(9, 'At the date of expiry', 'Expiration ended', '<table align="center" cellpadding="0" cellspacing="0" style="width:680px">\n	<tbody>\n		<tr>\n			<td colspan="2" style="text-align:center"><img alt="" src="http://esolz.co.in/lab6/ptplanner/assets/admin/images/logo_nav.png" /></td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td colspan="2">Hello,</td>\n		</tr>\n		<tr>\n			<td colspan="2">\n			<p><br />\n			This user&#39;s trial period is expiring today, Please access this link to deactivate his account</p>\n\n			<p>User: [TRAINER]</p>\n\n			<p>Link: <a href="[LINK]" target="_blank">[LINK]</a></p>\n			</td>\n		</tr>\n	</tbody>\n	<tbody>\n		<tr>\n			<td style="text-align:right">\n			<p>&nbsp;</p>\n\n			<p>&nbsp;</p>\n			</td>\n			<td style="width:170px">\n			<table cellpadding="0" cellspacing="0" style="width:100%">\n				<tbody>\n					<tr>\n						<td style="text-align:right">Sincerely Yours,</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner Team</td>\n					</tr>\n					<tr>\n						<td style="text-align:right">PTPlanner</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>\n', 'Y');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1, 1, 701, 'Planken', 'St p tr og albuer og la bekkenet hvile mot gulvet. Lft bekkenet opp fra gulvet ved  stramme opp i rygg og mage. Stabilisr kroppen i denne stillingen og hold 3-5 sek. Hvil tilsvarende og gjenta.', 1280, 2004712, 3, 'https://exorlive.com/media_701@50.50.media', 'https://exorlive.com/video/?ex=701'),
(2, 1, 6771, 'Avspent fall av underkroppen', 'Ligg p ryggen med fttene i gulvet og hendene ut til siden. Srg for  vende hndflatene opp og hold benene samlet. Kjenn at benene fles "tunge" og avslappede. La de nrmest falle til siden og bruk bukmusklene til  trekke de opp igjen samtidig som du presser korsryggen mot underlaget. Kjenn at du fr en fjrende effekt oppover i ryggen nr du slipper benene fra side til side.', 6730, 2007691, 3, 'https://exorlive.com/media_6771@50.50.media', 'https://exorlive.com/video/?ex=6771'),
(3, 1, 108, 'Stende strak sidehev', 'St med armene ned langs siden og en lett by i albuene. Lft armene ut og opp og sk hyest med albue og lillefinger. Hantlene heves  til maks. 15 grader over horisontalplanet.', 329, 2003809, 1, 'https://exorlive.com/media_108@50.50.media', 'https://exorlive.com/video/?ex=108'),
(4, 1, 581, 'Benkpress 2', 'Ligg med fttene i gulvet og hold stangen p strake armer over brystet. Ha litt bredere grep enn skulderbredden. Senk stangen langsomt, til den berrer brystet, og press opp igjen med noe strre hastighet.', 1051, 2004964, 3, 'https://exorlive.com/media_581@50.50.media', 'https://exorlive.com/video/?ex=581'),
(5, 1, 88, 'Nedtrekk til bryst', 'Ta et bredt grep, legg deg litt bakover og kikk skrtt opp. Press brystkassen fram og trekk stangen ned til brystet. Fr langsomt tilbake og gjenta.', 312, 2004942, 3, 'https://exorlive.com/media_88@50.50.media', 'https://exorlive.com/video/?ex=88'),
(6, 1, 122, 'Skrsittende benpress', 'Plasser benene p fotbrettet i skulderbreddes avstand. Ha ca. 90 grader i knrne. Stram opp i mage- og korsryggregionen og press opp til benene er nesten strake. Vend tilbake til startstillingen og gjenta.', 117, 2004945, 2, 'https://exorlive.com/media_122@50.50.media', 'https://exorlive.com/video/?ex=122'),
(7, 1, 3220, 'Cybex: Lat Pulldown 1', 'Ta et bredt grep, legg deg litt bakover og kikk skrtt opp. Press brystkassen fram og trekk stangen ned til brystet. Fr langsomt tilbake og gjenta.', 1000391, 2004054, 3, 'https://exorlive.com/media_3220@50.50.media', 'https://exorlive.com/video/?ex=3220'),
(8, 1, 139, 'Brystpress 2', 'Sitt med lave skuldre og et godt grep om hndtakene. Albuene holdes p hyde med grepet. Press fram til armene er strake og fr noe langsommere tilbake til brystet.', 157, 2004922, 2, 'https://exorlive.com/media_139@50.50.media', 'https://exorlive.com/video/?ex=139'),
(9, 1, 7282, 'Dyp kneby -  normal benstilling (Squat)', 'Hold hodet i en posisjon hvor blikket er rettet fremover under hele velsen. Start med strake ben i skulderbreddes avstand, tyngdepunktet rett igjennom kroppen med noe mer fordelt tyngdekontakt p bakre halvdel av fot. Gjennom fokus p mage og korsrygg, skal hele kroppen holdes stabil og innervert gjennom alle deler av velsen. Trekk pusten p vei ned, hold i velsens nedre fase og pust deretter ut p vei opp (siste halvdel av opplftet).', 7376, 2006135, 3, 'https://exorlive.com/media_7282@50.50.media', 'https://exorlive.com/video/?ex=7282'),
(10, 1, 8821, 'Utfall fremover', 'St med samlede ben og sett armene i siden. Lft det ene benet, og g framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Overkroppen skal vre rett. Trykk ifra og g videre til et nytt steg. \nKnekontroll og nytral rygg er viktig gjennom hele bevegelsen.', 11102, 2009759, 3, 'https://exorlive.com/media_8821@50.50.media', 'https://exorlive.com/video/?ex=8821'),
(11, 1, 92, 'Sittende roing 1', 'Sitt foroverbyd, med en liten by i knrne og skuldrene trukket godt fram. Fr overkroppen tilbake, trekk hndtaket mot mageregionen, press brystkassen fram og trekk skuldrene sammen. Slipp rolig tilbake til startstillingen og gjenta.', 101, 0, 4, 'https://exorlive.com/media_92@50.50.media', 'https://exorlive.com/video/?ex=92'),
(12, 1, 201, 'Stende bicepscurl 2', 'Velg over- eller undertak. St med stangen hengende foran deg, by i albuene og lft stangen helt opp mot brystet fr du senker den rolig tilbake.', 299, 2003851, 3, 'https://exorlive.com/media_201@50.50.media', 'https://exorlive.com/video/?ex=201'),
(13, 1, 97, 'Kne- og hndstttende roing', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk skulder og arm opp langs siden til hantelen er i mageniv. Senk tilbake.', 355, 2004819, 4, 'https://exorlive.com/media_97@50.50.media', 'https://exorlive.com/video/?ex=97'),
(14, 1, 8769, 'Goblet squat', 'Start i en stende posisjon med kettlebellen fremfor, men tett intill kroppen. Albuene holdes rett ned under kulen. Ha tyngden p helene og sett deg ned i en dyp kneby. Husk  ha hoften under kneleddet i bunnposisjon. Bruk bena til  strekke deg opp til startposisjon. Hold ryggen rak gjennom hele bevegelsen.', 10998, 2009826, 4, 'https://exorlive.com/media_8769@50.50.media', 'https://exorlive.com/video/?ex=8769'),
(15, 1, 29, 'Push up 2', 'St p ftter og hender med en strak fiksert kropp. Ha mer enn skulderbreddes avstand mellom hendene. Senk kroppen ned mot gulvet og press tilbake, uten  knekke i hoften.', 476, 2003919, 4, 'https://exorlive.com/media_29@50.50.media', 'https://exorlive.com/video/?ex=29'),
(16, 1, 8528, 'TRX Low Row', 'St p gulvet med hender i TRX, albue rett under skulder. Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen med albue tett mot kroppen. velsen gjres tyngre ved  forandre p vinkel.', 10502, 2009329, 3, 'https://exorlive.com/media_8528@50.50.media', 'https://exorlive.com/video/?ex=8528'),
(17, 1, 85, 'Liggende brystpress', 'Ligg p ryggen med fttene i gulvet og hold hantlene p strake armer over brystet. Senk hantlene i en svak bue mot utsiden av skuldrene og press tilbake til startstillingen med noe strre hastighet. Unng for mye svai i korsryggen.', 324, 2004812, 4, 'https://exorlive.com/media_85@50.50.media', 'https://exorlive.com/video/?ex=85'),
(18, 1, 8172, 'Kombinert planke, pushups og roing', 'St p trne og strake armer og hold en manual i hver hnd. Gjr en push-ups, trekk deretter opp den ene armen og slipp den rolig ned igjen. Gjenta med motsatt arm.', 9239, 2007991, 5, 'https://exorlive.com/media_8172@50.50.media', 'https://exorlive.com/video/?ex=8172'),
(19, 1, 241, 'Stende triceps press 1', 'Ta et godt grep om tauet, hold albuene inne mot kroppen. Press ned slik at armene strekkes helt.', 423, 2003875, 1, 'https://exorlive.com/media_241@50.50.media', 'https://exorlive.com/video/?ex=241'),
(20, 1, 603, 'Kneby 1', 'St med fttene i skulderbreddes avstand. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1098, 2004625, 2, 'https://exorlive.com/media_603@50.50.media', 'https://exorlive.com/video/?ex=603'),
(21, 1, 3138, 'Cybex: Seated Leg Press 1', 'Plasser fttene p fotbrettet med ca. skulderbreddes avstand. Srg for at vinklen i knrne er 90 grader. Spenn opp i mage- og korsryggsmuskulaturen, og press benene framover. Stopp bevegelsen nr benene er nesten strake, slik at du unngr  overstrekke knrne. Senk benene mot deg i et litt langsommere tempo.', 1000262, 2004020, 2, 'https://exorlive.com/media_3138@50.50.media', 'https://exorlive.com/video/?ex=3138'),
(22, 1, 95, 'Rygghev 1', 'Ligg med strake ben og la overkroppen henge ned mot gulvet. Stram opp i magen, krum ryggen og lft overkroppen i en rolig piskebevegelse. I sluttstillingen er kroppen strak og blikket er rettet fram. Senk rolig tilbake og gjenta.', 107, 2004818, 3, 'https://exorlive.com/media_95@50.50.media', 'https://exorlive.com/video/?ex=95'),
(23, 1, 98, 'Kroppsheving m/bredt grep', 'Heng med et bredt grep og trekk deg rett opp til nakken er p hyde med grepet. Senk rolig tilbake. Hold blikket rettet fram og ned under hele bevegelsen.', 683, 2004968, 6, 'https://exorlive.com/media_98@50.50.media', 'https://exorlive.com/video/?ex=98'),
(24, 1, 7293, 'Marklft', 'Hold blikket rettet fremover under hele velsen.  Vektstangen henger p strake armer, fres s nrt kroppen som mulig, men uten at den forstyrrer hensiktsmessig bevegelse og teknikk. Trekk pusten p vei ned, hold i velsens nedre fase, og pust deretter ut p vei opp. Hvis velsen kun gjennomfres med opplft (olympisk lft), trekkes pusten godt fr stabilisering og opplftet starter. Hold svai i korsryggen og etterstreb  holde denne gjennom hele opplftet. Skulderbreddes benstilling, tyngdepunktet holdes rett igjennom kroppen, med noe mer fordelt tyngdekontakt p bakre halvdel av fot. Det anbefales reversed grip p den ene hnden.', 7395, 2006172, 4, 'https://exorlive.com/media_7293@50.50.media', 'https://exorlive.com/video/?ex=7293'),
(25, 1, 587, 'Utfall fram 3', 'St med samlede ben og hold hantlene ned langs siden. Lft det ene benet og fall framover. Nr benet treffer gulvet bremser du bevegelsen til  kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1068, 2004609, 4, 'https://exorlive.com/media_587@50.50.media', 'https://exorlive.com/video/?ex=587'),
(26, 1, 59, 'Marklft m/strake ben 1', 'St med stangen hengende foran hoften. By overkroppen framover s langt som lrets bakside-muskulatur tillater det. Hold ryggen og benene strake under utfrelsen. Dette er en risikobetont velse for korsryggen!', 262, 2004966, 5, 'https://exorlive.com/media_59@50.50.media', 'https://exorlive.com/video/?ex=59'),
(27, 1, 128, 'Knestrekk 2', 'Srg for  ha god sttte i korsryggen. Sitt med byde knr (ca. 120 grader) og strekk benene maksimalt ut. Markr gjerne toppunktet og senk rolig tilbake.', 99, 2004917, 2, 'https://exorlive.com/media_128@50.50.media', 'https://exorlive.com/video/?ex=128'),
(28, 1, 169, 'Stende bicepscurl m/kabel 1', 'St med rett rygg og et godt grep om stangen. By i albuene og lft stangen opp mot brystet. Senk stangen helt tilbake fr neste repetisjon. Hold albuene mest mulig i ro under velsen.', 365, 2003831, 1, 'https://exorlive.com/media_169@50.50.media', 'https://exorlive.com/video/?ex=169'),
(29, 1, 283, 'Sittende hantelpress 1', 'Sitt med god sttte i ryggen, ha byde albuer og fiksr mage- og korsryggregionen. Ha et godt grep om hantlene som holdes p utsiden av skuldrene. Press opp til hantlene holdes p strake armer over hodet.', 557, 2003914, 4, 'https://exorlive.com/media_283@50.50.media', 'https://exorlive.com/video/?ex=283'),
(30, 1, 194, 'Liggende triceps press 1', 'Hold stangen p strake armer over brystet. By i albuene, senk stangen forsiktig til pannen og press tilbake. Forsk  holde albuene i ro under velsen.', 287, 2003845, 3, 'https://exorlive.com/media_194@50.50.media', 'https://exorlive.com/video/?ex=194'),
(31, 1, 3198, 'Sittende roing 3', 'Sitt lett foroverbyd, med en liten by i knrne og skuldrene trukket godt fram. Fr overkroppen bakover, trekk hndtaket mot mageregionen samtidig som du presser brystkassen fram og trekker skulderbladene godt sammen. Slipp rolig tilbake til startstillingen og gjenta.', 1000369, 2004956, 4, 'https://exorlive.com/media_3198@50.50.media', 'https://exorlive.com/video/?ex=3198'),
(32, 1, 83, 'Skr brystpress', 'Ligg p ryggen med fttene i gulvet og hold hantlene p strake armer over brystet. Senk hantlene i en svak bue mot utsiden av skuldrene og press tilbake til startstillingen med noe strre hastighet. Unng  svaie for mye i korsryggen.', 282, 2004799, 5, 'https://exorlive.com/media_83@50.50.media', 'https://exorlive.com/video/?ex=83'),
(33, 1, 11, 'Liggende bekkenlft', 'Ligg p ryggen med byde knr. Knip setet sammen og lft bekkenet og nedre del av ryggen fra underlaget. Hold i 3-5 sek. Hvil tilsvarende.', 1312, 2003810, 2, 'https://exorlive.com/media_11@50.50.media', 'https://exorlive.com/video/?ex=11'),
(34, 1, 524, 'Diagonalhev p en ball', 'Ligg p magen p ballen. Lft den ene armen og det motsatte ben til de er i forlengelse av kroppen. Lft deretter motsatt ben og arm.', 754, 2004902, 3, 'https://exorlive.com/media_524@50.50.media', 'https://exorlive.com/video/?ex=524'),
(35, 1, 601, 'Utfall fram 1', 'St med samlede ben og sett armene i siden. Lft det ene benet, og fall framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1095, 2004624, 3, 'https://exorlive.com/media_601@50.50.media', 'https://exorlive.com/video/?ex=601'),
(36, 1, 3143, 'Cybex: Leg Extension 1', 'Srg for  ha god sttte i korsryggen. Press anklene mot ankelputen og strekk benene maksimalt ut. Markr gjerne sluttstillingen og senk rolig tilbake.', 1000271, 0, 2, 'https://exorlive.com/media_3143@50.50.media', 'https://exorlive.com/video/?ex=3143'),
(37, 1, 57, 'Sittende lrcurl', 'Sitt helt tilbake i setet og fiksr overkroppen med grep om hndtakene. Press anklene mot puten, by maksimalt i knrne og vend rolig tilbake til startstillingen.', 151, 2007238, 2, 'https://exorlive.com/media_57@50.50.media', 'https://exorlive.com/video/?ex=57'),
(38, 1, 476, 'Liggende lrcurl m/ball', 'Ligg med begge benene p ballen og lft bekkenet. Ha armene ned langs siden. Stram lrets bakside-muskulatur og trekk ballen mot deg. Rull tilbake.', 964, 2004404, 4, 'https://exorlive.com/media_476@50.50.media', 'https://exorlive.com/video/?ex=476'),
(39, 1, 89, 'Nedtrekk m/smalt grep', 'Velg over- eller undertak. Press brystkassen fram samtidig som stangen trekkes ned til haken. Armene holdes til sist tett mot kroppen og sluttstillingen markres. Fr langsomt tilbake og gjenta.', 135, 2004943, 3, 'https://exorlive.com/media_89@50.50.media', 'https://exorlive.com/video/?ex=89'),
(40, 1, 21, 'Firfotstende diagonalhev', 'St p alle fire med hodet i forlengelse av overkroppen. Stram opp og stabilisr mage- og korsryggregionen. Strekk vekselvis den ene armen og det motsatte benet til de er i forlengelse av kroppen.', 484, 2005948, 3, 'https://exorlive.com/media_21@50.50.media', 'https://exorlive.com/video/?ex=21'),
(41, 1, 557, 'Stende roing m/strikk 1', 'Fest strikken nede i ribbeveggen. St med spredte ben, et hndtak i hver hnd og med ansiktet mot ribbeveggen. Hold armene strak ut fra kroppen og trekk hndtakene mot magen. Senk langsomt tilbake.', 873, 2004543, 2, 'https://exorlive.com/media_557@50.50.media', 'https://exorlive.com/video/?ex=557'),
(42, 1, 561, 'Stende skulderrotasjon ut m/strikk 1', 'Fest strikken i navlehyde. St med hndtakene i den ene hnden og med siden mot ribbeveggen. Ha ca. 90 graders vinkel i albuen og legg underarmen tett mot magen. Rotr utover i skulderleddet s langt du klarer. Albuen holdes tett p kroppen. Bytt arm.', 885, 2004547, 2, 'https://exorlive.com/media_561@50.50.media', 'https://exorlive.com/video/?ex=561'),
(43, 1, 149, 'Rygghev strak', 'Ligg med strake ben og la overkroppen henge ned mot gulvet. Stram opp i magen,  i korsryggen og lft overkroppen i en rolig bevegelse. Under bevegelsen er overkroppen strak. Senk rolig tilbake og gjenta.', 107, 2003822, 3, 'https://exorlive.com/media_149@50.50.media', 'https://exorlive.com/video/?ex=149'),
(44, 1, 74, 'Brystpress 1', 'Sitt med lave skuldre og et godt grep om hndtakene. Albuene holdes p hyde med grepet. Press fram til armene er strake og fr noe langsommere tilbake til brystet.', 220, 0, 2, 'https://exorlive.com/media_74@50.50.media', 'https://exorlive.com/video/?ex=74'),
(45, 1, 23, 'Dips p en benk', 'Sttt deg mot benken med ca. skulderbreddes grep. Kroppen holdes tilnrmet strak slik at kun hlene er i gulvet. By i albuen og senk kroppen ned mot gulvet. Press opp igjen.', 1459, 2003864, 3, 'https://exorlive.com/media_23@50.50.media', 'https://exorlive.com/video/?ex=23'),
(46, 1, 202, 'Stende hantelcurl', 'St med hantlene hengende ned langs siden. By i albuene og lft hantlene helt opp samtidig som du dreier de utover. Senk rolig tilbake.', 302, 2003852, 3, 'https://exorlive.com/media_202@50.50.media', 'https://exorlive.com/video/?ex=202'),
(47, 1, 8621, 'Bten med rotasjon med hantel', 'Sitt p en matte med lett by i hofter og knr og hold en hantel med begge hender foran kroppen. Len overkroppen litt bakover og lft fttene opp fra matten. Roter overkroppen rolig til annenhver side', 10688, 2009496, 5, 'https://exorlive.com/media_8621@50.50.media', 'https://exorlive.com/video/?ex=8621'),
(48, 1, 146, 'Sittende roing 2', 'Sitt med rett rygg, en liten by i knrne og skuldrene trukket godt fram. Trekk hndtaket mot magen samtidig som du presser brystkassen fram og skuldrene trekkes sammen. Slipp rolig tilbake til startstillingen og gjenta.', 171, 0, 4, 'https://exorlive.com/media_146@50.50.media', 'https://exorlive.com/video/?ex=146'),
(49, 1, 519, 'Kneby m/ball 1', 'St med ballen som ryggsttte. Fttene plasseres i skulderbreddes avstand og peker litt ut. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram.', 1045, 2004457, 3, 'https://exorlive.com/media_519@50.50.media', 'https://exorlive.com/video/?ex=519'),
