(52, 1, 471, 'Liggende bekkenlft m/ball', 'Ligg med begge benene p ballen. Ha armene ned langs siden. Knip setet sammen og lft bekkenet og nedre del av ryggen opp fra underlaget. Hold i 3-5 sek. Hvil tilsvarende.', 960, 2004893, 4, 'https://exorlive.com/media_471@50.50.media', 'https://exorlive.com/video/?ex=471'),
