(61, 1, 5352, 'Stende roing 2', 'Hold omkring stangen med skulderbredt supinert grep. St lett foroverbyd, med rett rygg og lett byde knr. Start velsen med  dra skuldrene bakover, by i albuene og fr armene langs kroppen. Lft stangen mot magen og press skulderbladene sammen i sluttfasen. Senk tilbake og gjenta velsen.', 5341, 0, 3, 'https://exorlive.com/media_5352@50.50.media', 'https://exorlive.com/video/?ex=5352'),
