(69, 1, 8177, 'To hnds sving med kneby', 'St med vekten i hl. Finn rett linje fra skulder, hofte, kne til ankel (grunnposisjon). Ha rette armer og gi kulen ett dytt med hofta. Nr kulen pendler tilbake mot kroppen sett deg tilbake og ned (som i kneby). Nr du er i nsket bunn posisjon trykk hlene hardt i gulvet og fr hofta opp og frem (hipp drive) til grunnposisjonen. Pust inn p vei ned og ut p topp.', 10120, 2007926, 5, 'https://exorlive.com/media_8177@50.50.media', 'https://exorlive.com/video/?ex=8177'),
(70, 1, 489, 'Knelft p en ball', 'St p hendene med fttene p ballen. Forsk  rulle ballen mot deg ved  trekke knrne opp mot brystet. Stram godt opp i mage- og korsryggregionen under bevegelsen.', 987, 2004898, 6, 'https://exorlive.com/media_489@50.50.media', 'https://exorlive.com/video/?ex=489'),
