(104, 9, 337, 'Sete 2', 'Ligg med det ene benet krysset over det andre, slik at ankelen hviler p motsatt kne. Hold omkring lret og trekk det mot brystet til du kjenner at det strekker i setemuskulaturen. Hold 30 sek. og bytt ben.', 638, 2004159, 2, 'https://exorlive.com/media_337@50.50.media', 'https://exorlive.com/video/?ex=337'),
(105, 9, 419, 'Nakke 2', 'Plasser den ene hnden p hodet og la det henge lett ned mot skulderen. Deretter dreier du hodet litt mot denne skulderen og trekker det forsiktig ned mot brystet slik at det strekker i nakken p motsatt side. Srg for  senke motsatt skulder. Hold 30 sek. og gjenta velsen til den andre siden.', 768, 2004361, 1, 'https://exorlive.com/media_419@50.50.media', 'https://exorlive.com/video/?ex=419'),
(106, 9, 336, 'Sete 1', 'Sitt med det ene benet krysset over det andre. By i kneet, hold omkring det og trekk det mot motsatt skulder til du kjenner at det strekker i setemuskulaturen. Hold 30 sek. og bytt ben.', 637, 2004158, 2, 'https://exorlive.com/media_336@50.50.media', 'https://exorlive.com/video/?ex=336'),
(107, 9, 299, 'Nakke 1', 'Plasser den ene hnden p hodet og trekk hodet forsiktig ned mot skulderen. Srg for  senke motsatt skulder og kjenn at det strekker p utsiden av nakken. Hold 30 sek. og gjenta velsen til den andre siden.', 613, 2003928, 1, 'https://exorlive.com/media_299@50.50.media', 'https://exorlive.com/video/?ex=299'),
(108, 9, 321, 'Bryst 2', 'St med siden til en ribbevegg, drkarm eller lignende. Strekk den ene armen ut, ha en liten by i albuen og fest grepet over hodehyde. Drei kroppen langsomt vekk fra festet til du kjenner et godt strekk i brystmuskulaturen. Hold 30 sek. og bytt arm.', 620, 2005972, 2, 'https://exorlive.com/media_321@50.50.media', 'https://exorlive.com/video/?ex=321'),
(109, 9, 20, 'Utside hofte 1', 'Ligg p ryggen, lft det ene benet og plasser det over til motsatt side. Lft den motsatte armen over hodet og kjenn at det strekker p utsiden av overkroppen og nederst i ryggen. Hold 30 sek.', 635, 2003850, 2, 'https://exorlive.com/media_20@50.50.media', 'https://exorlive.com/video/?ex=20'),
(110, 9, 9188, 'Foam roller: Brystrygg', 'Ligg p ryggen med rullen plassert i midtre del av ryggen.  Knrne holdes byd i 90 grader og bena brukes til  lage bevegelse slik at rullen gr opp og ned langs ryggstrekkerne. Du kan ogs bye og strekke litt i vre del av rygg for bedre bevegelse. mme punkter jobbes litt ekstra med.', 11727, 2011284, 3, 'https://exorlive.com/media_9188@50.50.media', 'https://exorlive.com/video/?ex=9188'),
(111, 9, 364, 'Sete 3', 'Start med  spre benene, slik at det bakerste benet er strakt og det forreste er byd og plassert under deg. Legg tyngden framover, mens du sttter deg p armene. Du skal merke et strekk omkring setemuskulaturen. Hold 30 sek. og bytt ben.', 665, 2004180, 3, 'https://exorlive.com/media_364@50.50.media', 'https://exorlive.com/video/?ex=364'),
(112, 9, 365, 'Bryst og skuldre 1', 'Fold hendene bak p ryggen, press brystkassen fram og armene bakover til du kjenner et godt strekk omkring brystet og skuldrene. Hold 30 sek.', 666, 2004181, 1, 'https://exorlive.com/media_365@50.50.media', 'https://exorlive.com/video/?ex=365'),
(113, 9, 345, 'Framside lr og hofte 2', 'Plasser det ene kneet i gulvet og st med oppreist overkropp. Hold omkring ankelen og trekk hlen opp mot baken. Press hoften fram til du kjenner strekket p framsiden av lret og over hoften. Hold 30 sek. og gjenta velsen med det andre benet forrest.', 646, 2004167, 3, 'https://exorlive.com/media_345@50.50.media', 'https://exorlive.com/video/?ex=345'),
(114, 9, 332, 'Rygg 6', 'Sitt p knrne og senk overkroppen ned mot lrene. Strekk armene over hodet, kjenn at det strekker i ryggen og hold stillingen i 30 sek.', 631, 2004129, 2, 'https://exorlive.com/media_332@50.50.media', 'https://exorlive.com/video/?ex=332'),
(115, 9, 5563, 'Bye hodet til siden', 'By hodet til den ene siden, slik at du legger ret ned mot skulderen. Hold ca 30 sek. Hold blikket framover, unng  rotre nakken eller  lfte skuldrene. Gjenta velsen til den andre siden.', 5554, 2007807, 1, 'https://exorlive.com/media_5563@50.50.media', 'https://exorlive.com/video/?ex=5563'),
(116, 9, 358, 'Bakside lr og legg 2', 'St med hendene i siden og plasser den ene foten p en benk eller lignende. Hold benet strakt og ryggen rett mens du presser overkroppen framover. Gjr dette til du kjenner at det strekker p baksiden av lret. Hold 30 sek. og bytt ben.', 1463, 2004175, 2, 'https://exorlive.com/media_358@50.50.media', 'https://exorlive.com/video/?ex=358'),
(117, 9, 353, 'Bakside legg 1', 'St skrtt opp mot veggen slik at det ene benet er byd og det andre er strakt og plassert i forlengelse av kroppen. Hold hlen i gulvet og press hoften framover til du kjenner at det strekker p baksiden av leggen. Hold 30 sek. og bytt ben.', 654, 2004173, 1, 'https://exorlive.com/media_353@50.50.media', 'https://exorlive.com/video/?ex=353'),
(118, 9, 355, 'Bakside legg 3', 'Sttt deg mot veggen og plasser den ene foten opp mot veggen, slik at kun hlen berrer gulvet. Ha strakt ben og press hoften rolig framover til du kjenner at det strekker p baksiden av leggen. Hold 30 sek. og bytt ben.', 656, 2005963, 2, 'https://exorlive.com/media_355@50.50.media', 'https://exorlive.com/video/?ex=355'),
(119, 9, 319, 'Bakside skulder 1', 'St med den ene armen krysset over brystet. Ta tak i albuen og trekk armen i retning av motsatt skulder, til du kjenner at det strekker p baksiden av skulderen. Hold tyningen i 30 sek. og bytt arm.', 617, 2004041, 2, 'https://exorlive.com/media_319@50.50.media', 'https://exorlive.com/video/?ex=319'),
(120, 9, 352, 'Hoftebyer 2', 'St med benene splittet og rett rygg. Plasser hendene i siden og press hoften fram til du kjenner at det strekker over hoften. Hold 30 sek. og gjenta velsen med det andre benet.', 653, 2004172, 2, 'https://exorlive.com/media_352@50.50.media', 'https://exorlive.com/video/?ex=352'),
(121, 9, 640, 'Utside hofte 2', 'Ligg p ryggen, by i hoften og kneet p det ene benet og drei det over til motsatt side. Lft den motsatte armen over hodet og kjenn at det strekker p utsiden av overkroppen og nederst i ryggen. Hold 30 sek.', 1170, 2004664, 2, 'https://exorlive.com/media_640@50.50.media', 'https://exorlive.com/video/?ex=640'),
(122, 9, 8283, 'Aktiv benstrekk i ryggliggende', 'Ligg p ryggen med det ene benet strakt. Det andre benet byer du 90 grader og tar tak i knehasen. Strekk benet opp mot taket slik at du kjenner en strekk p baksiden av lr og legg.', 9903, 2008059, 2, 'https://exorlive.com/media_8283@50.50.media', 'https://exorlive.com/video/?ex=8283'),
(123, 9, 317, 'Nakke og skulder', 'Plasser hendene p ryggen, senk skuldrene og legg hodet ned mot den ene skulderen. Hold 30 sek. og gjenta velsen til den andre siden.', 616, 2004038, 1, 'https://exorlive.com/media_317@50.50.media', 'https://exorlive.com/video/?ex=317'),
(124, 9, 5493, '"Skyte rygg"', 'Sitt med hendene foldet p fanget. Lft armene og strekk de framover samtidig som du skyter rygg. Nr du kjenner at det strekker mellom skulderbladene/i ryggen holder du stillingen 30 sekunder, fr du retter deg opp igjen og slapper av.', 5454, 2004531, 1, 'https://exorlive.com/media_5493@50.50.media', 'https://exorlive.com/video/?ex=5493'),
(125, 9, 671, 'Bryst og rygg 1', 'St foroverbyd med grep omkring en ribbe eller lignende. Hold armene strake og la overkroppen henge tungt ned mot gulvet, slik at du kjenner et strekk p forsiden av skuldrene, i brystet og nedover ryggen. Hold 30 sek.', 1225, 2007692, 1, 'https://exorlive.com/media_671@50.50.media', 'https://exorlive.com/video/?ex=671'),
(126, 9, 316, 'Nakke 3', 'Plasser begge hendene p hodet og trekk det forsiktig fram og ned mot brystet. Nr du kjenner at det strekker i nakken s holder du stillingen i 30 sek.', 615, 2004032, 1, 'https://exorlive.com/media_316@50.50.media', 'https://exorlive.com/video/?ex=316'),
(127, 9, 6770, 'Sideliggende rotasjon av overkroppen 2', 'Ligg p siden med den nederste hnden under hodet og den andre armen strak mot gulvet foran deg. Hold det verste benet byd. Drei overkroppen ved at du frer armen opp og bakover s langt du klarer. Hold stillingen ca 30 sekunder og drei rolig tilbake. Forsk  holde underkroppen i ro under velsen.', 6728, 2007653, 3, 'https://exorlive.com/media_6770@50.50.media', 'https://exorlive.com/video/?ex=6770'),
(128, 9, 9170, 'Foam roller: Utside lr', 'Ligg p siden, slik at foamrolleren er posisjonert p utsiden av lret, like ved hoften. Sett den verste foten opp fremfor den underste foten og bruk den til  stabilisere kroppen mens du lener deg p strake armer eller albuen. Rull opp og ned langs hele lret.', 11691, 2011170, 3, 'https://exorlive.com/media_9170@50.50.media', 'https://exorlive.com/video/?ex=9170'),
(129, 9, 5545, 'Sete 7', 'Sitt med strak rygg og det ene benet krysset over det andre. By i kneet, hold omkring det med begge hender, og trekk det mot motsatt skulder til du kjenner at det strekker i setemuskulaturen. Svai i korsryggen under hele tyningen. Hold 30 sek. og bytt ben.', 5513, 2007770, 1, 'https://exorlive.com/media_5545@50.50.media', 'https://exorlive.com/video/?ex=5545'),
(130, 9, 343, 'Bakside lr og legg 6', 'Sitt med det ene kneet p matten og strekk det andre benet framfor deg. Ha rett rygg og plasser hendene like over kneet. Slipp overkroppen fremover til du kjenner at det strekker p baksiden av lret. Hold 30 sek. og bytt ben.', 644, 2004165, 2, 'https://exorlive.com/media_343@50.50.media', 'https://exorlive.com/video/?ex=343'),
(131, 9, 410, 'Rygg 1', 'St p alle fire, la hodet henge ned og skyt ryggen opp mot taket. Nr du kjenner at det strekker i ryggen, s holder du stillingen i 30 sek.', 499, 2004355, 2, 'https://exorlive.com/media_410@50.50.media', 'https://exorlive.com/video/?ex=410'),
(132, 9, 347, 'Innside lr 1', 'Sitt p gulvet, plasser fotslene mot hverandre og trekk fttene mot deg. La knrne falle ut til siden til du kjenner at det strekker p innsiden av lrene. Bruk evt. albuene til  presse knrne fra hverandre og hold i 30 sek.', 648, 2004168, 2, 'https://exorlive.com/media_347@50.50.media', 'https://exorlive.com/video/?ex=347'),
(133, 9, 5635, 'Biceps og framside skulder 1', 'St med ansiktet mot en vegg. Sett hndflaten mot veggen med fingrene pekende oppover. Hold hnden i denne posisjonen mens du snur hele kroppen vekk fra veggen. Nr du kjenner at det strekker p framsiden av armen, s holder du 30 sek. Bytt arm.', 5532, 2007663, 1, 'https://exorlive.com/media_5635@50.50.media', 'https://exorlive.com/video/?ex=5635');
