(137, 9, 338, 'Sete og hoftebyer', 'Ligg p ryggen, lft det ene benet og ta tak i kneet. Trekk det mot brystet til du kjenner at det strekker i setemuskulaturen. Hold 30 sek. og bytt ben.', 639, 2004160, 1, 'https://exorlive.com/media_338@50.50.media', 'https://exorlive.com/video/?ex=338'),
