(140, 9, 6575, 'Bakside skulder 2', 'Kryss den ene armen over brystet. By albuen og drei armen slik at hnden peker opp mot taket. Ta tak i albuen og trekk armen i retning av motsatt skulder, til du kjenner at det strekker p baksiden av skulderen og mellom skulderbladene. Hold tyningen i 30 sek. og bytt arm.', 6546, 2007695, 2, 'https://exorlive.com/media_6575@50.50.media', 'https://exorlive.com/video/?ex=6575'),
(141, 9, 5550, 'Bye hodet framover', 'By hodet langsomt framover og senk haken mot brystbenet. Hold 30 sek. Lft rolig opp igjen til utgangsposisjonen og gjenta velsen.', 5543, 2007758, 1, 'https://exorlive.com/media_5550@50.50.media', 'https://exorlive.com/video/?ex=5550'),
(142, 9, 9184, 'Foam roller: Utside sete', 'Sitt p rullen med den siden som skal jobbes med, og legg foten p motsatt kne for  f litt ekstra strekk i setemuskulaturen. Bruk armene som sttte for kroppen. Rull frem og tilbake og fra side til side for  jobbe gjennom muskulaturen.', 11719, 2011167, 2, 'https://exorlive.com/media_9184@50.50.media', 'https://exorlive.com/video/?ex=9184'),
(143, 9, 675, 'Bakside lr og legg 1', 'St med hendene i siden, by litt i det ene kneet og strekk det andre benet. Press trne opp mot deg og senk overkroppen langsomt framover til du kjenner at det strekker p baksiden av benet. Unng  krumme ryggen. Hold 30 sek. og bytt ben.', 1230, 2004701, 1, 'https://exorlive.com/media_675@50.50.media', 'https://exorlive.com/video/?ex=675'),
(144, 9, 429, 'Sete 5', 'Sitt med det ene benet krysset over det andre, slik at ankelen hviler p motsatt kne. By overkroppen framover til du kjenner at det strekker i setemuskulaturen. Hold 30 sek. og bytt ben.', 792, 2007660, 2, 'https://exorlive.com/media_429@50.50.media', 'https://exorlive.com/video/?ex=429'),
