(149, 9, 411, 'Rygg 4', 'Ligg p ryggen og trekk knrne opp mot brystet. Lft hodet og forsk  vugge fram og tilbake mens du holder stillingen. Ta en pause etter ca. 30 sek.', 767, 2004356, 2, 'https://exorlive.com/media_411@50.50.media', 'https://exorlive.com/video/?ex=411'),
(150, 9, 8643, 'Squat to stand', 'Sitt p huk og ta tak i skotuppene med hendene. Strekk s ut i knrne mens du hele tiden holder tak i skoene dine. Senk rolig ned til huksittende igjen.', 10747, 2009715, 4, 'https://exorlive.com/media_8643@50.50.media', 'https://exorlive.com/video/?ex=8643'),
(151, 9, 9169, 'Foam roller: Bakside lr', 'Sitt p bakken og la det ene lret hvile p rullen, mens du legger det andre benet over som en vekt. Bruk armene til bevege kroppen opp og ned, slik at du kan rulle opp og ned i lrbenets retning. Start nede ved knehasen og jobb hele veien opp til sitteknuten.', 11689, 2011254, 2, 'https://exorlive.com/media_9169@50.50.media', 'https://exorlive.com/video/?ex=9169'),
(152, 9, 9173, 'Foam roller: Fremside lr', 'Ligg p magen med det ene benet ut til siden, og det andre benet plassert p foamrolleren.\nOverkroppen hviler p albuene og underarmene. Legg trykk p foamrolleren ved  senke hoftene mot bakken. Rull opp og ned langs med hele lrets lengde', 11697, 2011236, 3, 'https://exorlive.com/media_9173@50.50.media', 'https://exorlive.com/video/?ex=9173'),
(153, 9, 354, 'Bakside legg 2', 'St p ett ben og sttt deg mot veggen. By litt i kneet og press hoften fram og ned mens du beholder hlen i gulvet. Nr du kjenner at det strekker p baksiden av leggen, holder du stillingen i 30 sek. fr du bytter ben.', 655, 2005942, 2, 'https://exorlive.com/media_354@50.50.media', 'https://exorlive.com/video/?ex=354'),
(154, 9, 327, 'Underarm 2', 'Hold en strak arm framfor brystet og vend hndflaten ned. Grip omkring fingrene med den andre hnden og trekk hnden ned og bakover, slik at hndflaten vender mot deg. Nr du kjenner at det strekker p oversiden av underarmen, s holder du 30 sek. Bytt arm.', 626, 2004079, 1, 'https://exorlive.com/media_327@50.50.media', 'https://exorlive.com/video/?ex=327'),
