(156, 9, 9187, 'Foam roller: Korsrygg', 'Ligg p ryggen med rullen plassert i nedre del av korsryggen. Knrne holdes byd i 90 grader og bena brukes til  lage bevegelse slik at rullen gr opp og ned langs ryggstrekkerne. mme punkter jobbes litt ekstra med.', 11725, 2011179, 1, 'https://exorlive.com/media_9187@50.50.media', 'https://exorlive.com/video/?ex=9187'),
(157, 9, 423, 'Bakside lr og legg 10', 'Sitt p gulvet med spredde ben. Vend overkroppen mot det ene benet og by deg framover til du kjenner strekket p baksiden av benet. Unng  krumme for mye i ryggen. Hold 30 sek. og bytt ben.', 786, 2004364, 2, 'https://exorlive.com/media_423@50.50.media', 'https://exorlive.com/video/?ex=423'),
