(165, 9, 325, 'Triceps 1', 'Plasser begge armene bak hodet slik at du med den ene hnden holder rundt den andre albuen. Trekk albuen mot hodet til du kjenner at det strekker p baksiden av overarmen. Hold 30 sek. og bytt arm.', 624, 2004069, 2, 'https://exorlive.com/media_325@50.50.media', 'https://exorlive.com/video/?ex=325'),
(166, 9, 9167, 'Foam roller: Bakside legger', 'Start nede ved achillessenen og rull opp mot knehasen.\nRull i et jevnt tempo. Nr du finner mme punkter kan du holde trykket og gjre sirkelbevegelser med foten, samt bye og strekke i ankelleddet. \nForsk  jobbe bde p innsiden og utsiden av leggmuskulaturen.', 11685, 2011161, 1, 'https://exorlive.com/media_9167@50.50.media', 'https://exorlive.com/video/?ex=9167'),
(167, 9, 6563, 'Bakside lr og sete 4', 'Ligg p ryggen med byde ben og fttene i gulvet. Lft og strekk det ene benet mot taket. Grip omkring benet og trekk det forsiktig mot deg, til du kjenner det strekker p baksiden av lret. Hold stillingen i 30 sek.', 6529, 2007676, 2, 'https://exorlive.com/media_6563@50.50.media', 'https://exorlive.com/video/?ex=6563'),
(168, 9, 6430, 'Bryst 4', 'St med siden til en ribbevegg, drkarm eller lignende. Strekk den ene armen ut, ha en liten by i albuen og fest grepet i ca skulderhyde. Drei kroppen langsomt vekk fra festet til du kjenner et godt strekk i brystmuskulaturen og nedover p framsiden av armen. Hold 30 sek. og bytt arm.', 6418, 2007661, 1, 'https://exorlive.com/media_6430@50.50.media', 'https://exorlive.com/video/?ex=6430'),
(169, 9, 6697, 'Tyning av hamstrings med kontroll av svai 1', 'St med foten p en stol el lignende. St med naturlig svai i korsryggen. By framover i hoften, mens du beholder svaien i korsryggen. Kjenn at spenningen p baksiden av lret kes. Hold ca 30 sek.', 6687, 2007734, 1, 'https://exorlive.com/media_6697@50.50.media', 'https://exorlive.com/video/?ex=6697'),
(170, 9, 7044, 'Rygg og skuldre 2', 'St med hendene foldet bak hodet. Beveg albuene rolig framover og bakover. For hver repetisjon presser du litt ekstra og ker bevegelsesutslaget. Men husk at det ikke skal gjre vondt.', 6999, 2007788, 1, 'https://exorlive.com/media_7044@50.50.media', 'https://exorlive.com/video/?ex=7044'),
(171, 9, 5495, 'Sittende strekk mot en stolrygg', 'Sitt med hendene foldet bak nakken og hold albuene ut til siden. Len deg bakover inntil du kjenner at det strekker i ryggen, mellom skulderbladene, i bryst og skuldre. Hold stillingen i 30 sek.', 5458, 2004533, 1, 'https://exorlive.com/media_5495@50.50.media', 'https://exorlive.com/video/?ex=5495'),
(172, 9, 3070, 'Hoftebyer 3', 'St med benene splittet fra hverandre og plasser ballen ved siden av deg, slik at du kan sttte deg mot den. Press hoften fram til du kjenner at det strekker p framsiden av den. Hold 30 sek. og gjenta velsen med det andre benet.', 1000120, 2003973, 2, 'https://exorlive.com/media_3070@50.50.media', 'https://exorlive.com/video/?ex=3070'),
(173, 9, 7909, 'Aktiv tyning bakside legg', 'St med fremre del av fttene opp kassen og hold deg i ribbeveggen foran deg. Kom opp p t og hold i 5 sekunder, senk hlene s langt som mulig ned til du kjenner det strekker bak i leggen, hold i 30 sekunder.', 8616, 2007446, 3, 'https://exorlive.com/media_7909@50.50.media', 'https://exorlive.com/video/?ex=7909'),
(174, 9, 6394, 'vre trapezius tyning', 'Sitt p en stol. Kryss armene og ta tak under kanten p stolen. La skuldrene falle fram. Ty ved  skyve bekkenet fram slik at du retter deg opp i korsryggen. Strekk deg opp mot taket og len deg bakover mens du fortsetter  holde grepet i stolen. Viktig at du lar skuldrene henge framover under hele velsen. Hold i 30 sek.', 6363, 2004661, 1, 'https://exorlive.com/media_6394@50.50.media', 'https://exorlive.com/video/?ex=6394'),
(175, 9, 351, 'Utside lr 2', 'St med siden til veggen og sttt deg med den ene armen. Kryss det innerste benet bak det andre mens du srger for  holde det strakt. Len overkroppen vekk fra veggen til du kjenner at det strekker p utsiden av lret og hoften. Hold 30 sek. og bytt ben.', 652, 2004171, 2, 'https://exorlive.com/media_351@50.50.media', 'https://exorlive.com/video/?ex=351'),
(176, 9, 6390, 'Skulder og vre rygg', 'Lft den ene armen opp og bak nakken. Fr den andre armen bak ryggen og mot motsatt skulderblad. Forsk  fre hendene mot hverandre og ta tak i hendene og hold i 30 sek om du klarer det. Gjr det samme p motsatt side.', 6357, 2007721, 1, 'https://exorlive.com/media_6390@50.50.media', 'https://exorlive.com/video/?ex=6390'),
(177, 9, 366, 'Rygg 7', 'St med armene hevet framfor brystet og la hodet henge ned. Fold hendene, strekk armene framover og skyt rygg. Kjenn at det strekker mellom skulderbladene og hold 30 sek.', 667, 2004182, 1, 'https://exorlive.com/media_366@50.50.media', 'https://exorlive.com/video/?ex=366'),
(178, 9, 9192, 'Foam roller: situps', 'Ligg p ryggen med rullen plassert i midtre del av ryggen. Knrne holdes byd i 90 grader og armene i kryss over brystkassen. Pust inn p toppen, og pust ut mens du lener deg bakover p rullen. Beveg tilbake til startposisjon.', 11735, 2011230, 2, 'https://exorlive.com/media_9192@50.50.media', 'https://exorlive.com/video/?ex=9192'),
(179, 9, 7656, 'Tyning av nakken 1', 'St eller sitt. Hold en hnd over kragebeinet. By nakken til motsatt side av den siden du holder hnden p og roter hodet til samme side som du byde hodet til. Blikket ditt skal peke nedover. Kjenn at det tyer p fremsiden av nakken. Hold ca 30 sek', 8144, 2006928, 2, 'https://exorlive.com/media_7656@50.50.media', 'https://exorlive.com/video/?ex=7656'),
(180, 9, 9111, 'Firfotstende: sitt tilbake p heler', 'St p alle fire. Sitt tilbake p helene og strekk ut armene s langt foran deg du greier. Slapp av i nakken. Hold noen sekunder og g tilbake til utgangsstilling.', 11567, 2010866, 2, 'https://exorlive.com/media_9111@50.50.media', 'https://exorlive.com/video/?ex=9111'),
(181, 9, 6573, 'Bryst og skuldre 3', 'Fold hendene bak hodet og press albuene bakover samtidig som du presser brystkassen framover. Kjenn at det strekker i bryst og skulderpartiet. Hold tyningen i 30 sek.', 6544, 2007827, 1, 'https://exorlive.com/media_6573@50.50.media', 'https://exorlive.com/video/?ex=6573'),
(182, 9, 8344, 'Tyning av kapsel', 'Ligg p siden med den underste armen byd i 90 grader. Bruk motsatt arm til  rotere den underste armen innover (slik at du frer underarmen ned mot gulvet). Hold ca 30 sek', 10026, 2007889, 2, 'https://exorlive.com/media_8344@50.50.media', 'https://exorlive.com/video/?ex=8344'),
(183, 9, 5551, 'Bye hodet bakover', 'By hodet langsomt bakover, s langt du klarer. By fram igjen og gjenta velsen. Du kan eventuelt sttte hodet med en hnd nr du tipper hodet bakover.', 5544, 2007790, 1, 'https://exorlive.com/media_5551@50.50.media', 'https://exorlive.com/video/?ex=5551'),
(184, 9, 361, 'Bakside legg 5', 'St foroverbyd med vekten p ett ben og strake armer. Hold benet strakt og len deg framover til du kjenner at det strekker p baksiden av leggen. Hold 30 sek. og bytt ben.', 662, 2005974, 2, 'https://exorlive.com/media_361@50.50.media', 'https://exorlive.com/video/?ex=361'),
