(186, 9, 363, 'Framside lr og hofte 3', 'Sitt p knrne og mens du sttter deg med armene, senker du overkroppen bakover til du kjenner at det strekker p framsiden av lrene. Press eventuelt bekkenet fram og opp for  f et ekstra strekk. Hold 30 sek.', 664, 2004179, 2, 'https://exorlive.com/media_363@50.50.media', 'https://exorlive.com/video/?ex=363'),
(187, 9, 3038, 'Overkropp 3', 'Legg deg p ryggen over ballen med godt spredte ben. Strekk armene over hodet og forsk  la hodet og resten av kroppen ligge avslappet. Nr du merker strekket i ryggen og p forsiden av overkroppen holder du stillingen i 30 sek.', 1000066, 2003948, 2, 'https://exorlive.com/media_3038@50.50.media', 'https://exorlive.com/video/?ex=3038'),
