(189, 9, 6558, 'Sittende rotasjon av overkroppen 2', 'Sitt med byde ben og la knrne hvile ut til siden. Drei overkroppen langsomt til den ene siden, til du kjenner det strekker i ryggen og generelt i overkroppen. Hold stillingen i 30 sek fr du dreier til motsatt side.', 6520, 2008504, 1, 'https://exorlive.com/media_6558@50.50.media', 'https://exorlive.com/video/?ex=6558'),
