(197, 9, 6699, 'Tyning av hoftebyer 1', 'Ligg p ryggen med natulig svai i korsryggen. Grip omkring begge knrne og trekk de mot deg.  Aktiver muskelkorsettet. Slipp deretter det ene benet ned mot gulvet mens du holder omkring det motsatte kneet. Unng at svaien i korsryggen kes. Kjenn at det strekker p framsiden av hoften. Hold ca 30 sek.', 6689, 2008545, 1, 'https://exorlive.com/media_6699@50.50.media', 'https://exorlive.com/video/?ex=6699'),
