(229, 5, 8670, 'Hoppende utfall 1', 'Ta et stort skritt frem med det ene benet og ha lett by i kneet som str igjen. Gjr et hopp og bytt plass p fremste og bakerste ben vekselvis samtidig som du svinger begge armer frem og tilbake.', 10801, 2009728, 4, 'https://exorlive.com/media_8670@50.50.media', 'https://exorlive.com/video/?ex=8670'),
(230, 5, 850, 'Lpe i trapper', '', 1598, 2004813, 4, 'https://exorlive.com/media_850@50.50.media', 'https://exorlive.com/video/?ex=850'),
(231, 5, 8787, 'Battlerope alternerende armer', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  sl ene tauet mot bakken og det andre opp i luften. Jobb opp og ned i motsatte bevegelser med armene, og gjr det til en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11034, 2009665, 3, 'https://exorlive.com/media_8787@50.50.media', 'https://exorlive.com/video/?ex=8787'),
(232, 5, 8671, 'Hoppende utfall 2', 'Ta et stort skritt frem og by litt i fremste kne. Bytt plass p fremste og bakerste ben vekselvis ved  hoppe. Beveg ogs armene vekselvis frem og tilbake diagonalt slik at venstre arm flger hyre ben og motsatt.', 10803, 2009803, 4, 'https://exorlive.com/media_8671@50.50.media', 'https://exorlive.com/video/?ex=8671'),
(233, 5, 8846, '1 ben singelhopp', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Legg vekten p ett ben og finn balansen, for at du skal kunne hoppe p ett ben. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11152, 2009778, 2, 'https://exorlive.com/media_8846@50.50.media', 'https://exorlive.com/video/?ex=8846'),
(234, 5, 8666, 'Boksing', 'St med hoftebredde avstand mellom fttene og armene i bokseposisjon foran kroppen. Boks ved  strekke ut annenhver arm med knyttede hender foran kroppen', 10793, 2009848, 1, 'https://exorlive.com/media_8666@50.50.media', 'https://exorlive.com/video/?ex=8666'),
(235, 5, 8797, 'Bearcrawl fremover', 'Start i push-ups posisjon. Bevegelsen starter ved  g fremover med hyre fot og venstre arm som start, fr venstre fot og hyre arm gr fremover. Fot og arm jobber diagonalt.', 11054, 2009788, 3, 'https://exorlive.com/media_8797@50.50.media', 'https://exorlive.com/video/?ex=8797'),
(236, 5, 8802, 'Burpee sit-up', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert med raskt ned til bakken og flytt fttene raskt inn under kroppen. Rull bakover, slik at du ligger p ryggen med armene over hodet. Gjr en sit-up og hopp opp fra en dyp kneby posisjon. Klapp over hodet med strake armer.', 11064, 2009849, 4, 'https://exorlive.com/media_8802@50.50.media', 'https://exorlive.com/video/?ex=8802'),
(237, 5, 8121, 'Precore Adaptive motion trainer', 'Trykk quick start og juster motstand og hastighet etter eget nske.', 9146, 2008008, 2, 'https://exorlive.com/media_8121@50.50.media', 'https://exorlive.com/video/?ex=8121'),
(238, 5, 3248, 'Cybex: Sigma Recumbent Cycle', 'Du kan velge et program og starte sykkelen, eller bare trykke quick-start. For  endre motstanden trykk pluss el. minus, og for  avslutte trykk stopp.', 703, 2004067, 3, 'https://exorlive.com/media_3248@50.50.media', 'https://exorlive.com/video/?ex=3248'),
(239, 5, 7780, 'Technogym Wave 1', 'Du kan velge et program og starte, eller bare trykke start. For  endre motstanden trykk pluss el. minus, og for  avslutte trykk stopp.', 8348, 2007097, 3, 'https://exorlive.com/media_7780@50.50.media', 'https://exorlive.com/video/?ex=7780'),
(240, 5, 8067, 'Sykle i luften', 'Ligg p ryggen p en matte med armene ned langs siden. Hold bena i luften mens du strekker og byer knrne som om du skulle syklet.', 8853, 2007403, 3, 'https://exorlive.com/media_8067@50.50.media', 'https://exorlive.com/video/?ex=8067'),
(241, 5, 7063, 'G p stedet 2', 'St med rett rygg og avslappede skuldre. Begynn  bevege armene fram og tilbake samtidig som du vekselvis lfter knrne. G p stedet!', 7033, 2007645, 2, 'https://exorlive.com/media_7063@50.50.media', 'https://exorlive.com/video/?ex=7063'),
(242, 5, 388, 'Top XT', 'Juster avstanden til rohndtakene. Du kan velge et program og starte maskinen, eller bare trykke quick-start. For  endre motstanden trykk pluss el. minus, og for  avslutte trykk stopp.', 706, 0, 3, 'https://exorlive.com/media_388@50.50.media', 'https://exorlive.com/video/?ex=388'),
(243, 5, 7273, 'Lp p stedet', 'St med parallelle ftter. Lp p stedet. Rull p foten og lft hlene mot baken.', 7365, 2005397, 4, 'https://exorlive.com/media_7273@50.50.media', 'https://exorlive.com/video/?ex=7273'),
(244, 5, 8591, 'Enkle bendrag intervall', 'Plasser albuer og tballer p mattene, trekk inn magen. Trekk annenhvert ben inn med knrne langs gulvet til 90 grader i hofteleddet. Skyv tilbake til utgangspunktet samtidig som du trekker opp motsatt ben. Raskt og kontrollert tempo i valgt antall sekunder.', 10628, 2009535, 4, 'https://exorlive.com/media_8591@50.50.media', 'https://exorlive.com/video/?ex=8591'),
(245, 5, 5397, 'Oppvarming: rotasjonsvelse 1', 'St med rett rygg og ha ca. hoftebreddes avstand mellom fttene. Hold stavene bak hodet slik at de hviler p skuldrene. Spenn lett i mage- og ryggmuskulaturen. Drei overkroppen rolig fra side til side uten  flytte fttene.', 5368, 2008483, 2, 'https://exorlive.com/media_5397@50.50.media', 'https://exorlive.com/video/?ex=5397'),
(246, 5, 8807, 'Duck walk', 'Start i en dyp knebyposisjon og g bortover uten  reise deg opp.  Hold tyngdepunktet lavt gjennom hele bevegelsen.', 11074, 2009710, 3, 'https://exorlive.com/media_8807@50.50.media', 'https://exorlive.com/video/?ex=8807'),
(247, 5, 849, 'Sykle', '', 1605, 2004811, 4, 'https://exorlive.com/media_849@50.50.media', 'https://exorlive.com/video/?ex=849'),
(248, 5, 8804, 'Burpee tuckjump', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert men raskt ned til bakken og flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og trekk knrne inn til brystkassen i hoppet.', 11068, 2009819, 3, 'https://exorlive.com/media_8804@50.50.media', 'https://exorlive.com/video/?ex=8804'),
(249, 5, 7064, 'Jogge p stedet', 'St med rett rygg og avslappede skuldre. By albuene og begynn  bevege armene fram og tilbake samtidig som du vekselvis lfter knrne. Jogg p stedet!', 7032, 2007681, 2, 'https://exorlive.com/media_7064@50.50.media', 'https://exorlive.com/video/?ex=7064'),
(250, 5, 5431, 'Kneby m/staver', 'St med fttene i skulderbreddes avstand og hold stavene p skuldrene. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 5424, 2008563, 3, 'https://exorlive.com/media_5431@50.50.media', 'https://exorlive.com/video/?ex=5431'),
(251, 5, 8705, 'Stakemaskin/thorax trainer', 'St p stakemaskinen og fest stavene, riktig hyde p stavene har du nr de rekker deg til armhulene. St mest mulig i ro med bena. Ha rett rygg, sett setet litt ut og dra stavene bakover med armene. Fr armene frem igjen, stopp nr de er ca ved skulderhyde. Gjenta.', 10871, 2009775, 3, 'https://exorlive.com/media_8705@50.50.media', 'https://exorlive.com/video/?ex=8705'),
(252, 5, 8667, 'Boksing med spark', 'St p en matte med hoftebreddes avstand mellom fttene og hendene i bokseposisjon. Boks ut i luften med annenhver arm. Varier ved  bruke ulike slag og spark innimellom.', 10795, 2009729, 2, 'https://exorlive.com/media_8667@50.50.media', 'https://exorlive.com/video/?ex=8667'),
(253, 5, 7268, 'BOSU: Jogge', 'St p toppen av BOSU-en med parallelle ftter. Jogg p stedet. Prv  f inn en gyngebevegelse av kroppen der hlene lfter seg fra BOSU-en mens trne til en hver tid er i kontakt med BOSU-en.', 7356, 2005392, 2, 'https://exorlive.com/media_7268@50.50.media', 'https://exorlive.com/video/?ex=7268'),
(254, 5, 853, 'Skyggeboksing', '', 1601, 2004816, 3, 'https://exorlive.com/media_853@50.50.media', 'https://exorlive.com/video/?ex=853'),
(255, 5, 8803, 'Skalert burpee', 'Fra en stende posisjon byer du deg ned til bakken. G ut med fttene og legg deg kontrollert ned p bakken. Reis deg kontrollert opp fra bakken ved  g inn med fttene fra en liggende posisjon til en dyp kneby posisjon. Fra denne posisjonen reiser du deg opp til stende og avslutter velsene med et hopp og klapper over hodet.', 11066, 2009675, 3, 'https://exorlive.com/media_8803@50.50.media', 'https://exorlive.com/video/?ex=8803'),
(256, 5, 5398, 'Rotasjonsvelse 2', 'St med rett rygg og ha ca. hoftebreddes avstand mellom fttene. Hold stavene lftet med strake armer over hodet. Spenn lett i mage- og ryggmuskulaturen. Drei overkroppen rolig fra side til side uten  flytte fttene.', 5370, 2008503, 2, 'https://exorlive.com/media_5398@50.50.media', 'https://exorlive.com/video/?ex=5398'),
(257, 5, 5392, 'Stavgang', 'G framover med rett rygg og lave avslappede skuldre. Ha armene forholdsvis tett p kroppen og hold overkroppen lett foroverbyd. Hold et lett grep omkring stavene og sving armene vekselvis fram og tilbake. Stavene settes i bakken p hyde med hlen p motsatt fot, og skal peke skrtt bakover gjennom hele armbevegelsen. Legg trykk p staven inntil hnden er bak kroppens midtlinje. G med lette og lange steg. Finn ditt eget tempo. Ved hjelp af stavene fr du en god rytme i gangen og en bedre holdning.', 5360, 0, 3, 'https://exorlive.com/media_5392@50.50.media', 'https://exorlive.com/video/?ex=5392'),
(258, 5, 5430, 'Utfall fram m/staver', 'St med samlede ben og hold stavene p skuldrene. Lft det ene benet, og fall framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen. Gjenta med motsatt ben.', 5422, 2008546, 3, 'https://exorlive.com/media_5430@50.50.media', 'https://exorlive.com/video/?ex=5430'),
(259, 5, 848, 'G tur', '', 1573, 0, 2, 'https://exorlive.com/media_848@50.50.media', 'https://exorlive.com/video/?ex=848'),
(260, 5, 5395, 'Padletak', 'St med lett byde kne og hold stavene tett p kroppen. Ta et bredt grep slik at du holder i hver ende av stavene. Spenn lett i mage- og ryggmuskulaturen. Ta store padletak til hver side, mens du samtidig byer og strekker lett i knrne. Utfr bevegelsen i et moderat tempo og med en god rytme.', 5366, 2008549, 2, 'https://exorlive.com/media_5395@50.50.media', 'https://exorlive.com/video/?ex=5395'),
(261, 5, 8798, 'Burpee med knrne i bakken', 'Start i en stende posisjon. Start bevegelsen ved  bye p knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen ned til bakken, slik at hele kroppen er i bakken. Med knrne i kontakt med bakken, presses kroppen opp i en push-up posisjon. Flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og klapp over hodet med strake armer.', 11056, 2009844, 4, 'https://exorlive.com/media_8798@50.50.media', 'https://exorlive.com/video/?ex=8798'),
(262, 5, 8855, 'Bokse hopp', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  splitte fttene frem og tilbake mellom hoppene.\nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11170, 2009717, 2, 'https://exorlive.com/media_8855@50.50.media', 'https://exorlive.com/video/?ex=8855'),
(263, 5, 5429, 'Utfall til siden m/staver', 'St med samlede ben og hold stavene p skuldrene. Fr det aktive benet ut og legg tyngden av kroppen over til denne siden. Nr foten treffer gulvet bremses bevegelsen. Ved sluttstilling er det aktive benet byd, og standbenet er tilnrmet strakt. Returner hurtig til startstillingen. Gjenta til motsatt side.', 5420, 2008517, 3, 'https://exorlive.com/media_5429@50.50.media', 'https://exorlive.com/video/?ex=5429'),
(264, 5, 7272, 'G p stedet', 'St med parallelle ftter. G p stedet. Lft knrne og rull p foten.', 7364, 2005396, 2, 'https://exorlive.com/media_7272@50.50.media', 'https://exorlive.com/video/?ex=7272'),
(265, 5, 7271, 'BOSU: Saksehopp', 'St p toppen av BOSU-en. Hoppopp og ned ved  flytte annethvert ben fram og tilbake. Kan gjres vanskeligere ved  lfte bena hyere.', 7363, 2005395, 3, 'https://exorlive.com/media_7271@50.50.media', 'https://exorlive.com/video/?ex=7271'),
(266, 5, 8845, 'Skipping', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  bye og strekke i den passive foten, slik at den strekkes ut fremfor kroppen. Bytt fra side til side. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11150, 2009818, 2, 'https://exorlive.com/media_8845@50.50.media', 'https://exorlive.com/video/?ex=8845'),
(267, 5, 8786, 'Battlerope med kneby', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  strekke opp hoftene og armene fr du deretter slr tauene mot bakken ved  bye i hoften og armene. Gjr det til en flytende bevegelse. Samtidig som tauene beveges opp og ned skal du aktivt g opp og ned i en dyp kneby. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11032, 2009816, 3, 'https://exorlive.com/media_8786@50.50.media', 'https://exorlive.com/video/?ex=8786'),
(268, 5, 7991, 'Bokse mot boksepute', 'Ta p deg boksehansker og f noen til  holde en boksepute eller lignende. Sl mot puten. Beveg bena hele tiden og forsk  bokse i forskjellig hyder og ved  bruke bde ben og armer.', 9131, 2007584, 3, 'https://exorlive.com/media_7991@50.50.media', 'https://exorlive.com/video/?ex=7991'),
(269, 5, 7269, 'BOSU: Hopp', 'St p toppen av BOSU-en med ansiktet rett fram. Hopp fire ganger p stedet og snu en kvart turn p det femte. Hopp fire ganger p denne posisjonen fr du hopper tilbake p det femte hoppet. Gjenta begge sider. Kan gjres vanskeligere ved  lfte bena hyere.', 7359, 2005393, 2, 'https://exorlive.com/media_7269@50.50.media', 'https://exorlive.com/video/?ex=7269'),
(270, 5, 8792, 'Battlerope med utfallsteg bakover', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  alternerende sl tauene opp og ned. Gjr det til en flytende bevegelse. Samtidig som tauene beveges opp og ned skal du gjre utfall steg bakover. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer. Hold god balanse i hvert steg bakover.', 11044, 2009855, 4, 'https://exorlive.com/media_8792@50.50.media', 'https://exorlive.com/video/?ex=8792'),
(271, 5, 8847, 'Double unders', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen er lik et vanlig singelhopp, men farten p tauet m kes, slik at tauet gjr to hele runder fr du igjen kan ta ny sats. Tauet gr alts to runder under kroppen mellom hvert hopp.  \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11154, 2009842, 2, 'https://exorlive.com/media_8847@50.50.media', 'https://exorlive.com/video/?ex=8847'),
(272, 5, 8857, 'Bell jumps', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  gjre en halv rotasjon mellom hoppene. Roter frem og tilbake mellom hoppene. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11174, 2009799, 2, 'https://exorlive.com/media_8857@50.50.media', 'https://exorlive.com/video/?ex=8857'),
(273, 5, 5407, 'Stegavviklingen', 'Standfasen kan deles i 3 faser: hlisett, kontaktfase og avsett.\nIdet foten settes i bakken skal kneet vre strakt og hlens bakerste og ytterste del br treffe underlaget frst. Deretter rulles framover p foten og vekten fres over p standfoten (kontaktfasen). Vektoverfringen fortsettes til tyngdepunktet ligger foran foten og det settes av i underlaget med den forreste og innerste delen af foten (avsettet). Avsettet foregr med strakt ben. Hlen p motsatt ben settes i underlaget osv.', 5381, 0, 0, 'https://exorlive.com/media_5407@50.50.media', 'https://exorlive.com/video/?ex=5407');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(274, 5, 8851, 'Jumping jacks med hoppetau', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  flytte fttene ut og inn til siden.  \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11162, 2009846, 2, 'https://exorlive.com/media_8851@50.50.media', 'https://exorlive.com/video/?ex=8851'),
(275, 5, 5393, 'Korrekt grep', 'Det er avgjrende  ha et korrekt grep omkring staven, bde for  oppn full effekt av treningen og for  unng spenninger i nakke og skuldre. Grepet skal fles lett og avslappet. Hnden er lett pen og staven peker skrtt bakover nr du gr. Bruk staver med ergonomiske hndtak og gode brede reimer. Mange staver har og en spesialdesignet reim som minner litt om en handske, som gir et ekstra godt grep i staven.', 5363, 0, 0, 'https://exorlive.com/media_5393@50.50.media', 'https://exorlive.com/video/?ex=5393'),
(276, 5, 5408, 'Stavavviklingen', 'Stavene skal hele tiden peke skrtt bakover. De skal settes i bakken og brukes aktivt under gangen. Det oppns strst bidrag til framdriften fra staven ved at du strekker armene godt bakover. For  kunne klare dette skal hnden slippe taket om staven idet det skubbes ifra og armen skal fres fram igjen. Nr du strekker armene ut aktiverer du ogs de dype rygg- og magemusklene, i tillegg til muskler i skuldre og armer.', 5385, 0, 0, 'https://exorlive.com/media_5408@50.50.media', 'https://exorlive.com/video/?ex=5408'),
(277, 5, 8800, 'Burpee straight leg', 'Start i en stende posisjon. Start bevegelsen ved  sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert men raskt ned til bakken og flytt fttene raskt inn under kroppen, med rette ben. Hopp opp fra en stende posisjon og klapp over hodet med strake armer over hodet.', 11060, 2009655, 4, 'https://exorlive.com/media_8800@50.50.media', 'https://exorlive.com/video/?ex=8800'),
(278, 5, 8777, 'Battlerope side-side', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  raskt fre tauene fra side til side fremfor kroppen. Gjr det til en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11014, 2009660, 3, 'https://exorlive.com/media_8777@50.50.media', 'https://exorlive.com/video/?ex=8777'),
(279, 5, 7962, 'Hoppe p trampoline', 'St p en trampoline. Legg madrasser eller matter rundt trampolinen. Forsk  hoppe bde lavt og hyt. Prv for eksempel  lage stjerne eller gjre andre bevegelser mens du er i luften.', 9080, 2007554, 2, 'https://exorlive.com/media_7962@50.50.media', 'https://exorlive.com/video/?ex=7962'),
(280, 5, 7779, 'Technogym Wave 2', 'Du kan velge et program og starte, eller bare trykke start. For  endre motstanden trykk pluss el. minus, og for  avslutte trykk stopp.', 8347, 2007120, 3, 'https://exorlive.com/media_7779@50.50.media', 'https://exorlive.com/video/?ex=7779'),
(281, 5, 7270, 'BOSU: Twist', 'St p BOSU-en, hold armene ut til siden og forsk  holde balansen mens du twister med underkroppen.', 7361, 2005394, 3, 'https://exorlive.com/media_7270@50.50.media', 'https://exorlive.com/video/?ex=7270'),
(282, 5, 8849, 'Spark bak med hoppetau', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  bye i kneet p den passive foten, slik at helen blir frt opp til setet. Bytt fra side til side. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11158, 2009820, 2, 'https://exorlive.com/media_8849@50.50.media', 'https://exorlive.com/video/?ex=8849'),
(283, 5, 8779, 'Battlerope  ut-inn', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  raskt fre tauene rytmisk ut og inn fremfor kroppen. Gjr det til en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen.', 11018, 2009835, 3, 'https://exorlive.com/media_8779@50.50.media', 'https://exorlive.com/video/?ex=8779'),
