(287, 5, 8781, 'Battlerope bue, 1 arm', 'Start med skulderbredde avstand mellom fttene. St p den ene enden av tauet og hold i den andre. Start bevegelsen ved  strekke opp hoftene  og armene i en liten buebevegelse. La buebevegelsen g fra side til side fremfor kroppen i en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauet ved hjelp av hofter og armer.', 11022, 2009858, 3, 'https://exorlive.com/media_8781@50.50.media', 'https://exorlive.com/video/?ex=8781'),
