(292, 5, 8788, 'Battlerope sirkler innover, alternerende.', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  strekke opp hoftene og den ene armene fr du deretter slr tauene inn fremfor kroppen. Trekk s tauene tilbake og start bevegelsen med den andre armen. Gjr det til en flytende bevegelse, slik at tauene annenhver gang treffer bakken.  Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11036, 2009776, 3, 'https://exorlive.com/media_8788@50.50.media', 'https://exorlive.com/video/?ex=8788'),
(293, 5, 8640, 'Straight leg walk', 'G fremover med bestemte skritt ved  heve annenhvert ben strakt opp til vannrett posisjon og ca nitti grader by i hoften. La benet fremdeles vre strakt nr du frer det ned p gulvet igjen. Armene beveges med diagonalt.', 10741, 2009748, 2, 'https://exorlive.com/media_8640@50.50.media', 'https://exorlive.com/video/?ex=8640'),
(294, 5, 5396, 'Diagonalgang', 'For  oppn nsket treningseffekt er det viktig  ha riktig rytme og symmetri over bevegelsene. Stavgang er, akkurat som alminnelig gang, diagonalgang der bevegelsesmnsteret skal fles helt naturlig. Motsatt arm og ben flyttes samtidig fram og tilbake. Pass p at armbevegelsen foregr i skulderen og ikke i albuen.', 5383, 0, 3, 'https://exorlive.com/media_5396@50.50.media', 'https://exorlive.com/video/?ex=5396'),
(295, 5, 8785, 'Battlerope latteral shuffle', 'Start med mer enn skulderbredde melom fttene, og hold p hver sin ende av tauene. Start bevegelsen ved  strekke opp hoftene og armene fr du deretter slr tauene mot bakken ved  bye i hoften og armene. Gjr det til en flytende bevegelse. Samtidig som tauene beveges opp og ned skal kroppen flyttes fra side til side. Hold tyngdepunktet lavt gjennom hele bevegelsen. Flytt vekten dynamisk fra side til side. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11030, 2009792, 3, 'https://exorlive.com/media_8785@50.50.media', 'https://exorlive.com/video/?ex=8785'),
(296, 5, 8848, 'Flutter kicks', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  strekke den passive foten ut fremfor kroppen. Bytt fra side til side. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11156, 2009860, 2, 'https://exorlive.com/media_8848@50.50.media', 'https://exorlive.com/video/?ex=8848'),
