(298, 1059, 9136, 'Bekkenhev m/ ball 2', 'Ligg med ben/stump p en ball. Armene ned langs siden. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet/setet opp til du ligger p skulderbladene. Hold stillingen litt fr du senker rolig ned igjen. Kjenn etter at du bruker setemusklene p den amputerte siden like mye som p den ikke-amputerte siden nr du lfter bekkenet.', 11623, 2011398, 3, 'https://exorlive.com/media_9136@50.50.media', 'https://exorlive.com/video/?ex=9136'),
(299, 1059, 9119, 'Balanse m/ stepkasse', 'Plasser en stepkasse, liten krakk eller lignende foran deg. Lft rolig ikke-amputerte ben opp p stepkassen og ned igjen. Fr i tillegg vekten fram over benet som er p stepen. Utfr velsen rolig og kontrollert. Kjenn at du bruker muskulaturen rundt hofteleddet.', 11590, 2011419, 4, 'https://exorlive.com/media_9119@50.50.media', 'https://exorlive.com/video/?ex=9119'),
(300, 1059, 9130, 'Sidelengs gange', 'G sidelengs. Ha fokus p  bruke musklene i stumpen, spesielt hoftemuskulaturen. Ha fokus p  holde bekkenet rett under velsen og unng  lene overkroppen for mye over mot protesesiden nr du flytter gjenvrende ben.', 11610, 2011461, 3, 'https://exorlive.com/media_9130@50.50.media', 'https://exorlive.com/video/?ex=9130'),
(301, 1059, 9132, 'Baklengs gange', 'Tren p  g baklengs. Hvis du er lramputert kan baklengs gange oppleves frustrerende fordi du savner aktiv kneby og blir tvunget til  lfte hoften. Men det er en god velse for  trene bakside lr- og setemuskulatur samt god protesekontroll.', 11615, 2011377, 3, 'https://exorlive.com/media_9132@50.50.media', 'https://exorlive.com/video/?ex=9132'),
(302, 1059, 9120, 'Stende p balansepute', 'St p balanseputen med hoftebreddes avstand mellom fttene. Kjenn etter at du har like mye vekt p protesen som p gjenvrende ben. Kjenn etter hvordan hoftemuskulaturen brukes og at det er hoftene som arbeider for  opprettholde balansen.', 11591, 2011401, 3, 'https://exorlive.com/media_9120@50.50.media', 'https://exorlive.com/video/?ex=9120'),
(303, 1059, 9135, 'ttetallsgange', 'Sett to markrer p gulvet. G rundt markrene i et ttetall. Ha fokus p  bruke hoftene nr du snur. Bruk protesefoten og ikke kun det ikke-amputerte ben nr du snur deg. Ta korte, men like lange steg. Tren p  f til en jevn og rolig bevegelse spesielt under snuing.', 11621, 2011341, 3, 'https://exorlive.com/media_9135@50.50.media', 'https://exorlive.com/video/?ex=9135'),
(304, 1059, 9113, 'Stende benhev ut 5', 'Sttt deg til en stol eller annet som er stabilt. Lft protesebenet ut til siden og rolig tilbake til utgangsstilling. Srg for at benet er i rett forlengelse av kroppen eller litt bakover og at all bevegelse skjer i hoften. Tenk deg at hlen p protesen kommer ut til siden frst.', 11578, 2011368, 1, 'https://exorlive.com/media_9113@50.50.media', 'https://exorlive.com/video/?ex=9113'),
(305, 1059, 9166, 'Sitte og reise seg 5', 'St foran en stol. Fttene skal peke rett frem eller litt p skr utover. By i hofter og knr og sett deg p  stolen. Det er helt greit at hlen p protesefoten lfter seg opp nr du byer i hofter og knr. Ryggen skal holdes naturlig rett gjennom velsen, spenn derfor mage-og ryggmusklene fr du begynner bevegelsen. Ha fokus p  ha lik tyngde p hyre og venstre ben under velsen.', 11683, 2011302, 2, 'https://exorlive.com/media_9166@50.50.media', 'https://exorlive.com/video/?ex=9166'),
(306, 1059, 9121, 'Balansepute m/ armbevegelser', 'St p balanseputen med hoftebreddes avstand mellom fttene. Beveg armene i ulike retninger f.eks opp mot taket og ned mot gulvet. Kjenn etter hvordan hoftemuskulaturen brukes og at det blant annet er hoftene som arbeider for  opprettholde balansen.', 11593, 2011299, 2, 'https://exorlive.com/media_9121@50.50.media', 'https://exorlive.com/video/?ex=9121'),
