(309, 1059, 9117, 'Vektoverfringer sideveis m/ vekt', 'St med hoftebredde avstand mellom fttene med en vekt/manual i protesesidens hnd. Flytt hele kroppsvekten fra hyre til venstre ben. Ha fokus p  bruke musklene i stumpen og musklene rundt hofteleddet. St foran et speil hvis du har mulighet. Poenget er  f mer vekt ned i protesen ved hjelp av vekten.', 11586, 2011365, 3, 'https://exorlive.com/media_9117@50.50.media', 'https://exorlive.com/video/?ex=9117'),
