(327, 1059, 9124, 'Kneby m/ leggprotese', 'St bak en stol. Plasser hendene p stolryggen som sttte. Fttene skal peke rett frem eller litt p skr utover. By hofte- og kneleddene og press opp igjen til startstilling. Det er samme bevegelse som nr du setter deg p en stol. Det er helt greit at hlen p protesefoten lfter seg opp nr du byer i hofter og knr. Ryggen skal holdes naturlig rett gjennom velsen, spenn derfor mage-og ryggmusklene fr du begynner bevegelsen.', 11599, 2011320, 1, 'https://exorlive.com/media_9124@50.50.media', 'https://exorlive.com/video/?ex=9124'),
