(355, 1028, 6783, 'Armpendel', 'St med god holdning. Kjenn at armene er tunge. Sving den ene armen rolig fram og tilbake ved at du pendler i skulderleddet. k etterhvert pendelen og ta den verste delen av ryggen med i bevegelsen, slik at du bde svinger armen og dreier overkroppen. F et godt "slipp" i skulderleddet og hold en fin rytme. Svikt gjerne lett knrne mens du pendler. Kombiner evt velsen med fokus p respirasjon.', 6745, 2007710, 1, 'https://exorlive.com/media_6783@50.50.media', 'https://exorlive.com/video/?ex=6783'),
