(376, 1028, 7985, 'Hvilestilling over en stol', 'Snu en stol opp ned og legg deg over den for drenasje. Legg gjerne ett lite pledd over dersom det er hardt  ligge rett p stolen.', 9120, 2007550, 2, 'https://exorlive.com/media_7985@50.50.media', 'https://exorlive.com/video/?ex=7985'),
(377, 1028, 10085, 'Dyrenes hvilestilling (Saithalyasana)', 'Sitt p baken med bena strukket frem. By deretter det ene benet godt bakover slik at hlen kommer s nrme baken som mulig og kneet peker rett ut til siden. Det andre benet byer du inn slik at hlen kommer s nrme skrittet som mulig og kneet peker rett frem. Orienter overkroppen rett frem mot det fremre kneet og plasser hendene p kneet med strake armer. Rett deg litt ekstra opp i ryggen.\nP en rolig innpust: lft armene rett opp mot taket.\nP en rolig utpust: senk overkroppen ned og legg deg opp det fremre lret/kneet. Legg hendene og underarmene i matten p en slik mte at du fr sttte og balanse i stillingen. Stillingen tyer muskulatur i baken og p utsiden av hoftene/lrene, og kan kan holdes i alt fra 1 til 5 minutter.\nUt av stillingen: pust rolig inn mens du lfter overkroppen opp og strekker armene mot taket. Pust ut nr du senker armene ned p kneet. Gjenta til den andre siden.', 13712, 2013871, 2, 'https://exorlive.com/media_10085@50.50.media', 'https://exorlive.com/video/?ex=10085'),
(378, 1028, 10087, 'Krokodillen (Makarasana)', 'Ligg p magen med armene strukket frem. Lft opp vre del av ryggen, nakken og hodet og plasser albuene i matten litt foran skuldrene. Legg hodet i hendene slik at haken/kjevebena hviler ned i hndflatene, og fingrene er vendt opp mot kinnene. Ansiktet vender rett frem. Lukk ynene, ha fri pust med nesen og la deg synke litt inn i stillingen - brystkassen fr synke litt fremover og nedover. Vr i stillingen i 1 til 3 minutter. Ligg et kort yeblikk p magen etterp.', 13511, 2013817, 1, 'https://exorlive.com/media_10087@50.50.media', 'https://exorlive.com/video/?ex=10087'),
(379, 1028, 10086, 'Flyndra (Matsya Kridasana)', 'Ligg frst p magen med armene strukket frem. Legg deg deretter delvis over p hyre side, samtidig som du legger flate hender opp hverandre, og hviler hyre kinn opp hendene. By godt opp i venstre ben slik at venstre kne berrer venstre albue. Venstre fotsle skal berre forsiden av hyre kne. Lukk ynene, ha fri pust med nesen og fall til ro i stillingen. Du kan ligge i stillingen i mellom 1 og 5 minutter fr du kommer rolig ut av den og gjentar til den andre siden.', 13509, 2013790, 1, 'https://exorlive.com/media_10086@50.50.media', 'https://exorlive.com/video/?ex=10086'),
(380, 1028, 10084, 'Dd stille i mageliggende (Advasana)', 'Ligg p magen. Ha litt avstand mellom fttene. Strekk ut i fttene slik at vristene er ned mot matten. Ligg med armene strukket fremover, men ikke lenger frem enn at du ligger uanstrengt med skuldrene. Hodet kan du la hvile p det ene kinnet. Lukk ynene og fall til ro.\nDette er en avspenningsstilling som du kan ligge i i alt fra 3 til 10 minutter, og er en fin stilling for  avslutte et yogaprogram.', 13504, 2013772, 1, 'https://exorlive.com/media_10084@50.50.media', 'https://exorlive.com/video/?ex=10084'),
(381, 7, 701, 'Planken', 'St p tr og albuer og la bekkenet hvile mot gulvet. Lft bekkenet opp fra gulvet ved  stramme opp i rygg og mage. Stabilisr kroppen i denne stillingen og hold 3-5 sek. Hvil tilsvarende og gjenta.', 1280, 2004712, 3, 'https://exorlive.com/media_701@50.50.media', 'https://exorlive.com/video/?ex=701'),
(382, 7, 778, '"Broen"', 'Plasser fotslene p gulvet og armene ut til siden. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt.', 1494, 2004768, 2, 'https://exorlive.com/media_778@50.50.media', 'https://exorlive.com/video/?ex=778'),
(383, 7, 8528, 'TRX Low Row', 'St p gulvet med hender i TRX, albue rett under skulder. Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen med albue tett mot kroppen. velsen gjres tyngre ved  forandre p vinkel.', 10502, 2009329, 3, 'https://exorlive.com/media_8528@50.50.media', 'https://exorlive.com/video/?ex=8528'),
(384, 7, 8172, 'Kombinert planke, pushups og roing', 'St p trne og strake armer og hold en manual i hver hnd. Gjr en push-ups, trekk deretter opp den ene armen og slipp den rolig ned igjen. Gjenta med motsatt arm.', 9239, 2007991, 5, 'https://exorlive.com/media_8172@50.50.media', 'https://exorlive.com/video/?ex=8172'),
(385, 7, 603, 'Kneby 1', 'St med fttene i skulderbreddes avstand. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1098, 2004625, 2, 'https://exorlive.com/media_603@50.50.media', 'https://exorlive.com/video/?ex=603'),
(386, 7, 834, 'Kneby stabilitet m/ball', 'St oppreist med en ball som ryggsttte. Finn nytralstillingen i ryggen og bekken. Lag "flat mage" og by i knrne til du er i sittestilling. Press opp igjen og gjenta.', 1635, 2005949, 2, 'https://exorlive.com/media_834@50.50.media', 'https://exorlive.com/video/?ex=834'),
(387, 7, 524, 'Diagonalhev p en ball', 'Ligg p magen p ballen. Lft den ene armen og det motsatte ben til de er i forlengelse av kroppen. Lft deretter motsatt ben og arm.', 754, 2004902, 3, 'https://exorlive.com/media_524@50.50.media', 'https://exorlive.com/video/?ex=524');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(388, 7, 601, 'Utfall fram 1', 'St med samlede ben og sett armene i siden. Lft det ene benet, og fall framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1095, 2004624, 3, 'https://exorlive.com/media_601@50.50.media', 'https://exorlive.com/video/?ex=601'),
(389, 7, 782, '"Firfot" ben- og armlft', 'St p alle fire og finn nytralstillingen  i ryggen og bekkenet. Lag "flat mage" og lft det ene benet og den motsatte armen til de er i forlengelse av resten av kroppen. Gjenta motsatt.', 1498, 2004771, 3, 'https://exorlive.com/media_782@50.50.media', 'https://exorlive.com/video/?ex=782'),
(390, 7, 8503, 'TRX Crunch (elbow)', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og albuer i gulvet. Trekk begge knr inn mot albue.', 10452, 2009489, 3, 'https://exorlive.com/media_8503@50.50.media', 'https://exorlive.com/video/?ex=8503'),
(391, 7, 489, 'Knelft p en ball', 'St p hendene med fttene p ballen. Forsk  rulle ballen mot deg ved  trekke knrne opp mot brystet. Stram godt opp i mage- og korsryggregionen under bevegelsen.', 987, 2004898, 6, 'https://exorlive.com/media_489@50.50.media', 'https://exorlive.com/video/?ex=489'),
(392, 7, 8016, 'Firefotstende diagonalstrekk', 'St p alle fire p en matte. Hold ryggen rett under hele velsen. Strekk motsatt arm og ben samtidig. Gjenta med motsatt side.', 8831, 2007420, 4, 'https://exorlive.com/media_8016@50.50.media', 'https://exorlive.com/video/?ex=8016'),
(393, 7, 786, '"Broen" ettbenslft 1', 'Plasser fotslene p gulvet og armene ut til siden. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Strekk det ene benet og lft bekkenet opp til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1495, 2004774, 4, 'https://exorlive.com/media_786@50.50.media', 'https://exorlive.com/video/?ex=786'),
(394, 7, 7253, 'BOSU: Kneby', 'St med parallelle ftter med litt avstand p toppen av BOSU-en. By i knr og hofter og sving armene fram foran kroppen. Pass p  holde ryggen rett og at nakken er i en naturlig forlengelse av ryggen. Se p skr ned og framover. Pass ogs p  ha kne over t. Fr armene tilbake samtidig som du strekker deg tilbake til utgangsstillingen.', 7328, 2005377, 4, 'https://exorlive.com/media_7253@50.50.media', 'https://exorlive.com/video/?ex=7253'),
(395, 7, 8308, 'Planken p ball', 'Plasser albuene p ballen. St p trne med strak kropp. Spenn magemusklaturen slik at du klarer  holde kroppen strak.', 9953, 2008076, 4, 'https://exorlive.com/media_8308@50.50.media', 'https://exorlive.com/video/?ex=8308'),
(396, 7, 605, 'Ettbens kneby 1', 'St p ett ben. Det passive ben kan eventuelt settes bak det andre og kun sttte bevegelsen. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram. Gjenta med motsatt ben.', 1103, 2004627, 4, 'https://exorlive.com/media_605@50.50.media', 'https://exorlive.com/video/?ex=605'),
(397, 7, 6399, 'Albuestende stabilitetsvelse m/ball', 'Start gjerne velsen med at du str p knrne. Plasser underarmene p ballen og lft bekkenet, slik at du str p tr og albuer. Stram godt opp i mage- og korsryggregionen og hold kroppen strak og stabil. Unng  svaie i korsryggen eller senke hoften.', 6372, 2007809, 5, 'https://exorlive.com/media_6399@50.50.media', 'https://exorlive.com/video/?ex=6399'),
(398, 7, 6579, 'Planken - rulle fra side til side', 'Sttt deg p albuer og tr. Lft bekkenet slik at kroppen er strak (som en planke). Stram rygg- og magemuskulaturen og stabilisr kroppen i denne stillingen. Legg s vekten over p den ene albuen og dreie hele kroppen som n enhet. Rull tilbake og videre over p den andre albuen. Hver stilling br holdes i minimum 5 sek.', 6513, 2007823, 4, 'https://exorlive.com/media_6579@50.50.media', 'https://exorlive.com/video/?ex=6579'),
(399, 7, 798, 'Bekkenhev og lrcurl m/ball', 'Ligg med begge benene p ballen og armene ned langs siden. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og lft bekkenet opp til du ligger p skulderbladene. Trekk benene mot baken ved  bye i knrne, rull ballen tilbake og gjenta.', 1516, 2004909, 4, 'https://exorlive.com/media_798@50.50.media', 'https://exorlive.com/video/?ex=798'),
(400, 7, 3112, '"Broen" ettbenslft 3', 'Plasser den ene fotslen p gulvet og ha armene ut til siden. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1000204, 2004006, 4, 'https://exorlive.com/media_3112@50.50.media', 'https://exorlive.com/video/?ex=3112'),
(401, 7, 8329, 'Utfall m/ bakre ben p stol', 'St p ett ben med knr og tr pekende rett frem. Sett en stol ca 1 meter bak deg og plasser motsatt ben p stolen. Gjr en kneby og vr ppasselig med  holde kne over t under hele velsen.', 9995, 2007978, 4, 'https://exorlive.com/media_8329@50.50.media', 'https://exorlive.com/video/?ex=8329'),
(402, 7, 8535, 'TRX Chest press (deep)', 'St p gulvet med hender i TRX, armene foran kroppen rett ut fra skulder. Plasser bena mot ankerpunktet. Senk overkroppen mot gulvet til albue har 90 grader, press tilbake til utgangspunktet med en strak kropp.', 10516, 2009399, 4, 'https://exorlive.com/media_8535@50.50.media', 'https://exorlive.com/video/?ex=8535'),
(403, 7, 8531, 'TRX Low Row (tung)', 'St p gulvet med hender i TRX. Senk kroppen ned mot gulvet slik at det er 45 grader i forhold til gulvet og trekk overkroppen opp med albue tett mot kroppen. velsen gjres tyngre ved  plassere bena nrmere ankerpunktet.', 10508, 2009378, 5, 'https://exorlive.com/media_8531@50.50.media', 'https://exorlive.com/video/?ex=8531'),
(404, 7, 835, 'Bekkenhev m/ball', 'Ligg med begge benene p ballen og armene ned langs siden. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og lft bekkenet opp til du ligger p skulderbladene. Hold i 10-15 sek. Hvil tilsvarende.', 1631, 2004914, 3, 'https://exorlive.com/media_835@50.50.media', 'https://exorlive.com/video/?ex=835'),
(405, 7, 8512, 'TRX Squat', 'St p gulvet med skulderbredde mellom ftter, hender i TRX og albue rett under skulder. Senk setet mot gulvet, rett ut albue og skyv tilbake til utgangspunktet gjennom helen.', 10470, 2009336, 2, 'https://exorlive.com/media_8512@50.50.media', 'https://exorlive.com/video/?ex=8512'),
(406, 7, 3115, 'Firfotstende arm- og benlft', 'St p alle fire uten  "henge" i skulderpartiet. Lft hodet slik at det er i forlengelse av overkroppen og trekk haken inn. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Deretter strekker du det ene benet bakover samtidig som du lfter motsatt arm. Vend tilbake og gjenta motsatt.', 1000226, 2005939, 4, 'https://exorlive.com/media_3115@50.50.media', 'https://exorlive.com/video/?ex=3115'),
(407, 7, 407, 'Thev p en benk el. et trappetrinn', 'St p kanten av et trappetrinn eller en benk, slik at hlene er fri. Ha ca. hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1676, 2004352, 3, 'https://exorlive.com/media_407@50.50.media', 'https://exorlive.com/video/?ex=407'),
(408, 7, 602, 'Splitt 1', 'St med med hendene i siden. Plasser det aktive benet et godt stykke foran det andre. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram under hele bevegelsen. Gjenta med motsatt ben.', 1097, 2007224, 3, 'https://exorlive.com/media_602@50.50.media', 'https://exorlive.com/video/?ex=602'),
(409, 7, 788, 'Sideliggende bekkenhev 1', 'Ligg p siden og sttt deg mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1513, 2004775, 3, 'https://exorlive.com/media_788@50.50.media', 'https://exorlive.com/video/?ex=788'),
(410, 7, 8504, 'TRX Crunch (hand)', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Trekk begge knr inn mot albue til det er 90 grader i hofteleddet.', 10454, 2009426, 4, 'https://exorlive.com/media_8504@50.50.media', 'https://exorlive.com/video/?ex=8504'),
(411, 7, 8171, 'Planken p knrne', 'Ligg p en matte. Sttt deg p albuene og knrne. Hold ryggen rett som en planke under hele velsen.', 9238, 2007939, 2, 'https://exorlive.com/media_8171@50.50.media', 'https://exorlive.com/video/?ex=8171'),
(412, 7, 777, 'Ryggligende "flat mage"', 'Ligg p ryggen (hold nytralposisjon av bekken og ryggrad) med fotslene i gulvet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Forsk  holde spenningen mens du puster normalt i 10-15 sek.', 1485, 2007751, 1, 'https://exorlive.com/media_777@50.50.media', 'https://exorlive.com/video/?ex=777'),
(413, 7, 8343, 'Retraksjon og protraksjon av skuldrene i planken', 'Sttt deg p armer og tr. Hold kroppen strak under hele velsen. Forsk  skyv skulderbladene fra hverandre slik at du skyver vre del av ryggen opp mot taket. Senk deretter rolig ned igjen og trekk skulderbladene sammen.', 10024, 2008147, 4, 'https://exorlive.com/media_8343@50.50.media', 'https://exorlive.com/video/?ex=8343'),
(414, 7, 600, 'Utfall til siden 1', 'St med samlede ben og sett armene i siden. Fr det aktive benet ut og legg tyngden av kroppen over til denne siden. Nr foten treffer gulvet bremses bevegelsen. Ved sluttstilling er det aktive ben byd, og standbenet er tilnrmet strakt. Returner hurtig til startstillingen.', 1092, 2004623, 3, 'https://exorlive.com/media_600@50.50.media', 'https://exorlive.com/video/?ex=600'),
(415, 7, 8167, 'Diagonal hndstende planke', 'St p trne og strake armer. Vr ppasslig med  holde ryggen rett. Hold balansen mens du lfter og strekker motsatt arm og ben.', 9231, 2008003, 5, 'https://exorlive.com/media_8167@50.50.media', 'https://exorlive.com/video/?ex=8167'),
(416, 7, 8485, 'TRX Suspended Lunge', 'St med ansiktet vendt bort fra ankerpunktet med det ene benet festet i TRX, by fremste ben, senk setet ned mot gulvet mens bakerste ben fres bakover, skyv opp til utgangsposisjon gjennom helen.', 10416, 2009533, 5, 'https://exorlive.com/media_8485@50.50.media', 'https://exorlive.com/video/?ex=8485'),
(417, 7, 8638, 'Dragen', 'St p ett ben. Len overkroppen fremover samtidig som benet du ikke str p beveges bakover. Stopp bevegelsen nr kroppen er i en rett linje. Armene strekkes ned mot gulvet. Kom deretter tilbake til stende posisjon, lft kneet opp til du har ca nitti grader i hoften, Beveg armene opp mot taket og g opp p t p benet du str p. Kom rolig tilbake til utgangsstilling.', 10737, 2009811, 4, 'https://exorlive.com/media_8638@50.50.media', 'https://exorlive.com/video/?ex=8638'),
(418, 7, 8513, 'TRX Squat 1 ben', 'St p gulvet med en fot, strekk motsatt ben foran deg. Hender i TRX og albue rett under skulder. Senk setet mot gulvet, rett ut albue og skyv tilbake til utgangspunktet gjennom helen.', 10472, 2009396, 4, 'https://exorlive.com/media_8513@50.50.media', 'https://exorlive.com/video/?ex=8513'),
(419, 7, 8511, 'TRX Saw', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og albuer i gulvet. Hold kroppen i strak linje, start en bevegelse i skulderleddet hvor kroppen fres fram og tilbake med samlede og strake ben.', 10468, 2009456, 3, 'https://exorlive.com/media_8511@50.50.media', 'https://exorlive.com/video/?ex=8511'),
(420, 7, 8530, 'TRX High Row', 'St p gulvet med hender i TRX, albue rett ut fra skulder.  Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen. velsen gjres tyngre ved  forandre vinkelen p kroppen i forhold til gulvet.', 10506, 2009422, 4, 'https://exorlive.com/media_8530@50.50.media', 'https://exorlive.com/video/?ex=8530'),
(421, 7, 8496, 'TRX Plank', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og knr og albuer i gulvet. Lft knrne av gulvet slik at kroppen blir strak og hold posisjonen.', 10438, 2009339, 4, 'https://exorlive.com/media_8496@50.50.media', 'https://exorlive.com/video/?ex=8496'),
(422, 7, 5219, 'Liggende kroppsheving i slynge', 'Ligg p ryggen med strake armer framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Lft overkroppen ved bde  bye i albuene og trekke skulderbladene mot hverandre slik at brystkassen presses fram. Fr rolig tilbake til utgangsstillingen.', 4799, 2004850, 4, 'https://exorlive.com/media_5219@50.50.media', 'https://exorlive.com/video/?ex=5219'),
(423, 7, 8105, 'G opp og ned p albuer i planke stillling', 'St p trne og hold overkroppen fiksert p strake armer.  G opp og ned fra/til albuene.', 8879, 2007520, 4, 'https://exorlive.com/media_8105@50.50.media', 'https://exorlive.com/video/?ex=8105'),
(424, 7, 9240, 'Mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Jobb med annenhvert ben.', 11829, 2011275, 4, 'https://exorlive.com/media_9240@50.50.media', 'https://exorlive.com/video/?ex=9240'),
(425, 7, 521, 'Rygghev p en ball 3', 'Ligg med overkroppen og hoftene p ballen og la armene henge ned mot gulvet. Stram opp i magen, i korsryggen og lft overkroppen i en rolig bevegelse. Til sist i bevegelsen er kroppen tilnrmet strak og armene holdes strukket over hodet.', 755, 2004901, 3, 'https://exorlive.com/media_521@50.50.media', 'https://exorlive.com/video/?ex=521'),
(426, 7, 8505, 'TRX Oblique Crunch', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Trekk begge knr inn mot annenhver side opp mot armene til det er 90 grader i hofteleddet.', 10456, 2009377, 4, 'https://exorlive.com/media_8505@50.50.media', 'https://exorlive.com/video/?ex=8505'),
(427, 7, 3130, '"Dobbelthake" 1', 'velsen kan gjres sittende eller stende. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000245, 2005916, 1, 'https://exorlive.com/media_3130@50.50.media', 'https://exorlive.com/video/?ex=3130'),
(428, 7, 781, 'T og albuestende bro', 'St p tr og albuer og finn nytralstillingen av ryggen og bekken. Lag "flat mage" og st i denne posisjonen i 10-15 sek.', 1497, 2008509, 3, 'https://exorlive.com/media_781@50.50.media', 'https://exorlive.com/video/?ex=781'),
(429, 7, 9259, 'Bekkenhev m/stang', 'Ligg p ryggen med byde ben og hold en vektstang over hoftene. Aktiver magemuskulaturen og lft setet opp fra gulvet til du har en rett linje mellom skulder og kne. Hold noen sekunder p toppen og senk rolig tilbake til utgangsstilling.', 11867, 2011038, 4, 'https://exorlive.com/media_9259@50.50.media', 'https://exorlive.com/video/?ex=9259'),
(430, 7, 7250, 'BOSU: Stasjonrt utfall', 'Sett en fot p toppen av BOSU-en og plasser den andre foten et godt steg tilbake. By i knrne og senk kroppen ned og litt framover. Pass p at du har knr over tr. Strekk opp igjen til utgangsstillingen og gjenta.', 7322, 2005374, 5, 'https://exorlive.com/media_7250@50.50.media', 'https://exorlive.com/video/?ex=7250'),
(431, 7, 818, 'Sideliggende bekkenhev 3', 'Ligg p siden med byde knr og sttte mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1610, 2004793, 2, 'https://exorlive.com/media_818@50.50.media', 'https://exorlive.com/video/?ex=818'),
(432, 7, 3262, 'Thev 1', 'St p gulvet med ca hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1000465, 2004072, 1, 'https://exorlive.com/media_3262@50.50.media', 'https://exorlive.com/video/?ex=3262'),
(433, 7, 8558, 'TRX Biceps Curl', 'St p gulvet med hender i TRX, hndflatene opp. Len deg tilbake til armene er rette. By albuen og trekk kroppen opp til hendene kommer opp til hver sin side av hodet. Albuene skal peke rett framover under hele velsen.', 10562, 2009390, 4, 'https://exorlive.com/media_8558@50.50.media', 'https://exorlive.com/video/?ex=8558'),
(434, 7, 8168, 'Planken med utoverfring av annenhvert ben', 'St med sttte p albuene og trne. Vr ppasselig med  holde ryggen rett under hele velsen. Fr det ene benet ut til siden og inn igjen.Bytt ben og gjenta.', 9233, 2008052, 4, 'https://exorlive.com/media_8168@50.50.media', 'https://exorlive.com/video/?ex=8168'),
(435, 7, 9241, 'Dynamisk mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Dette gjres i en dynamisk bevegelse. Jobb med annenhvert ben og k tempoet i forhold til nsket intensitet.', 11831, 2011269, 4, 'https://exorlive.com/media_9241@50.50.media', 'https://exorlive.com/video/?ex=9241'),
(436, 7, 785, '"Broen" ettbenslft 2', 'Ligg med et godt grep om det ene lret. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1501, 2007249, 4, 'https://exorlive.com/media_785@50.50.media', 'https://exorlive.com/video/?ex=785'),
(437, 7, 8491, 'TRX Hamstring Curl og Hip Press', 'Ligg p ryggen med setet i gulvet og begge helene i TRX. Trekk helene inn mot setet samtidig som du hever bekkenet opp fra gulvet til hoften er rett og kneet har 90 grader.', 10428, 2009409, 4, 'https://exorlive.com/media_8491@50.50.media', 'https://exorlive.com/video/?ex=8491'),
(438, 7, 3323, 'Balansepute: kneby', 'St p balanseputen. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1000576, 2004133, 2, 'https://exorlive.com/media_3323@50.50.media', 'https://exorlive.com/video/?ex=3323'),
(439, 7, 9030, 'Steg opp med knelft', 'G opp p en step/trinn med venstre ben og lft kneet p hyre ben hyt opp. Sett s hyre ben ned p gulvet og deretter venstre. Gjenta velsen, men n med hyre ben frst opp p stepen/trinnet.', 11425, 2010905, 2, 'https://exorlive.com/media_9030@50.50.media', 'https://exorlive.com/video/?ex=9030'),
(440, 7, 7192, 'BOSU: Planken 1', 'Plasser underarmene p BOSU-en, sett trne i gulvet og hold kroppen strak. Hold bekken og korsrygg i nytralstilling og nakken i en naturlig forlengelse av ryggen. Se ned i gulvet. Hold stillingen s lenge du klarer. Sett knrne i gulvet og ta en pause fr du gjentar velsen.', 7213, 2005319, 4, 'https://exorlive.com/media_7192@50.50.media', 'https://exorlive.com/video/?ex=7192'),
(441, 7, 8534, 'TRX Chest Press (medium)', 'St p gulvet med hender i TRX, armener foran kroppen rett ut fra skulder. By albue til 90 grader og senk overkroppen mot gulvet, press tilbake til utgangspunktet med en strak kropp.', 10514, 2009406, 3, 'https://exorlive.com/media_8534@50.50.media', 'https://exorlive.com/video/?ex=8534'),
(442, 7, 6641, 'Transversus/Korsett aktivering 2', 'Ligg p ryggen med fttene i gulvet. Plasser hendene p magen, den ene under og den andre over navlen. Aktiver muskelkorsettet ved   trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, uten at den verste hnden beveger seg. Spenn bekkenbunnen samtidig.', 6638, 2008538, 1, 'https://exorlive.com/media_6641@50.50.media', 'https://exorlive.com/video/?ex=6641'),
(443, 7, 8493, 'TRX Pike', 'Plasser begge ftter i TRX og hender i gulvet. Trekk fttene inn mot armene samtidig som du hever setet og holder bena rette. Hodet kommer inn mellom hendene.', 10432, 2009383, 3, 'https://exorlive.com/media_8493@50.50.media', 'https://exorlive.com/video/?ex=8493'),
(444, 7, 790, 'Push up mot benk', 'St i push up stilling mot en benk. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekken. Lag "flat mage", senk overkroppen mot benken og press tilbake.', 1512, 2004778, 3, 'https://exorlive.com/media_790@50.50.media', 'https://exorlive.com/video/?ex=790'),
(445, 7, 5021, 'Brystpress m/bredt grep i slynge 2', 'St med trne i gulvet og sttt deg i stroppene med strake armer. Ha en slynge i hver hnd. Skyt rygg. Stabilisr i mage og korsrygg. Senk kroppen ved  fre albuene rett ut til siden samtidig som du byer dem. Press rolig tilbake ved  fre armene sammen foran kroppen igjen.', 4779, 2004846, 4, 'https://exorlive.com/media_5021@50.50.media', 'https://exorlive.com/video/?ex=5021'),
(446, 7, 779, '"Broen" m/benspark', 'Plasser fotslene p gulvet og armene ut til siden. Fra den broliggende posisjonen, med "flat mage" og "bekkenvipp bak" utfrer du langsomme benspark. Lrene skal hele tiden vre parallelle.', 1495, 2004769, 4, 'https://exorlive.com/media_779@50.50.media', 'https://exorlive.com/video/?ex=779'),
(447, 7, 8307, 'Ettbens setelft p ball m/utoverfring', 'Ligg p ryggen p en matte med armene ned langs siden. Hold begge bena strake. Plasser det ene benet p ballen og hold det andre benet parallelt i luften. Lft setet opp i luften s hele kroppen er strak. Fr det benet som er i luften rolig ut til siden og tilbake igjen. Senk deg s ned p matten.', 9952, 2008027, 5, 'https://exorlive.com/media_8307@50.50.media', 'https://exorlive.com/video/?ex=8307'),
(448, 7, 5284, 'Hofte fleksjon i slynge 4', 'St p albuene med en slynge plassert omkring hver ankel. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4924, 2004499, 3, 'https://exorlive.com/media_5284@50.50.media', 'https://exorlive.com/video/?ex=5284'),
(449, 7, 5621, 'Sittende bekkenvipp p en stor ball', 'Sitt p ballen med en god og stabil holdning. Hold bekkenet i midtstillingen. Vipp bekkenet fram slik at korsryggen svaier. Deretter vippes bekkenet rolig bakover slik at svaien nederst i ryggen rettes ut. Vend tilbake til midtstillingen og gjenta.', 5436, 2007803, 1, 'https://exorlive.com/media_5621@50.50.media', 'https://exorlive.com/video/?ex=5621'),
(450, 7, 8502, 'TRX Push Up', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet.Hold overkropp og ben strake under utfrsel av hele velsen. By albuene og senk overkroppen ned mot gulvet og skyv tilbake til utgangsposisjon.', 10450, 2009526, 4, 'https://exorlive.com/media_8502@50.50.media', 'https://exorlive.com/video/?ex=8502'),
(451, 7, 8498, 'TRX Side Plank (elbow)', 'Plasser begge ftter i TRX, med det verste benet foran det andre, med siden til ankerpunktet. Albuen plasserer du rett under skulder. Lft hoften opp fra gulvet slik at kroppen blir strak og hold posisjonen.', 10442, 2009450, 4, 'https://exorlive.com/media_8498@50.50.media', 'https://exorlive.com/video/?ex=8498'),
(452, 7, 800, '"Vandring" p en ball', 'Ligg i push up stilling med bekkenet p ballen. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekkenet. Lag "flat mage" og begynn  g p strake armer framover. G tilbake og gjenta.', 1514, 2004910, 3, 'https://exorlive.com/media_800@50.50.media', 'https://exorlive.com/video/?ex=800'),
(453, 7, 8829, 'Box jump', 'Start stende med en boks fremfor deg. Gjr et hopp opp p boksen og land med 3/4 deler av foten inne p boksen. Forlat boksen ved  strekke i hoftene. Kroppen skal vre helt strak over bokshyde fr du treffer bakken og gjennomfrer et nytt hopp. Forsk  ha s kort kontakttid i bakken som mulig.', 11118, 2009851, 3, 'https://exorlive.com/media_8829@50.50.media', 'https://exorlive.com/video/?ex=8829'),
(454, 7, 8489, 'TRX Hamstring Curl', 'Ligg p ryggen med begge helene festet i TRX. Lft setet over gulvet, trekk helene inn mot setet med et jevnt trykk ned i TRX. Kom tilbake til utgangspunktet.', 10424, 2009488, 3, 'https://exorlive.com/media_8489@50.50.media', 'https://exorlive.com/video/?ex=8489'),
(455, 7, 8494, 'TRX Mountain Climber', 'Plasser begge ftter i TRX og hender i gulvet, med ansiktet fra ankerpunktet. Trekk annenhver fot inn mot armene i stempelbevegelse.', 10434, 2009473, 5, 'https://exorlive.com/media_8494@50.50.media', 'https://exorlive.com/video/?ex=8494'),
(456, 7, 710, 'Liggende diagonal armsving og benspark', 'Ligg p ryggen med 90 graders by i hofter og knr og armene hevet over brystet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Samtidig senker du den ene armen og det motsatte benet.', 1489, 2004719, 5, 'https://exorlive.com/media_710@50.50.media', 'https://exorlive.com/video/?ex=710'),
(457, 7, 8630, 'Push ups med benopptrekk 2', 'St p tr og strake armer. Fr det ene kneet opp mot samme sides albue og beveg rolig tilbake, gjenta med motsatt sides ben. By deretter i albuene og senk brystet ned mot gulvet. Skyv deg opp til utgangsposisjon.', 10706, 2009523, 4, 'https://exorlive.com/media_8630@50.50.media', 'https://exorlive.com/video/?ex=8630'),
(458, 7, 3131, '"Dobbelthake" 2', 'Ligg p ryggen. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000244, 2005930, 1, 'https://exorlive.com/media_3131@50.50.media', 'https://exorlive.com/video/?ex=3131'),
(459, 7, 793, 'Knestende framoverrulle m/ball 2', 'St p knrne og sttt underarmene p ballen. Lag "flat mage", rull framover samtidig som du srger for  holde nytralstilingen og unng  overstrekke i ryggen. Vend tilbake til utgangsstillingen fr belastningen overstiger den styrken du har.', 1523, 2004780, 6, 'https://exorlive.com/media_793@50.50.media', 'https://exorlive.com/video/?ex=793'),
(460, 7, 3110, 'Firfotstende posisjon "rygg"', 'St p alle fire. Lft hodet slik at det er i forlengelse av overkroppen. Press den vre del av ryggen opp mot taket slik at du unngr  "henge" i skulderpartiet. Trekk deretter haken inn samtidig som du forsker  gjre nakken lngre. Dette er nakkens nytralstilling. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Hold stillingen mens du puster normalt i 10-30 sek.', 1000224, 2005967, 3, 'https://exorlive.com/media_3110@50.50.media', 'https://exorlive.com/video/?ex=3110'),
(461, 7, 8529, 'TRX Medium Row', 'St p gulvet med hender i TRX, albue 45 grader vinkel ut fra skulder.  Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen. velsen gjres tyngre ved  forandre vinkelen p kroppen i forhold til gulvet.', 10504, 2009354, 4, 'https://exorlive.com/media_8529@50.50.media', 'https://exorlive.com/video/?ex=8529'),
(462, 7, 8560, 'TRX Triceps Press', 'St p gulvet med hender i TRX, armene rett fram foran skulder og hndflatene pekende ned. Senk kroppen ned mot gulvet ved  bye i albue, skyv tilbake til utgangspunktet. Albuen skal peke framover under hele velsen.', 10566, 2009398, 4, 'https://exorlive.com/media_8560@50.50.media', 'https://exorlive.com/video/?ex=8560'),
(463, 7, 780, '"Firfot" benlft', 'St p alle fire og finn nytralstillingen i ryggen og bekkenet. Lag "flat mage" og lft det ene benet til det er i forlengelse av resten av kroppen. Gjenta med det andre benet.', 1621, 2004770, 2, 'https://exorlive.com/media_780@50.50.media', 'https://exorlive.com/video/?ex=780'),
(464, 7, 6233, 'Stende knelft 3', 'Legg all tyngden over p ett ben. Finn balansen og lft det motsatte kneet. Stabiliser i mage og rygg og unng bevegelse i korsryggen. Senk kneet rolig ned og gjenta med motsatt ben.', 6100, 2007630, 2, 'https://exorlive.com/media_6233@50.50.media', 'https://exorlive.com/video/?ex=6233'),
(465, 7, 8553, 'TRX Roll Out', 'St p gulvet med hender i TRX, armene fram foran kroppen med en lett framoverlent. Senk kroppen ned mot gulvet mens armene kommer opp over hodet  til ret. Skyv tilbake til utgangspunktet med en strak kropp.', 10552, 2009388, 4, 'https://exorlive.com/media_8553@50.50.media', 'https://exorlive.com/video/?ex=8553'),
(466, 7, 7466, 'Stabilisering av rygg m/slynge 2', 'St oppreist og hold i slyngene med strake armer. Len deg framover og stabilisr samtidig i korsyggen.', 7754, 2005873, 4, 'https://exorlive.com/media_7466@50.50.media', 'https://exorlive.com/video/?ex=7466'),
(467, 7, 9247, 'Kombinert planke og sideplanke', 'St p gulvet p tr og albuer. Aktiver magemuskulaturen og hold en rett linje gjennom hele kroppen. Hold stillingen. Roter deretter hele kroppen rundt s du ligger p siden med albue og tr i gulvet. Strekk den andre armen opp mot taket. Hold stillingen. Kom deretter ned i vanlig planke igjen.', 11843, 2011059, 5, 'https://exorlive.com/media_9247@50.50.media', 'https://exorlive.com/video/?ex=9247'),
(468, 7, 8490, 'TRX Hip Press', 'Ligg p ryggen med helene festet i TRX, setet i gulvet og 90 grader i kneet. Hev bekkenet opp fra gulvet til hoften er rett, behold 90 grader i kneet under hele velsen.', 10426, 2009394, 3, 'https://exorlive.com/media_8490@50.50.media', 'https://exorlive.com/video/?ex=8490'),
(469, 7, 8584, 'Glidende utfall til siden', 'Fest blikket p et punkt foran deg, trekk inn magen, plasser den ene foten p matten og skli rett ut til  siden. Press setet mot gulvet, stram magen og dra benet tilbake til utgangpunktet.', 10614, 2009466, 4, 'https://exorlive.com/media_8584@50.50.media', 'https://exorlive.com/video/?ex=8584'),
(470, 7, 8506, 'TRX Atomic Push Up', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Senk brystet ned mot gulvet og trekk begge knr inn mot albue, nr du kommer opp, til det er 90 grader i hofteleddet. velsen kan ogs gjres med opptrekk av bena samtidig som du skyver overkroppen opp.', 10458, 2009529, 5, 'https://exorlive.com/media_8506@50.50.media', 'https://exorlive.com/video/?ex=8506'),
(471, 7, 795, '"Broen" p en ball', 'Ligg med den verste delen av ryggen p ballen. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og lft bekkenet opp til vannrett posisjon. Senk langsomt tilbake og gjenta.', 1520, 2004907, 1, 'https://exorlive.com/media_795@50.50.media', 'https://exorlive.com/video/?ex=795'),
(472, 7, 8351, 'Eksentrisk ettbens kneby', 'St p gulvet med cirka hoftebreddes avstand mellom bena. Knr og tr peker rett frem. Lft opp det ene benet. Gjr en kneby p ett ben og press opp med begge bena.', 10042, 2007974, 4, 'https://exorlive.com/media_8351@50.50.media', 'https://exorlive.com/video/?ex=8351'),
(473, 7, 8622, 'Planken med enarms roing', 'St i plankestilling p tr og strake armer med en hantel i hver hnd. By i albuen og trekk armen oppover og bakover. Senk rolig ned og gjenta med den andre armen. Hold strak kropp under hele velsen.', 10690, 2009431, 5, 'https://exorlive.com/media_8622@50.50.media', 'https://exorlive.com/video/?ex=8622'),
(474, 7, 5620, 'Korrekt sittestilling p en ball', 'Velg en ball som er s stor at du sitter i riktig hyde, dvs at hoften er hyere enn knrne. Rett deg opp, slapp av i skuldrene og trekk hodet litt tilbake. Vipp bekkenet litt fram slik at korsryggen svaier naturlig og bekkenet er i midtstilling. Forsk  holde denne stillingen mens du f.eks arbeider eller sitter foran fjernsynet.', 5482, 2007771, 1, 'https://exorlive.com/media_5620@50.50.media', 'https://exorlive.com/video/?ex=5620'),
(475, 7, 3277, 'Ettbens thev', 'St p ett ben. Lft hlen og press opp til tstende. Hold stillingen i 10-15 sek. Hold blikket framover og unng  kikke ned mens du gjr velsen. velsen kan gjres vanskeligere ved at du lukker ynene.', 1000490, 2004087, 4, 'https://exorlive.com/media_3277@50.50.media', 'https://exorlive.com/video/?ex=3277'),
(476, 7, 8107, 'Sideliggende bekkenhev', 'Ligg p siden med rette ben og sttt deg p albuen. Lag "flat mage" og hev bekkenet til kroppen er strak.', 8883, 2007605, 3, 'https://exorlive.com/media_8107@50.50.media', 'https://exorlive.com/video/?ex=8107'),
(477, 7, 828, '"Crawl" ben- og armlft m/pute', 'Ligg p magen med sttte under bekkenet f.eks en tykk pute. Lag "bekkenvipp bak" og "flat mage" og lft den ene armen og det motsatte benet opp fra gulvet.', 1625, 2007682, 3, 'https://exorlive.com/media_828@50.50.media', 'https://exorlive.com/video/?ex=828'),
(478, 7, 8533, 'TRX High Row (tung)', 'St p gulvet med hender i TRX, flytt bena mot ankerpunktet slik at du har 45 grader vinkel i forhold til gulvet. Trekk overkroppen opp med albue rett ut fra skulder. velsen gjres tyngre ved  plassere bena nrmere ankerpunktet.', 10512, 2009379, 5, 'https://exorlive.com/media_8533@50.50.media', 'https://exorlive.com/video/?ex=8533'),
(479, 7, 8382, 'Kneby p BOSU opp ned', 'Snu BOSU-en opp ned. Stell deg p BOSU`en med cirka hoftebreddes avstand mellom bena og hoftetak med hendene. Gjr en kneby ned til 90 grader og returner til startstilling.', 10225, 2008548, 5, 'https://exorlive.com/media_8382@50.50.media', 'https://exorlive.com/video/?ex=8382'),
(480, 7, 5262, 'Ettbens setelft  i slynge 1', 'Ligg p ryggen med en slynge rundt det ene kneet. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke hoften og kneet p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt i sluttstillingen. Fr rolig tilbake til utgangsstillingen.', 4882, 2004871, 3, 'https://exorlive.com/media_5262@50.50.media', 'https://exorlive.com/video/?ex=5262'),
(481, 49, 603, 'Kneby 1', 'St med fttene i skulderbreddes avstand. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1098, 2004625, 2, 'https://exorlive.com/media_603@50.50.media', 'https://exorlive.com/video/?ex=603'),
(482, 49, 524, 'Diagonalhev p en ball', 'Ligg p magen p ballen. Lft den ene armen og det motsatte ben til de er i forlengelse av kroppen. Lft deretter motsatt ben og arm.', 754, 2004902, 3, 'https://exorlive.com/media_524@50.50.media', 'https://exorlive.com/video/?ex=524'),
(483, 49, 601, 'Utfall fram 1', 'St med samlede ben og sett armene i siden. Lft det ene benet, og fall framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1095, 2004624, 3, 'https://exorlive.com/media_601@50.50.media', 'https://exorlive.com/video/?ex=601'),
(484, 49, 489, 'Knelft p en ball', 'St p hendene med fttene p ballen. Forsk  rulle ballen mot deg ved  trekke knrne opp mot brystet. Stram godt opp i mage- og korsryggregionen under bevegelsen.', 987, 2004898, 6, 'https://exorlive.com/media_489@50.50.media', 'https://exorlive.com/video/?ex=489'),
(485, 49, 8016, 'Firefotstende diagonalstrekk', 'St p alle fire p en matte. Hold ryggen rett under hele velsen. Strekk motsatt arm og ben samtidig. Gjenta med motsatt side.', 8831, 2007420, 4, 'https://exorlive.com/media_8016@50.50.media', 'https://exorlive.com/video/?ex=8016'),
(486, 49, 7253, 'BOSU: Kneby', 'St med parallelle ftter med litt avstand p toppen av BOSU-en. By i knr og hofter og sving armene fram foran kroppen. Pass p  holde ryggen rett og at nakken er i en naturlig forlengelse av ryggen. Se p skr ned og framover. Pass ogs p  ha kne over t. Fr armene tilbake samtidig som du strekker deg tilbake til utgangsstillingen.', 7328, 2005377, 4, 'https://exorlive.com/media_7253@50.50.media', 'https://exorlive.com/video/?ex=7253'),
(487, 49, 605, 'Ettbens kneby 1', 'St p ett ben. Det passive ben kan eventuelt settes bak det andre og kun sttte bevegelsen. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram. Gjenta med motsatt ben.', 1103, 2004627, 4, 'https://exorlive.com/media_605@50.50.media', 'https://exorlive.com/video/?ex=605'),
(488, 49, 8329, 'Utfall m/ bakre ben p stol', 'St p ett ben med knr og tr pekende rett frem. Sett en stol ca 1 meter bak deg og plasser motsatt ben p stolen. Gjr en kneby og vr ppasselig med  holde kne over t under hele velsen.', 9995, 2007978, 4, 'https://exorlive.com/media_8329@50.50.media', 'https://exorlive.com/video/?ex=8329'),
(489, 49, 407, 'Thev p en benk el. et trappetrinn', 'St p kanten av et trappetrinn eller en benk, slik at hlene er fri. Ha ca. hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1676, 2004352, 3, 'https://exorlive.com/media_407@50.50.media', 'https://exorlive.com/video/?ex=407'),
(490, 49, 602, 'Splitt 1', 'St med med hendene i siden. Plasser det aktive benet et godt stykke foran det andre. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram under hele bevegelsen. Gjenta med motsatt ben.', 1097, 2007224, 3, 'https://exorlive.com/media_602@50.50.media', 'https://exorlive.com/video/?ex=602'),
(491, 49, 600, 'Utfall til siden 1', 'St med samlede ben og sett armene i siden. Fr det aktive benet ut og legg tyngden av kroppen over til denne siden. Nr foten treffer gulvet bremses bevegelsen. Ved sluttstilling er det aktive ben byd, og standbenet er tilnrmet strakt. Returner hurtig til startstillingen.', 1092, 2004623, 3, 'https://exorlive.com/media_600@50.50.media', 'https://exorlive.com/video/?ex=600'),
(492, 49, 8167, 'Diagonal hndstende planke', 'St p trne og strake armer. Vr ppasslig med  holde ryggen rett. Hold balansen mens du lfter og strekker motsatt arm og ben.', 9231, 2008003, 5, 'https://exorlive.com/media_8167@50.50.media', 'https://exorlive.com/video/?ex=8167'),
(493, 49, 8638, 'Dragen', 'St p ett ben. Len overkroppen fremover samtidig som benet du ikke str p beveges bakover. Stopp bevegelsen nr kroppen er i en rett linje. Armene strekkes ned mot gulvet. Kom deretter tilbake til stende posisjon, lft kneet opp til du har ca nitti grader i hoften, Beveg armene opp mot taket og g opp p t p benet du str p. Kom rolig tilbake til utgangsstilling.', 10737, 2009811, 4, 'https://exorlive.com/media_8638@50.50.media', 'https://exorlive.com/video/?ex=8638'),
(494, 49, 5219, 'Liggende kroppsheving i slynge', 'Ligg p ryggen med strake armer framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Lft overkroppen ved bde  bye i albuene og trekke skulderbladene mot hverandre slik at brystkassen presses fram. Fr rolig tilbake til utgangsstillingen.', 4799, 2004850, 4, 'https://exorlive.com/media_5219@50.50.media', 'https://exorlive.com/video/?ex=5219'),
(495, 49, 521, 'Rygghev p en ball 3', 'Ligg med overkroppen og hoftene p ballen og la armene henge ned mot gulvet. Stram opp i magen, i korsryggen og lft overkroppen i en rolig bevegelse. Til sist i bevegelsen er kroppen tilnrmet strak og armene holdes strukket over hodet.', 755, 2004901, 3, 'https://exorlive.com/media_521@50.50.media', 'https://exorlive.com/video/?ex=521'),
(496, 49, 7250, 'BOSU: Stasjonrt utfall', 'Sett en fot p toppen av BOSU-en og plasser den andre foten et godt steg tilbake. By i knrne og senk kroppen ned og litt framover. Pass p at du har knr over tr. Strekk opp igjen til utgangsstillingen og gjenta.', 7322, 2005374, 5, 'https://exorlive.com/media_7250@50.50.media', 'https://exorlive.com/video/?ex=7250'),
(497, 49, 3262, 'Thev 1', 'St p gulvet med ca hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1000465, 2004072, 1, 'https://exorlive.com/media_3262@50.50.media', 'https://exorlive.com/video/?ex=3262'),
(498, 49, 8168, 'Planken med utoverfring av annenhvert ben', 'St med sttte p albuene og trne. Vr ppasselig med  holde ryggen rett under hele velsen. Fr det ene benet ut til siden og inn igjen.Bytt ben og gjenta.', 9233, 2008052, 4, 'https://exorlive.com/media_8168@50.50.media', 'https://exorlive.com/video/?ex=8168'),
(499, 49, 3323, 'Balansepute: kneby', 'St p balanseputen. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1000576, 2004133, 2, 'https://exorlive.com/media_3323@50.50.media', 'https://exorlive.com/video/?ex=3323'),
(500, 49, 9030, 'Steg opp med knelft', 'G opp p en step/trinn med venstre ben og lft kneet p hyre ben hyt opp. Sett s hyre ben ned p gulvet og deretter venstre. Gjenta velsen, men n med hyre ben frst opp p stepen/trinnet.', 11425, 2010905, 2, 'https://exorlive.com/media_9030@50.50.media', 'https://exorlive.com/video/?ex=9030'),
(501, 49, 8307, 'Ettbens setelft p ball m/utoverfring', 'Ligg p ryggen p en matte med armene ned langs siden. Hold begge bena strake. Plasser det ene benet p ballen og hold det andre benet parallelt i luften. Lft setet opp i luften s hele kroppen er strak. Fr det benet som er i luften rolig ut til siden og tilbake igjen. Senk deg s ned p matten.', 9952, 2008027, 5, 'https://exorlive.com/media_8307@50.50.media', 'https://exorlive.com/video/?ex=8307'),
(502, 49, 5621, 'Sittende bekkenvipp p en stor ball', 'Sitt p ballen med en god og stabil holdning. Hold bekkenet i midtstillingen. Vipp bekkenet fram slik at korsryggen svaier. Deretter vippes bekkenet rolig bakover slik at svaien nederst i ryggen rettes ut. Vend tilbake til midtstillingen og gjenta.', 5436, 2007803, 1, 'https://exorlive.com/media_5621@50.50.media', 'https://exorlive.com/video/?ex=5621'),
(503, 49, 8829, 'Box jump', 'Start stende med en boks fremfor deg. Gjr et hopp opp p boksen og land med 3/4 deler av foten inne p boksen. Forlat boksen ved  strekke i hoftene. Kroppen skal vre helt strak over bokshyde fr du treffer bakken og gjennomfrer et nytt hopp. Forsk  ha s kort kontakttid i bakken som mulig.', 11118, 2009851, 3, 'https://exorlive.com/media_8829@50.50.media', 'https://exorlive.com/video/?ex=8829'),
(504, 49, 6233, 'Stende knelft 3', 'Legg all tyngden over p ett ben. Finn balansen og lft det motsatte kneet. Stabiliser i mage og rygg og unng bevegelse i korsryggen. Senk kneet rolig ned og gjenta med motsatt ben.', 6100, 2007630, 2, 'https://exorlive.com/media_6233@50.50.media', 'https://exorlive.com/video/?ex=6233'),
(505, 49, 8351, 'Eksentrisk ettbens kneby', 'St p gulvet med cirka hoftebreddes avstand mellom bena. Knr og tr peker rett frem. Lft opp det ene benet. Gjr en kneby p ett ben og press opp med begge bena.', 10042, 2007974, 4, 'https://exorlive.com/media_8351@50.50.media', 'https://exorlive.com/video/?ex=8351'),
(506, 49, 5620, 'Korrekt sittestilling p en ball', 'Velg en ball som er s stor at du sitter i riktig hyde, dvs at hoften er hyere enn knrne. Rett deg opp, slapp av i skuldrene og trekk hodet litt tilbake. Vipp bekkenet litt fram slik at korsryggen svaier naturlig og bekkenet er i midtstilling. Forsk  holde denne stillingen mens du f.eks arbeider eller sitter foran fjernsynet.', 5482, 2007771, 1, 'https://exorlive.com/media_5620@50.50.media', 'https://exorlive.com/video/?ex=5620'),
(507, 49, 3277, 'Ettbens thev', 'St p ett ben. Lft hlen og press opp til tstende. Hold stillingen i 10-15 sek. Hold blikket framover og unng  kikke ned mens du gjr velsen. velsen kan gjres vanskeligere ved at du lukker ynene.', 1000490, 2004087, 4, 'https://exorlive.com/media_3277@50.50.media', 'https://exorlive.com/video/?ex=3277'),
(508, 49, 8382, 'Kneby p BOSU opp ned', 'Snu BOSU-en opp ned. Stell deg p BOSU`en med cirka hoftebreddes avstand mellom bena og hoftetak med hendene. Gjr en kneby ned til 90 grader og returner til startstilling.', 10225, 2008548, 5, 'https://exorlive.com/media_8382@50.50.media', 'https://exorlive.com/video/?ex=8382'),
(509, 49, 3296, 'Firfotstende diagonalhev p en matte', 'Rull matten sammen i begge ender. St p alle fire, slik at armene og knrne er plassert p de sammenrullede endene av matten. Spenn opp i mage- og korsryggsregionen og lft og strekk vekselvis motsatt arm og ben.', 1000526, 2004104, 4, 'https://exorlive.com/media_3296@50.50.media', 'https://exorlive.com/video/?ex=3296'),
(510, 49, 3314, 'Balansepute: utfall fram', 'St med samlede ben i god avstand fra balanseputen. Lft det ene benet og fall framover mot balanseputen. Nr foten treffer balanseputen, bremser du bevegelsen og stopper nr kneet er ca 90 grader og kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1000560, 2004123, 5, 'https://exorlive.com/media_3314@50.50.media', 'https://exorlive.com/video/?ex=3314'),
(511, 49, 3307, 'Balansepute: hold balansen', 'St p balanseputen og forsk  holde balansen. Gjr evt. velsen vanskeligere ved  dreie hodet og se i forskjellige retninger elller ved  lukke ynene.', 1000550, 2004115, 1, 'https://exorlive.com/media_3307@50.50.media', 'https://exorlive.com/video/?ex=3307'),
(512, 49, 8663, 'Balanse thev p matte', 'St p en matte med fttene helt inntil hverandre. G opp p t, senk rolig ned igjen.', 10787, 2009853, 2, 'https://exorlive.com/media_8663@50.50.media', 'https://exorlive.com/video/?ex=8663'),
(513, 49, 3313, 'Balansepute: ettbens balanse m/kneby', 'St p balanseputen og hold balansen. Lft det ene benet og by kneet, mens du holder balansen p det andre benet, s lenge du klarer. Gjenta velsen med det andre benet.', 1000558, 2004122, 2, 'https://exorlive.com/media_3313@50.50.media', 'https://exorlive.com/video/?ex=3313'),
(514, 49, 468, 'Ryggliggende bekkenlft p en ball', 'Legg deg slik at kun skuldrene og den verste delen av ryggen berrer ballen. Ha byde knr. Knip setet sammen og lft bekkenet. Hold i 3-5 sek. Hvil tilsvarende.', 954, 2004890, 3, 'https://exorlive.com/media_468@50.50.media', 'https://exorlive.com/video/?ex=468'),
(515, 49, 449, 'Vippebrett: hold balansen 1', 'St p vippebrettet og forsk  holde balansen. Prv  unng at kanten av brettet berrer gulvet. velsen er enklere desto strre avstand du har mellom fttene.', 770, 2004386, 2, 'https://exorlive.com/media_449@50.50.media', 'https://exorlive.com/video/?ex=449'),
(516, 49, 3324, 'Balansepute: ettbens kneby', 'St p balanseputen. Lft den ene foten og hold balansen p ett ben. By s langt ned i \nkneet som du klarer og press opp igjen. Hold ryggen rett og blikket fram.', 1000578, 2004134, 5, 'https://exorlive.com/media_3324@50.50.media', 'https://exorlive.com/video/?ex=3324'),
(517, 49, 655, 'Sittende diagonal kne- og armlft p en ball', 'Sitt p ballen med rett rygg og lft det ene benet og den motsatte armen. Forsk  holde balansen. Gjenta med motsatt arm og ben.', 1199, 2004677, 1, 'https://exorlive.com/media_655@50.50.media', 'https://exorlive.com/video/?ex=655'),
(518, 49, 3268, 'St p ett ben 1', 'St p ett ben, med lett by i kneet og rett rygg. Forestill deg at det blser og at du svaier som et str i vinden. Forsk  st slik til du blir trtt i benet. velsen kan gjres vanskeligere ved at du lukker ynene.', 1000474, 2004077, 2, 'https://exorlive.com/media_3268@50.50.media', 'https://exorlive.com/video/?ex=3268');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(519, 49, 8169, 'Planken med utoverfring av ben', 'St med sttte p albuene og trne. Vr ppasselig med  holde ryggen rett under hele velsen. Fr det benet ut til siden igjen.', 9235, 2008099, 4, 'https://exorlive.com/media_8169@50.50.media', 'https://exorlive.com/video/?ex=8169'),
(520, 49, 3309, 'Balansepute: ettbens balanse m/knelft', 'St p balanseputen og hold balansen. Lft det ene kneet slik at du balanserer p ett ben. Hold balansen s lenge du klarer. Sttt deg gjerne mot noe i starten.', 1000553, 2004117, 2, 'https://exorlive.com/media_3309@50.50.media', 'https://exorlive.com/video/?ex=3309'),
(521, 49, 3299, 'Ryggliggende bekkenlft m/knestrekk p en ball', 'Legg deg forsiktig bakover p ballen, slik at kun skuldrene og den verste delen av ryggen hviler p den. Spenn opp i sete- og lrmuskulaturen og lft bekkenet slik at du ligger vannrett. Strekk benene vekselvis i 10-15 sek. Hvil tilsvarende og gjenta velsen.', 1000540, 2007696, 4, 'https://exorlive.com/media_3299@50.50.media', 'https://exorlive.com/video/?ex=3299'),
(522, 49, 3287, 'Kneby p en matte 1', 'Fold matten 3-4 ganger. St p matten med fttene i ca. skulderbreddes avstand. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1000511, 2005933, 3, 'https://exorlive.com/media_3287@50.50.media', 'https://exorlive.com/video/?ex=3287'),
(523, 49, 7259, 'BOSU: Balanse 3', 'St midt opp BOSU-en. Lft det ene kneet og hold balansen noen sekunder fr setter foten ned igjen. Gjenta annethvert ben.', 7339, 2005383, 4, 'https://exorlive.com/media_7259@50.50.media', 'https://exorlive.com/video/?ex=7259'),
(524, 49, 473, 'Sittende balanse p en ball 2', 'Sett deg p ballen, lft fttene fra gulvet og forsk  holde balansen. Du kan eventuelt sttte deg med den ene hnden mot en vegg og kontrollere bevegelsesretningen.', 947, 2004403, 2, 'https://exorlive.com/media_473@50.50.media', 'https://exorlive.com/video/?ex=473'),
(525, 49, 7258, 'BOSU: Ettbens kneby 1', 'St p en fot litt framp BOSU-en. By i kne og hofteledd til du har ca. 90 grader i knrne. Strekk s opp igjen til utgangsstillingen. Vr nye med  ha kne over t.', 7338, 2005382, 6, 'https://exorlive.com/media_7258@50.50.media', 'https://exorlive.com/video/?ex=7258'),
(526, 49, 7211, 'BOSU: Firfotstende diagonal arm- og benstrekk', 'St p alle fire p BOSU-en. Stabiliser mage- og korsryggregionen. Strekk vekselvis den ene armen og det motsatte benet til de er i forlengelse av kroppen. Hold noen sekunder fr du vender tilbake til utgangsstillingen og gjentar til motsatt side. Pass p  holde korsryggen i nytralstilling under hele velsen.', 7249, 2005338, 5, 'https://exorlive.com/media_7211@50.50.media', 'https://exorlive.com/video/?ex=7211'),
(527, 49, 8318, 'Ettbens balanse p pute (byd kne)', 'St p en en pute eller brett en matte og st p den. St p ett ben med litt by i kneet. Hold det andre benet i luften og hold hoftetak med hendene. Vr ppasselig med  holde kne over t og forsk  hold balansen.', 9973, 2008005, 2, 'https://exorlive.com/media_8318@50.50.media', 'https://exorlive.com/video/?ex=8318'),
(528, 49, 8313, 'Oppsteg p trinn med benlft 1', 'Sett ett ben p kassen som str foran deg. Vr ppasselig med at kne og t peker rett frem i samme retning. Legg all vekten p det benet som str p trinnet. Lft deg opp med det benet som str p trinnet. Stram forsiden av lr og setet slik at du strekker ut det benet du str p. Motsatt ben lftes opp i by. Senk deg rolig ned igjen og gjenta med samme ben.', 9963, 2008067, 3, 'https://exorlive.com/media_8313@50.50.media', 'https://exorlive.com/video/?ex=8313'),
(529, 49, 450, 'Vippebrett: ettbens balanse 1', 'St med ett ben p vippebrettet og forsk  holde balansen. k vanskelighetsgraden ved  bevege det andre benet. Gjenta velsen med det andre benet.', 771, 2004387, 4, 'https://exorlive.com/media_450@50.50.media', 'https://exorlive.com/video/?ex=450'),
(530, 49, 456, 'Vippebrett: kneby', 'St p vippebrettet og forsk  holde balansen mens du utfrer kneby til 90 grader i knrne. Du kan alternativt holde den dype stillingen noen sekunder. Under utfrelsen kan du forske  holde nytralstillingen i ryggen og bekkenet og lage "flat mage".', 1524, 2004392, 5, 'https://exorlive.com/media_456@50.50.media', 'https://exorlive.com/video/?ex=456'),
(531, 49, 8853, 'Singel hopp', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Skuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11166, 2009711, 2, 'https://exorlive.com/media_8853@50.50.media', 'https://exorlive.com/video/?ex=8853'),
(532, 49, 7230, 'BOSU: Liggende bekkenlft med ballen ned 1', 'Snu BOSU-en opp ned. Ligg p ryggen med byde knr, armene langs gulvet og fttene p BOSU-en. Trekk nedre del av magen inn mot ryggen og stram setemuskulaturen. Hold denne spenningen mens du lfter setet og strekker ut i hofteleddet. Prv  hold korsrygg og bekken i nytralstilling. Senk setet ned igjen og finn tilbake til utgangsstillingen.', 7286, 2005357, 3, 'https://exorlive.com/media_7230@50.50.media', 'https://exorlive.com/video/?ex=7230'),
(533, 49, 3041, '"Kne mot albue" p en ball 1', 'Sitt litt framme p ballen med rett rygg og avslappede skuldre. Forsk  vekselvis lfte det ene kneet i retning av motsatt albue, samtidig som du svinger den samsidige armen bakover. Gjr dette i 1-2 minutt.', 1000070, 2003950, 2, 'https://exorlive.com/media_3041@50.50.media', 'https://exorlive.com/video/?ex=3041'),
(534, 49, 7251, 'BOSU: Balanse 1', 'St med parallelle ftter med litt avstand p toppen av BOSU-en. Skyv tyngden framover p trne, tilbake p hlene og sideveis. Kan gjres med lukkede yne for  ke vanskelighetsgraden.', 7324, 2005375, 2, 'https://exorlive.com/media_7251@50.50.media', 'https://exorlive.com/video/?ex=7251'),
(535, 49, 604, 'Dyp thev', 'St i sittestilling med armene foran kroppen. G opp p t og hold stillingen noen sekunder, eller senk tilbake med det samme. Gjenta flere ganger mens du holder sittestillingen.', 1677, 2004626, 5, 'https://exorlive.com/media_604@50.50.media', 'https://exorlive.com/video/?ex=604'),
(536, 49, 8370, 'Kneby med glidning til siden', 'St med hoftebreddes avstand mellom bena. Srg for at knr og tr peker rett frem. Ta p deg en ullsokk eller st med en teppebit under den ene foten. La benet gli strakt ut til siden samtidig som du byer det motsatte kneet. Kjenn at du bruker innsiden av lret til  dra benet inn mot midten igjen samtidig som du strekker opp i motsatt ben.', 10080, 2008080, 4, 'https://exorlive.com/media_8370@50.50.media', 'https://exorlive.com/video/?ex=8370'),
(537, 49, 3265, 'Hopp framover', 'St med armene ned langs siden. By i knrne, sving armene litt bakover og hopp framover med samlede ben. Prv  land mykt.', 1000471, 2004074, 2, 'https://exorlive.com/media_3265@50.50.media', 'https://exorlive.com/video/?ex=3265'),
(538, 49, 7234, 'BOSU: Utfall i 4 tellinger', 'St et lite steg bak BOSU-en. Plasser en fot p toppen. Ta en dyp kneby mot BOSU-en, ved at du byer i knrne og senker kroppen ned og litt framover. Pass p at du har knr over tr og rett rygg. Strekk opp igjen og skyv deg tilbake til utgangsstillingen. Foten skal vre p BOSU-en under hele velsen.', 7292, 2005360, 5, 'https://exorlive.com/media_7234@50.50.media', 'https://exorlive.com/video/?ex=7234'),
(539, 49, 3067, 'Store steg m/rotasjon og m/ball 1', 'Hold ballen foran brystet. G fremover med forholdsvis dype og lange skritt, mens du roterer overkroppen fra side til side. Du skal nesten bye ned til 90 grader i det forreste kneet. Hold overkroppen oppreist og blikket frem under hele bevegelsen.', 1000117, 2003969, 5, 'https://exorlive.com/media_3067@50.50.media', 'https://exorlive.com/video/?ex=3067'),
(540, 49, 8623, 'Balansepute: bicepscurl', 'St p en balansepute med hantler i hendene med underhndsgrep. By i albuene og fr hantlene opp mot brystet, senk rolig ned igjen', 10692, 2009501, 3, 'https://exorlive.com/media_8623@50.50.media', 'https://exorlive.com/video/?ex=8623'),
(541, 49, 8321, 'Ettbens kneby 4', 'St p ett ben med knr og tr pekende rett frem.Strekk ut det andre benet og forsk  hold det strakt foran deg under hele velsen. Armene holdes samlet foran kroppen. Gjr en kneby p ett ben. Vr ppasselig med  holde knr over tr under hele velsen.', 9979, 2007893, 4, 'https://exorlive.com/media_8321@50.50.media', 'https://exorlive.com/video/?ex=8321'),
(542, 49, 8521, 'TRX Balance Lunge', 'St p gulvet med hender i TRX og samlede ben, albue rett under skulder. Lft det ene benet i balanse, og fr bakerste kne bakover uten  berre gulvet med benet. Rett ut albue og hold overkroppen over bekkenet. Kom opp i balanse mellom hver repetisjon, velsen utfres p et ben av gangen.', 10488, 2009483, 4, 'https://exorlive.com/media_8521@50.50.media', 'https://exorlive.com/video/?ex=8521'),
(543, 49, 7232, 'BOSU: Liggende bekkenlft', 'Sitt litt foran BOSU-en og len deg bak slik at midtre del av ryggen og hodet hviler mot BOSU-en. Hold armene i kryss p brystet. Trekk nedre del av magen inn mot ryggen og stram setemuskulaturen. Hold denne spenningen mens du lfter setet og strekker ut i hofteleddet. Prv  hold korsrygg og bekken i nytralstilling. Senk setet ned igjen og finn tilbake til utgangsstillingen.', 7289, 2005359, 2, 'https://exorlive.com/media_7232@50.50.media', 'https://exorlive.com/video/?ex=7232'),
(544, 49, 3275, '"Kne mot albue"', 'St med armene ned langs siden. Lft motsatt arm og kne og fr kneet mot albuen. velsen skal utfres langsomt og kontrollert.', 1000487, 2004085, 4, 'https://exorlive.com/media_3275@50.50.media', 'https://exorlive.com/video/?ex=3275'),
(545, 49, 8330, 'Hoppende utfall med bakre fot p stol', 'St p ett ben med knr og tr pekende rett frem. Sett en stol ca 1 meter bak deg og plasser motsatt ben p stolen. By i hofte og kne. Nr du har byd deg helt ned forsker du  hoppe rett opp s hyt du klarer og deretter lande. Vr ppasselig med  holde kne over t under hele velsen.', 9997, 2008073, 4, 'https://exorlive.com/media_8330@50.50.media', 'https://exorlive.com/video/?ex=8330'),
(546, 49, 8844, 'Wallball', 'Start med fttene i skulderbredde avstand. Ballen holdes fremfor og tett inntil kroppen. Sitt ned som i en dyp kneby og g hele veien ned, slik at hoftene er under kneleddet. Ryggen holdes rett gjennom bevegelsen. Fra bunnposisjonen strekkes kroppen opp igjen, og p topp av velsen kastes ballen opp til et gitt punkt p veggen. Ta imot ballen, og g ned i en dyp kneby fr du igjen strekker deg opp og kaster ballen opp p veggen.', 11148, 2009869, 2, 'https://exorlive.com/media_8844@50.50.media', 'https://exorlive.com/video/?ex=8844'),
(547, 49, 3273, 'G sidelengs', 'G sidelengs. Varier gjerne skrittlengden, og srg for at du samler benene helt fr du tar et nytt skritt.', 1000483, 2004083, 1, 'https://exorlive.com/media_3273@50.50.media', 'https://exorlive.com/video/?ex=3273'),
(548, 49, 7231, 'BOSU: Liggende bekkenlft med ballen ned 2', 'Snu BOSU-en opp ned. Ligg p ryggen med byde knr, armene foldet over brystet og fttene p BOSU-en. Trekk nedre del av magen inn mot ryggen og stram setemuskulaturen. Hold denne spenningen mens du lfter setet og strekker ut i hofteleddet. Prv  hold korsrygg og bekken i nytralstilling. Senk setet ned igjen og finn tilbake til utgangsstillingen.', 7287, 2005358, 4, 'https://exorlive.com/media_7231@50.50.media', 'https://exorlive.com/video/?ex=7231'),
(549, 49, 517, 'Splitt p en ball', 'St p ett ben med det andre benet hvilende p ballen. Det aktive ben er plassert et godt stykke foran det andre. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram under hele bevegelsen. Bytt ben.', 1340, 2004455, 5, 'https://exorlive.com/media_517@50.50.media', 'https://exorlive.com/video/?ex=517'),
(550, 49, 3321, 'Balansepute: stende benspark m/strikk', 'St p balanseputen med strikken festet rundt den ene ankelen. Hold balansen mens du byer i bde kne og hofte p det aktive benet. Utfr et benspark slik at du strekker kneet maksimalt. Gjenta velsen med det andre benet.', 1000573, 2004131, 4, 'https://exorlive.com/media_3321@50.50.media', 'https://exorlive.com/video/?ex=3321'),
