(606, 70, 8511, 'TRX Saw', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og albuer i gulvet. Hold kroppen i strak linje, start en bevegelse i skulderleddet hvor kroppen fres fram og tilbake med samlede og strake ben.', 10468, 2009456, 3, 'https://exorlive.com/media_8511@50.50.media', 'https://exorlive.com/video/?ex=8511'),
(607, 70, 8530, 'TRX High Row', 'St p gulvet med hender i TRX, albue rett ut fra skulder.  Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen. velsen gjres tyngre ved  forandre vinkelen p kroppen i forhold til gulvet.', 10506, 2009422, 4, 'https://exorlive.com/media_8530@50.50.media', 'https://exorlive.com/video/?ex=8530'),
(608, 70, 8496, 'TRX Plank', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og knr og albuer i gulvet. Lft knrne av gulvet slik at kroppen blir strak og hold posisjonen.', 10438, 2009339, 4, 'https://exorlive.com/media_8496@50.50.media', 'https://exorlive.com/video/?ex=8496'),
(609, 70, 8105, 'G opp og ned p albuer i planke stillling', 'St p trne og hold overkroppen fiksert p strake armer.  G opp og ned fra/til albuene.', 8879, 2007520, 4, 'https://exorlive.com/media_8105@50.50.media', 'https://exorlive.com/video/?ex=8105'),
(610, 70, 9240, 'Mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Jobb med annenhvert ben.', 11829, 2011275, 4, 'https://exorlive.com/media_9240@50.50.media', 'https://exorlive.com/video/?ex=9240'),
(611, 70, 8505, 'TRX Oblique Crunch', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Trekk begge knr inn mot annenhver side opp mot armene til det er 90 grader i hofteleddet.', 10456, 2009377, 4, 'https://exorlive.com/media_8505@50.50.media', 'https://exorlive.com/video/?ex=8505'),
(612, 70, 3130, '"Dobbelthake" 1', 'velsen kan gjres sittende eller stende. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000245, 2005916, 1, 'https://exorlive.com/media_3130@50.50.media', 'https://exorlive.com/video/?ex=3130'),
(613, 70, 781, 'T og albuestende bro', 'St p tr og albuer og finn nytralstillingen av ryggen og bekken. Lag "flat mage" og st i denne posisjonen i 10-15 sek.', 1497, 2008509, 3, 'https://exorlive.com/media_781@50.50.media', 'https://exorlive.com/video/?ex=781'),
(614, 70, 9259, 'Bekkenhev m/stang', 'Ligg p ryggen med byde ben og hold en vektstang over hoftene. Aktiver magemuskulaturen og lft setet opp fra gulvet til du har en rett linje mellom skulder og kne. Hold noen sekunder p toppen og senk rolig tilbake til utgangsstilling.', 11867, 2011038, 4, 'https://exorlive.com/media_9259@50.50.media', 'https://exorlive.com/video/?ex=9259'),
(615, 70, 818, 'Sideliggende bekkenhev 3', 'Ligg p siden med byde knr og sttte mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1610, 2004793, 2, 'https://exorlive.com/media_818@50.50.media', 'https://exorlive.com/video/?ex=818'),
(616, 70, 8558, 'TRX Biceps Curl', 'St p gulvet med hender i TRX, hndflatene opp. Len deg tilbake til armene er rette. By albuen og trekk kroppen opp til hendene kommer opp til hver sin side av hodet. Albuene skal peke rett framover under hele velsen.', 10562, 2009390, 4, 'https://exorlive.com/media_8558@50.50.media', 'https://exorlive.com/video/?ex=8558'),
(617, 70, 9241, 'Dynamisk mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Dette gjres i en dynamisk bevegelse. Jobb med annenhvert ben og k tempoet i forhold til nsket intensitet.', 11831, 2011269, 4, 'https://exorlive.com/media_9241@50.50.media', 'https://exorlive.com/video/?ex=9241'),
(618, 70, 785, '"Broen" ettbenslft 2', 'Ligg med et godt grep om det ene lret. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1501, 2007249, 4, 'https://exorlive.com/media_785@50.50.media', 'https://exorlive.com/video/?ex=785'),
(619, 70, 8491, 'TRX Hamstring Curl og Hip Press', 'Ligg p ryggen med setet i gulvet og begge helene i TRX. Trekk helene inn mot setet samtidig som du hever bekkenet opp fra gulvet til hoften er rett og kneet har 90 grader.', 10428, 2009409, 4, 'https://exorlive.com/media_8491@50.50.media', 'https://exorlive.com/video/?ex=8491'),
(620, 70, 7192, 'BOSU: Planken 1', 'Plasser underarmene p BOSU-en, sett trne i gulvet og hold kroppen strak. Hold bekken og korsrygg i nytralstilling og nakken i en naturlig forlengelse av ryggen. Se ned i gulvet. Hold stillingen s lenge du klarer. Sett knrne i gulvet og ta en pause fr du gjentar velsen.', 7213, 2005319, 4, 'https://exorlive.com/media_7192@50.50.media', 'https://exorlive.com/video/?ex=7192'),
(621, 70, 8534, 'TRX Chest Press (medium)', 'St p gulvet med hender i TRX, armener foran kroppen rett ut fra skulder. By albue til 90 grader og senk overkroppen mot gulvet, press tilbake til utgangspunktet med en strak kropp.', 10514, 2009406, 3, 'https://exorlive.com/media_8534@50.50.media', 'https://exorlive.com/video/?ex=8534'),
(622, 70, 6641, 'Transversus/Korsett aktivering 2', 'Ligg p ryggen med fttene i gulvet. Plasser hendene p magen, den ene under og den andre over navlen. Aktiver muskelkorsettet ved   trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, uten at den verste hnden beveger seg. Spenn bekkenbunnen samtidig.', 6638, 2008538, 1, 'https://exorlive.com/media_6641@50.50.media', 'https://exorlive.com/video/?ex=6641'),
(623, 70, 8493, 'TRX Pike', 'Plasser begge ftter i TRX og hender i gulvet. Trekk fttene inn mot armene samtidig som du hever setet og holder bena rette. Hodet kommer inn mellom hendene.', 10432, 2009383, 3, 'https://exorlive.com/media_8493@50.50.media', 'https://exorlive.com/video/?ex=8493'),
(624, 70, 790, 'Push up mot benk', 'St i push up stilling mot en benk. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekken. Lag "flat mage", senk overkroppen mot benken og press tilbake.', 1512, 2004778, 3, 'https://exorlive.com/media_790@50.50.media', 'https://exorlive.com/video/?ex=790'),
(625, 70, 5021, 'Brystpress m/bredt grep i slynge 2', 'St med trne i gulvet og sttt deg i stroppene med strake armer. Ha en slynge i hver hnd. Skyt rygg. Stabilisr i mage og korsrygg. Senk kroppen ved  fre albuene rett ut til siden samtidig som du byer dem. Press rolig tilbake ved  fre armene sammen foran kroppen igjen.', 4779, 2004846, 4, 'https://exorlive.com/media_5021@50.50.media', 'https://exorlive.com/video/?ex=5021'),
(626, 70, 779, '"Broen" m/benspark', 'Plasser fotslene p gulvet og armene ut til siden. Fra den broliggende posisjonen, med "flat mage" og "bekkenvipp bak" utfrer du langsomme benspark. Lrene skal hele tiden vre parallelle.', 1495, 2004769, 4, 'https://exorlive.com/media_779@50.50.media', 'https://exorlive.com/video/?ex=779'),
(627, 70, 5284, 'Hofte fleksjon i slynge 4', 'St p albuene med en slynge plassert omkring hver ankel. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4924, 2004499, 3, 'https://exorlive.com/media_5284@50.50.media', 'https://exorlive.com/video/?ex=5284'),
(628, 70, 8502, 'TRX Push Up', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet.Hold overkropp og ben strake under utfrsel av hele velsen. By albuene og senk overkroppen ned mot gulvet og skyv tilbake til utgangsposisjon.', 10450, 2009526, 4, 'https://exorlive.com/media_8502@50.50.media', 'https://exorlive.com/video/?ex=8502'),
(629, 70, 8498, 'TRX Side Plank (elbow)', 'Plasser begge ftter i TRX, med det verste benet foran det andre, med siden til ankerpunktet. Albuen plasserer du rett under skulder. Lft hoften opp fra gulvet slik at kroppen blir strak og hold posisjonen.', 10442, 2009450, 4, 'https://exorlive.com/media_8498@50.50.media', 'https://exorlive.com/video/?ex=8498'),
(630, 70, 800, '"Vandring" p en ball', 'Ligg i push up stilling med bekkenet p ballen. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekkenet. Lag "flat mage" og begynn  g p strake armer framover. G tilbake og gjenta.', 1514, 2004910, 3, 'https://exorlive.com/media_800@50.50.media', 'https://exorlive.com/video/?ex=800'),
(631, 70, 8489, 'TRX Hamstring Curl', 'Ligg p ryggen med begge helene festet i TRX. Lft setet over gulvet, trekk helene inn mot setet med et jevnt trykk ned i TRX. Kom tilbake til utgangspunktet.', 10424, 2009488, 3, 'https://exorlive.com/media_8489@50.50.media', 'https://exorlive.com/video/?ex=8489'),
(632, 70, 8494, 'TRX Mountain Climber', 'Plasser begge ftter i TRX og hender i gulvet, med ansiktet fra ankerpunktet. Trekk annenhver fot inn mot armene i stempelbevegelse.', 10434, 2009473, 5, 'https://exorlive.com/media_8494@50.50.media', 'https://exorlive.com/video/?ex=8494'),
(633, 70, 710, 'Liggende diagonal armsving og benspark', 'Ligg p ryggen med 90 graders by i hofter og knr og armene hevet over brystet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Samtidig senker du den ene armen og det motsatte benet.', 1489, 2004719, 5, 'https://exorlive.com/media_710@50.50.media', 'https://exorlive.com/video/?ex=710'),
(634, 70, 8630, 'Push ups med benopptrekk 2', 'St p tr og strake armer. Fr det ene kneet opp mot samme sides albue og beveg rolig tilbake, gjenta med motsatt sides ben. By deretter i albuene og senk brystet ned mot gulvet. Skyv deg opp til utgangsposisjon.', 10706, 2009523, 4, 'https://exorlive.com/media_8630@50.50.media', 'https://exorlive.com/video/?ex=8630'),
(635, 70, 3131, '"Dobbelthake" 2', 'Ligg p ryggen. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000244, 2005930, 1, 'https://exorlive.com/media_3131@50.50.media', 'https://exorlive.com/video/?ex=3131'),
(636, 70, 793, 'Knestende framoverrulle m/ball 2', 'St p knrne og sttt underarmene p ballen. Lag "flat mage", rull framover samtidig som du srger for  holde nytralstilingen og unng  overstrekke i ryggen. Vend tilbake til utgangsstillingen fr belastningen overstiger den styrken du har.', 1523, 2004780, 6, 'https://exorlive.com/media_793@50.50.media', 'https://exorlive.com/video/?ex=793'),
(637, 70, 3110, 'Firfotstende posisjon "rygg"', 'St p alle fire. Lft hodet slik at det er i forlengelse av overkroppen. Press den vre del av ryggen opp mot taket slik at du unngr  "henge" i skulderpartiet. Trekk deretter haken inn samtidig som du forsker  gjre nakken lngre. Dette er nakkens nytralstilling. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Hold stillingen mens du puster normalt i 10-30 sek.', 1000224, 2005967, 3, 'https://exorlive.com/media_3110@50.50.media', 'https://exorlive.com/video/?ex=3110'),
(638, 70, 8529, 'TRX Medium Row', 'St p gulvet med hender i TRX, albue 45 grader vinkel ut fra skulder.  Senk kroppen ned mot gulvet og trekk tilbake til utgangsposisjonen. velsen gjres tyngre ved  forandre vinkelen p kroppen i forhold til gulvet.', 10504, 2009354, 4, 'https://exorlive.com/media_8529@50.50.media', 'https://exorlive.com/video/?ex=8529'),
(639, 70, 8560, 'TRX Triceps Press', 'St p gulvet med hender i TRX, armene rett fram foran skulder og hndflatene pekende ned. Senk kroppen ned mot gulvet ved  bye i albue, skyv tilbake til utgangspunktet. Albuen skal peke framover under hele velsen.', 10566, 2009398, 4, 'https://exorlive.com/media_8560@50.50.media', 'https://exorlive.com/video/?ex=8560'),
(640, 70, 780, '"Firfot" benlft', 'St p alle fire og finn nytralstillingen i ryggen og bekkenet. Lag "flat mage" og lft det ene benet til det er i forlengelse av resten av kroppen. Gjenta med det andre benet.', 1621, 2004770, 2, 'https://exorlive.com/media_780@50.50.media', 'https://exorlive.com/video/?ex=780'),
(641, 70, 8553, 'TRX Roll Out', 'St p gulvet med hender i TRX, armene fram foran kroppen med en lett framoverlent. Senk kroppen ned mot gulvet mens armene kommer opp over hodet  til ret. Skyv tilbake til utgangspunktet med en strak kropp.', 10552, 2009388, 4, 'https://exorlive.com/media_8553@50.50.media', 'https://exorlive.com/video/?ex=8553'),
(642, 70, 7466, 'Stabilisering av rygg m/slynge 2', 'St oppreist og hold i slyngene med strake armer. Len deg framover og stabilisr samtidig i korsyggen.', 7754, 2005873, 4, 'https://exorlive.com/media_7466@50.50.media', 'https://exorlive.com/video/?ex=7466'),
(643, 70, 9247, 'Kombinert planke og sideplanke', 'St p gulvet p tr og albuer. Aktiver magemuskulaturen og hold en rett linje gjennom hele kroppen. Hold stillingen. Roter deretter hele kroppen rundt s du ligger p siden med albue og tr i gulvet. Strekk den andre armen opp mot taket. Hold stillingen. Kom deretter ned i vanlig planke igjen.', 11843, 2011059, 5, 'https://exorlive.com/media_9247@50.50.media', 'https://exorlive.com/video/?ex=9247'),
(644, 70, 8490, 'TRX Hip Press', 'Ligg p ryggen med helene festet i TRX, setet i gulvet og 90 grader i kneet. Hev bekkenet opp fra gulvet til hoften er rett, behold 90 grader i kneet under hele velsen.', 10426, 2009394, 3, 'https://exorlive.com/media_8490@50.50.media', 'https://exorlive.com/video/?ex=8490'),
(645, 70, 8584, 'Glidende utfall til siden', 'Fest blikket p et punkt foran deg, trekk inn magen, plasser den ene foten p matten og skli rett ut til  siden. Press setet mot gulvet, stram magen og dra benet tilbake til utgangpunktet.', 10614, 2009466, 4, 'https://exorlive.com/media_8584@50.50.media', 'https://exorlive.com/video/?ex=8584'),
(646, 70, 8506, 'TRX Atomic Push Up', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Senk brystet ned mot gulvet og trekk begge knr inn mot albue, nr du kommer opp, til det er 90 grader i hofteleddet. velsen kan ogs gjres med opptrekk av bena samtidig som du skyver overkroppen opp.', 10458, 2009529, 5, 'https://exorlive.com/media_8506@50.50.media', 'https://exorlive.com/video/?ex=8506'),
(647, 70, 795, '"Broen" p en ball', 'Ligg med den verste delen av ryggen p ballen. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og lft bekkenet opp til vannrett posisjon. Senk langsomt tilbake og gjenta.', 1520, 2004907, 1, 'https://exorlive.com/media_795@50.50.media', 'https://exorlive.com/video/?ex=795'),
(648, 70, 8622, 'Planken med enarms roing', 'St i plankestilling p tr og strake armer med en hantel i hver hnd. By i albuen og trekk armen oppover og bakover. Senk rolig ned og gjenta med den andre armen. Hold strak kropp under hele velsen.', 10690, 2009431, 5, 'https://exorlive.com/media_8622@50.50.media', 'https://exorlive.com/video/?ex=8622');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(649, 70, 8107, 'Sideliggende bekkenhev', 'Ligg p siden med rette ben og sttt deg p albuen. Lag "flat mage" og hev bekkenet til kroppen er strak.', 8883, 2007605, 3, 'https://exorlive.com/media_8107@50.50.media', 'https://exorlive.com/video/?ex=8107'),
(650, 70, 828, '"Crawl" ben- og armlft m/pute', 'Ligg p magen med sttte under bekkenet f.eks en tykk pute. Lag "bekkenvipp bak" og "flat mage" og lft den ene armen og det motsatte benet opp fra gulvet.', 1625, 2007682, 3, 'https://exorlive.com/media_828@50.50.media', 'https://exorlive.com/video/?ex=828'),
(651, 70, 8533, 'TRX High Row (tung)', 'St p gulvet med hender i TRX, flytt bena mot ankerpunktet slik at du har 45 grader vinkel i forhold til gulvet. Trekk overkroppen opp med albue rett ut fra skulder. velsen gjres tyngre ved  plassere bena nrmere ankerpunktet.', 10512, 2009379, 5, 'https://exorlive.com/media_8533@50.50.media', 'https://exorlive.com/video/?ex=8533'),
(652, 70, 5262, 'Ettbens setelft  i slynge 1', 'Ligg p ryggen med en slynge rundt det ene kneet. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke hoften og kneet p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt i sluttstillingen. Fr rolig tilbake til utgangsstillingen.', 4882, 2004871, 3, 'https://exorlive.com/media_5262@50.50.media', 'https://exorlive.com/video/?ex=5262'),
(653, 70, 783, 'Kneby stabilitet', 'St oppreist og finn nytralstillingen i ryggen og bekken. Lag "flat mage" og by i knrne til du er i sittestilling. Press opp igjen og gjenta.', 1502, 2004772, 2, 'https://exorlive.com/media_783@50.50.media', 'https://exorlive.com/video/?ex=783'),
(654, 70, 805, 'Liggende bekkenvipp', 'Ligg p ryggen med fotslene p gulvet. Hold bekkenet i midtstillingen. Vipp bekkenet fram slik at korsryggen svaier. Deretter vippes bekkenet bakover slik at svaien nederst i ryggen rettes ut. Vend tilbake til midtstillingen og gjenta.', 1508, 2007686, 3, 'https://exorlive.com/media_805@50.50.media', 'https://exorlive.com/video/?ex=805'),
(655, 70, 7198, 'BOSU: Planken m/lft av ben 2', 'Ligg framover med underarmene plassert p gulvet og trne p toppen av BOSU-en. Pass p  holde bekken og korsrygg i nytralstilling og at nakken er i en naturlig forlengelse av ryggen. Se ned i gulvet. Lft annethvert ben opp ca. 30 cm og hold noen sekunder fr du vender rolig tilbake til utgangsposisjonen.', 7224, 2005325, 5, 'https://exorlive.com/media_7198@50.50.media', 'https://exorlive.com/video/?ex=7198'),
(656, 70, 217, '"Broen" ettbenslft p en ball', 'Ligg i "brostillingen", med verste del av ryggen p ballen. Strekk det ene benet slik at det holdes parallelt med gulvet. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og senk og lft langsomt p ett ben. Gjenta med det andre benet etterp.', 1654, 2004889, 4, 'https://exorlive.com/media_217@50.50.media', 'https://exorlive.com/video/?ex=217'),
(657, 70, 8734, 'Toes through rings', 'Fra hengende posisjon, lft fttene hele veien opp og gjennom ringene. Kontroller bevegelsen tilbake til startposisjonen.', 10927, 2009692, 5, 'https://exorlive.com/media_8734@50.50.media', 'https://exorlive.com/video/?ex=8734'),
(658, 70, 8532, 'TRX Medium Row (tung)', 'St p gulvet med hender i TRX, flytt bena mot ankerpunktet slik at du har 45 grader vinkel i forhold til gulvet. Trekk overkroppen opp med albue 45 grader ut fra skulder. velsen gjres tyngre ved  plassere bena nrmere ankerpunktet.', 10510, 2009418, 5, 'https://exorlive.com/media_8532@50.50.media', 'https://exorlive.com/video/?ex=8532'),
(659, 70, 5258, 'Setelft i slynge 2', 'Ligg p ryggen med en slynge omkring hver ankel (bruk evt. en stor slynge som begge benene kan ligge i). Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fr rolig tilbake til utgangsstillingen.', 4825, 2004474, 3, 'https://exorlive.com/media_5258@50.50.media', 'https://exorlive.com/video/?ex=5258'),
(660, 70, 5260, 'Setelft i slynge 4', 'Ligg p ryggen med en slynge omkring hver ankel. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fra denne stillingen byer og strekker du i hofter og knr samtidig. Fr rolig tilbake til utgangsstillingen.', 4877, 2004477, 5, 'https://exorlive.com/media_5260@50.50.media', 'https://exorlive.com/video/?ex=5260'),
(661, 70, 8104, 'Planken p knrne', 'St p knrne og albuene. Vr s rett som mulig i overkroppen.', 8877, 2007479, 2, 'https://exorlive.com/media_8104@50.50.media', 'https://exorlive.com/video/?ex=8104'),
(662, 70, 6657, 'Transversus aktivering og kontroll av rotasjon 4', 'Ligg p siden med naturlig svai i korsryggen. Aktiver muskelkorsettet. By begge knrne, men srg for at ftter, hofter og overkroppen ligger p linje. Hold hlene samlet og lft det verste kneet uten at korsryggen beveger seg.', 6649, 2008515, 1, 'https://exorlive.com/media_6657@50.50.media', 'https://exorlive.com/video/?ex=6657'),
(663, 70, 5278, 'Hofte fleksjon i slynge 3', 'St p albuene med en slynge plassert omkring anklene. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4914, 2004492, 3, 'https://exorlive.com/media_5278@50.50.media', 'https://exorlive.com/video/?ex=5278'),
(664, 70, 8544, 'TRX T Deltoid Fly', 'St p gulvet med hender i TRX og armene rett ut til siden, som en T. Senk overkroppen mot gulvet og trekk med strake albuer opp til utgangsposisjonen.', 10534, 2009477, 4, 'https://exorlive.com/media_8544@50.50.media', 'https://exorlive.com/video/?ex=8544'),
(665, 70, 8492, 'TRX Runner', 'Ligg p ryggen med begge helene festet i TRX. Lft setet opp fra gulvet, trekk annenhvert ben inn mot setet i stempelbevegelse. Hold et jevnt trykk ned i TRX under hele velsen.', 10430, 2009485, 5, 'https://exorlive.com/media_8492@50.50.media', 'https://exorlive.com/video/?ex=8492'),
(666, 70, 5227, 'Skulder knestende ekstensjon i slynge 2', 'St p knrne med armene rett framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Len kroppen framover ved  fre armene rett fram slik at de peker over hodet. Press armene ned mot underlaget for  komme tilbake til utgangsstillingen.', 4816, 2004855, 5, 'https://exorlive.com/media_5227@50.50.media', 'https://exorlive.com/video/?ex=5227'),
(667, 70, 823, '"Broen" m/sm steg', 'Plasser fotslene p gulvet og armene ut til siden. Fra den broliggende posisjonen, med "flat mage" og "bekkenvipp bak" lfter du vekselvis fttene opp ca. 10 cm fra gulvet.', 1615, 2004795, 3, 'https://exorlive.com/media_823@50.50.media', 'https://exorlive.com/video/?ex=823'),
