(669, 70, 8170, 'Hndstende planke med benlft', 'St p strake armer og trne. Vr ppasselig med  holde ryggen rett under hele velsen. Hold stillingen mens du lfter det ene benet opp fra bakken, Gjenta med motsatt ben.', 9237, 2007891, 4, 'https://exorlive.com/media_8170@50.50.media', 'https://exorlive.com/video/?ex=8170'),
(670, 70, 825, '"Firfot" armlft', 'St p alle fire og finn nytralstillingen i ryggen og bekkenet. Lag "flat mage" og lft den ene armen til den er i forlengelse av resten av kroppen. Gjenta med den andre armen.', 1624, 2004796, 1, 'https://exorlive.com/media_825@50.50.media', 'https://exorlive.com/video/?ex=825'),
(671, 70, 8583, 'Glidende utfall bakover', 'Fest blikket p et punkt foran deg. Trekk inn magen, plasser den ene foten p matten og skli bakover. Senk bakre kne mot gulvet. Press setet mot gulvet, stram magen og dra benet tilbake til utgangpunktet.', 10612, 2009491, 4, 'https://exorlive.com/media_8583@50.50.media', 'https://exorlive.com/video/?ex=8583'),
