(675, 70, 824, 'Firfotstende bekkenvipp', 'St p alle fire - pass p at du ikke henger i skulderpartiet. Hold bekkenet i midtstillingen. Vipp bekkenet fram slik at korsryggen svaier. Deretter vippes bekkenet bakover slik at svaien nederst i ryggen rettes ut. Vend tilbake til midtstillingen og gjenta.', 1642, 2007767, 2, 'https://exorlive.com/media_824@50.50.media', 'https://exorlive.com/video/?ex=824'),
