(677, 70, 706, 'Firfotstende "flat mage"', 'St p alle fire med rett rygg og nakke (nytralposisjon av bekken og ryggrad). Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Forsk  holde spenningen mens du puster normalt i 10-15 sek.', 1484, 2004715, 1, 'https://exorlive.com/media_706@50.50.media', 'https://exorlive.com/video/?ex=706'),
