(775, 200, 3335, 'Blank velse', '', 0, 0, 0, 'https://exorlive.com/media_3335@50.50.media', 'https://exorlive.com/video/?ex=3335'),
(776, 1053, 8821, 'Utfall fremover', 'St med samlede ben og sett armene i siden. Lft det ene benet, og g framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Overkroppen skal vre rett. Trykk ifra og g videre til et nytt steg. \nKnekontroll og nytral rygg er viktig gjennom hele bevegelsen.', 11102, 2009759, 3, 'https://exorlive.com/media_8821@50.50.media', 'https://exorlive.com/video/?ex=8821'),
(777, 1053, 8769, 'Goblet squat', 'Start i en stende posisjon med kettlebellen fremfor, men tett intill kroppen. Albuene holdes rett ned under kulen. Ha tyngden p helene og sett deg ned i en dyp kneby. Husk  ha hoften under kneleddet i bunnposisjon. Bruk bena til  strekke deg opp til startposisjon. Hold ryggen rak gjennom hele bevegelsen.', 10998, 2009826, 4, 'https://exorlive.com/media_8769@50.50.media', 'https://exorlive.com/video/?ex=8769'),
(778, 1053, 8801, 'Burpee', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert men raskt ned til bakken og flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og klapp over hodet med strake armer.', 11062, 2009673, 3, 'https://exorlive.com/media_8801@50.50.media', 'https://exorlive.com/video/?ex=8801'),
(779, 1053, 8871, 'Kneby 8', 'Start stende med stangen hvilende bak nakken. Grepet er s smalt som mulig utenfor skuldrene. Tomlene rundt stangen. Bena er litt bredere enn hoftebredde. Brystet opp og ryggen spent. Sett deg bak og ned med setet. Hold en oppreist og nytral rygg under hele bevegelsen. Stopp nr hofteleddet er lavere enn kneleddet. Trykk gjennom helen p vei opp til startposisjon.', 11202, 2009802, 3, 'https://exorlive.com/media_8871@50.50.media', 'https://exorlive.com/video/?ex=8871'),
(780, 1053, 8756, 'Press', 'Start i en stende posisjon med vektstangen hvilende p skuldrene. Det er hoftebredde avstand mellom fttene. Hendene er plassert like utenfor skuldrene, og albuene er rett fremfor stangen.  Stram mage og rygg. Start bevegelsen ved  presse stangen opp mot taket. Stangen skal g i en rett linje opp mot taket, s hodet m trekkes litt bak for  tillate stangens bevegelse. Bevegelsen avsluttes p toppen med helt utstrakte armer, fr stangen senkes kontrollert ned i startposisjon.', 10971, 2009784, 4, 'https://exorlive.com/media_8756@50.50.media', 'https://exorlive.com/video/?ex=8756'),
(781, 1053, 8823, 'Utfall fram med vekt over hodet', 'St med samlede ben og strake armer med en vektskive over hodet. Lft det ene benet, og g framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Trykk ifra og g videre til et nytt steg. Knekontroll og nytral rygg er viktig gjennom hele bevegelsen. Armene m vre strake gjennom hele bevegelsen.', 11106, 2009668, 4, 'https://exorlive.com/media_8823@50.50.media', 'https://exorlive.com/video/?ex=8823'),
(782, 1053, 8827, 'Squat jump', 'Start i en stenede posisjon. Fttene har skulderbredde avstand og ryggen holdes nytral. Start bevegelsen ved  sette deg bakover som i en dyp kneby. Nr du kommer ned i bunnposisjon, hoften under kneet, hopper du opp s hyt du kan. Hold en nytral rygg gjennom hele bevegelsen og ha tyngden p helene.', 11114, 2009734, 2, 'https://exorlive.com/media_8827@50.50.media', 'https://exorlive.com/video/?ex=8827'),
(783, 1053, 8757, 'Push-press', 'Start i en stende posisjon med vektstangen hvilende p skuldrene. Det er hoftebredde avstand mellom fttene. Hendene er plassert like utenfor skuldrene, og albuene er rett fremfor stangen. Stram mage og rygg. Start bevegelsen gjennom  gjre en eksplosiv by og strekk i knrne, fr stangen presses opp mot taket. Stangen skal g i en rett linje opp mot taket, s hodet m trekkes litt bak for  tillate stangens bevegelse. Bevegelsen avsluttes p toppen med helt utstrekte armer, fr stangen senkes kontrollert ned i startposisjon. \nDet er viktig  holde overkroppen rett opp og ned, slik at ikke overkroppen faller fremover.', 10973, 2009690, 4, 'https://exorlive.com/media_8757@50.50.media', 'https://exorlive.com/video/?ex=8757'),
(784, 1053, 8795, 'Utfallsteg bakover', 'St med samlede ben og start bevegelsen ved  ta et langt steg bakover. Nr kroppen er i balanse senkes kroppen kontrollert rett ned, slik at kneet p det bakerste benet treffer bakken. Overkroppen holdes rett opp og ned gjennom hele bevegelsen. Spark ifra med den fremste foten og returner til startstillingen.', 11050, 2009787, 3, 'https://exorlive.com/media_8795@50.50.media', 'https://exorlive.com/video/?ex=8795'),
(785, 1053, 8822, 'Utfall frem med rotasjon', 'St med samlede ben og sett armene i siden. Lft det ene benet, og g framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Nr du er i bunnposisjon roterer du kontrollert overkroppen mot den siden som foten er fram. Roter kontrollert tilbake til nytral posisjon. Trykk ifra og g videre til et nytt steg. \nKnekontroll og nytral rygg er viktig gjennom hele bevegelsen. Rotasjonen skjer rundt lengdeaksen.', 11104, 2009706, 4, 'https://exorlive.com/media_8822@50.50.media', 'https://exorlive.com/video/?ex=8822'),
(786, 1053, 8794, 'American sit-ups', 'Start sittende p bakken med fotslene mot hverandre. Trekk helene inn mot setet. Armene holdes fremfor trene og bevegelsen startes ved  senke ryggen ned mot bakken. Armene fres bakover sammen med kroppen, og hendene skal treffe bakken, bak hodet fr man retunerer til startposisjon.', 11048, 2009742, 3, 'https://exorlive.com/media_8794@50.50.media', 'https://exorlive.com/video/?ex=8794'),
(787, 1053, 8837, 'Kettlebell full swing', 'Start med kettlebellen fremfor kroppen. Grip tak i hornet p kulen og dra kulen bakover mellom benene. Med en agressiv strekk av hoftene skapes en pendelbevegelse p kulen. La kulen pendle hele veien opp til over hodet. Kulen henger som et lodd fra amene. Det er viktig med en rett rygg gjennom hele bevegelsen og at det er hoften som skaper all kraften.', 11134, 2009810, 4, 'https://exorlive.com/media_8837@50.50.media', 'https://exorlive.com/video/?ex=8837'),
(788, 1053, 8824, 'Splittby', 'St i splittposisjon med det ene benet framfor det andre.Brystet opp.Tenk p  gjre ryggen s lang som mulig. Tyngdepunktet holdes midt mellom bena. Senk overkroppen rett ned med belastning p begge ben til bakre kneet nr gulvet.\nBakre lret skal vre p linje med overkroppen. Trykk opp via begge bein til fremre beinet er helt eller nesten strakt.', 11108, 2009823, 3, 'https://exorlive.com/media_8824@50.50.media', 'https://exorlive.com/video/?ex=8824'),
(789, 1053, 8829, 'Box jump', 'Start stende med en boks fremfor deg. Gjr et hopp opp p boksen og land med 3/4 deler av foten inne p boksen. Forlat boksen ved  strekke i hoftene. Kroppen skal vre helt strak over bokshyde fr du treffer bakken og gjennomfrer et nytt hopp. Forsk  ha s kort kontakttid i bakken som mulig.', 11118, 2009851, 3, 'https://exorlive.com/media_8829@50.50.media', 'https://exorlive.com/video/?ex=8829'),
(790, 1053, 8867, 'Joystick med rotasjon', 'Start med skulderbredde avstand mellom fttene og lett by i knr og hofter. Hold stangen med rake armer. Beveg stangen i en kontrollert rotasjon fra nytral posisjon og ned til siden, samtidig som du lar overkroppen flge med i rotasjonen. I denne velsen holdes overkroppen stabil og ryggen rett. Roter rundt lengdeaksen', 11194, 2009676, 3, 'https://exorlive.com/media_8867@50.50.media', 'https://exorlive.com/video/?ex=8867');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(791, 1053, 8799, 'Burpee med push-up', 'Start i en stende posisjon. Start bevegelsen ved  bye p knrne, sette hendene i bakken og strekke bena ut bak kroppen. Fra push-ups posisjonen senkes kroppen ned til bakken. Press kroppen opp i en push-up posisjon. Flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og klapp over hodet med strake armer.', 11058, 2009794, 5, 'https://exorlive.com/media_8799@50.50.media', 'https://exorlive.com/video/?ex=8799'),
(792, 1053, 8818, 'Hoppende utfall 3', 'Start i en splittby posisjon. Fra denne posisjonen hopper du opp mot taket og flytter fttene, slik at du lander med motsatt ben frem. I denne velsen er det viktig at overkroppen holdes rett, og at kraften av hoppet gr oppover. Knestabilitet og kontroll er en viktig faktor for  unng en valguskollaps i kneet.', 11096, 2009888, 4, 'https://exorlive.com/media_8818@50.50.media', 'https://exorlive.com/video/?ex=8818'),
(793, 1053, 8768, 'Sumo deadlift high pull med kettlebell', 'Start med fttene i skulderbredde. Kettlebellen er plassert mellom fttene. I bunnposisjon er det viktig at ryggen holdes rak, ha tyngden p helene og skuldrene befinner seg lett fremfor kettlebellen. Start bevegelsen ved  strekke p bena. Kettlebellen skal lftes rett opp. Skulder, hofte og kettlebell beveger seg like mye til kettlebellen kommer forbi knrne. Nr kettlebellen  er lftet hele veien opp til hoften fortsetter man draget ved  gjre en "shrug" med skuldrene og trekke albuene opp og ut til siden. Hndtaket p kettlebellen skal hele veien opp til under haken, fr den senkes direkte ned i startposisjon. Det er viktig med en eksplosiv utstrekking av hoftene, for  skape en kraft som gr oppover og at man holder fart p stangen.', 10996, 2009893, 4, 'https://exorlive.com/media_8768@50.50.media', 'https://exorlive.com/video/?ex=8768'),
(794, 1053, 8869, 'Front kneby', 'Start med stangen hvilende p skuldrene. Grepet ligger utenfor skulderbredde med fingrene rundt stangen eller i fingertippene. Overarmen er parallell med gulvet og albuene peker rett fram. Balansen og trykket holdes midt p foten, med fttene i skulderbredde fra hverandre. Hold overkroppen s oppreist som mulig, samtidig som du senker hoftenbak og ned. Hold albuene pekende framover og knrne over andre t. Stopp nr hofteleddet er lavere enn kneleddet. \n\n?', 11198, 2009831, 4, 'https://exorlive.com/media_8869@50.50.media', 'https://exorlive.com/video/?ex=8869'),
(795, 1053, 8734, 'Toes through rings', 'Fra hengende posisjon, lft fttene hele veien opp og gjennom ringene. Kontroller bevegelsen tilbake til startposisjonen.', 10927, 2009692, 5, 'https://exorlive.com/media_8734@50.50.media', 'https://exorlive.com/video/?ex=8734'),
(796, 1053, 8868, '1 arms joystick press', 'Start med skulderbredde avstand mellom fttene og lett by i knr og hofter. Hold stangen med en arm. Senk stangen kontrollert ned til brystkassen. Ved hjelp av hofte og arm presses stangen tilbake til startposisjonen. I denne velsen holdes overkroppen stabil og ryggen rett.', 11196, 2009670, 3, 'https://exorlive.com/media_8868@50.50.media', 'https://exorlive.com/video/?ex=8868'),
(797, 1053, 8866, 'Joystick', 'Start med skulderbredde avstand mellom fttene og lett by i knr og hofter. Hold stangen med rake armer. Beveg stangen i en kontrollert rotasjon fra side til side med rake armer. I denne velsen holdes overkroppen stabil og ryggen rett.', 11192, 2009836, 3, 'https://exorlive.com/media_8866@50.50.media', 'https://exorlive.com/video/?ex=8866'),
(798, 1053, 8796, 'Bearcrawl bakover', 'Start i push-ups posisjon. Bevegelsen starter ved  g bakover med hyre fot og venstre arm som start, fr venstre fot og hyre arm gr bakover. Fot og arm jobber diagonalt.', 11052, 2009843, 4, 'https://exorlive.com/media_8796@50.50.media', 'https://exorlive.com/video/?ex=8796'),
(799, 1053, 8872, 'Kneby med stopp i 90 grader', 'Start stende med stangen hvilende bak nakken. Grepet er s smalt som mulig utenfor skuldrene. Tomlene rundt stangen. Bena er litt bredere enn hoftebredde. Brystet opp og ryggen spent. Sett deg bak og ned med setet. Hold en oppreist og nytral rygg under hele bevegelsen. Stopp nr lrene er parallelle med gulvet. Trykk gjennom helen p vei opp i startposisjon.', 11204, 2009830, 3, 'https://exorlive.com/media_8872@50.50.media', 'https://exorlive.com/video/?ex=8872'),
(800, 1053, 8838, 'Kettlebell thruster', 'Start med kettlebellene fremfor, men tett inntil kroppen. St med skulderbredde avstand mellom fttene, og senk kroppen kontrollert ned som i en dyp kneby. Sitt bak og ha tyngden p helene. Fra bunnposisjon strekkes kroppen oppover og avsluttes med  presse kettlebellene opp over hodet. Bruk bena aktivt til  f kulene opp over hodet med strake armer. Det er viktig at ryggen holdes rett gjennom hele bevegelsen.', 11136, 2009768, 5, 'https://exorlive.com/media_8838@50.50.media', 'https://exorlive.com/video/?ex=8838'),
(801, 1053, 8853, 'Singel hopp', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Skuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11166, 2009711, 2, 'https://exorlive.com/media_8853@50.50.media', 'https://exorlive.com/video/?ex=8853'),
(802, 1053, 8805, 'Burpee uten push-ups', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Stopp med kroppen i push-ups posisjon. Fra denne posisjonen flytter du fttene inn mot hendene og hopper opp fra en dyp kneby posisjon. Klapp med strake armer over hodet.', 11070, 2009671, 3, 'https://exorlive.com/media_8805@50.50.media', 'https://exorlive.com/video/?ex=8805'),
(803, 1053, 8819, 'Prisoner Squat', 'Start i en stenede posisjon med hendene bak hodet. Fttene har skulderbredde avstand og ryggen holdes nytral. Start bevegelsen ved  sette deg bakover som i en dyp kneby. Nr du kommer ned i bunnposisjon, hoften under kneet, hopper du opp s hyt du kan. Hold en nytral rygg gjennom hele bevegelsen og ha tyngden p helene.', 11098, 2009828, 3, 'https://exorlive.com/media_8819@50.50.media', 'https://exorlive.com/video/?ex=8819'),
(804, 1053, 8828, 'Ettbens kneby 5', 'Start stende med all tyngden p den ene foten. Bevegelsen starter ved  sette deg ned p den vektbrende foten, mens den andre foten strekkes ut fremfor kroppen. Kontroller bevegelsen til bunnposisjon og trykk deretter opp til stende. Hoften skal under kneleddet i bunnposisjon.', 11116, 2009681, 5, 'https://exorlive.com/media_8828@50.50.media', 'https://exorlive.com/video/?ex=8828'),
(805, 1053, 8820, 'Lalteral lunge', 'Start i en stenede posisjon, med fttene sammen. Gjr et steg ut til siden, samtidig som du setter setet ned og bak over helen p den aktive foten. Nr foten treffer gulvet bremses bevegelsen. Ved sluttstilling er det aktive benet byd, og standbenet er tilnrmet strakt. Returner hurtig til startstillingen.', 11100, 2009727, 3, 'https://exorlive.com/media_8820@50.50.media', 'https://exorlive.com/video/?ex=8820'),
(806, 1053, 8842, 'Ballslam', 'Start som i en dyp kneby med en slamball mellom fttene. Start bevegelsen ved  strekke deg opp og lfte ballen opp over hodet. Strekk deg opp s lang du er og eksplosivt kast ballen i bakken ved  bye armer og hofter. Bruk magen og hoftene til  sette fart p ballen i kastet.', 11144, 2009719, 3, 'https://exorlive.com/media_8842@50.50.media', 'https://exorlive.com/video/?ex=8842'),
(807, 1053, 8766, 'Thruster', 'Start i en stende posisjon med stangen hvilende p skuldrene. Albuene holdes lett fremfor stangen. Ha tyngden p helene og sett deg ned i en dyp kneby. Husk  ha hoften under kneleddet i bunnposisjon. Bruk bena til  strekke deg opp, og p toppen av bevegelsen presses stangen opp over hodet. Det er viktig at kraften hentes fra bena i denne velsen, og at ryggen holdes i sin naturlige posisjon. Pass p at albuene ikke stter mot lrene i bunn posisjonen.', 10992, 2009845, 4, 'https://exorlive.com/media_8766@50.50.media', 'https://exorlive.com/video/?ex=8766'),
(808, 1053, 8844, 'Wallball', 'Start med fttene i skulderbredde avstand. Ballen holdes fremfor og tett inntil kroppen. Sitt ned som i en dyp kneby og g hele veien ned, slik at hoftene er under kneleddet. Ryggen holdes rett gjennom bevegelsen. Fra bunnposisjonen strekkes kroppen opp igjen, og p topp av velsen kastes ballen opp til et gitt punkt p veggen. Ta imot ballen, og g ned i en dyp kneby fr du igjen strekker deg opp og kaster ballen opp p veggen.', 11148, 2009869, 2, 'https://exorlive.com/media_8844@50.50.media', 'https://exorlive.com/video/?ex=8844'),
(809, 1053, 8775, 'Battlerope', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  strekke opp hoftene og armene fr du deretter slr tauene mot bakken ved  bye i hoften og armene. Gjr det til en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11010, 2009881, 3, 'https://exorlive.com/media_8775@50.50.media', 'https://exorlive.com/video/?ex=8775'),
(810, 1053, 8787, 'Battlerope alternerende armer', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  sl ene tauet mot bakken og det andre opp i luften. Jobb opp og ned i motsatte bevegelser med armene, og gjr det til en flytende bevegelse. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11034, 2009665, 3, 'https://exorlive.com/media_8787@50.50.media', 'https://exorlive.com/video/?ex=8787'),
(811, 1053, 8839, 'Utfall frem med kettlebell press', 'St med samlede ben og kettlebellene fremfor og tett inntil kroppen. Lft det ene benet, og g framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Samtidig som fremre foten lander, presses motsatt arm opp i en press over hodet. I bevegelsen jobber man med motsatt arm og fot. Trykk ifra, senk kettlebellen og g videre til et nytt steg. Knekontroll og nytral rygg er viktig gjennom hele bevegelsen.', 11138, 2009812, 4, 'https://exorlive.com/media_8839@50.50.media', 'https://exorlive.com/video/?ex=8839'),
(812, 1053, 8846, '1 ben singelhopp', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Legg vekten p ett ben og finn balansen, for at du skal kunne hoppe p ett ben. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11152, 2009778, 2, 'https://exorlive.com/media_8846@50.50.media', 'https://exorlive.com/video/?ex=8846'),
(813, 1053, 8815, 'Superman', 'Ligg p magen og lft armer og ftter opp fra bakken. Armene holdes fremfor kroppen som en forlengelse av kroppen.', 11090, 2009712, 4, 'https://exorlive.com/media_8815@50.50.media', 'https://exorlive.com/video/?ex=8815'),
(814, 1053, 8826, 'Tucked', 'Ligg p ryggen med armer og ftter over bakken. Korsryggen holdes i kontakt med bakken ved  stramme magen. Trekk knrne inn mot brystkassen og overkroppen mot knrne, slik at de mtes p midten. Strekk deg deretter ut til startposisjon, uten at armer og ftter har kontakt med bakken. \nHold mage og rygg stabilt gjennom bevegelsen.', 11112, 2009889, 4, 'https://exorlive.com/media_8826@50.50.media', 'https://exorlive.com/video/?ex=8826'),
(815, 1053, 8863, 'Sittende rotasjonskast til partner', 'Start sittende med fttene opp fra bakken og ballen ved siden av kroppen.  Kast ballen ved hjelp av en rotasjon til partneren, som sitter ved siden av. Partneren tar imot ballen og kaster tilbake. Tilpass kraften i forhold til partneren.', 11186, 2009809, 2, 'https://exorlive.com/media_8863@50.50.media', 'https://exorlive.com/video/?ex=8863'),
(816, 1053, 8817, 'Inchworm', 'Start med hender og ftter i bakken. Stram mage og rygg og gr forsiktig ut med hendene fremfor kroppen. Fortstett s lang fram du kan, men korsryggen skal holdes nytral. Nr du kommer ut i ytterposisjon gr du opp til startposisjon ved hjelp av sm fotbevegelser. Husk  holde ryggen rak gjennom hele bevegelsen.', 11094, 2009664, 4, 'https://exorlive.com/media_8817@50.50.media', 'https://exorlive.com/video/?ex=8817'),
(817, 1053, 8813, 'Hollow', 'Ligg p ryggen med bare korsryggen i bakken. Armene holdes sammen bak hodet som en forlengelse av kroppen og fttene holdes over bakken. I denne posisjonen er det viktig  stramme hele kroppen, slik at posisjonen kan holdes.', 11086, 2009654, 4, 'https://exorlive.com/media_8813@50.50.media', 'https://exorlive.com/video/?ex=8813'),
(818, 1053, 8797, 'Bearcrawl fremover', 'Start i push-ups posisjon. Bevegelsen starter ved  g fremover med hyre fot og venstre arm som start, fr venstre fot og hyre arm gr fremover. Fot og arm jobber diagonalt.', 11054, 2009788, 3, 'https://exorlive.com/media_8797@50.50.media', 'https://exorlive.com/video/?ex=8797'),
(819, 1053, 8835, '1 leg box jump', 'Start stende med en boks fremfor deg. Hold vekten p den ene foten. Gjr et hopp opp p boksen, og stabiliser landingsposisjonen. Strekk ut hoftene og innta en stende posisjon fr du forlater boksen. Kroppen skal vre helt strak over bokshyde fr du treffer bakken og gjennomfrer et nytt hopp.', 11130, 2009702, 3, 'https://exorlive.com/media_8835@50.50.media', 'https://exorlive.com/video/?ex=8835'),
(820, 1053, 8802, 'Burpee sit-up', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert med raskt ned til bakken og flytt fttene raskt inn under kroppen. Rull bakover, slik at du ligger p ryggen med armene over hodet. Gjr en sit-up og hopp opp fra en dyp kneby posisjon. Klapp over hodet med strake armer.', 11064, 2009849, 4, 'https://exorlive.com/media_8802@50.50.media', 'https://exorlive.com/video/?ex=8802'),
(821, 1053, 8836, '1 leg lateral box jump', 'Start stende med en boks ved siden av deg. St p en fot og gjr et sidelengs hopp opp p boksen. Land p boksen og stabiliser bevegelsen fr du hopper videre ned fra boksen. Hopp tilbake, samme veien som du kom. Det er viktig med knekontroll og balanse i denne velsen.', 11132, 2009724, 4, 'https://exorlive.com/media_8836@50.50.media', 'https://exorlive.com/video/?ex=8836'),
(822, 1053, 8771, '1 arm over head squat med kettlebell.', 'Start i en stende posisjon med en kettlebell over hodet p rak arm. Det er skulderbredde avstand mellom fttene. Ha tyngden p helene og sett deg ned i en dyp kneby. Hoften skal vre under kneleddet i bunnposisjon. Det er viktig at armen holdes rett opp mot taket hele tiden, og at ryggen holder sin naturlige posisjon.', 11002, 2009703, 4, 'https://exorlive.com/media_8771@50.50.media', 'https://exorlive.com/video/?ex=8771'),
(823, 1053, 8755, 'Burpee thruster', 'Start i en stende posisjon med ansiktet mot vektstangen. Start bevegelsen ved  bye  knrne. Sett hendene p vektstangen, fr du strekker bena ut bak kroppen. Senk kroppen som i en push-up ned til stangen. Press deg opp til en push-ups posisjon fr du hopper inn i en dyp kneby med hendene p stangen. Heretter utfrer du en frivending med stangen, som fanges i en dyp kneby posisjon. Fra denne posisjonen strekker du deg opp, og avslutter velsen ved  presse stangen opp over hodet. Det er viktig  bruke kraften fra bena nr stangen presses opp over hodet.', 10969, 2009769, 6, 'https://exorlive.com/media_8755@50.50.media', 'https://exorlive.com/video/?ex=8755'),
(824, 1053, 8830, 'Box jump, pen hofte p kassen', 'Start stende med en boks fremfor deg. Gjr et hopp opp p boksen og land med 3/4 deler av foten inne p boksen. Strekk ut hoftene og innta en stende posisjon fr du forlater boksen. Kroppen skal vre helt strak over bokshyde fr du treffer bakken og gjennomfrer et nytt hopp. Forsk  ha s kort kontakttid i bakken som mulig.', 11120, 2009749, 3, 'https://exorlive.com/media_8830@50.50.media', 'https://exorlive.com/video/?ex=8830'),
(825, 1053, 8870, 'Front kneby med armene i kryss', 'Start med stangen hvilende p skuldrene. Hold armene i kryss over brystkassen og hold om stangen. Overarmen er parallell med gulvet og albuene peker rett fram. Balansen og trykket holdes midt p foten, med fttene i skulderbredde fra hverandre. Hold overkroppen s oppreist som mulig, samtidig som du senker hoften bak ?og ?ned. Hold albuene pekende framover og knrne over andre t. Stopp nr hofteleddet er lavere enn kneleddet. Denne varianten velges, dersom det ikke er bevegelighet til  gjre en vanlig front kneby\n\n?', 11200, 2009873, 4, 'https://exorlive.com/media_8870@50.50.media', 'https://exorlive.com/video/?ex=8870'),
(826, 1053, 8770, 'Kettlebell swing to goblet squat', 'Start med fttene i skulderbredde avstand og plasser kettlebellen fremfor kroppen. Ta tak i hornet og trekk kulen bak mellom bena. Strekk ut hoftene og skap en sving p kulen. Nr kulen bryter parallell, vendes kulen, slik at hornet peker ned mot bakken. Senk kroppen ned i en dyp knebyposisjon. Fra bunn posisjon strekker du deg opp, vender kulen, og begynner en ny sving bevegelse.\nDet er viktig  holde god balanse og kontrollere kulen gjennom hele bevegelsen for  unng skader.', 11000, 2009884, 4, 'https://exorlive.com/media_8770@50.50.media', 'https://exorlive.com/video/?ex=8770'),
(827, 1053, 8814, 'Hollow rock', 'Ligg p ryggen med bare korsryggen i bakken. Armene holdes sammen bak hodet som en forlengelse av kroppen og fttene holdes over bakken. I denne posisjonen er det viktig  stramme hele kroppen, slik at posisjonen kan holdes. Start bevegelsen og vugg frem og tilbake med en stabil kropp.', 11088, 2009659, 4, 'https://exorlive.com/media_8814@50.50.media', 'https://exorlive.com/video/?ex=8814'),
(828, 1053, 8807, 'Duck walk', 'Start i en dyp knebyposisjon og g bortover uten  reise deg opp.  Hold tyngdepunktet lavt gjennom hele bevegelsen.', 11074, 2009710, 3, 'https://exorlive.com/media_8807@50.50.media', 'https://exorlive.com/video/?ex=8807'),
(829, 1053, 8825, 'Splittby med vekt over hodet', 'St i splittposisjon med et ben framfor det andre. Armene holdes rett opp over hodet med en vektskive, og skal vre strake gjennom hele bevegelsen.  Brystet opp.Tenk p  gjre ryggen s lang som mulig. Balansen og tyngdepunktet holdes midt mellom bena. Senk overkroppen rett ned med belastning p begge ben til bakre kneet nr gulvet.\nBakre lret skal vre p linje med overkroppen. Trykk opp via begge ben til fremre beinet er helt eller nesten strakt.', 11110, 2009683, 4, 'https://exorlive.com/media_8825@50.50.media', 'https://exorlive.com/video/?ex=8825'),
(830, 1053, 8816, 'Hollow til superman', 'Ligg p ryggen med bare korsryggen i bakken. Armene holdes sammen bak hodet som en forlengelse av kroppen og fttene holdes over bakken. I denne posisjonen er det viktig  stramme hele kroppen, slik at posisjonen kan holdes. Rull langs kroppens lengdeakse slik at du kommer inn i en superman posisjon med magen ned i bakken. Det er bare mage og rygg som skal vre i kontakt med bakken. Armer og ben holdes over bakken gjennom hele bevegelsen.', 11092, 2009825, 4, 'https://exorlive.com/media_8816@50.50.media', 'https://exorlive.com/video/?ex=8816'),
(831, 1053, 8833, 'Hopp over boks', 'Start stende med en boks fremfor kroppen. Gjr et kontrollert hopp over boksen og land p andre siden. Snu deg rundt og gjr det samme igjen.  Det er viktig med knekontroll og stabilitet i bevegelsen.', 11126, 2009763, 4, 'https://exorlive.com/media_8833@50.50.media', 'https://exorlive.com/video/?ex=8833'),
(832, 1053, 8843, 'Medisinball thruster med partner', 'Start med fttene i skulderbredde avstand. Ballen holdes fremfor og tett inntil kroppen. Sitt ned som i en dyp kneby og g hele veien ned, slik at hoftene er under kneleddet. Ryggen holdes rett gjennom bevegelsen. Fra bunnposisjonen strekkes kroppen opp igjen, og p topp av velsen kastes ballen til partneren, som tar imot og gjr samme bevegelse fr ballen kastes tilbake. Det er viktig  tilpasse kastet til partneren. Timing og kontroll er viktig.', 11146, 2009793, 3, 'https://exorlive.com/media_8843@50.50.media', 'https://exorlive.com/video/?ex=8843'),
(833, 1053, 8804, 'Burpee tuckjump', 'Start i en stende posisjon. Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen kontrollert men raskt ned til bakken og flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og trekk knrne inn til brystkassen i hoppet.', 11068, 2009819, 3, 'https://exorlive.com/media_8804@50.50.media', 'https://exorlive.com/video/?ex=8804'),
(834, 1053, 8767, 'Sumo deadlift high pull', 'Start med fttene bredere enn skuldrene og hold hendene s smalt p stangen at armene ikke kommer i kontakt med knrne. I bunnposisjon er det viktig at ryggen holdes rak, tyngden er p helene og skuldrene befinner seg lett fremfor stangen. Start bevegelsen ved  strekke p bena. Stangen, skuldrene og hofte beveger seg like mye til stangen kommer forbi knrne. Nr stangen er lftet hele veien opp til hoften fortsetter man draget ved  gjre en "shrug" med skuldrene og trekke albuene opp og ut til siden. Stangen skal hele veien opp til under haken, fr den senkes direkte ned i startposisjon. Det er viktig med en eksplosiv utstrekking av hoftene, for  skape en kraft som gr oppover og at man holder fart p stangen.', 10994, 2009805, 5, 'https://exorlive.com/media_8767@50.50.media', 'https://exorlive.com/video/?ex=8767'),
(835, 1053, 8840, 'Burpee thruster med kettlebell', 'Start i en push-ups posisjon med hendene p hornene til kettlebellen. Start bevegelsen ved  gjre en pushup, fr du hopper inn i en dyp kneby med hendene p kettlebellene. Heretter utfrer du en frivending med kettlebellene, som fanges i en dyp kneby posisjon. Fra denne posisjonen strekker du deg opp, og avslutter velsen ved  presse kulene opp over hodet. Det er viktig  bruke kraften fra bena nr kulene presses opp over hodet.', 11140, 2009733, 5, 'https://exorlive.com/media_8840@50.50.media', 'https://exorlive.com/video/?ex=8840'),
(836, 1053, 8803, 'Skalert burpee', 'Fra en stende posisjon byer du deg ned til bakken. G ut med fttene og legg deg kontrollert ned p bakken. Reis deg kontrollert opp fra bakken ved  g inn med fttene fra en liggende posisjon til en dyp kneby posisjon. Fra denne posisjonen reiser du deg opp til stende og avslutter velsene med et hopp og klapper over hodet.', 11066, 2009675, 3, 'https://exorlive.com/media_8803@50.50.media', 'https://exorlive.com/video/?ex=8803'),
(837, 1053, 8841, 'Frivending med medisinball', 'Start med skulderbredde avstand mellom fttene. Plasser en medisinball mellom fttene og hold ballen med begge hender.  I startposisjonen holdes ryggen rett og skuldrene plasseres over ballen. Bevegelsen starter ved  strekke hoftene oppover slik at ballen lftes som et marklft fra bakken. Nr ballen kommer opp til hoftene fortsettes bevegelsen med en rask utstrekking av hoften og en shrug med skuldrene. Denne bevegelsen skaper fart p ballen, slik at du raskt kan sette deg ned under ballen og fange den i en dyp kneby. Strekk deg opp til en stende posisjon med ballen fremfor kroppen, fr du vender den ned til bakken igjen.', 11142, 2009847, 4, 'https://exorlive.com/media_8841@50.50.media', 'https://exorlive.com/video/?ex=8841'),
(838, 1053, 8750, 'Ring row, fttene p bakken', 'Start med kroppen strak og fttene p bakken. Ryggen er ned mot bakken, og kroppen holdes rett som en planke. Start bevegelsen ved  trekke deg opp til ringene. Kroppen skal trekkes helt opp, slik at hendene kommer i kontakt med brystkassen.\nFra topp posisjonen senkes kroppen kontrollert tilbake til startposisjonen. Husk  holde kroppen strak gjennom hele velsen.', 10959, 2009662, 4, 'https://exorlive.com/media_8750@50.50.media', 'https://exorlive.com/video/?ex=8750'),
(839, 1053, 8860, 'Diagonalkast til partner', 'Start med skulderbredde avstand mellom fttene og ballen ved siden av kroppen. St med lett byde knr og ryggen rett. Kast ballen diagonalt til partneren, som tar imot ballen og kaster diagonalt tilbake. Tilpass kraften i forhold til partneren.', 11180, 2009751, 2, 'https://exorlive.com/media_8860@50.50.media', 'https://exorlive.com/video/?ex=8860'),
(840, 1053, 8806, 'Crab walk', 'Start i en dyp knebyposisjon og g sidelengs bortover fra side til side. Hold tyngdepunktet lavt gjennom hele bevegelsen.', 11072, 2009862, 3, 'https://exorlive.com/media_8806@50.50.media', 'https://exorlive.com/video/?ex=8806'),
(841, 1053, 8798, 'Burpee med knrne i bakken', 'Start i en stende posisjon. Start bevegelsen ved  bye p knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen ned til bakken, slik at hele kroppen er i bakken. Med knrne i kontakt med bakken, presses kroppen opp i en push-up posisjon. Flytt fttene raskt inn under kroppen. Hopp opp fra en dyp kneby posisjon og klapp over hodet med strake armer.', 11056, 2009844, 4, 'https://exorlive.com/media_8798@50.50.media', 'https://exorlive.com/video/?ex=8798'),
(842, 1053, 8855, 'Bokse hopp', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  splitte fttene frem og tilbake mellom hoppene.\nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11170, 2009717, 2, 'https://exorlive.com/media_8855@50.50.media', 'https://exorlive.com/video/?ex=8855'),
(843, 1053, 8808, 'Table walk', 'Start med ftter og hender i bakken. Press hoftene opp mot taket, slik at kroppen holdes som et bord. G bakover eller fremover etter eget nske. Hold hoftene s hyt som mulig gjennom hele bevegelsen.', 11076, 2009837, 4, 'https://exorlive.com/media_8808@50.50.media', 'https://exorlive.com/video/?ex=8808'),
(844, 1053, 8831, 'Burpee box jump', 'Start bevegelsen ved  bye knrne, sette hendene i bakken og strekke bena ut bak kroppen. Senk kroppen ned til bakken, slik at hele kroppen er i bakken. Press deg opp fra bakken og kom opp i en stende posisjon, fr du hopper opp p boksen.', 11122, 2009732, 3, 'https://exorlive.com/media_8831@50.50.media', 'https://exorlive.com/video/?ex=8831'),
