(849, 1053, 8845, 'Skipping', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  bye og strekke i den passive foten, slik at den strekkes ut fremfor kroppen. Bytt fra side til side. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11150, 2009818, 2, 'https://exorlive.com/media_8845@50.50.media', 'https://exorlive.com/video/?ex=8845'),
