(851, 1053, 8786, 'Battlerope med kneby', 'Start med skulderbredde avstand mellom fttene og hold p hver sin ende av tauene. Start bevegelsen ved  strekke opp hoftene og armene fr du deretter slr tauene mot bakken ved  bye i hoften og armene. Gjr det til en flytende bevegelse. Samtidig som tauene beveges opp og ned skal du aktivt g opp og ned i en dyp kneby. Det er viktig  stramme magen og ryggen i bevegelsen, slik at man kan f kraften ut i tauene ved hjelp av hofter og armer.', 11032, 2009816, 3, 'https://exorlive.com/media_8786@50.50.media', 'https://exorlive.com/video/?ex=8786'),
