(874, 1053, 8732, 'Knelft i ringer', 'Fra hengende posisjon, trekk knrne opp mot brystkassen.  Senk kontrollert tilbake til startposisjon.', 10923, 2009762, 3, 'https://exorlive.com/media_8732@50.50.media', 'https://exorlive.com/video/?ex=8732'),
(875, 1053, 8743, 'Ring row, fttene p benk', 'Start med fttene p en benk, og hendene i ringene. Ryggen er ned mot bakken, og kroppen holdes rett som en planke. Start bevegelsen ved  trekke deg opp til ringene. Kroppen skal trekkes helt opp, slik at hendene kommer i kontakt med brystkassen.\nFra topp posisjonen senkes kroppen kontrollert tilbake til startposisjonen. Husk  holde kroppen strak gjennom hele velsen.', 10945, 2009796, 5, 'https://exorlive.com/media_8743@50.50.media', 'https://exorlive.com/video/?ex=8743'),
(876, 1069, 7955, 'Kle p bukse i liggende', 'Ligg p siden med knrne byd. By det verste benet og tre buksen p. Snu deg rundt p andre siden og gjr det samme. Legg deg s p ryggen med byde knr, lft opp sete og dra buksen p.', 9066, 2007480, 1, 'https://exorlive.com/media_7955@50.50.media', 'https://exorlive.com/video/?ex=7955'),
(877, 1069, 9842, 'Henge opp ty p klessnor', 'Aktiviteten gjres lettere eller vanskeligere ved  velge om klyper skal benyttes eller ikke. Klessnoren kan festes i ulike hyder.', 13040, 2013239, 1, 'https://exorlive.com/media_9842@50.50.media', 'https://exorlive.com/video/?ex=9842'),
(878, 1069, 9904, 'Nintendo Wii', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.\nBenytt spill som utfordrer ditt funksjonsniv.', 13163, 2013203, 2, 'https://exorlive.com/media_9904@50.50.media', 'https://exorlive.com/video/?ex=9904'),
(879, 1069, 9903, 'Stryke', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13161, 2013275, 1, 'https://exorlive.com/media_9903@50.50.media', 'https://exorlive.com/video/?ex=9903'),
(880, 1069, 9962, 'Forflytning fra sittende til stende m/ hjelp', 'Ved forflytning fra rullestol husk  sette p bremser, samt fjerne fotbrett. \nSett deg godt frem i stolen.\nSrg for at fttene er plassert s langt under kroppen som mulig, samtidig som begge fotbladene er i gulvet.\nLen deg fremover.\nReis deg opp med vekt p begge ben.\nFinn balansen. Hjelper sttter p hoftene.\nSt godt p begge ben fr du slipper taket i hjelper.\nVed redusert funksjon i en side/hemiparese kan frisk hnd benyttes til  holde armen med mindre funksjon nr du reiser deg opp. Alternativt kan hjelper sttte denne siden.', 13279, 2013611, 4, 'https://exorlive.com/media_9962@50.50.media', 'https://exorlive.com/video/?ex=9962'),
(881, 1069, 9863, ' vaske bord ved hemiplegisk arm', 'Fokuser p  benytte hnden med minst funksjon s mye som mulig. Sttt med frisk hnd.', 13082, 2013377, 1, 'https://exorlive.com/media_9863@50.50.media', 'https://exorlive.com/video/?ex=9863'),
(882, 1069, 9945, 'Rengjring av rullestol', 'Det anbefales riktig arbeidshyde.', 13245, 2013347, 2, 'https://exorlive.com/media_9945@50.50.media', 'https://exorlive.com/video/?ex=9945'),
(883, 1069, 7956, 'Kle p bukse i sittende', 'Sitt inntil en stor pute, stol eller liknende. By opp det ene benet og tre p buksen, gjenta p samme mte med motsatt ben. By knrne opp og snu deg rundt slik at du kommer opp og st p knrne, bruk gjerne armene til  sttte deg p puten. Nr du str p knrne inntil puten trekker du buksen p deg.', 9068, 2007522, 2, 'https://exorlive.com/media_7956@50.50.media', 'https://exorlive.com/video/?ex=7956'),
(884, 1069, 9843, 'Henge klr p henger', 'Klessnoren kan festes i ulike hyder.', 13042, 2013410, 1, 'https://exorlive.com/media_9843@50.50.media', 'https://exorlive.com/video/?ex=9843'),
