(886, 1069, 9866, 'Ta av og p flaskekork', 'Ved redusert funksjon i en side benytt denne til  holde flasken.', 13088, 2013215, 1, 'https://exorlive.com/media_9866@50.50.media', 'https://exorlive.com/video/?ex=9866'),
(887, 1069, 9858, 'Smre p brdskive ved hemiplegisk arm', 'Bruk hnd med minst funksjon til  sttte brdskiven. Bruk frisk hnd til  smre med.', 13072, 2013488, 2, 'https://exorlive.com/media_9858@50.50.media', 'https://exorlive.com/video/?ex=9858'),
