(889, 1069, 9849, 'Avkledning genser ved hemiplegi', 'Ta tak i kragen bak og dra genseren over hodet.', 13054, 2013356, 2, 'https://exorlive.com/media_9849@50.50.media', 'https://exorlive.com/video/?ex=9849'),
(890, 1069, 9852, 'Vask og trk under armer ved hemiplegisk arm', 'Legg klut/ hndkle under armen med minst funksjon og beveg overarmen ved hjelp av frisk arm', 13060, 2013299, 1, 'https://exorlive.com/media_9852@50.50.media', 'https://exorlive.com/video/?ex=9852'),
(891, 1069, 9956, 'Forflytning fra rullestol til seng uten brett', 'Du br tilstrebe  ha lik hyde eller litt nedoverbakke nr du skal forflytte deg mellom to steder. Sett deg godt frem p stolkanten med minst 100 grader i kneleddet. Hyre hnden skal vre tett inntil setet. Venstre hnd sttter p sengen. Len deg noe frem og roter overkroppen mot hyre (motsatt side av sengen). Lft baken godt opp og sving deg over p sengen.', 13267, 2013629, 3, 'https://exorlive.com/media_9956@50.50.media', 'https://exorlive.com/video/?ex=9956'),
(892, 1069, 9865, 'Drikke av flaske', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten. Flasken kan eventuelt lftes med begge hender.\nAktiviteten gjres vanskeligere eller lettere ved  ha mer eller mindre vske i flasken.', 13086, 2013359, 1, 'https://exorlive.com/media_9865@50.50.media', 'https://exorlive.com/video/?ex=9865'),
