(895, 1069, 9874, 'Skjre frukt', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.\nFikseringsbrett benyttes ved behov.', 13104, 2013419, 1, 'https://exorlive.com/media_9874@50.50.media', 'https://exorlive.com/video/?ex=9874'),
(896, 1069, 9881, 'Bruke stiftemaskin', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13118, 2013407, 1, 'https://exorlive.com/media_9881@50.50.media', 'https://exorlive.com/video/?ex=9881'),
(897, 1069, 9936, 'Plukke opp ting fra gulvet ved tetraplegi', 'Dersom man ikke har muskulatur i mage og rygg har man drlig balanse og vanskelig for  plukke opp ting man mister p gulvet. Hold den ene armen bak hndtaket p rullestolen. Hold fast ved  strekke hndleddet kraftig (dorsalfleksjon). Vipp opp det du skal ha tak i mot hjulet p rullestolen.', 13227, 2013218, 2, 'https://exorlive.com/media_9936@50.50.media', 'https://exorlive.com/video/?ex=9936'),
(898, 1069, 9871, 'Trke opp', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13098, 2013362, 1, 'https://exorlive.com/media_9871@50.50.media', 'https://exorlive.com/video/?ex=9871'),
(899, 1069, 9869, 'Dekke bord', 'Ta ut glass/ tallerken/ bestikk av skap.\n\nVed redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13094, 2013422, 1, 'https://exorlive.com/media_9869@50.50.media', 'https://exorlive.com/video/?ex=9869'),
(900, 1069, 9937, 'Pkledning tetraplegi: ta p skjorte med knappeknepper', 'Det kan vre lurt  f montert en hndklemme p knappeknepperen dersom man ikke har fingerfunksjon.Fr knappeknepperen inn i skjortehullet. F tak i knappen og trekk den gjennom hullet. Sttt med motsatt hnd.', 13229, 2013473, 2, 'https://exorlive.com/media_9937@50.50.media', 'https://exorlive.com/video/?ex=9937'),
(901, 1069, 9875, 'Kna deig', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13106, 2013227, 1, 'https://exorlive.com/media_9875@50.50.media', 'https://exorlive.com/video/?ex=9875'),
(902, 1069, 9963, 'Plassering av seil til forflytning med heis', 'Seilet legges klart p rullestolryggen. Pleiere hjelper pasienten frem med ryggen for  kunne plassere seilet bak pasienten og langt ned til sitteputen. Deretter lener pasienten seg tilbake og hjelperne lfter bena for  plassere seilet under lrene. Seilender skal krysses for  holde bena samlet.', 13301, 2013614, 4, 'https://exorlive.com/media_9963@50.50.media', 'https://exorlive.com/video/?ex=9963'),
(903, 1069, 9877, 'Vispe egg for hnd', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i alle deler av aktiviteten.\nBenytt en egen bolle til  knekke eggene i, for  unng eggeskall i rren, deigen eller lignende.', 13110, 2013455, 1, 'https://exorlive.com/media_9877@50.50.media', 'https://exorlive.com/video/?ex=9877'),
(904, 1069, 9851, 'Avkledning bukse med hemiplegisk arm', 'Hvis du kan, reis deg opp. Ved forflytning fra rullestol husk  sette p bremser, samt fjerne fotbrett. \nSett deg godt frem i stolen.\nSrg for at fttene er plassert s langt under kroppen som mulig, samtidig som begge fotbladene er i gulvet.\nBruk frisk hnd til  sttte deg p armlenet. \nLen deg fremover, overdriv.\nReis deg opp med vekt p begge ben. Det er viktig at helen p foten med minst funksjon er godt i bakken.\nFinn balansen, bruk eventuelt servant eller et bord foran deg som sikring.\nBruk frisk hnd til  dra buksen ned s langt du fr til, helst ned p knrne.\nSett deg deretter ned igjen og ta buksen av p frisk side frst.\nBruk friskt ben til  vippe buksen av det andre benet.', 13058, 2013254, 1, 'https://exorlive.com/media_9851@50.50.media', 'https://exorlive.com/video/?ex=9851'),
(905, 1069, 9950, 'Rengjre svinghjulene', 'Plasser rullestolen slik at du nr svinghjulene. Det anbefales  demontere svinghjul jevnlig for  fjerne hr og annet smuss.', 13255, 2013302, 2, 'https://exorlive.com/media_9950@50.50.media', 'https://exorlive.com/video/?ex=9950'),
(906, 1069, 9958, 'Forflytning fra seng til rullestol ved hemiplegi', 'Sett deg ut p sengekanten, og plasser begge bena i gulvet.\nPlasser rullestolen inntil senga p frisk side. Husk  sette p bremser. Ta av fotbrett og armlene p siden av rullestolen som er nrmest sengen. Har du hyderegulerbar seng, juster denne slik at sengekanten er i hyde med rullestolputen.\nPass p at foten med minst funksjon str plassert i samme retning som er naturlig nr du sitter i stolen.\nBruk armlenet lengst unna til  sttte deg p. \nLen deg fremover og snu deg over i stolen. \nMonter armlenet og fotsttten.', 13271, 2013608, 3, 'https://exorlive.com/media_9958@50.50.media', 'https://exorlive.com/video/?ex=9958'),
(907, 1069, 9844, 'Pkledning genser ved hemiplegi', 'Sjekk at t-skjorten/genseren ikke er vrang ved  se p smmene.\nTa tak i kragen p plagget, finn merkelappen bak i kragen. Legg plagget i fanget, med baksiden opp og kraven mot knrne.\nFinn armene og legg plagget som en T\nFinn den store pningen p plagget som ligger nrmest magen. \nFr armen med minst funksjon ned i pningen og ned i ermet. Ta frisk arm inn i det andre ermet. \nTrekk ermet godt over albuen p armen med minst funksjon ved hjelp av frisk hnd. \nTa tak i kragen p plagget, samle sammen stoffet som utgjr ryggen og ta plagget over hodet.\nKontroller i speilet at plagget ikke sitter skjevt.', 13044, 2013338, 1, 'https://exorlive.com/media_9844@50.50.media', 'https://exorlive.com/video/?ex=9844'),
(908, 1069, 9845, 'Pkledning jakke ved hemiplegi', 'Start alltid pkledning av overkropp ved  kle p armen med minst funksjon.\nLegg jakka p fanget med kragen mot deg. Innsiden av jakken skal vende opp.\nFr frisk arm inn i motsatt erme, legg ermet mellom bena slik at det blir en tunnel. Trekk frisk arm ut igjen.\nFr armen med minst funksjon ned i hullet ved  bye overkroppen frem.\nDra jakkeermet opp over albuen.\nTa tak p motsatt side av jakken (frisk side).\nFr jakken over skulder med minst funksjon og videre bak nakken. Ikke slipp fr du har ftt den godt over p motsatt side.\nFr frisk hnd bak og ta tak i jakken. Armen fres inn i jakkeermet.\nDra jakken ned bak for  f den p plass.\nKontroller i speilet at plagget ikke sitter skjevt.', 13046, 2013368, 2, 'https://exorlive.com/media_9845@50.50.media', 'https://exorlive.com/video/?ex=9845'),
(909, 1069, 9947, 'Justering av luftmengden i trykkavlastende sittepute', 'For noen rullestolbrukere er det mulig  stille og justere luftmengden selv. For riktig bruk av enhver sittepute m bruksanvisningen leses nye og evt. opplring gis av fagpersonell.', 13249, 2013464, 2, 'https://exorlive.com/media_9947@50.50.media', 'https://exorlive.com/video/?ex=9947'),
(910, 1069, 9951, 'Forflytning fra rullestol til seng med brett ved tetraplegi', 'Plasser eventuelt hjulbeskyttelse p hjulet.Kom frem i stolen. Skyv brettet inn under baken ved  lene deg over p motsatt side, eventuelt lfte benet s det hviler p leggsttteremmen. Lft fttene av fotbrettene, vinkelen i kne skal vre minst 100 grader. Plasser venstre arm bak og tett inntil setet. Len deg fremover og roter overkroppen mot motsatt side av den du skal forflytte deg til. Skyv fra med venstre hnd mens du roterer i skulderen, eventuelt bruk hyre arm og hjelp til ved  trekke deg over til sengen.', 13257, 2013635, 3, 'https://exorlive.com/media_9951@50.50.media', 'https://exorlive.com/video/?ex=9951'),
(911, 1069, 9850, 'Avkledning jakke ved hemiplegi', 'Begynn med frisk arm. Sett fast nederste del av ermet under lret og dra ut armen.\nDytt jakken bak mot arm med minst funksjon.\nDra av jakken med frisk hnd.', 13056, 2013476, 1, 'https://exorlive.com/media_9850@50.50.media', 'https://exorlive.com/video/?ex=9850'),
(912, 1069, 9957, 'Forflytning fra seng til rullestol uten brett', 'Du br tilstrebe  ha lik hyde eller litt nedoverbakke nr du skal forflytte deg mellom to steder. Sett deg godt frem p sengekanten med minst 100 grader i kneleddet. Venstre hnden skal vre tett inntil setet. Hyre hnd sttter p stolen (husk litt plass der du skal sette deg). Len deg noe frem og roter overkroppen mot venstre (motsatt side av stolen). Lft baken godt opp og sving deg over p stolen.', 13269, 2013617, 3, 'https://exorlive.com/media_9957@50.50.media', 'https://exorlive.com/video/?ex=9957'),
(913, 1069, 9855, 'F ut innhold av flaske ved hemiplegisk arm', 'Plasser flasken mellom lrene. \npne korken med frisk hnd. \nTrykk ut nsket mengde shampoo rett i hret ved bruk av frisk arm. \nAlternativt kan du klemme ut nsket mengde i hnden med minst funksjon, og deretter ta det over i frisk hnd.', 13066, 2013374, 1, 'https://exorlive.com/media_9855@50.50.media', 'https://exorlive.com/video/?ex=9855'),
(914, 1069, 9847, 'Pkledning bukse ved hemiplegi', 'Pass p at buksa er riktig vei. \nForsk  f beinet opp motsatt kne. Alternativ kan det benyttes en krakk. \nLegg foten slik at den ligger fritt i luften.\nStart alltid med foten med minst funksjon. Reis deg opp.\nDra buksen s godt opp p lret som mulig.\nDra p buksen. Kontroller i speilet at plagget ikke sitter skjevt.\n \nVed forflytning fra rullestol; husk  sette p bremser, samt fjerne fotbrett fr du reiser deg. \nSett deg godt frem i stolen.\nSrg for at fttene er plassert s langt under kroppen som mulig, samtidig som begge fotbladene er i gulvet.\nBruk frisk hnd til  sttte deg p armlenet. \nLen deg fremover, overdriv.\nReis deg opp med vekt p begge ben. Det er viktig at helen p foten med minst funksjon er godt i bakken.\nFinn balansen. \nSrg for sttte ved nedsatt balanse, ved at for eksempel rullestol str bak deg og at du str med et bord eller vaskeservant foran deg.', 13050, 2013305, 2, 'https://exorlive.com/media_9847@50.50.media', 'https://exorlive.com/video/?ex=9847'),
(915, 1069, 9846, 'Pkledning sokker ved hemiplegi', 'Forsk  f benet opp motsatt kne. Alternativ kan det benyttes en krakk. \nLegg foten slik at den ligger fritt i luften. \npne opp sokken med fingrene og tr den p foten. Kjenn etter med fingrene at alle trne er inne i sokken.', 13048, 2013236, 1, 'https://exorlive.com/media_9846@50.50.media', 'https://exorlive.com/video/?ex=9846'),
(916, 1069, 9935, 'Pusse tenner ved tetraplegi 2', 'Hold tannkremtuben i en hnd og vipp opp lokket ved hjelp av andre hnden som du sttter p bordet. Sug ut tannkrem. Det er enklere enn  presse ut av tuben. F tak p tannbrsten. Trykk p knappen med hndbaken, eller ved  presse knappen p tannbrsten mot kanten av vasken.Puss tennene ved  holde tannbrsten i en eller med to hender.', 13225, 2013389, 2, 'https://exorlive.com/media_9935@50.50.media', 'https://exorlive.com/video/?ex=9935'),
(917, 1069, 9938, 'Pkledning tetraplegi: Ta p jakke +  lukke glidels', 'Det kan vre lurt  feste en hempe eller ring i glidelstappen.Fr den ene delen av glidelsen ned i pningen. Hold fast jakken p denne siden mens du trekker opp glidelsen i hempen/ringen', 13231, 2013413, 2, 'https://exorlive.com/media_9938@50.50.media', 'https://exorlive.com/video/?ex=9938'),
(918, 1069, 9879, 'Bruke hullmaskin', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13114, 2013329, 1, 'https://exorlive.com/media_9879@50.50.media', 'https://exorlive.com/video/?ex=9879'),
(919, 1069, 9911, 'Folde sammen sokker ved tetraplegi', 'Hold sokkene i munnen verst p kanten. Ta pekefingrene og langfingre ned i den ytterste sokken og skyv resten av sokken opp med tomlene', 13177, 2013293, 2, 'https://exorlive.com/media_9911@50.50.media', 'https://exorlive.com/video/?ex=9911'),
(920, 1069, 9878, 'Bake muffins', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i alle deler av aktiviteten.\nHnden med minst funksjon kan for eksempel benyttes til  sttte/holde fast bollen eller vispe.', 13112, 2013245, 1, 'https://exorlive.com/media_9878@50.50.media', 'https://exorlive.com/video/?ex=9878'),
(921, 1069, 9906, 'Bruk av nettbrett/PC ved Tetraplegi', 'Benytt knokene til  trykke p knapper og touche platen.', 13167, 2013467, 2, 'https://exorlive.com/media_9906@50.50.media', 'https://exorlive.com/video/?ex=9906'),
(922, 1069, 9882, 'Bla i avis', 'Ved redusert funksjon i en side fokuser p  benytte denne s mye som mulig i aktiviteten.', 13120, 2013500, 1, 'https://exorlive.com/media_9882@50.50.media', 'https://exorlive.com/video/?ex=9882'),
(923, 1069, 9953, 'Sette seg opp i sengen ved tetraplegi', 'F tak i rullestolhjulet. Trekk deg litt opp mens du samtidig sttter deg p motsatt albue fr du strekker den armen i overstrekk. Nr du har kommet litt hyere opp skyver du fra siste biten med albuen p rullestolen og venstre arm under venstre ben.', 13261, 2013638, 3, 'https://exorlive.com/media_9953@50.50.media', 'https://exorlive.com/video/?ex=9953'),
(924, 1069, 9867, 'Vanne blomster', 'Gjr aktiviteten lettere eller vanskeligere ved  plassere blomstene i ulike hyder og fyll lite eller mye vann i vannkannen', 13090, 2013257, 1, 'https://exorlive.com/media_9867@50.50.media', 'https://exorlive.com/video/?ex=9867'),
(925, 1069, 9848, 'Pkledning sko ved hemiplegi', 'Forsk  f benet opp motsatt kne. Alternativt kan det benyttes en krakk. \nLegg foten slik at den ligger fritt i luften, da er det lettest  f dratt p skoen.\nPass p at lissene ikke ligger nede i skoen.', 13052, 2013308, 1, 'https://exorlive.com/media_9848@50.50.media', 'https://exorlive.com/video/?ex=9848'),
