(994, 1063, 7514, 'Underarms innoverrotasjon med strikk', 'Kryss underarmene og la den underste underarmen sttte seg p bordflaten, mens den verste underarmen hviler opp med hndbaken pekende ned. Hold tak rundt strikken med hver hnd. Roter den verste underarmen slik at hndbaken blir pekende opp og strikken strammes.', 7879, 2006767, 3, 'https://exorlive.com/media_7514@50.50.media', 'https://exorlive.com/video/?ex=7514'),
(995, 1063, 7517, 'Rotasjon av hndleddet med foldet hender', 'La underarmene hvile p et bord med hendene utenfor bordkanten. Fold hendene og roter fra side til side.', 7885, 2006886, 1, 'https://exorlive.com/media_7517@50.50.media', 'https://exorlive.com/video/?ex=7517'),
(996, 1063, 5639, 'Gape og sperre opp ynene', 'pne munnen og leppene s langt  som mulig samtidig som du hever yenbrynene s hyt som mulig. Hold i 5 sekunder.', 5556, 2005996, 2, 'https://exorlive.com/media_5639@50.50.media', 'https://exorlive.com/video/?ex=5639'),
(997, 1063, 7513, 'Underarms utoverrotasjon med strikk og sttte', 'Plasser albuene inntil siden av kroppen og by 90 grader i albueleddet. Sttt underarmene p bordflaten. Hold tak med hendene rundt strikken. Vri underarmen utover slik at hndbaken blir pekende ned mot bordet. Returner til startposisjon.', 7877, 2006972, 3, 'https://exorlive.com/media_7513@50.50.media', 'https://exorlive.com/video/?ex=7513'),
(998, 1063, 6431, 'Underarmsvelse m/strikk (radial deviasjon)', 'Sitt med underarmen p lret. Fest den ene enden av strikken under foten og ha et godt grep om den andre enden av strikken. Hold underarmen slik at tommelen peker oppover. By hndleddet mot deg og senk tilbake. Unng  lfte underarmen.', 6419, 2007704, 2, 'https://exorlive.com/media_6431@50.50.media', 'https://exorlive.com/video/?ex=6431'),
(999, 1063, 7560, 'Fingersprik med strikk', 'Sitt p en stol ved et bord med hndflaten ned mot bordet. Fest strikken samlet rundt alle fingrene utenom tommelen. Sprik med fingrene og forsk  ty ut strikken.', 7964, 2006801, 2, 'https://exorlive.com/media_7560@50.50.media', 'https://exorlive.com/video/?ex=7560'),
(1000, 1063, 7593, 'Rotasjon av underarmen', 'Sitt p en stol. By 90 grader i albuen og hold hnden som om du skulle hilse p noen. Hold albuen i ro og roter kun underarmen. Frst innover slik at hndflaten peker ned, og deretter utover slik at hndflaten peker opp.', 8016, 2006985, 1, 'https://exorlive.com/media_7593@50.50.media', 'https://exorlive.com/video/?ex=7593'),
(1001, 1063, 6587, 'Plassering av skjerm 1', 'Tradisjonelt anbefales 15 - 30 vinkel under yets horisontallinje til et punkt midt p skjermen. Avstand til skjermen vil vre avhengig av brukerens synsevne. Foretrukket synsavstand varierer gjerne mellom 50 cm og 70 cm.', 6586, 0, 0, 'https://exorlive.com/media_6587@50.50.media', 'https://exorlive.com/video/?ex=6587'),
(1002, 1063, 5610, 'Underarms pronasjon-supinasjon', 'Plassr underarmen og hndflaten p bordet eller lret ditt, slik at du slapper av i bde arm og skulder. Drei underarmen slik at hndflaten vekselvis vender opp og ned.', 5596, 2006006, 1, 'https://exorlive.com/media_5610@50.50.media', 'https://exorlive.com/video/?ex=5610'),
(1003, 1063, 5643, 'Sprike med fingrene', 'Strekk og samle fingrene slik at hnden blir flat. Sprik s mye med fingrene som du klarer. Bytt hnd.', 5572, 0, 2, 'https://exorlive.com/media_5643@50.50.media', 'https://exorlive.com/video/?ex=5643'),
(1004, 1063, 7564, 'Utoverfring av tommel med strikk', 'Sitt p en stol ved et bord med lillefingersiden av hnden ned mot bordet. Fest en strikk rundt nederste del av pekfingeren og rundt tommelen. Sprik med tommelen slik at du frer den lengst mulig fra pekefingeren.', 7972, 2006960, 2, 'https://exorlive.com/media_7564@50.50.media', 'https://exorlive.com/video/?ex=7564'),
(1005, 1063, 7516, 'Hndleddsby med foldet hender', 'La underarmene hvile p et bord med hendene utenfor bordkanten. Fold hendene og beveg hndleddet opp og ned.', 7883, 2006844, 1, 'https://exorlive.com/media_7516@50.50.media', 'https://exorlive.com/video/?ex=7516'),
(1006, 1063, 6432, 'Underarmsvelse m/strikk (ulnar deviasjon)', 'Sitt med underarmen p lret. Hold den ene enden av strikken i den passive hnden og ha et godt grep om den andre enden av strikken. Hold underarmen slik at tommelen peker oppover og strikken slik at den er parallell med underarmen. By hndleddet fra deg slik at strikken strammes.', 6411, 2007738, 2, 'https://exorlive.com/media_6432@50.50.media', 'https://exorlive.com/video/?ex=6432'),
(1007, 1063, 5647, 'Bye ytter- og mellomledd i fingrene', 'Strekk og samle alle fingrene. By alle fingrene i mellomleddet som om du lager et "karategrep".', 5580, 2007688, 2, 'https://exorlive.com/media_5647@50.50.media', 'https://exorlive.com/video/?ex=5647'),
(1008, 1063, 6404, 'Forslag til plassering av utstyr', 'Arbeidstakeren har god plass til underarmene og mulighet til  benytte datamus i forkant av tastatur.', 6378, 0, 0, 'https://exorlive.com/media_6404@50.50.media', 'https://exorlive.com/video/?ex=6404'),
(1009, 1063, 7558, 'By av tommel', 'Sitt p en stol ved siden av et bord. Legg hndbaken p bordet slik at hndflaten peker opp. Fr tommelen  mot grunnleddet av lillefingeren.', 7960, 2006930, 2, 'https://exorlive.com/media_7558@50.50.media', 'https://exorlive.com/video/?ex=7558'),
(1010, 1063, 9802, 'Heve og senke skuldrene', 'Pust dypt inn og trekk skuldrene s hyt opp som mulig og slipp skuldrene ned ved utpust, press ned s godt som mulig', 12960, 2013578, 1, 'https://exorlive.com/media_9802@50.50.media', 'https://exorlive.com/video/?ex=9802'),
(1011, 1063, 7563, 'Sprik av pekefinger og tommel med strikk', 'Sitt p en stol ved et bord med hndflaten ned. Fest en strikk rundt pekfingeren og tommelen. Sprik med pekefingeren og tommelen slik at de fres lengst mulig fra hverandre.', 7970, 2006920, 2, 'https://exorlive.com/media_7563@50.50.media', 'https://exorlive.com/video/?ex=7563'),
(1012, 1063, 7547, 'Knyttneve p bord', 'Sitt ved et bord med undearmen og hndflaten stttende p bordet. Fra  ha hele hndflaten stttende p bordet, by i alle fingrene slik at det blir en knyttneve og deretter strekk ut fingrene igjen.', 7942, 2006952, 2, 'https://exorlive.com/media_7547@50.50.media', 'https://exorlive.com/video/?ex=7547'),
(1013, 1063, 6584, 'Plassering av tastatur', 'Tastaturet skal vre adskilt fra skjermen slik at det kan tilpasses arbeidstakeren og arbeidsoppgavene. Trdlse tastaturer kan vre  foretrekke da de er enkle  plassere. Tastaturet br vre s lavt som mulig for at hndleddet kan vre i tilnrmet hvilestilling ved bruk. Det br vre mulig  endre helningsvinkel p tastaturet slik at hndleddsvinkelen kan varieres. Det skal vre god plass til  hvile hndledd og underarmer p bordplaten. Tastaturet br ligge stdig p bordet og ikke skli, det skal ha en matt overflate, og symbolene skal ha tilstrekkelig kontrast slik at du lett kan lese dem ved en normal sittestilling. Tastaturer som lager sty br unngs.', 6377, 0, 0, 'https://exorlive.com/media_6584@50.50.media', 'https://exorlive.com/video/?ex=6584'),
(1014, 1063, 6405, 'Arbeidsstol', 'Arbeidsstolen skal gi muligheter for varierte og komfortable stillinger og skal kunne tilpasses den enkelte arbeidstaker. Stolens sete og rygg br kunne reguleres uavhengig av hverandre. Innstillingene br kunne lses ved behov. Du br velge en stoltype som gir deg god sttte i korsryggen. Armlener kan gi god avlastning men m ikke vre til hinder slik at stolen ikke kommer tilstrekkelig nr bord/tastatur. Armlenene br ha god bredde, kunne reguleres i hyden og ikke ha glatt overflate.', 6588, 0, 0, 'https://exorlive.com/media_6405@50.50.media', 'https://exorlive.com/video/?ex=6405'),
(1015, 1063, 9805, 'Skuldersirkel bakover', 'Legg fingrene p toppen av skuldrene. Beveg albuene i en stor sirkel bakover.', 12966, 2013587, 1, 'https://exorlive.com/media_9805@50.50.media', 'https://exorlive.com/video/?ex=9805'),
(1016, 1063, 8354, 'Lukke munnen med motstand', 'Sitt oppreist p en stol. Gap. Plasser pekefinger og tommel over haken og hold igjen nr du forsker  lukke munnen.', 10048, 2008117, 2, 'https://exorlive.com/media_8354@50.50.media', 'https://exorlive.com/video/?ex=8354'),
(1017, 1063, 6393, 'Massre ansiktet', 'Flytt blikket bort fra skjermen. Massr musklene i ansiktet med faste sirkelbevegelser. Massr pannen, tinningene og de store kjevemusklene.', 6362, 2006005, 1, 'https://exorlive.com/media_6393@50.50.media', 'https://exorlive.com/video/?ex=6393'),
(1018, 1063, 7548, 'Fingerstrekk p bord', 'Sitt ved et bord med underarmen og hndflaten stttende p bordet. Lft en og en finger opp fra bordet fra tommelen til lillefingeren uten  lfte resten av hnden.', 8002, 2006991, 2, 'https://exorlive.com/media_7548@50.50.media', 'https://exorlive.com/video/?ex=7548'),
(1019, 1063, 6403, 'Plassering av skjerm 2', 'Flate skjermer er  foretrekke. De avgir mindre varme, har lavere elektromagnetiske felt, flimrer ikke, gir ofte bedre lesekvalitet, tar mindre plass, er mindre srbare for sjenerede refleks i skjermbildet og er enklere  plassere. Stor skjerm er en fordel for de fleste. Spesielt om man har drlig syn. Det er best om skjermen kan vinkles og roteres. En vinkling av skjermen p 15 - 20 grader bakover gir for mange en bedre arbeidsstilling.', 6377, 0, 0, 'https://exorlive.com/media_6403@50.50.media', 'https://exorlive.com/video/?ex=6403'),
(1020, 1063, 6585, 'Plassering av datamus', 'Det anbefales  prve ut ulike typer datamus. For stor datamus gir oppoverby (ekstensjon) i hndleddet og kan gi statisk muskelbelastning. Trdls mus er  foretrekke, slik at den enkelt kan beveges og flyttes p. Det kan vre bra  variere med  bruke datamusen foran tastaturet. Man br lre seg hutigtaster p tastaturet slik at man kan variere mellom datamus og tastatur da bruk av pekeutstyr kan gi strre statisk muskelbelastning enn bruk av tastatur.', 6377, 0, 0, 'https://exorlive.com/media_6585@50.50.media', 'https://exorlive.com/video/?ex=6585'),
(1021, 1063, 7559, 'Lage sirkler med tommelen', 'Sitt p en stol ved siden av et bord. Legg hndens lillefingerside ned mot bordet. Ha tommelen slik at den peker rett opp mot taket. Prv  lage sirkler i luften med tommelen.', 7962, 2006967, 2, 'https://exorlive.com/media_7559@50.50.media', 'https://exorlive.com/video/?ex=7559'),
(1022, 1063, 9423, 'Hndleddsstrekk og -by', 'Sett deg med siden til et bord og legg hnden ut over bordkanten. Beveg heretter din hnd opp og ned med avslappede fingre. Vend den andre side til, nr du skifter hnd.', 11947, 2011586, 1, 'https://exorlive.com/media_9423@50.50.media', 'https://exorlive.com/video/?ex=9423'),
(1023, 1063, 7521, 'Fingerby', 'Sittende med underarmen stttende p et bord og hnden utenfor. Med tommelen pekende rett opp og fingrene helt strukket. By alle fingrene utenom tommelen.', 7892, 2006835, 1, 'https://exorlive.com/media_7521@50.50.media', 'https://exorlive.com/video/?ex=7521'),
(1024, 1063, 6387, 'Sideforskyvning av kjeven', 'Beveg kjeven fra side til side.', 6352, 2005993, 1, 'https://exorlive.com/media_6387@50.50.media', 'https://exorlive.com/video/?ex=6387'),
(1025, 1063, 7596, 'Gripe', 'Hold underarmen og hnden rett med fingrene helt inntil hverandre. By i alle ledd i fingrene og tommelen som om du skulle gripe rundt en flaske.', 8022, 2006856, 1, 'https://exorlive.com/media_7596@50.50.media', 'https://exorlive.com/video/?ex=7596'),
(1026, 1063, 7594, 'Halvsirkelbevegelse med hnd', 'Hold hnden utenfor bordkanten med hndflaten frem. Tegn store halvsirkler i luften i begge retninger.', 8018, 2006777, 2, 'https://exorlive.com/media_7594@50.50.media', 'https://exorlive.com/video/?ex=7594'),
(1027, 1063, 7546, 'Fingerby 2', 'Sitt ved et bord med underarmen og hndflaten hvilende p bordet. Hold fingrene strake og by kun opp i grunnleddene (knokene) og i hndleddet.', 7940, 2006912, 2, 'https://exorlive.com/media_7546@50.50.media', 'https://exorlive.com/video/?ex=7546'),
(1028, 1063, 7597, 'Tyning av tommel', 'Hvil hnden p et bord og lag en knyttneve med den aktive hnden. Strekk ut alle fingrene og snu hnden slik at hndflaten peker rett opp. Ved hjelp av den motsatte hnden trekk tommelen nedover slik at det tyer. Hold ca 30 sek', 8383, 2006896, 1, 'https://exorlive.com/media_7597@50.50.media', 'https://exorlive.com/video/?ex=7597'),
(1029, 1063, 9838, 'Skyve hndkle p bordplate', 'Sitt ved bord med et brettet hndkle under knyttede hender.\nSkyv hndkleet diagonalt fra deg og tilbake. Vekselvis hyre og venstre side.', 13032, 2013452, 1, 'https://exorlive.com/media_9838@50.50.media', 'https://exorlive.com/video/?ex=9838'),
