(1044, 1063, 9420, 'Fingerby 3', 'Legg hndryggen p et bord. By og strekk fingrene i de to ytterste ledd med strakte knoker. Knytt til sist hnden ved  bye alle tre ledd, s fingertuppene nr hndflaten. pne hnden og strekk fingrene ut.', 11941, 2011553, 1, 'https://exorlive.com/media_9420@50.50.media', 'https://exorlive.com/video/?ex=9420'),
