(1046, 1063, 7167, 'Hvilestilling - stende i trapp', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. St med stdig beinstilling og len deg p handlevognen, mot vinduskarmen eller p rekkverket e.l. Pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7150, 0, 1, 'https://exorlive.com/media_7167@50.50.media', 'https://exorlive.com/video/?ex=7167'),
(1047, 1063, 7522, 'Fingerstrekk ledd for ledd', 'Sittende med underarmen hvilende p et bord. Start med  holde en knyttneve og strekk fingrene ut ledd for ledd slik at det ytterste fingerleddet er det som strekkes ut til slutt, hold fingerne samlet gjennom hele bevegelsen.', 7894, 2006877, 2, 'https://exorlive.com/media_7522@50.50.media', 'https://exorlive.com/video/?ex=7522'),
(1048, 1063, 9811, 'Padling med trunkusrotasjon', 'Store padlebevegelser til hyre og venstre med rotasjon av overkroppen.', 12978, 2013554, 2, 'https://exorlive.com/media_9811@50.50.media', 'https://exorlive.com/video/?ex=9811'),
(1049, 1063, 9421, 'Sideveis bevegelse av fingre', 'Legg hnden flatt p bordet. Flytt tommelfingeren ut til siden og la de andre fingrene flge etter n etter n. Lft hele hnden tilbake til utgangsstillingen.', 11943, 2011619, 1, 'https://exorlive.com/media_9421@50.50.media', 'https://exorlive.com/video/?ex=9421'),
(1050, 1063, 9392, 'Bred munn', 'Lag bred munn/smil med samlede lepper.', 11885, 2011610, 1, 'https://exorlive.com/media_9392@50.50.media', 'https://exorlive.com/video/?ex=9392'),
(1051, 1063, 9807, 'Strekk og sprik', 'Strekk armene fremover og sprik med fingrene, hndflatene peker nedover. By albuene og trekk  hendene mot brystkassen med knyttede never.\nGjr det samme ut p sidene.', 12970, 2013521, 1, 'https://exorlive.com/media_9807@50.50.media', 'https://exorlive.com/video/?ex=9807'),
(1052, 1063, 8680, 'Knip og pne yne og munn', 'Knip yne og munn godt sammen, pne deretter yne og munn og gjr dem s store du kan. Gjenta.', 10821, 2009892, 1, 'https://exorlive.com/media_8680@50.50.media', 'https://exorlive.com/video/?ex=8680'),
