(1112, 1071, 8038, 'Trille rullestol', 'Srg for at barnet sitter godt i rullestolen med bena p fotsttten. Bruk hndtak bak p rullestol for  trille barnet.', 8437, 2007374, 1, 'https://exorlive.com/media_8038@50.50.media', 'https://exorlive.com/video/?ex=8038'),
(1113, 1071, 8051, 'Forflytning fra rullestol til stol med to personer', 'Fortell barnet hva dere skal gjre. Sett p bremsene p rullestolen og be barnet krysse armene over brystet. Den ene personen stiller seg foran barnet og tar tak under barnets lr. Den andre personen stiller seg bak barnet  og tar tak under armene. Bruk bena og srg for en god lftestilling. Lft barnet opp og forflytt det til stolen.', 8448, 2007476, 1, 'https://exorlive.com/media_8051@50.50.media', 'https://exorlive.com/video/?ex=8051'),
(1114, 1071, 8041, 'Snu rullestol til venstre - hurtig', 'Sitt oppreist i rullestolen med bena p fotstttene. Dra det venstre hjulet bakover samtidig som du drar det hyre hjulet fremover.', 8455, 2007541, 1, 'https://exorlive.com/media_8041@50.50.media', 'https://exorlive.com/video/?ex=8041'),
(1115, 1071, 8042, 'Snu rullestol til venstre', 'Sitt oppreist i rullestolen med bena p fotstttene. Hold det venstre hjulet i ro samtidig som du drar det hyre hjulet fremover.', 8457, 2007585, 1, 'https://exorlive.com/media_8042@50.50.media', 'https://exorlive.com/video/?ex=8042'),
(1116, 1071, 9956, 'Forflytning fra rullestol til seng uten brett', 'Du br tilstrebe  ha lik hyde eller litt nedoverbakke nr du skal forflytte deg mellom to steder. Sett deg godt frem p stolkanten med minst 100 grader i kneleddet. Hyre hnden skal vre tett inntil setet. Venstre hnd sttter p sengen. Len deg noe frem og roter overkroppen mot hyre (motsatt side av sengen). Lft baken godt opp og sving deg over p sengen.', 13267, 2013629, 3, 'https://exorlive.com/media_9956@50.50.media', 'https://exorlive.com/video/?ex=9956'),
(1117, 1071, 9958, 'Forflytning fra seng til rullestol ved hemiplegi', 'Sett deg ut p sengekanten, og plasser begge bena i gulvet.\nPlasser rullestolen inntil senga p frisk side. Husk  sette p bremser. Ta av fotbrett og armlene p siden av rullestolen som er nrmest sengen. Har du hyderegulerbar seng, juster denne slik at sengekanten er i hyde med rullestolputen.\nPass p at foten med minst funksjon str plassert i samme retning som er naturlig nr du sitter i stolen.\nBruk armlenet lengst unna til  sttte deg p. \nLen deg fremover og snu deg over i stolen. \nMonter armlenet og fotsttten.', 13271, 2013608, 3, 'https://exorlive.com/media_9958@50.50.media', 'https://exorlive.com/video/?ex=9958'),
(1118, 1071, 9951, 'Forflytning fra rullestol til seng med brett ved tetraplegi', 'Plasser eventuelt hjulbeskyttelse p hjulet.Kom frem i stolen. Skyv brettet inn under baken ved  lene deg over p motsatt side, eventuelt lfte benet s det hviler p leggsttteremmen. Lft fttene av fotbrettene, vinkelen i kne skal vre minst 100 grader. Plasser venstre arm bak og tett inntil setet. Len deg fremover og roter overkroppen mot motsatt side av den du skal forflytte deg til. Skyv fra med venstre hnd mens du roterer i skulderen, eventuelt bruk hyre arm og hjelp til ved  trekke deg over til sengen.', 13257, 2013635, 3, 'https://exorlive.com/media_9951@50.50.media', 'https://exorlive.com/video/?ex=9951'),
(1119, 1071, 9957, 'Forflytning fra seng til rullestol uten brett', 'Du br tilstrebe  ha lik hyde eller litt nedoverbakke nr du skal forflytte deg mellom to steder. Sett deg godt frem p sengekanten med minst 100 grader i kneleddet. Venstre hnden skal vre tett inntil setet. Hyre hnd sttter p stolen (husk litt plass der du skal sette deg). Len deg noe frem og roter overkroppen mot venstre (motsatt side av stolen). Lft baken godt opp og sving deg over p stolen.', 13269, 2013617, 3, 'https://exorlive.com/media_9957@50.50.media', 'https://exorlive.com/video/?ex=9957'),
(1120, 1071, 9963, 'Plassering av seil til forflytning med heis', 'Seilet legges klart p rullestolryggen. Pleiere hjelper pasienten frem med ryggen for  kunne plassere seilet bak pasienten og langt ned til sitteputen. Deretter lener pasienten seg tilbake og hjelperne lfter bena for  plassere seilet under lrene. Seilender skal krysses for  holde bena samlet.', 13301, 2013614, 4, 'https://exorlive.com/media_9963@50.50.media', 'https://exorlive.com/video/?ex=9963'),
(1121, 1071, 9953, 'Sette seg opp i sengen ved tetraplegi', 'F tak i rullestolhjulet. Trekk deg litt opp mens du samtidig sttter deg p motsatt albue fr du strekker den armen i overstrekk. Nr du har kommet litt hyere opp skyver du fra siste biten med albuen p rullestolen og venstre arm under venstre ben.', 13261, 2013638, 3, 'https://exorlive.com/media_9953@50.50.media', 'https://exorlive.com/video/?ex=9953'),
(1122, 1071, 9954, 'Bena utenfor sengekanten ved tetraplegi', 'Benytt venstre arm. Skyv det ene benet delvis utfor kanten av sengen, s det andre benet. Flytt baken litt og litt. Bena faller da naturlig p plass og klare til forflytning.', 13263, 2013641, 3, 'https://exorlive.com/media_9954@50.50.media', 'https://exorlive.com/video/?ex=9954'),
(1123, 1071, 9955, 'Forflytning fra seng til rullestol med brett', 'Du br tilstrebe  ha lik hyde eller litt nedoverbakke nr du skal forflytte deg mellom to steder. Sett deg godt frem p sengekanten med minst 100 grader i kneleddet. Len deg ned og hvil p albuen p motsatt side av rullestolen. Plasser brettet godt under setet. Kom s opp i midtposisjon. Hnden som s skyver fra skal vre tett inntil setet. Len deg frem og roter overkroppen til motsatt side av rullestolen. Finn et stttepunkt til hnden, gjerne godt inn p setet i rullestolen. Skyv fra med hnden i sengen. Ikke kom opp med overkroppen fr du er helt over i stolen. Plasser s fttene p fotbrettet ved bruk av hndbaken og albuen som motsttte p motsatt kne. Skyv baken godt inn i setet. Kom opp ved  sttte deg p sengen eller skyv fra med hendene p lrene', 13265, 2013623, 3, 'https://exorlive.com/media_9955@50.50.media', 'https://exorlive.com/video/?ex=9955'),
(1124, 1071, 8048, 'Forflytning fra rullestol til liggende med to personer 1', 'Fortell barnet hva dere skal gjre. Sett p bremsene p rullestolen.Still dere p hver deres side av barnet. Be barnet samle armene og legge dem i fanget. Ta tak under lret og bak ryggen p barnet. Bruk bena og srg for en god arbeidsstilling. Lft barnet opp og forflytt det til matten.', 8441, 2007571, 1, 'https://exorlive.com/media_8048@50.50.media', 'https://exorlive.com/video/?ex=8048'),
(1125, 1071, 9952, 'Fra sittende til liggende i seng ved tetraplegi', 'F sttte bak deg med venstre arm. Hekt hyre arm under venstre knehase og len  bakover mens du lfter med deg benet opp. Ta s tak i det andre benet (eventuelt ved  kaste deg bakover slik at du blir liggende p siden).Rett p bena nr du er kommet opp i sengen.Legg deg ned ved hjelp av  sttte deg p albuene.', 13259, 2013620, 3, 'https://exorlive.com/media_9952@50.50.media', 'https://exorlive.com/video/?ex=9952'),
(1126, 1072, 701, 'Planken', 'St p tr og albuer og la bekkenet hvile mot gulvet. Lft bekkenet opp fra gulvet ved  stramme opp i rygg og mage. Stabilisr kroppen i denne stillingen og hold 3-5 sek. Hvil tilsvarende og gjenta.', 1280, 2004712, 3, 'https://exorlive.com/media_701@50.50.media', 'https://exorlive.com/video/?ex=701'),
(1127, 1072, 778, '"Broen"', 'Plasser fotslene p gulvet og armene ut til siden. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt.', 1494, 2004768, 2, 'https://exorlive.com/media_778@50.50.media', 'https://exorlive.com/video/?ex=778'),
(1128, 1072, 29, 'Push up 2', 'St p ftter og hender med en strak fiksert kropp. Ha mer enn skulderbreddes avstand mellom hendene. Senk kroppen ned mot gulvet og press tilbake, uten  knekke i hoften.', 476, 2003919, 4, 'https://exorlive.com/media_29@50.50.media', 'https://exorlive.com/video/?ex=29'),
(1129, 1072, 603, 'Kneby 1', 'St med fttene i skulderbreddes avstand. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan den dype sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1098, 2004625, 2, 'https://exorlive.com/media_603@50.50.media', 'https://exorlive.com/video/?ex=603'),
(1130, 1072, 11, 'Liggende bekkenlft', 'Ligg p ryggen med byde knr. Knip setet sammen og lft bekkenet og nedre del av ryggen fra underlaget. Hold i 3-5 sek. Hvil tilsvarende.', 1312, 2003810, 2, 'https://exorlive.com/media_11@50.50.media', 'https://exorlive.com/video/?ex=11'),
(1131, 1072, 601, 'Utfall fram 1', 'St med samlede ben og sett armene i siden. Lft det ene benet, og fall framover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1095, 2004624, 3, 'https://exorlive.com/media_601@50.50.media', 'https://exorlive.com/video/?ex=601'),
(1132, 1072, 21, 'Firfotstende diagonalhev', 'St p alle fire med hodet i forlengelse av overkroppen. Stram opp og stabilisr mage- og korsryggregionen. Strekk vekselvis den ene armen og det motsatte benet til de er i forlengelse av kroppen.', 484, 2005948, 3, 'https://exorlive.com/media_21@50.50.media', 'https://exorlive.com/video/?ex=21'),
(1133, 1072, 23, 'Dips p en benk', 'Sttt deg mot benken med ca. skulderbreddes grep. Kroppen holdes tilnrmet strak slik at kun hlene er i gulvet. By i albuen og senk kroppen ned mot gulvet. Press opp igjen.', 1459, 2003864, 3, 'https://exorlive.com/media_23@50.50.media', 'https://exorlive.com/video/?ex=23'),
(1134, 1072, 6385, 'Kneby 7', 'St med hoftebreddes avstand mellom beina. By ned til ca. 90 grader i knrne og sett rumpa ut som om du skal sette deg p en stol. Fr samtidig armene framover. Strekk deg rolig opp til stende igjen samtidig som du frer armene inn til kroppen igjen.', 6348, 2005958, 2, 'https://exorlive.com/media_6385@50.50.media', 'https://exorlive.com/video/?ex=6385'),
(1135, 1072, 782, '"Firfot" ben- og armlft', 'St p alle fire og finn nytralstillingen  i ryggen og bekkenet. Lag "flat mage" og lft det ene benet og den motsatte armen til de er i forlengelse av resten av kroppen. Gjenta motsatt.', 1498, 2004771, 3, 'https://exorlive.com/media_782@50.50.media', 'https://exorlive.com/video/?ex=782'),
(1136, 1072, 16, 'Sit up 1', 'Ligg p ryggen med byde knr og fttene i gulvet. Lft hodet og overkroppen, slik at kun korsryggen til sist berrer underlaget, og senk tilbake. Srg for en jevn bevegelse.', 530, 2003829, 2, 'https://exorlive.com/media_16@50.50.media', 'https://exorlive.com/video/?ex=16'),
(1137, 1072, 711, 'Bekkenlft m/knestrekk', 'Ligg p ryggen med byde knr. Knip setet sammen og lft bekkenet og nedre del av ryggen fra underlaget. Hold denne stillingen og strekk det ene benet. Hold i 3-5 sek. og senk rolig tilbake. Gjenta med motsatt ben.', 1313, 2007219, 4, 'https://exorlive.com/media_711@50.50.media', 'https://exorlive.com/video/?ex=711'),
(1138, 1072, 13, 'Mageliggende rygghev 1', 'Ligg p magen med armene under hodet. Knip setet sammen og stram ryggmuskulaturen og lft overkroppen opp fra gulvet. Hold stillingen i 3-5 sek. og senk overkroppen tilbake. Hvil tilsvarende fr du gjentar velsen.', 488, 2003817, 1, 'https://exorlive.com/media_13@50.50.media', 'https://exorlive.com/video/?ex=13'),
(1139, 1072, 786, '"Broen" ettbenslft 1', 'Plasser fotslene p gulvet og armene ut til siden. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Strekk det ene benet og lft bekkenet opp til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1495, 2004774, 4, 'https://exorlive.com/media_786@50.50.media', 'https://exorlive.com/video/?ex=786'),
(1140, 1072, 4118, 'Ryggliggende ettbens senk', 'Ligg p ryggen med  90 i hofte og knr. Plassr fingrene p innsiden av hoftekammen. Trekk navlen inn. Pust ut, senk hyre fot og strekk benet ut. Trekk inn navlen s mye som mulig. Pust inn og by og hev benet opp til utgangsstillingen igjen. Unng kt svai i korsryggen. Ikke senk benet lenger ned enn at du klarer  holde korsryggen i gulvet.', 4099, 2007666, 4, 'https://exorlive.com/media_4118@50.50.media', 'https://exorlive.com/video/?ex=4118'),
(1141, 1072, 605, 'Ettbens kneby 1', 'St p ett ben. Det passive ben kan eventuelt settes bak det andre og kun sttte bevegelsen. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram. Gjenta med motsatt ben.', 1103, 2004627, 4, 'https://exorlive.com/media_605@50.50.media', 'https://exorlive.com/video/?ex=605'),
(1142, 1072, 6579, 'Planken - rulle fra side til side', 'Sttt deg p albuer og tr. Lft bekkenet slik at kroppen er strak (som en planke). Stram rygg- og magemuskulaturen og stabilisr kroppen i denne stillingen. Legg s vekten over p den ene albuen og dreie hele kroppen som n enhet. Rull tilbake og videre over p den andre albuen. Hver stilling br holdes i minimum 5 sek.', 6513, 2007823, 4, 'https://exorlive.com/media_6579@50.50.media', 'https://exorlive.com/video/?ex=6579'),
(1143, 1072, 3112, '"Broen" ettbenslft 3', 'Plasser den ene fotslen p gulvet og ha armene ut til siden. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1000204, 2004006, 4, 'https://exorlive.com/media_3112@50.50.media', 'https://exorlive.com/video/?ex=3112'),
(1144, 1072, 720, 'Push up m/rotasjon', 'St p ftter og hender med en strak fiksert kropp. Senk kroppen ned mot gulvet og press tilbake, uten  knekke i hoften. I sluttposisjonen roteres overkroppen, ved at man legger vekten over p den ene armen og svinger den andre armen opp mot taket.', 1327, 2004722, 4, 'https://exorlive.com/media_720@50.50.media', 'https://exorlive.com/video/?ex=720'),
(1145, 1072, 19, 'Bekkenhev 1', 'Ligg p ryggen med armene ned langs siden. Lft benene opp, slik at du har 100-110 grader i hoften og en liten by i knrne. Lft bekkenet rett opp mot taket uten  svinge med benene og senk langsomt tilbake.', 502, 2003843, 3, 'https://exorlive.com/media_19@50.50.media', 'https://exorlive.com/video/?ex=19'),
(1146, 1072, 7121, 'Sideliggende hofterotasjon med samlede ftter 1', 'Ligg p siden og sttt hodet mot den ene hnden. Trekk benene litt imot deg slik at du har by i bde knr og hofter. Lft det verste kneet og roter benet utover, mens du holder fttene samlet. Gjenta mot motsatt side.', 7113, 2007638, 2, 'https://exorlive.com/media_7121@50.50.media', 'https://exorlive.com/video/?ex=7121'),
(1147, 1072, 265, 'Mageliggende diagonalhev', 'Ligg p magen med strake armer over hodet. Lft den ene armen og det motsatte ben opp fra gulvet og senk langsomt tilbake. Lft deretter motsatt ben og arm.', 486, 2006013, 2, 'https://exorlive.com/media_265@50.50.media', 'https://exorlive.com/video/?ex=265'),
(1148, 1072, 3, 'Bekkenvipp', 'Ligg p ryggen med byde knr og fttene p gulvet. Press korsryggen ned mot gulvet og vipp bekkenet mot deg. Herfra vippes tilbake ved at du presser baken ned mot gulvet, slik at du til sist svaier i korsryggen.', 494, 2003929, 1, 'https://exorlive.com/media_3@50.50.media', 'https://exorlive.com/video/?ex=3'),
(1149, 1072, 8329, 'Utfall m/ bakre ben p stol', 'St p ett ben med knr og tr pekende rett frem. Sett en stol ca 1 meter bak deg og plasser motsatt ben p stolen. Gjr en kneby og vr ppasselig med  holde kne over t under hele velsen.', 9995, 2007978, 4, 'https://exorlive.com/media_8329@50.50.media', 'https://exorlive.com/video/?ex=8329'),
(1150, 1072, 7, 'Firfotstende krum - svai 1', 'St p alle fire. Krum ryggen og se ned. Hold 4-5 sek. Svai ryggen og se opp. Hold 4-5 sek. Hvil tilsvarende.', 499, 2006003, 1, 'https://exorlive.com/media_7@50.50.media', 'https://exorlive.com/video/?ex=7'),
(1151, 1072, 3346, 'Sit up 7', 'Ligg p ryggen med armene krysset over brystet og med knrne byd. Lft hodet og overkroppen, inntil kun korsryggen berrer underlaget, og senk tilbake. Srg for en jevn bevegelse.', 1000620, 2004153, 2, 'https://exorlive.com/media_3346@50.50.media', 'https://exorlive.com/video/?ex=3346'),
(1152, 1072, 3115, 'Firfotstende arm- og benlft', 'St p alle fire uten  "henge" i skulderpartiet. Lft hodet slik at det er i forlengelse av overkroppen og trekk haken inn. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Deretter strekker du det ene benet bakover samtidig som du lfter motsatt arm. Vend tilbake og gjenta motsatt.', 1000226, 2005939, 4, 'https://exorlive.com/media_3115@50.50.media', 'https://exorlive.com/video/?ex=3115'),
(1153, 1072, 3118, 'Sideliggende ettbenslft 2', 'Ligg p siden med strake ben og sttt hodet med den ene hnden. Lft det verste benet oppover. Srg for at trne peker rett fram og at all bevegelsen skjer i hoften. Unng derfor  vippe bekkenet mot deg eller rotere i hoften. Gjenta velsen med motsatt ben.', 1000209, 2004008, 2, 'https://exorlive.com/media_3118@50.50.media', 'https://exorlive.com/video/?ex=3118'),
(1154, 1072, 407, 'Thev p en benk el. et trappetrinn', 'St p kanten av et trappetrinn eller en benk, slik at hlene er fri. Ha ca. hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1676, 2004352, 3, 'https://exorlive.com/media_407@50.50.media', 'https://exorlive.com/video/?ex=407'),
(1155, 1072, 602, 'Splitt 1', 'St med med hendene i siden. Plasser det aktive benet et godt stykke foran det andre. By ned til ca. 90 grader i kneet. Hold overkroppen oppreist og blikket fram under hele bevegelsen. Gjenta med motsatt ben.', 1097, 2007224, 3, 'https://exorlive.com/media_602@50.50.media', 'https://exorlive.com/video/?ex=602'),
(1156, 1072, 788, 'Sideliggende bekkenhev 1', 'Ligg p siden og sttt deg mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1513, 2004775, 3, 'https://exorlive.com/media_788@50.50.media', 'https://exorlive.com/video/?ex=788'),
(1157, 1072, 31, 'Sideligende bekkenlft 2', 'Ligg p siden og sttt deg mot den ene albuen. Hev bekkenet til kroppen er strak. Hold i 3-5 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 508, 2003996, 5, 'https://exorlive.com/media_31@50.50.media', 'https://exorlive.com/video/?ex=31'),
(1158, 1072, 8171, 'Planken p knrne', 'Ligg p en matte. Sttt deg p albuene og knrne. Hold ryggen rett som en planke under hele velsen.', 9238, 2007939, 2, 'https://exorlive.com/media_8171@50.50.media', 'https://exorlive.com/video/?ex=8171'),
(1159, 1072, 777, 'Ryggligende "flat mage"', 'Ligg p ryggen (hold nytralposisjon av bekken og ryggrad) med fotslene i gulvet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Forsk  holde spenningen mens du puster normalt i 10-15 sek.', 1485, 2007751, 1, 'https://exorlive.com/media_777@50.50.media', 'https://exorlive.com/video/?ex=777'),
(1160, 1072, 8343, 'Retraksjon og protraksjon av skuldrene i planken', 'Sttt deg p armer og tr. Hold kroppen strak under hele velsen. Forsk  skyv skulderbladene fra hverandre slik at du skyver vre del av ryggen opp mot taket. Senk deretter rolig ned igjen og trekk skulderbladene sammen.', 10024, 2008147, 4, 'https://exorlive.com/media_8343@50.50.media', 'https://exorlive.com/video/?ex=8343'),
(1161, 1072, 600, 'Utfall til siden 1', 'St med samlede ben og sett armene i siden. Fr det aktive benet ut og legg tyngden av kroppen over til denne siden. Nr foten treffer gulvet bremses bevegelsen. Ved sluttstilling er det aktive ben byd, og standbenet er tilnrmet strakt. Returner hurtig til startstillingen.', 1092, 2004623, 3, 'https://exorlive.com/media_600@50.50.media', 'https://exorlive.com/video/?ex=600'),
(1162, 1072, 8167, 'Diagonal hndstende planke', 'St p trne og strake armer. Vr ppasslig med  holde ryggen rett. Hold balansen mens du lfter og strekker motsatt arm og ben.', 9231, 2008003, 5, 'https://exorlive.com/media_8167@50.50.media', 'https://exorlive.com/video/?ex=8167'),
(1163, 1072, 8164, '"Broen" ettbenslft 4', 'Ligg med det ene benet byd og fotslen i gulvet, by motsatt ben og ta tak rundt kneet med armene. Stram sete- og lrmuskulaturen og lft bekkenet og nedre del av ryggen fra underlaget.', 9226, 2008160, 4, 'https://exorlive.com/media_8164@50.50.media', 'https://exorlive.com/video/?ex=8164'),
(1164, 1072, 8638, 'Dragen', 'St p ett ben. Len overkroppen fremover samtidig som benet du ikke str p beveges bakover. Stopp bevegelsen nr kroppen er i en rett linje. Armene strekkes ned mot gulvet. Kom deretter tilbake til stende posisjon, lft kneet opp til du har ca nitti grader i hoften, Beveg armene opp mot taket og g opp p t p benet du str p. Kom rolig tilbake til utgangsstilling.', 10737, 2009811, 4, 'https://exorlive.com/media_8638@50.50.media', 'https://exorlive.com/video/?ex=8638');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1165, 1072, 28, 'Push up p knrne 2', 'St p knrne med en fiksert kropp. Ha mer enn skulderbreddes avstand mellom hendene. Senk kroppen ned mot gulvet og press tilbake, uten  knekke i hoften.', 472, 2003912, 2, 'https://exorlive.com/media_28@50.50.media', 'https://exorlive.com/video/?ex=28'),
(1166, 1072, 3340, 'Mageliggende rygghev 3', 'Ligg p magen med armene ned langs siden. Knip setet sammen og stram ryggmuskulaturen og lft overkroppen og armene opp fra gulvet. Hold stillingen i 3-5 sek. og senk overkroppen tilbake. Hvil tilsvarende fr du gjentar velsen.', 1000612, 2004149, 1, 'https://exorlive.com/media_3340@50.50.media', 'https://exorlive.com/video/?ex=3340'),
(1167, 1072, 636, 'Mageliggende skulderlft 3', 'Ligg med armene ut til siden og ha 90 graders vinkel i albuene. Lft armene fra gulvet og press skulderbladene sammen. Senk skuldrene rolig tilbake.', 1163, 2004653, 1, 'https://exorlive.com/media_636@50.50.media', 'https://exorlive.com/video/?ex=636'),
(1168, 1072, 5623, 'Steg opp p en step-benk', 'Plassr det aktive benet p en step-benk, ett trappetrinn eller lignende. Ln deg forover, legg tyngden over p dette benet og strekk kneet slik at du lfter deg opp. Senk langsomt tilbake og gjenta velsen.', 5506, 2005924, 2, 'https://exorlive.com/media_5623@50.50.media', 'https://exorlive.com/video/?ex=5623'),
(1169, 1072, 714, 'Liggende ettbens bekkenlft 2', 'Ligg med det ene benet byd og det andre strakt i ca 45 graders vinkel. Ha armene ned langs siden. Stram sete- og lrmuskulaturen og lft bekkenet og nedre del av ryggen fra underlaget. Hold i 3-5 sek. Hvil tilsvarende. Gjenta med motsatt ben.', 1313, 2007236, 5, 'https://exorlive.com/media_714@50.50.media', 'https://exorlive.com/video/?ex=714'),
(1170, 1072, 9240, 'Mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Jobb med annenhvert ben.', 11829, 2011275, 4, 'https://exorlive.com/media_9240@50.50.media', 'https://exorlive.com/video/?ex=9240'),
(1171, 1072, 7040, 'Rulle med skuldrene 3', 'Rull med begge skuldrene samtidig. Forsk  lage store sirkler. Rull frst noen ganger den ene veien og deretter noen ganger den andre veien. Armene skal henge ned langs siden.', 6990, 2007648, 1, 'https://exorlive.com/media_7040@50.50.media', 'https://exorlive.com/video/?ex=7040'),
(1172, 1072, 5486, 'Kneby m/stol 1', 'Plasser stolen bak deg. St med rett rygg og med fttene i skulderbreddes avstand. Lft armene opp foran brystet. By i hofter og knr og senk deg ned til rumpa svidt berrer kanten p stolen. Press opp igjen. Hold ryggen rett og blikket fram.', 5442, 2004523, 2, 'https://exorlive.com/media_5486@50.50.media', 'https://exorlive.com/video/?ex=5486'),
(1173, 1072, 3130, '"Dobbelthake" 1', 'velsen kan gjres sittende eller stende. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000245, 2005916, 1, 'https://exorlive.com/media_3130@50.50.media', 'https://exorlive.com/video/?ex=3130'),
(1174, 1072, 781, 'T og albuestende bro', 'St p tr og albuer og finn nytralstillingen av ryggen og bekken. Lag "flat mage" og st i denne posisjonen i 10-15 sek.', 1497, 2008509, 3, 'https://exorlive.com/media_781@50.50.media', 'https://exorlive.com/video/?ex=781'),
(1175, 1072, 700, 'Liggende bekkenrotasjon 2', 'Ligg p ryggen med 90 grader i hofte og knr. Hold armene ut til siden. Roter bekkenet og benene vekselvis mot hyre og venstre. Srg for  holde benene samlet.', 1296, 2007222, 4, 'https://exorlive.com/media_700@50.50.media', 'https://exorlive.com/video/?ex=700'),
(1176, 1072, 8345, 'Liggende benlft 1', 'Ligg p ryggen med strake ben og armene ned langs siden litt ut fra kroppen. Hold bena noks strake under hele velsen. Lft bena opp til de er horisontale, senk bena rolig ned til de nesten treffer gulvet og gjenta.', 10028, 2007938, 4, 'https://exorlive.com/media_8345@50.50.media', 'https://exorlive.com/video/?ex=8345'),
(1177, 1072, 280, 'Firfotstende benlft 3', 'St p tr og albuer og hold kroppen fiksert. Forsk  lfte ett ben slik at det er i forlengelse av kroppen. Bytt ben.', 524, 2003913, 5, 'https://exorlive.com/media_280@50.50.media', 'https://exorlive.com/video/?ex=280'),
(1178, 1072, 818, 'Sideliggende bekkenhev 3', 'Ligg p siden med byde knr og sttte mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1610, 2004793, 2, 'https://exorlive.com/media_818@50.50.media', 'https://exorlive.com/video/?ex=818'),
(1179, 1072, 3262, 'Thev 1', 'St p gulvet med ca hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende. Vend tilbage til utgangsstillingen og gjenta. velsen kan gjres med eller uten sttte.', 1000465, 2004072, 1, 'https://exorlive.com/media_3262@50.50.media', 'https://exorlive.com/video/?ex=3262'),
(1180, 1072, 8168, 'Planken med utoverfring av annenhvert ben', 'St med sttte p albuene og trne. Vr ppasselig med  holde ryggen rett under hele velsen. Fr det ene benet ut til siden og inn igjen.Bytt ben og gjenta.', 9233, 2008052, 4, 'https://exorlive.com/media_8168@50.50.media', 'https://exorlive.com/video/?ex=8168'),
(1181, 1072, 9241, 'Dynamisk mountain climber', 'Start i en push-ups posisjon. Hold mage og rygg stabil, mens du trekker kneet opp til albuen fr du frer foten tilbake til startposisjon. Dette gjres i en dynamisk bevegelse. Jobb med annenhvert ben og k tempoet i forhold til nsket intensitet.', 11831, 2011269, 4, 'https://exorlive.com/media_9241@50.50.media', 'https://exorlive.com/video/?ex=9241'),
(1182, 1072, 785, '"Broen" ettbenslft 2', 'Ligg med et godt grep om det ene lret. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1501, 2007249, 4, 'https://exorlive.com/media_785@50.50.media', 'https://exorlive.com/video/?ex=785'),
(1183, 1072, 390, 'Sit up - "foldekniven"', 'Ligg p ryggen med armene ned langs siden. Lft benene opp mot kroppen samtidig som du lfter overkroppen mot benene. I sluttstillingen berrer kun setet gulvet og fingrene berrer ankel/tr.', 711, 2004272, 4, 'https://exorlive.com/media_390@50.50.media', 'https://exorlive.com/video/?ex=390'),
(1184, 1072, 267, 'Skr sit up 1', 'Ligg p ryggen med byde ben. Hold den ene armen bak hodet, og den andre litt ut til siden. Lft hodet og overkroppen og drei i retning av det ene kneet. Korsryggen holdes i gulvet. Gjenta til motsatt side.', 532, 2003899, 2, 'https://exorlive.com/media_267@50.50.media', 'https://exorlive.com/video/?ex=267'),
(1185, 1072, 634, 'Mageliggende skulderlft 1', 'Ligg med armene ned langs siden. Lft skuldrene og overkroppen fra gulvet og press skulderbladene sammen. Senk skuldrene og overkroppen rolig tilbake.', 1159, 2004651, 1, 'https://exorlive.com/media_634@50.50.media', 'https://exorlive.com/video/?ex=634'),
(1186, 1072, 7673, 'Liggende rotasjon av overkroppen', 'Ligg p magen med pannen i matten og med byde albuer slik at hendene ligger p hver side av hodet. Lft venstre arm, skulder og hodet opp fra matten og roter til venstre. Returner til startstillingen og gjenta til hyre side.', 8179, 2006937, 3, 'https://exorlive.com/media_7673@50.50.media', 'https://exorlive.com/video/?ex=7673'),
(1187, 1072, 6641, 'Transversus/Korsett aktivering 2', 'Ligg p ryggen med fttene i gulvet. Plasser hendene p magen, den ene under og den andre over navlen. Aktiver muskelkorsettet ved   trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, uten at den verste hnden beveger seg. Spenn bekkenbunnen samtidig.', 6638, 2008538, 1, 'https://exorlive.com/media_6641@50.50.media', 'https://exorlive.com/video/?ex=6641'),
(1188, 1072, 790, 'Push up mot benk', 'St i push up stilling mot en benk. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekken. Lag "flat mage", senk overkroppen mot benken og press tilbake.', 1512, 2004778, 3, 'https://exorlive.com/media_790@50.50.media', 'https://exorlive.com/video/?ex=790'),
(1189, 1072, 8681, 'Sideliggende abduksjon hofte', 'Ligg p siden med hodet p en pute. Lft det verste benet strakt opp mot taket, senk rolig ned igjen.', 10823, 2009791, 2, 'https://exorlive.com/media_8681@50.50.media', 'https://exorlive.com/video/?ex=8681'),
(1190, 1072, 779, '"Broen" m/benspark', 'Plasser fotslene p gulvet og armene ut til siden. Fra den broliggende posisjonen, med "flat mage" og "bekkenvipp bak" utfrer du langsomme benspark. Lrene skal hele tiden vre parallelle.', 1495, 2004769, 4, 'https://exorlive.com/media_779@50.50.media', 'https://exorlive.com/video/?ex=779'),
(1191, 1072, 7066, 'Utfall bakover 2', 'St med samlede ben og sett armene i siden. Lft det ene benet, og ta et godt steg bakover samtidig som du faller bakover. Nr benet treffer gulvet bremser du bevegelsen til kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 7068, 2007754, 3, 'https://exorlive.com/media_7066@50.50.media', 'https://exorlive.com/video/?ex=7066'),
(1192, 1072, 765, 'Sittende knestrekk 2', 'Sitt ytterst p en stol eller en benk. Strekk og by i det ene kneet. Gjenta med det andre benet.', 1398, 2004757, 1, 'https://exorlive.com/media_765@50.50.media', 'https://exorlive.com/video/?ex=765'),
(1193, 1072, 7502, 'Sammentrekning av skulderbladene 1', 'St oppreist med armene hengende ned langs siden. Trekk skulderbladene sammen og litt ned.', 7855, 2006996, 1, 'https://exorlive.com/media_7502@50.50.media', 'https://exorlive.com/video/?ex=7502'),
(1194, 1072, 8619, 'Bten', 'Sitt p en matte med by i hofter og knr. Lft fttene fra matten og len overkroppen bakover. Armene holdes strake og rett frem. Hold posisjonen.', 10684, 2009345, 5, 'https://exorlive.com/media_8619@50.50.media', 'https://exorlive.com/video/?ex=8619'),
(1195, 1072, 599, 'Kneby mot en vegg', 'St med ryggen mot veggen og plasser benene et stykke ifra den. G ned i sittestilling og hold denne posisjonen. Du skal holde posisjonen til du merker at du begynner  stivne i lrene. Hvil tilsvarende.', 1090, 2004620, 2, 'https://exorlive.com/media_599@50.50.media', 'https://exorlive.com/video/?ex=599'),
(1196, 1072, 32, 'Firfotstende benhev ut', 'St p alle fire. Lft det ene benet ut til siden, mens bekkenet holdes stabilt. Markr sluttstillingen og senk benet. Gjenta til motsatt side..', 514, 2004042, 2, 'https://exorlive.com/media_32@50.50.media', 'https://exorlive.com/video/?ex=32'),
(1197, 1072, 710, 'Liggende diagonal armsving og benspark', 'Ligg p ryggen med 90 graders by i hofter og knr og armene hevet over brystet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Samtidig senker du den ene armen og det motsatte benet.', 1489, 2004719, 5, 'https://exorlive.com/media_710@50.50.media', 'https://exorlive.com/video/?ex=710'),
(1198, 1072, 8325, 'Kneby m/ stol 2', 'St oppreist foran en stol. Bena skal vre i cirka hoftebreddes avstand. Knr og tr skal peke rett frem og armene holdes strakt foran kropen. Gjr en kneby slik at du akkurat ikke setter deg ned p stolen. Bli stende i den stillingen og gjr sm kneby.', 9987, 2008087, 2, 'https://exorlive.com/media_8325@50.50.media', 'https://exorlive.com/video/?ex=8325'),
(1199, 1072, 8630, 'Push ups med benopptrekk 2', 'St p tr og strake armer. Fr det ene kneet opp mot samme sides albue og beveg rolig tilbake, gjenta med motsatt sides ben. By deretter i albuene og senk brystet ned mot gulvet. Skyv deg opp til utgangsposisjon.', 10706, 2009523, 4, 'https://exorlive.com/media_8630@50.50.media', 'https://exorlive.com/video/?ex=8630'),
(1200, 1072, 3131, '"Dobbelthake" 2', 'Ligg p ryggen. Trekk haken inn og lag "dobbelthake", uten  bye hodet framover. Hold stillingen i ca. 15 sekunder og hvil tilsvarende, fr du gjentar velsen igjen.', 1000244, 2005930, 1, 'https://exorlive.com/media_3131@50.50.media', 'https://exorlive.com/video/?ex=3131'),
(1201, 1072, 30, 'Push up smalt grep 1', 'St p tr og strake armer med hendene plassert p en benk. Ha et skulderbredt grep. Srg for at albuene fres tett p kroppen nr du senker kroppen ned mot benken. Press tilbake.', 480, 2003930, 3, 'https://exorlive.com/media_30@50.50.media', 'https://exorlive.com/video/?ex=30'),
(1202, 1072, 3110, 'Firfotstende posisjon "rygg"', 'St p alle fire. Lft hodet slik at det er i forlengelse av overkroppen. Press den vre del av ryggen opp mot taket slik at du unngr  "henge" i skulderpartiet. Trekk deretter haken inn samtidig som du forsker  gjre nakken lngre. Dette er nakkens nytralstilling. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Hold stillingen mens du puster normalt i 10-30 sek.', 1000224, 2005967, 3, 'https://exorlive.com/media_3110@50.50.media', 'https://exorlive.com/video/?ex=3110'),
(1203, 1072, 3339, 'Mageliggende rygghev 2', 'Ligg p magen med armene over hodet. Knip setet sammen og stram ryggmuskulaturen og lft overkroppen og armene opp fra gulvet. Hold stillingen i 3-5 sek. og senk overkroppen tilbake. Hvil tilsvarende fr du gjentar velsen.', 1000609, 2004147, 2, 'https://exorlive.com/media_3339@50.50.media', 'https://exorlive.com/video/?ex=3339'),
(1204, 1072, 279, 'Ryggliggende sykling 1', 'Ligg p ryggen med benene hevet. Press korsryggen ned mot gulvet og strekk benene vekselvis, som om du sykler i luften. Hold spenningen i mage-rygg muskulatur mens du sykler. Unng  svaie i korsryggen.', 522, 2003911, 4, 'https://exorlive.com/media_279@50.50.media', 'https://exorlive.com/video/?ex=279'),
(1205, 1072, 7120, 'Liggende bekkenlft 2', 'Ligg p ryggen med byde knr og fttene i gulvet. Kryss armene over brystet. Knip setet sammen og lft bekkenet og nedre del av ryggen fra underlaget. Hold i ca 5 sek. Hvil tilsvarende.', 7111, 2007817, 3, 'https://exorlive.com/media_7120@50.50.media', 'https://exorlive.com/video/?ex=7120'),
(1206, 1072, 780, '"Firfot" benlft', 'St p alle fire og finn nytralstillingen i ryggen og bekkenet. Lag "flat mage" og lft det ene benet til det er i forlengelse av resten av kroppen. Gjenta med det andre benet.', 1621, 2004770, 2, 'https://exorlive.com/media_780@50.50.media', 'https://exorlive.com/video/?ex=780'),
(1207, 1072, 6233, 'Stende knelft 3', 'Legg all tyngden over p ett ben. Finn balansen og lft det motsatte kneet. Stabiliser i mage og rygg og unng bevegelse i korsryggen. Senk kneet rolig ned og gjenta med motsatt ben.', 6100, 2007630, 2, 'https://exorlive.com/media_6233@50.50.media', 'https://exorlive.com/video/?ex=6233'),
(1208, 1072, 639, 'Liggende bekkenrotasjon 1', 'Ligg p ryggen med byde knr og armene ut til siden. Rotr underkroppen vekselvis mot hyre og venstre.', 1169, 2004658, 2, 'https://exorlive.com/media_639@50.50.media', 'https://exorlive.com/video/?ex=639'),
(1209, 1072, 9247, 'Kombinert planke og sideplanke', 'St p gulvet p tr og albuer. Aktiver magemuskulaturen og hold en rett linje gjennom hele kroppen. Hold stillingen. Roter deretter hele kroppen rundt s du ligger p siden med albue og tr i gulvet. Strekk den andre armen opp mot taket. Hold stillingen. Kom deretter ned i vanlig planke igjen.', 11843, 2011059, 5, 'https://exorlive.com/media_9247@50.50.media', 'https://exorlive.com/video/?ex=9247'),
(1210, 1072, 273, 'Sit up m/knelft', 'Sitt p gulvet med hendene bak hodet. Lft benene s vidt opp fra gulvet og legg deg skrtt bakover slik at du finner balansen. Trekk vekselvis motsatt kne og albue mot hverandre.', 546, 2003905, 4, 'https://exorlive.com/media_273@50.50.media', 'https://exorlive.com/video/?ex=273'),
(1211, 1072, 8351, 'Eksentrisk ettbens kneby', 'St p gulvet med cirka hoftebreddes avstand mellom bena. Knr og tr peker rett frem. Lft opp det ene benet. Gjr en kneby p ett ben og press opp med begge bena.', 10042, 2007974, 4, 'https://exorlive.com/media_8351@50.50.media', 'https://exorlive.com/video/?ex=8351'),
(1212, 1072, 5434, 'Ryggliggende benlft m/90 i knrne', 'Ligg p ryggen med fotslene i gulvet. Plassr fingrene p innsiden av hoftekammene og press lett ned. Trekk navlen inn og merk at magemusklene presser mot fingrene. Pust ut og lft begge knrne mot brystet til lrene er loddrette og leggene parallelle med gulvet. Trekk inn navlen s mye som mulig. Hold stillingen og pust inn. Deretter puster du ut mens du senker benene rolig ned til gulvet.', 4098, 2007725, 3, 'https://exorlive.com/media_5434@50.50.media', 'https://exorlive.com/video/?ex=5434'),
(1213, 1072, 3277, 'Ettbens thev', 'St p ett ben. Lft hlen og press opp til tstende. Hold stillingen i 10-15 sek. Hold blikket framover og unng  kikke ned mens du gjr velsen. velsen kan gjres vanskeligere ved at du lukker ynene.', 1000490, 2004087, 4, 'https://exorlive.com/media_3277@50.50.media', 'https://exorlive.com/video/?ex=3277'),
(1214, 1072, 702, 'Sideliggende benhev', 'Ligg p siden og sttt hodet mot den ene hnden. Lft begge benene samlet opp mot taket. Gjenta til motsatt side.', 1300, 2004713, 3, 'https://exorlive.com/media_702@50.50.media', 'https://exorlive.com/video/?ex=702'),
(1215, 1072, 828, '"Crawl" ben- og armlft m/pute', 'Ligg p magen med sttte under bekkenet f.eks en tykk pute. Lag "bekkenvipp bak" og "flat mage" og lft den ene armen og det motsatte benet opp fra gulvet.', 1625, 2007682, 3, 'https://exorlive.com/media_828@50.50.media', 'https://exorlive.com/video/?ex=828'),
(1216, 1072, 5564, 'Steg opp p trappetrinn 1', 'St med det aktive benet p et trappetrinn, en stepbenk eller lignende. Stram sete- og lrmuskulaturen, strekk i kne og hofte og press deg opp. Senk rolig ned igjen.', 5504, 2006017, 2, 'https://exorlive.com/media_5564@50.50.media', 'https://exorlive.com/video/?ex=5564'),
