(1221, 1072, 261, 'Push up smalt grep 2', 'St p tr og hender med en strak fiksert kropp. Ha et skulderbredt grep. Srg for at albuene fres tett p kroppen nr du senker kroppen ned mot gulvet. Press tilbake.', 478, 2003896, 4, 'https://exorlive.com/media_261@50.50.media', 'https://exorlive.com/video/?ex=261'),
