(1283, 1012, 4294, 'Stende vekselvis armsving over hodet', 'St med fttene samlet og lett utadrotert. Lft armene fram og opp til ca brysthyde. Pust ut og lft den ene armen opp mot taket mens du senker den andre armen mot gulvet, med begge hndflatene vendende fram. Fortsett bevegelsen bakover med begge armer, til du merker strekket i bryst muskulaturen. Unng  svaie i ryggen. Pust inn og returner til utgangsstillingen og gjenta velsen motsatt.', 4274, 2007820, 2, 'https://exorlive.com/media_4294@50.50.media', 'https://exorlive.com/video/?ex=4294'),
(1284, 1012, 5489, 'Sittende sideby', 'Sitt med armene ned langs siden. Strekk varsomt den ene armen ned mot gulvet. Unng  rotre i overkroppen. Hold stillingen i 3-5 sek og vend tilbake til utgangsposisjonen.', 5448, 2004526, 1, 'https://exorlive.com/media_5489@50.50.media', 'https://exorlive.com/video/?ex=5489'),
(1285, 1012, 5649, 'Tye tommel og underarm', 'Hold armen strak ut til siden med tommelen pekende opp mot taket. Lag s en ls knyttneve med tommelen inni hnden. By hndleddet varsomt ned mot gulvet. Hold i 30 sekunder. Bytt hnd.', 5584, 2007757, 1, 'https://exorlive.com/media_5649@50.50.media', 'https://exorlive.com/video/?ex=5649'),
(1286, 1012, 5497, 'Sittende svai og krum i korsryggen', 'Sett deg litt fram p stolen. Krum og svai i korsryggen, ved at du vipper bekkenet fram og tilbake.', 5471, 2004534, 2, 'https://exorlive.com/media_5497@50.50.media', 'https://exorlive.com/video/?ex=5497'),
(1287, 1012, 6401, 'Underarm 8', 'Legg hndflatene ned p bordet. Hold albuene strake. Len deg rolig forover s du kjenner at det strekker p baksiden av underarmene. Hold i 30 sekunder.', 6375, 2004665, 1, 'https://exorlive.com/media_6401@50.50.media', 'https://exorlive.com/video/?ex=6401'),
(1288, 1012, 4295, 'Stende armsving ut', 'St med fttene samlet og lett utadrotert. Lft armene fram og opp til ca brysthyde og vend hndflatene opp. Pust godt ut og fr armene ut til siden/bakover og skrtt opp til armene er bak hodet. pn brystkassen, og merk at brystmuskulaturen tyes. Pust inn og returner til utgangsstillingen.', 4275, 2007890, 1, 'https://exorlive.com/media_4295@50.50.media', 'https://exorlive.com/video/?ex=4295'),
(1289, 1012, 6383, 'Sittende kne mot albue', 'Sitt p en stol.  Lft vekselvis det ene kneet i retning av motsatt albue, samtidig som du vrir deg mot kneet med overkroppen.', 6344, 2004656, 3, 'https://exorlive.com/media_6383@50.50.media', 'https://exorlive.com/video/?ex=6383'),
(1290, 1012, 5639, 'Gape og sperre opp ynene', 'pne munnen og leppene s langt  som mulig samtidig som du hever yenbrynene s hyt som mulig. Hold i 5 sekunder.', 5556, 2005996, 2, 'https://exorlive.com/media_5639@50.50.media', 'https://exorlive.com/video/?ex=5639'),
(1291, 1012, 6395, 'Sittende hofte abduksjon', 'Sitt p en stol. Flytt den ene foten ut mot siden s langt du klarer. Bevegelsen skal kun skje i hoften. Flytt foten tilbake. Bytt fot.', 6365, 2004662, 1, 'https://exorlive.com/media_6395@50.50.media', 'https://exorlive.com/video/?ex=6395'),
(1292, 1012, 6391, 'Skulder pendling', 'Sitt p en stol, len deg framover og la hodet henge tungt. Sttt deg med den ene armen p kneet. La den motsatte armen henge tungt ned langs siden. Beveg hele armen tungt fram og tilbake og kjenn at du fr et lett strekk i skulder og arm.', 6359, 2004659, 1, 'https://exorlive.com/media_6391@50.50.media', 'https://exorlive.com/video/?ex=6391'),
(1293, 1012, 6587, 'Plassering av skjerm 1', 'Tradisjonelt anbefales 15 - 30 vinkel under yets horisontallinje til et punkt midt p skjermen. Avstand til skjermen vil vre avhengig av brukerens synsevne. Foretrukket synsavstand varierer gjerne mellom 50 cm og 70 cm.', 6586, 0, 0, 'https://exorlive.com/media_6587@50.50.media', 'https://exorlive.com/video/?ex=6587'),
(1294, 1012, 6560, 'Heng over lrene', 'Sitt med fttene i gulvet. By deg framover til du hviler med overkroppen mot lrene. La hodet og armene henge tungt mot gulvet. Lukk ynene og slapp av et yeblikk. Trekk pusten rolig.', 6524, 2004681, 1, 'https://exorlive.com/media_6560@50.50.media', 'https://exorlive.com/video/?ex=6560'),
(1295, 1012, 5643, 'Sprike med fingrene', 'Strekk og samle fingrene slik at hnden blir flat. Sprik s mye med fingrene som du klarer. Bytt hnd.', 5572, 0, 2, 'https://exorlive.com/media_5643@50.50.media', 'https://exorlive.com/video/?ex=5643'),
(1296, 1012, 5491, '"Rist ls"', 'La armene henge rett ned langs siden. Slapp av i armene og rist hendene i ca 5 sek. Slapp av like lenge og rist ls p nytt.', 5450, 2004529, 1, 'https://exorlive.com/media_5491@50.50.media', 'https://exorlive.com/video/?ex=5491'),
(1297, 1012, 5647, 'Bye ytter- og mellomledd i fingrene', 'Strekk og samle alle fingrene. By alle fingrene i mellomleddet som om du lager et "karategrep".', 5580, 2007688, 2, 'https://exorlive.com/media_5647@50.50.media', 'https://exorlive.com/video/?ex=5647'),
(1298, 1012, 6404, 'Forslag til plassering av utstyr', 'Arbeidstakeren har god plass til underarmene og mulighet til  benytte datamus i forkant av tastatur.', 6378, 0, 0, 'https://exorlive.com/media_6404@50.50.media', 'https://exorlive.com/video/?ex=6404'),
(1299, 1012, 5616, 'Sittende armsving m/utadrotasjon i skulder', 'Sitt med armene ned langs siden og sprik med fingrene. Drei armene utover, slik at tommelene peker ut til siden. Lft armene ut og opp og strekk de s langt opp mot taket som du klarer. Senk armene rolig tilbake til utgangsposisjonen og gjenta.', 5468, 2004548, 1, 'https://exorlive.com/media_5616@50.50.media', 'https://exorlive.com/video/?ex=5616'),
(1300, 1012, 9802, 'Heve og senke skuldrene', 'Pust dypt inn og trekk skuldrene s hyt opp som mulig og slipp skuldrene ned ved utpust, press ned s godt som mulig', 12960, 2013578, 1, 'https://exorlive.com/media_9802@50.50.media', 'https://exorlive.com/video/?ex=9802'),
(1301, 1012, 6389, 'Strak framoverby', 'St med skulderbreddes avstand mellom fttene og strekk armene opp mot taket. La overkroppen og armene falle rolig ned mot gulvet s langt ned du kommer samtidig som du puster ut. Svikt lett i knrne og rull opp i ryggen nr du strekker deg opp mot taket igjen og puster inn.', 6356, 2007642, 2, 'https://exorlive.com/media_6389@50.50.media', 'https://exorlive.com/video/?ex=6389'),
(1302, 1012, 8281, 'Stol press', 'Sitt p en stol med by i knr og hofter. Ta tak med hendene i stolkanten. Strekk ut armene slik at du lfter deg opp fra stolen.', 9899, 2007958, 3, 'https://exorlive.com/media_8281@50.50.media', 'https://exorlive.com/video/?ex=8281'),
(1303, 1012, 6584, 'Plassering av tastatur', 'Tastaturet skal vre adskilt fra skjermen slik at det kan tilpasses arbeidstakeren og arbeidsoppgavene. Trdlse tastaturer kan vre  foretrekke da de er enkle  plassere. Tastaturet br vre s lavt som mulig for at hndleddet kan vre i tilnrmet hvilestilling ved bruk. Det br vre mulig  endre helningsvinkel p tastaturet slik at hndleddsvinkelen kan varieres. Det skal vre god plass til  hvile hndledd og underarmer p bordplaten. Tastaturet br ligge stdig p bordet og ikke skli, det skal ha en matt overflate, og symbolene skal ha tilstrekkelig kontrast slik at du lett kan lese dem ved en normal sittestilling. Tastaturer som lager sty br unngs.', 6377, 0, 0, 'https://exorlive.com/media_6584@50.50.media', 'https://exorlive.com/video/?ex=6584');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1304, 1012, 6405, 'Arbeidsstol', 'Arbeidsstolen skal gi muligheter for varierte og komfortable stillinger og skal kunne tilpasses den enkelte arbeidstaker. Stolens sete og rygg br kunne reguleres uavhengig av hverandre. Innstillingene br kunne lses ved behov. Du br velge en stoltype som gir deg god sttte i korsryggen. Armlener kan gi god avlastning men m ikke vre til hinder slik at stolen ikke kommer tilstrekkelig nr bord/tastatur. Armlenene br ha god bredde, kunne reguleres i hyden og ikke ha glatt overflate.', 6588, 0, 0, 'https://exorlive.com/media_6405@50.50.media', 'https://exorlive.com/video/?ex=6405'),
(1305, 1012, 6384, 'G med skinkene', 'Sitt p en stol med hendene p knrne. Beveg deg framover p stolen kun ved  lfte hlene og bevege lrene framover slik at du "gr" med sitteknutene/skinkene.', 6346, 2004657, 2, 'https://exorlive.com/media_6384@50.50.media', 'https://exorlive.com/video/?ex=6384'),
(1306, 1012, 9805, 'Skuldersirkel bakover', 'Legg fingrene p toppen av skuldrene. Beveg albuene i en stor sirkel bakover.', 12966, 2013587, 1, 'https://exorlive.com/media_9805@50.50.media', 'https://exorlive.com/video/?ex=9805'),
(1307, 1012, 8354, 'Lukke munnen med motstand', 'Sitt oppreist p en stol. Gap. Plasser pekefinger og tommel over haken og hold igjen nr du forsker  lukke munnen.', 10048, 2008117, 2, 'https://exorlive.com/media_8354@50.50.media', 'https://exorlive.com/video/?ex=8354'),
(1308, 1012, 6393, 'Massre ansiktet', 'Flytt blikket bort fra skjermen. Massr musklene i ansiktet med faste sirkelbevegelser. Massr pannen, tinningene og de store kjevemusklene.', 6362, 2006005, 1, 'https://exorlive.com/media_6393@50.50.media', 'https://exorlive.com/video/?ex=6393'),
(1309, 1012, 6403, 'Plassering av skjerm 2', 'Flate skjermer er  foretrekke. De avgir mindre varme, har lavere elektromagnetiske felt, flimrer ikke, gir ofte bedre lesekvalitet, tar mindre plass, er mindre srbare for sjenerede refleks i skjermbildet og er enklere  plassere. Stor skjerm er en fordel for de fleste. Spesielt om man har drlig syn. Det er best om skjermen kan vinkles og roteres. En vinkling av skjermen p 15 - 20 grader bakover gir for mange en bedre arbeidsstilling.', 6377, 0, 0, 'https://exorlive.com/media_6403@50.50.media', 'https://exorlive.com/video/?ex=6403'),
(1310, 1012, 6585, 'Plassering av datamus', 'Det anbefales  prve ut ulike typer datamus. For stor datamus gir oppoverby (ekstensjon) i hndleddet og kan gi statisk muskelbelastning. Trdls mus er  foretrekke, slik at den enkelt kan beveges og flyttes p. Det kan vre bra  variere med  bruke datamusen foran tastaturet. Man br lre seg hutigtaster p tastaturet slik at man kan variere mellom datamus og tastatur da bruk av pekeutstyr kan gi strre statisk muskelbelastning enn bruk av tastatur.', 6377, 0, 0, 'https://exorlive.com/media_6585@50.50.media', 'https://exorlive.com/video/?ex=6585'),
(1311, 1012, 6561, 'Underarm 7', 'Lft og strekk armene inn foran kroppen. Hold albuene strake og by hndleddene slik at hndflatene vender mot deg. Drei deretter armene slik at fingrene peker ut til siden. Kjenn at det strekker p oversiden av underarmene. Hold tyningen 30 sek.', 6527, 2004682, 1, 'https://exorlive.com/media_6561@50.50.media', 'https://exorlive.com/video/?ex=6561'),
(1312, 1012, 5546, 'Stende enkel armsving opp', 'St med armene ned langs siden. Strekk den ene armen fram og opp mot taket med strak albue. Senk armen rolig ned igjen. Bytt arm.', 5535, 2007802, 1, 'https://exorlive.com/media_5546@50.50.media', 'https://exorlive.com/video/?ex=5546'),
(1313, 1012, 6387, 'Sideforskyvning av kjeven', 'Beveg kjeven fra side til side.', 6352, 2005993, 1, 'https://exorlive.com/media_6387@50.50.media', 'https://exorlive.com/video/?ex=6387'),
(1314, 1012, 8352, 'Isometrisk nakke rotasjon', 'Sitt opreist p en stol. Hold en flat hnd p den ene siden av kinnet. Forsk  roter hodet, men gi motstand med hnden slik at det bare skjer en isometrisk kontraksjon i rotator musklaturen (at du bare spenner musklaturen uten  gjre noen bevgelse).', 10044, 2008021, 2, 'https://exorlive.com/media_8352@50.50.media', 'https://exorlive.com/video/?ex=8352'),
(1315, 1012, 5488, 'Sitte framoverbyd og slappe av', 'Len deg godt framover og sttt albuene p knrne. La hodet henge ned mot gulvet, slapp av i skuldrene, lukk ynene og pust dypt inn og ut i 20-30 sekunder. Kjenn at det tyer lett i nakke-rygg muskulaturen og at du senker spenningsnivet i kroppen.', 5447, 2004525, 1, 'https://exorlive.com/media_5488@50.50.media', 'https://exorlive.com/video/?ex=5488'),
(1316, 1012, 9806, 'Plukke epler', 'Simulerte plukk eple-bevegelser. Strekk armene vekselsvis hyre og venstre opp i luften og grip etter epler i luften.', 12968, 2013503, 1, 'https://exorlive.com/media_9806@50.50.media', 'https://exorlive.com/video/?ex=9806'),
(1317, 1012, 6388, 'Bevege ynene', 'Flytt blikket fra pc-skjermen, hold hode og nakke i ro. Se opp og ut p skr. Flytt s blikket diagonalt ned og inn. Se deretter motsatt opp og ut til andre siden og s diagonalt ned og inn.', 6354, 2006012, 1, 'https://exorlive.com/media_6388@50.50.media', 'https://exorlive.com/video/?ex=6388'),
(1318, 1012, 5648, 'Tromme med fingrene', 'Legg hndflaten p bordet. Trom med fingrene. Bytt hnd.', 5582, 2004552, 1, 'https://exorlive.com/media_5648@50.50.media', 'https://exorlive.com/video/?ex=5648'),
(1319, 1012, 9809, 'Pil og Bue', 'Pil- og bue bevegelser, vekselvis hyre og venstre arm', 12974, 2013590, 1, 'https://exorlive.com/media_9809@50.50.media', 'https://exorlive.com/video/?ex=9809'),
(1320, 1012, 9811, 'Padling med trunkusrotasjon', 'Store padlebevegelser til hyre og venstre med rotasjon av overkroppen.', 12978, 2013554, 2, 'https://exorlive.com/media_9811@50.50.media', 'https://exorlive.com/video/?ex=9811'),
(1321, 1012, 9807, 'Strekk og sprik', 'Strekk armene fremover og sprik med fingrene, hndflatene peker nedover. By albuene og trekk  hendene mot brystkassen med knyttede never.\nGjr det samme ut p sidene.', 12970, 2013521, 1, 'https://exorlive.com/media_9807@50.50.media', 'https://exorlive.com/video/?ex=9807'),
(1322, 1012, 8353, 'Gape med motstand', 'Sitt oppreist p en stol. Hold en knyttneve under haken. Forsk  gape opp, bruk knyttneven til  gi motstand nr du gaper.', 10046, 2008070, 2, 'https://exorlive.com/media_8353@50.50.media', 'https://exorlive.com/video/?ex=8353'),
(1323, 1012, 6392, 'Framoverby p stol', 'Sitt p en stol. Fold hendene i nakken og fr albuene ut til sidene. By deg rolig fram og ned mot det ene kneet samtidig som du puster rolig ut. Strekk deg opp igjen til utgangsposisjonen samtidig som du puster rolig inn. By deg deretter ned mot det andre kneet. Gjenta.', 6361, 2004660, 2, 'https://exorlive.com/media_6392@50.50.media', 'https://exorlive.com/video/?ex=6392'),
(1324, 1012, 9804, 'Skuldersirkel forover', 'Legg fingrene p toppen av skuldrene. Beveg albuene i en stor sirkel forover.', 12964, 2013560, 1, 'https://exorlive.com/media_9804@50.50.media', 'https://exorlive.com/video/?ex=9804'),
(1325, 1012, 5638, 'Blinke med ynene', 'Blink med vekselvis det ene og det andre ynet eller begge samtidig.', 5555, 2005982, 1, 'https://exorlive.com/media_5638@50.50.media', 'https://exorlive.com/video/?ex=5638'),
(1326, 212, 6641, 'Transversus/Korsett aktivering 2', 'Ligg p ryggen med fttene i gulvet. Plasser hendene p magen, den ene under og den andre over navlen. Aktiver muskelkorsettet ved   trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, uten at den verste hnden beveger seg. Spenn bekkenbunnen samtidig.', 6638, 2008538, 1, 'https://exorlive.com/media_6641@50.50.media', 'https://exorlive.com/video/?ex=6641'),
(1327, 212, 7502, 'Sammentrekning av skulderbladene 1', 'St oppreist med armene hengende ned langs siden. Trekk skulderbladene sammen og litt ned.', 7855, 2006996, 1, 'https://exorlive.com/media_7502@50.50.media', 'https://exorlive.com/video/?ex=7502'),
(1328, 212, 6657, 'Transversus aktivering og kontroll av rotasjon 4', 'Ligg p siden med naturlig svai i korsryggen. Aktiver muskelkorsettet. By begge knrne, men srg for at ftter, hofter og overkroppen ligger p linje. Hold hlene samlet og lft det verste kneet uten at korsryggen beveger seg.', 6649, 2008515, 1, 'https://exorlive.com/media_6657@50.50.media', 'https://exorlive.com/video/?ex=6657'),
(1329, 212, 7481, 'Kombinert skulderbladkontroll', 'St oppreist. Gjennom hele velsen skal all bevegelse kun skje ved at skulderbladene beveges. Begynn velsen med  heise skulderbladene opp mot ret og senk deretter ned igjen. Returner til midtstilling. Skyv s skulderbladene fra hverandre og trekk de sammen.', 8001, 2006889, 2, 'https://exorlive.com/media_7481@50.50.media', 'https://exorlive.com/video/?ex=7481'),
(1330, 212, 6783, 'Armpendel', 'St med god holdning. Kjenn at armene er tunge. Sving den ene armen rolig fram og tilbake ved at du pendler i skulderleddet. k etterhvert pendelen og ta den verste delen av ryggen med i bevegelsen, slik at du bde svinger armen og dreier overkroppen. F et godt "slipp" i skulderleddet og hold en fin rytme. Svikt gjerne lett knrne mens du pendler. Kombiner evt velsen med fokus p respirasjon.', 6745, 2007710, 1, 'https://exorlive.com/media_6783@50.50.media', 'https://exorlive.com/video/?ex=6783'),
(1331, 212, 3171, 'Brgger 2', 'St med fttene i ca. hoftebreddes avstand og drei de litt utover. Trekk haken litt tilbake. Ta en dyp innnding igjennom nesen og ned i magen. Deretter puster du langsomt ut mens du samtidig dreier hndflatene utover, spriker med fingrene og presser brystbenet lett opp og fram. Pust helt ut og hold posisjonen noen sekunder.', 7792, 2007670, 2, 'https://exorlive.com/media_3171@50.50.media', 'https://exorlive.com/video/?ex=3171'),
(1332, 212, 9222, 'Ryggliggende ettbens hlsenk', 'Ligg p ryggen med byde ben og hendene plassert p hoftene. Aktiver magemuskulaturen og lft begge ben opp s du har 90 grader i hofter og knr. Senk s hlen p det ene benet ned mot gulvet og rolig opp igjen. Oppretthold hele tiden stillingen i ryggen og unng rotasjon av bekkenet.', 11793, 2011056, 2, 'https://exorlive.com/media_9222@50.50.media', 'https://exorlive.com/video/?ex=9222'),
(1333, 212, 6656, 'Transversus aktivering og kontroll av rotasjon 3', 'Ligg p ryggen med naturlig svai i korsryggen. By det ene benet og plasser foten i gulvet. Spenn muskelkorsettet. Fr kneet ut til siden og tilbake igjen, uten at det skjer noen bevegelse i korsryggen. Hold evt hnden p hoftekammen for  sikre at det ikke skjer bevegelse.', 6647, 2008502, 1, 'https://exorlive.com/media_6656@50.50.media', 'https://exorlive.com/video/?ex=6656'),
(1334, 212, 6660, 'Transversus aktivering og kontroll av rotasjon 6', 'Ligg p ryggen med naturlig svai i korsryggen. By begge beina og plasser fttene i gulvet. Spenn muskelkorsettet. Lft den ene foten fra gulvet uten at det skjer noen bevegelse i korsryggen. Hold evt hnden p hoftekammen for  sikre at det ikke skjer bevegelse.', 6643, 2008477, 1, 'https://exorlive.com/media_6660@50.50.media', 'https://exorlive.com/video/?ex=6660'),
(1335, 212, 5637, 'Holdningsvelse med ryggen mot veggen', 'St med ryggen inntil veggen. Lft armene og plassr hndryggen mot veggen. Srg for at du holder bakhodet mot veggen og at haken er trukket litt inn. Press armene lett mot veggen, kjenn at det strammer i skulder- og ryggmuskulatur og at det strekker p framsiden av skuldre og i bryst. Hold posisjonen i 5-10 sekunder fr du tar armene ned igjen.', 5538, 2007740, 1, 'https://exorlive.com/media_5637@50.50.media', 'https://exorlive.com/video/?ex=5637'),
(1336, 212, 7503, 'Sammentrekning av skulderbladene 2', 'St oppreist med armene hengende ned langs siden. Trekk skulderbladene sammen og litt ned. Hold sammentrekningen i 10 sekunder.', 7857, 2006787, 1, 'https://exorlive.com/media_7503@50.50.media', 'https://exorlive.com/video/?ex=7503'),
(1337, 212, 8645, 'Wall slides skulder', 'St inntil en vegg. By albuene og legg underarmer inntil veggen med hndflatene pekende ut fra veggen. Beveg armene opp og over hodet til de er helt strake. Senk rolig ned til utgangsposisjon igjen ved  begynne  trekke skulderbladene ned og sammen.', 10751, 2009699, 1, 'https://exorlive.com/media_8645@50.50.media', 'https://exorlive.com/video/?ex=8645'),
(1338, 212, 7504, 'Sammentrekning av skulderbladene 3', 'St oppreist med armene hengende ned langs siden. Trekk skulderbladene sammen og litt ned.', 7859, 2006828, 1, 'https://exorlive.com/media_7504@50.50.media', 'https://exorlive.com/video/?ex=7504'),
(1339, 212, 7496, 'Sammentrekning av skulderblad med armene mot en vegg', 'Plasser begge underarmene mot en vegg. Trekk skulderbladene sammen og litt ned og hold stillingen noen sekunder.', 7843, 2006778, 2, 'https://exorlive.com/media_7496@50.50.media', 'https://exorlive.com/video/?ex=7496'),
(1340, 212, 6781, 'Avspenning av skulderbuen 1', 'St med god holdning. Trekk det ene skulderbladet inn mot ryggsylen, og deretter hele skulderbuen bak og litt oppover, samtidig som du dreier hodet til den samme siden. Hold noen f sekunder og slipp rolig ned og ls opp. Gjenta til den andre siden.', 6755, 2007633, 1, 'https://exorlive.com/media_6781@50.50.media', 'https://exorlive.com/video/?ex=6781'),
(1341, 212, 9226, 'Ryggliggende ettbens strekk 2', 'Ligg p ryggen med byde ben og hendene p hoftene. Lft bena opp til 90 grader i hofter og knr. Senk hlen p det ene benet nesten ned til gulvet og strekk deretter ut benet. Strekk kun s langt at du har kontroll p stillingen i ryggen. Unng svai og rotasjon av bekkenet. Beveg rolig tilbake til utgangsposisjon.', 11801, 2011125, 1, 'https://exorlive.com/media_9226@50.50.media', 'https://exorlive.com/video/?ex=9226'),
