(1393, 212, 7499, 'Innoverrotasjon av skulder 2', 'St oppreist, legg armen bak p ryggen med hndbaken mot ryggen og by 90 grader i albuen. Trekk skulderbladene sammen og litt ned. Fr hndbaken ut fra ryggen.', 7849, 2006898, 2, 'https://exorlive.com/media_7499@50.50.media', 'https://exorlive.com/video/?ex=7499'),
(1394, 212, 6642, 'Transversus/Korsett aktivering 1', 'Ligg p magen med naturlig svai i korsryggen. Plasser fingrene p innsiden av hoftekammen. Aktiver muskelkorsettet ved  trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, og merk spenningen under fingerspissene. Spenn bekkenbunnen samtidig.', 6633, 2008556, 1, 'https://exorlive.com/media_6642@50.50.media', 'https://exorlive.com/video/?ex=6642'),
(1395, 212, 6703, 'Muskel aktivering og kontroll i korsryggen 2', 'Ligg p magen med naturlig svai i korsryggen. Spenn dypt i magen og setemusklene, slik at svaien i korsryggen rettes ut.', 6695, 2007701, 1, 'https://exorlive.com/media_6703@50.50.media', 'https://exorlive.com/video/?ex=6703'),
(1396, 212, 7486, 'Utoverfring av arm med 90 graders by i albuen', 'St oppreist, by albuen til 90 grader og hold overarmen inntil siden av kroppen. Trekk skulderbladene sammen og litt ned. Lft den aktive armen rett ut til siden slik at du gjr en utoverfring til 45 grader.', 7823, 2006838, 2, 'https://exorlive.com/media_7486@50.50.media', 'https://exorlive.com/video/?ex=7486'),
(1397, 212, 3194, 'Len deg mot veggen', 'Sitt ytterst p stolen/benken. Kryss armene og plasser de foran hodet. Slapp av i overkroppen og len deg framover mot veggen, slik at ryggen rettes ut. Mens du holder denne posisjonen tar du en dyp innnding og puster helt ut, samtidig som du presser brystbenet framover mot veggen, s langt du kommer.', 7794, 2007665, 2, 'https://exorlive.com/media_3194@50.50.media', 'https://exorlive.com/video/?ex=3194'),
(1398, 212, 9221, 'Ryggliggende ettbenslft m/ motstand 4', 'Ligg p ryggen med byde ben. Aktiver magemuskulaturen s korsryggen har kontakt med gulvet. By opp det ene benet til 90 grader i hofte og kne og press motsatt hnd mot kneet. Hold dette presset samtidig som du lfter hlen p motsatt side noen cm opp fra gulvet. Oppretthold stillingen i rygg og bekken under hele velsen.', 11791, 2011062, 1, 'https://exorlive.com/media_9221@50.50.media', 'https://exorlive.com/video/?ex=9221'),
(1399, 212, 6658, 'Transversus aktivering og kontroll av rotasjon 2', 'Sitt med naturlig svai i korsryggen. Aktiver muskelkorsettet. Strekk det ene benet, uten at det oppstr bevelse i korsryggen.', 6651, 0, 1, 'https://exorlive.com/media_6658@50.50.media', 'https://exorlive.com/video/?ex=6658'),
(1400, 212, 7489, 'Utoverrotasjon av arm fra 90 grader', 'St oppreist med overarmen i vannrett stilling slik at underarmen henger ned mot gulvet. Trekk skulderbladene sammen og litt ned. Fr underarmen oppover mot taket, slik at du utoverroterer i skulderen.', 7829, 2006959, 3, 'https://exorlive.com/media_7489@50.50.media', 'https://exorlive.com/video/?ex=7489'),
(1401, 212, 9239, 'Sittende bekkenrotasjoner', 'Sitt p en balansepute p en stol med fttene i gulvet og hendene i siden. Rett deg opp i ryggen og hold oppretthold denne stillingen mens du beveger bekkenet i sirkulre bevegelser og klemmer balanseputen flat langs kanten.', 11827, 2011071, 1, 'https://exorlive.com/media_9239@50.50.media', 'https://exorlive.com/video/?ex=9239'),
(1402, 212, 7483, 'Utoverfring av arm til 45 grader 1', 'St oppreist. Trekk skulderbladene sammen og litt ned. Lft den aktive armen strakt ut til siden til  45 grader.', 7817, 2006966, 2, 'https://exorlive.com/media_7483@50.50.media', 'https://exorlive.com/video/?ex=7483'),
(1403, 212, 6681, 'Transversus aktivering og kontroll av fleksjon 2', 'St med naturlig svai i korsryggen. Aktiver muskelkorsettet. By framover i hoften, uten av korsryggen beveger seg. Stopp dersom du merker at det oppstr bevegelse i korsryggen eller smerter. Progresjon: by i kne og hofter samtidig.', 6674, 2007787, 1, 'https://exorlive.com/media_6681@50.50.media', 'https://exorlive.com/video/?ex=6681'),
(1404, 212, 7463, 'Bevegelseskontroll av vre del rygg m/slynge', 'Utgangsposisjon er mageliggende med en airexpute under bryst- mage og strikkslynge rundt hndleddene. Trekk halen inn, lft vre del av rygg og nakke opp og strekk deretter armene over hodet.', 7748, 2005847, 2, 'https://exorlive.com/media_7463@50.50.media', 'https://exorlive.com/video/?ex=7463'),
(1405, 212, 8981, 'Korsryggkontroll: sideliggende benstrekk', 'Ligg p siden med lett by i hofter og knr. Hold bekken i ro og ha parallelle hofter mens du lfter det verste benet, strekker det ut, byer det tilbake og senker benet rolig.', 11352, 2010793, 2, 'https://exorlive.com/media_8981@50.50.media', 'https://exorlive.com/video/?ex=8981'),
(1406, 212, 6684, 'Transversus aktivering og kontroll av ekstensjon 3', 'St med naturlig svai i korsryggen. Aktiver muskelkorsettet. Len overkroppen bakover uten at korsryggen beveger seg (bevegelsen skal foreg i brystryggen) og uten at du skyter hoftene framover. Stopp hvis du merker at korsryggen beveger seg eller at det oppstr smerter.', 6668, 2008493, 1, 'https://exorlive.com/media_6684@50.50.media', 'https://exorlive.com/video/?ex=6684'),
(1407, 212, 9225, 'Ryggliggende dobbel benstrekk 1', 'Ligg p ryggen og lft begge bena opp s du har 90 grader i hofter og knr. Hendene plasseres p hoftene. Aktiver magemuskulaturen s korsryggen ligger flatt i gulvet. Senk begge hler ned i gulvet og strekk deretter ut begge ben ved  skyve dem langs underlaget. Strekk dem kun s langt at du har kontroll p stilingen i ryggen. Unng svai og rotasjon av bekkenet. Beveg rolig tilbake til utgangsposisjon.', 11799, 2011050, 2, 'https://exorlive.com/media_9225@50.50.media', 'https://exorlive.com/video/?ex=9225'),
(1408, 212, 7477, 'Skulderblad kontroll m/slynge 1', 'Utgangsposisjon er sittende p firkantpute med rett rygg og slynger plassert rundt hndledd. Trekk det ene skulderbladet ned og inn mot ryggsylen uten  spenne i nakke-skuldre. Bytt side etter 4-6 repetisjoner.', 7776, 2005867, 2, 'https://exorlive.com/media_7477@50.50.media', 'https://exorlive.com/video/?ex=7477'),
(1409, 212, 9074, 'Korsryggkontroll: stende lft av fot', 'St med hoftebredde avstand mellom fttene. Finn en mellomstilling for ryggen, midt mellom svai og krum. Hold denne stillingen mens du byer kneet og lfter foten opp og bakover. Ha hele tiden kontroll p stillingen i ryggen.', 11498, 2010878, 2, 'https://exorlive.com/media_9074@50.50.media', 'https://exorlive.com/video/?ex=9074'),
(1410, 212, 9228, 'Transversus aktivering og kontroll av rotasjon 9', 'Ligg p siden med strake ben og parallelle hofter. Aktiver magemuskulaturen og ha nytral posisjon i ryggen. Lft det verste benet noen cm opp og roter s foten mot taket. Gjr kun s stor bevegelse at du har kontroll p stillingen i ryggen. Senk rolig tilbake til utgangsstilling.', 11805, 2011035, 1, 'https://exorlive.com/media_9228@50.50.media', 'https://exorlive.com/video/?ex=9228'),
(1411, 212, 9022, 'Sittende krum og svai', 'Sitt oppreist. Synk sammen i ryggen og beveg deretter opp til full svai. Finn mellomstillingen.', 11411, 2010992, 1, 'https://exorlive.com/media_9022@50.50.media', 'https://exorlive.com/video/?ex=9022'),
(1412, 212, 7490, 'Utoverfring av arm', 'St oppreist med armene ned langs siden. Trekk skulderbladene sammen og litt ned. Fr den aktive armen rett ut til siden og opp mot taket.', 7831, 2006790, 2, 'https://exorlive.com/media_7490@50.50.media', 'https://exorlive.com/video/?ex=7490'),
(1413, 212, 7488, 'Utoverfring av arm til 45 grader 2', 'St oppreist med armene ned langs siden. Trekk skulderbladene sammen og litt ned. Fr den aktive armen ut til siden til ca 45 grader og hold stillingen i ca 10 sekunder.', 7827, 2006919, 2, 'https://exorlive.com/media_7488@50.50.media', 'https://exorlive.com/video/?ex=7488'),
(1414, 212, 6683, 'Transversus aktivering og kontroll av ekstensjon 2', 'Sitt med naturlig svai i korsryggen. Aktiver muskelkorsettet. Len overkroppen bakover uten at korsryggen beveger seg (bevegelsen skal foreg i brystryggen) Stopp hvis du merker at korsryggen beveger seg eller at det oppstr smerter.', 6678, 2007637, 1, 'https://exorlive.com/media_6683@50.50.media', 'https://exorlive.com/video/?ex=6683'),
(1415, 212, 7495, 'Frem- og utoverfring av arm til 90 grader', 'St oppreist med armen ned langs siden og den andre armen stttende til stolryggen. Beveg armen rett ut til siden til 90 grader, samtidig som du byer i albuen. Srg for at disse to bevegelsene skjer i en sammenhengende og flytende bevegelse.', 7841, 2006987, 2, 'https://exorlive.com/media_7495@50.50.media', 'https://exorlive.com/video/?ex=7495'),
(1416, 212, 9023, 'Sittende korsryggkontroll med armstrekk', 'Sitt p noe usttt, for eksempel en balansepute. Oppretthold oppreist holdning mens du beveger begge armene oppover og fremover.', 11413, 2010968, 1, 'https://exorlive.com/media_9023@50.50.media', 'https://exorlive.com/video/?ex=9023'),
(1417, 212, 8005, 'Korreksjon av sittestilling', 'Sitt p en stol med ryggsttte med lut rygg og drlig holdning. Samtidig som du trekker pusten inn retter du deg opp og setter deg inntil ryggsttten p stolen . Ryggen skal vre rett, blikket skal vre rettet frem og armene henger avslappet ned langs siden.', 8964, 2007441, 2, 'https://exorlive.com/media_8005@50.50.media', 'https://exorlive.com/video/?ex=8005'),
(1418, 212, 7431, 'Rytmisk stabilisering m/partner', 'Utveren str i balanse over bena. Partneren gir rytmiske skyv i ulike retninger mens utveren forblir i ro som en statue.', 7684, 2005869, 2, 'https://exorlive.com/media_7431@50.50.media', 'https://exorlive.com/video/?ex=7431'),
(1419, 212, 7494, 'Kombinert skulderbevegelse', 'St oppreist og sttt deg med begge hendene mot en stolrygg. Trekk skulderbladene sammen slik at du skyver brystet frem. Deretter heiser du skulderen opp mot ret og senker skulderene ned igjen. Beveg til slutt skuldrene fremover. Mellom hver bevegelse forsk  finn frem til nytralposisjon.', 7839, 2006949, 2, 'https://exorlive.com/media_7494@50.50.media', 'https://exorlive.com/video/?ex=7494'),
(1420, 212, 9025, 'Sittende korsryggkontroll med armstrekk til siden', 'Sitt p noe usttt, for eksempel en balansepute. Oppretthold oppreist holdning mens du beveger begge armene samtidig ut til siden .', 11417, 2010884, 1, 'https://exorlive.com/media_9025@50.50.media', 'https://exorlive.com/video/?ex=9025'),
(1421, 212, 9024, 'Sittende korsryggkontroll med armstrekk 2', 'Sitt p noe usttt, for eksempel balansepute. Oppretthold oppreist holdning mens du beveger annenhver arm frem og oppover.', 11415, 2010947, 1, 'https://exorlive.com/media_9024@50.50.media', 'https://exorlive.com/video/?ex=9024'),
(1422, 212, 9026, 'Sittende korsryggkontroll med armstrekk 2', 'Sitt p noe usttt, for eksempel en balansepute. Oppretthold oppreist holdning mens du lfter annenhver arm til siden.', 11419, 2010974, 1, 'https://exorlive.com/media_9026@50.50.media', 'https://exorlive.com/video/?ex=9026'),
(1423, 212, 8010, 'Sitte p skrpute', 'Sitt p gulvet med rette ben og en skrpute under sete.', 8819, 2007429, 2, 'https://exorlive.com/media_8010@50.50.media', 'https://exorlive.com/video/?ex=8010'),
(1424, 210, 3077, 'Ekstensjon, liggende', 'Legg deg ned p magen og plassr hendene under skuldrene. Press overkroppen s langt opp som mulig. Slapp helt av i sete- og ryggmuskulaturen og la tyngden hvile p armene. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000140, 2007811, 6, 'https://exorlive.com/media_3077@50.50.media', 'https://exorlive.com/video/?ex=3077'),
(1425, 210, 3002, 'Ekstensjon, liggende p albuer', 'Legg deg ned p magen og plassr albuene tett p skuldrene. Press overkroppen opp slik at tyngden til sist hviler p underarmene. Ta noen dype ndedrag og forsk  slappe helt av i rygg- og setemuskulaturen. Bli liggende slik i 5 min.', 1000006, 2007797, 3, 'https://exorlive.com/media_3002@50.50.media', 'https://exorlive.com/video/?ex=3002'),
(1426, 210, 3000, 'Ekstensjon, stende', 'St med fttene i ca. hoftebreddes avstand og plassr hndflatene p overgangen mellom korsryggen og bekkenet. Kikk opp i taket og by s langt bakover som mulig. Unng  bye knrne. Hold ytterposisjonen i 1-2 sek. Vend helt tilbake til utgangsposisjonen og gjenta velsen. Forsk  bye lengre bakover for hver gang.', 1000002, 2003931, 4, 'https://exorlive.com/media_3000@50.50.media', 'https://exorlive.com/video/?ex=3000'),
(1427, 210, 3001, 'Ekstensjon thorakalt, liggende', 'Legg deg ned p magen og plassr hendene ved ansiktet. Press overkroppen s langt opp som mulig. Slapp helt av i sete- og ryggmuskulaturen og la tyngden hvile p armene. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000004, 2003932, 1, 'https://exorlive.com/media_3001@50.50.media', 'https://exorlive.com/video/?ex=3001'),
(1428, 210, 3092, 'Retraksjon, sittende/stende', 'velsen kan gjres sittende eller stende. Trekk haken inn og hodet tilbake. Unng  bye hodet fram eller bakover og srg for  holde blikket rett framover. Hold posisjonen 1-2 sek. Slapp deretter av og la hodet vende tilbake til utgangsposisjonen fr du igjen gjentar velsen.', 1000171, 2003989, 1, 'https://exorlive.com/media_3092@50.50.media', 'https://exorlive.com/video/?ex=3092'),
(1429, 210, 3089, 'Fleksjon, liggende', 'Ligg p ryggen, lft fttene fra gulvet og trekk knrne mot deg. Fest et grep omkring knrne og trekk knrne videre opp mot brystet. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta. Forsk  bye lengre og lengre opp for hver gang.', 1000165, 2003987, 1, 'https://exorlive.com/media_3089@50.50.media', 'https://exorlive.com/video/?ex=3089'),
(1430, 210, 3169, '"Slouch overcorrect" / Overdreven god stilling', 'Sitt p kanten av stolen og la overkroppen synke helt sammen i ett par sekunder. Rett deg opp, press brystet skrtt opp, trekk hodet tilbake, hold blikket framover og svai s mye som mulig i korsryggen. Dette er en overdreven god sittestilling. Bevegelsen skal utfres i et jevn tempo. Siste gang du gjr velsen, skal du falle ca. 10 %  tilbake fra ytterstillingen, da sitter du slik du skal!', 1000304, 2004037, 1, 'https://exorlive.com/media_3169@50.50.media', 'https://exorlive.com/video/?ex=3169');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1431, 210, 3094, 'Retraksjon og ekstensjon, sittende/stende', 'velsen kan gjres sittende eller stende. Trekk haken inn og hodet tilbake, uten  bye hodet. N er du klar til  bye hodet bakover s langt som mulig. Gjr dette og hold ytterposisjonen i 1-2 sek. Vend deretter helt tilbake til utgangsposisjonen fr du gjentar velsen.', 1000173, 2003990, 4, 'https://exorlive.com/media_3094@50.50.media', 'https://exorlive.com/video/?ex=3094'),
(1432, 210, 3095, 'Retraksjon m/ekstra press, sittende/stende', 'velsen kan gjres sittende eller stende. Legg den ene hnden p haken, trekk haken inn og press hodet forsiktig tilbake. Unng  bye hodet fram eller bakover og srg for  holde blikket rett framover. Hold posisjonen 1-2 sek. Slapp deretter av og la hodet vende tilbake til utgangsposisjonen fr du igjen gjentar velsen.', 1000175, 2003991, 3, 'https://exorlive.com/media_3095@50.50.media', 'https://exorlive.com/video/?ex=3095'),
(1433, 210, 3076, 'Ekstensjon, stende mot vegg', 'St med ca. skulderbreddes avstand fra veggen og plassr begge armene foran ansiktet. Hold overkroppen i ro, slapp av i sete- og ryggmuskulaturen og slipp bekkenet s langt framover som mulig. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta. Forsk  komme lengre ut for hver gang.', 1000139, 2003978, 5, 'https://exorlive.com/media_3076@50.50.media', 'https://exorlive.com/video/?ex=3076'),
(1434, 210, 3156, 'Ekstensjon thorakalt, sittende', 'Sitt oppreist med armene krysset foran brystet. Hold albuene lftet og by s langt bakover over stolryggen som mulig og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000296, 2004029, 2, 'https://exorlive.com/media_3156@50.50.media', 'https://exorlive.com/video/?ex=3156'),
(1435, 210, 3155, 'Rotasjon thorakalt, sittende', 'Sitt oppreist med hendene foldet foran brystet. Lft albuene og drei overkroppen i et godt tempo til den smertefulle siden. Vend tilbake til utgangsposisjonen og gjenta. Forsk  komme lengre og lengre ut for hver gang.', 1000300, 2004028, 1, 'https://exorlive.com/media_3155@50.50.media', 'https://exorlive.com/video/?ex=3155'),
(1436, 210, 3085, 'Fleksjon, sittende', 'Sitt p stolen og la armene hvile p lrene. By s langt framover som mulig, hold ytterposisjonen 1-2 sek. og vend tilbake til utgangsposisjonen. Forsk  bye lengre og lengre ned for hver gang.', 1000159, 2003984, 2, 'https://exorlive.com/media_3085@50.50.media', 'https://exorlive.com/video/?ex=3085'),
(1437, 210, 3004, 'Fleksjon, stende', 'St med fttene i ca. hoftebreddes avstand. By overkroppen s langt framover som mulig og strekk armene ned mot fttene. Hold ytterposisjonen i 1-2 sek. Vend deretter helt tilbake til utgangsposisjonen og gjenta velsen. Forsk  bye lengre og lengre ned for hver gang. Hold benene strake hele tiden.', 1000010, 2003933, 3, 'https://exorlive.com/media_3004@50.50.media', 'https://exorlive.com/video/?ex=3004'),
(1438, 210, 3109, 'Retraksjon, ryggliggende', 'Ligg p ryggen. Trekk haken inn og lag "dobbelthake". Hold posisjonen 1-2 sek. og slapp av slik at hodet inntar utgangsposisjonen igjen, fr du gjentar velsen.', 1000137, 2004004, 2, 'https://exorlive.com/media_3109@50.50.media', 'https://exorlive.com/video/?ex=3109'),
(1439, 210, 3100, 'Retraksjon og hyre rotasjon, sittende/stende', 'velsen kan gjres sittende eller stende. Trekk haken inn og hodet tilbake, uten  bye hodet. Drei deretter hodet s langt som mulig mot hyre. Hold ytterposisjonen i 1-2 sek. og vend deretter helt tilbake til utgangsposisjonen fr du gjentar velsen.', 1000315, 2003998, 1, 'https://exorlive.com/media_3100@50.50.media', 'https://exorlive.com/video/?ex=3100'),
(1440, 210, 3082, 'Sideglidning mot venstre 2', 'St med venstre side mot veggen. Plassr den hyre hnden i siden og den venstre underarmen mot veggen. Skyv bekkenet mot veggen samtidig som du forsker  holde overkroppen i ro. Hold ytterposisjonen 1-2 sek. og vend helt tilbake til utgangsposisjonen. Gjenta velsen og forsk  komme lengre ut for hver gang. velsen etterflges av stende ekstensjon.', 1000148, 2007806, 2, 'https://exorlive.com/media_3082@50.50.media', 'https://exorlive.com/video/?ex=3082'),
(1441, 210, 3078, 'Liggende p magen', 'Legg deg ned p magen. Drei hodet til den ene siden og plassr armene ned langs siden. Ta noen dype ndedrag og forsk  slappe helt av i rygg- og setemuskulaturen. Bli liggende slik i 5 min.', 1000294, 2003979, 2, 'https://exorlive.com/media_3078@50.50.media', 'https://exorlive.com/video/?ex=3078'),
(1442, 210, 3101, 'Retraksjon og venstre rotasjon, sittende/stende', 'velsen kan gjres sittende eller stende. Trekk haken inn og hodet tilbake, uten  bye hodet. Drei deretter hodet s langt som mulig mot venstre. Hold ytterposisjonen i 1-2 sek. og vend deretter helt tilbake til utgangsposisjonen fr du gjentar velsen.', 1000316, 2003999, 1, 'https://exorlive.com/media_3101@50.50.media', 'https://exorlive.com/video/?ex=3101'),
(1443, 210, 3083, 'Sideglidning mot hyre 2', 'St med hyre side mot veggen. Plassr den venstre hnden i siden og den hyre underarmen mot veggen. Skyv bekkenet mot veggen samtidig som du forsker  holde overkroppen i ro. Hold ytterposisjonen 1-2 sek. og vend helt tilbake til utgangsposisjonen. Gjenta velsen og forsk  komme lengre ut for hver gang. velsen etterflges av stende ekstensjon.', 1000151, 2003983, 2, 'https://exorlive.com/media_3083@50.50.media', 'https://exorlive.com/video/?ex=3083'),
(1444, 210, 3080, 'Ekstensjon, liggende "hips off centre" mot venstre', 'Legg deg ned p magen og plassr hendene under skuldrene. Kryss benene og skyv bekkenet ut til venstre side, slik at du ligger i en bue. Lft overkroppen rett opp og s langt som mulig. Slapp helt av i sete- og ryggmuskulaturen og la tyngden hvile p armene. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000317, 2007739, 3, 'https://exorlive.com/media_3080@50.50.media', 'https://exorlive.com/video/?ex=3080'),
(1445, 210, 3081, 'Ekstensjon, liggende "hips off centre" mot hyre', 'Legg deg ned p magen og plassr hendene under skuldrene. Kryss benene og skyv bekkenet ut til hyre side, slik at du ligger i en bue. Lft overkroppen rett opp og s langt som mulig. Slapp helt av i sete- og ryggmuskulaturen og la tyngden hvile p armene. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000147, 2003982, 3, 'https://exorlive.com/media_3081@50.50.media', 'https://exorlive.com/video/?ex=3081'),
