(1493, 211, 3987, 'Skr ryggliggende brystpress m/hantler 3', 'Skrstill benken slik at utgangsposisjonen gir ca. 120 fleksjon i skuldrene. Hold en hantel i hver hnd. Ligg p ryggen med armene utstrakt over brystet. Senk armene ned samtidig som brystet presses fram. Markr sluttstillingen med albuene pekende ut til siden for  oppn innadrotasjon i skuldrene. Press rolig tilbake og gjenta velsen.', 3611, 2004326, 5, 'https://exorlive.com/media_3987@50.50.media', 'https://exorlive.com/video/?ex=3987'),
(1494, 211, 3801, 'Sittende nedtrekk m/undergrep', 'Ta tak i stangen med et undergrep og plassr hendene i ca skulderbreddes avstand. Press brystkassen fram, trekk stangen til brystet og markr sluttstillingen. Slipp rolig tilbake og gjenta velsen.', 3361, 2004187, 4, 'https://exorlive.com/media_3801@50.50.media', 'https://exorlive.com/video/?ex=3801'),
(1495, 211, 3842, 'Kne- og hndstttende enarms roing 2', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk armen opp langs siden, samtidig som du innoverroterer den, til hantelen er i mageniv. Senk tilbake og gjenta velsen.', 3440, 2004820, 3, 'https://exorlive.com/media_3842@50.50.media', 'https://exorlive.com/video/?ex=3842'),
(1496, 211, 3800, 'Skrsittende nedtrekk (90 fleksj. i skulder)', 'Fest et godt grep omkring spesialhndtaket og legg deg skrtt bakover, slik at det er ca 90 fleksjon i skuldrene. Dette er utgangsstillingen. Hold ryggen rett, press brystkassen fram og trekk hndtaket ned til brystet samtidig som frer albuene tett p kroppen. Slipp langsomt tilbake og gjenta velsen.', 3359, 2004186, 2, 'https://exorlive.com/media_3800@50.50.media', 'https://exorlive.com/video/?ex=3800'),
(1497, 211, 3938, 'Stende benstrekk bak 1', 'Fest stroppen rundt foten p det aktive benet. St med ca. 90 by i hofte og kne p det aktive benet, og sttt deg til trekkapparatet eller benken ved siden av. Stram opp i mage- og korsryggregionen og strekk benet bakover til foten nr gulvet. Gjenta velsen med motsatt ben.', 3685, 2004292, 1, 'https://exorlive.com/media_3938@50.50.media', 'https://exorlive.com/video/?ex=3938'),
(1498, 211, 3829, 'Stende enarms sidehev', 'St med armen krysset foran kroppen og ha et godt grep om hndtaket. Sving armen ut til siden og opp, samtidig som du dreier armen utover. Senk rolig tilbake og gjenta velsen. Ha en liten by i albuen under hele bevegelsen.', 3416, 2004211, 3, 'https://exorlive.com/media_3829@50.50.media', 'https://exorlive.com/video/?ex=3829'),
(1499, 211, 3972, 'Stende thev m/hantler', 'Plasser benene i hoftebreddes avstand og hold en hantel i hver hnd. Kun den framre del av fttene skal berre plankebiten. Press opp til tstende og senk tilbake.', 3747, 2004316, 3, 'https://exorlive.com/media_3972@50.50.media', 'https://exorlive.com/video/?ex=3972'),
(1500, 211, 3927, 'Stende benfring inn', 'Fest stroppen rundt ankelen og st med siden til apparatet. Trekk det aktive benet inntil standbenet, slipp rolig tilbake og gjenta velsen. Hold ryggen og bekkenet stabilt gjennom hele bevegelsen. velsen kan evt. utfres med en matte eller en plankebit under standbenet.', 3660, 2004284, 2, 'https://exorlive.com/media_3927@50.50.media', 'https://exorlive.com/video/?ex=3927'),
(1501, 211, 3804, 'Sittende nedtrekk til nakke', 'Ta et bredt grep, press brystkassen fram og trekk stangen ned til nakken. Hold blikket framover under hele bevegelsen. Slipp rolig tilbake og gjenta velsen.', 3367, 2004190, 6, 'https://exorlive.com/media_3804@50.50.media', 'https://exorlive.com/video/?ex=3804'),
(1502, 211, 3811, 'Mageliggende armsving bak (90 fleksj. i skulder)', 'Ligg p magen med armene hengende rett ned. Hold armene strake og sving de bakover samtidig som du presser skulderbladene sammen. Senk rolig tilbake og gjenta velsen.', 3569, 2004197, 4, 'https://exorlive.com/media_3811@50.50.media', 'https://exorlive.com/video/?ex=3811'),
(1503, 211, 4006, 'Mageliggende armsving bak (80 fleksj. i skulder)', 'Hold en hantel i hver hnd. Start med ca. 80 fleksjon i skuldrene og la armene henge rett ned. Trekk armene bakover samtidig som skulderbladene presses sammen. Slipp rolig tilbake og gjenta velsen.', 3761, 2004342, 3, 'https://exorlive.com/media_4006@50.50.media', 'https://exorlive.com/video/?ex=4006'),
(1504, 211, 3845, 'Ryggliggende armstrekk m/hantler 1', 'Ligg p ryggen med fotslene i benken og armene utstrakt over brystet. Senk armene ned samtidig som brystet presses fram og sluttstillingen markres med albuene tett inntil siden av kroppen. Strekk armene og gjenta velsen.', 3446, 2004225, 3, 'https://exorlive.com/media_3845@50.50.media', 'https://exorlive.com/video/?ex=3845'),
(1505, 211, 3851, 'Ryggliggende brystpress', 'Ligg p ryggen med fotslene i benken og hold stangen p strake armer over brystet. Senk stangen ned samtidig som brystet presses fram. Press tilbake og gjenta velsen.', 3456, 2004231, 1, 'https://exorlive.com/media_3851@50.50.media', 'https://exorlive.com/video/?ex=3851'),
(1506, 211, 3974, 'Sittende ankelby m/belastning', 'Sitt med det aktive benet strakt og det hvilende benet byd. Fest stroppen rundt den framre delen av foten og hvil benet mot en plle. By i ankelleddet og trekk trne mot deg. Slipp rolig tilbake og gjenta velsen.', 3751, 2004318, 3, 'https://exorlive.com/media_3974@50.50.media', 'https://exorlive.com/video/?ex=3974'),
(1507, 211, 6238, 'Dobbel sidehev i kabel-apparat 2', 'St med ryggen mot apparatet og armene langs sidan. Hold ryggen rett og blikket framover. Lft armene ut til siden til de er ca horisontale. Senk rolig ned og gjenta.', 6110, 0, 2, 'https://exorlive.com/media_6238@50.50.media', 'https://exorlive.com/video/?ex=6238'),
(1508, 211, 3803, 'Sittende nedtrekk til hodet', 'Ta et bredt grep, press brystkassen fram og trekk stangen ned til toppen av hodet. Hold blikket framover under hele bevegelsen. Slipp rolig tilbake og gjenta velsen.', 3365, 2004189, 5, 'https://exorlive.com/media_3803@50.50.media', 'https://exorlive.com/video/?ex=3803'),
(1509, 211, 3977, 'Sittende thev m/vektmansjett', 'Sitt p en firkantpute med en plankebit under trne og fest vektmansjetten rundt lret. Press opp til tstende p det aktive benet. Slipp rolig tilbake og gjenta velsen.', 3755, 2004320, 2, 'https://exorlive.com/media_3977@50.50.media', 'https://exorlive.com/video/?ex=3977'),
(1510, 211, 3890, 'Kne- og hndstttende roing p pute 1', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk armen opp langs siden til hantelen er i mageniv. Senk tilbake og gjenta velsen.', 3536, 2004268, 3, 'https://exorlive.com/media_3890@50.50.media', 'https://exorlive.com/video/?ex=3890'),
(1511, 211, 3886, 'Stende enarms omvendt kryssdrag m/kabel 2', 'St skrstilt med den ene armen krysset foran kroppen og et godt grep om hndtaket. Lft armen ut til siden og opp. Ha en liten by i albuen under hele bevegelsen. Slipp rolig tilbake og gjenta velsen. velsen utfres i frontal planet.', 3527, 2004264, 3, 'https://exorlive.com/media_3886@50.50.media', 'https://exorlive.com/video/?ex=3886'),
(1512, 211, 3405, 'Sittende nedtrekk (70 fleksj. i skulder)', 'Fest et godt grep omkring spesialhndtaket og trekk ned til det er ca 70 fleksjon i skuldrene. Dette er utgangsstillingen. Hold ryggen rett, press brystkassen fram og trekk hndtaket ned til brystet samtidig som du frer albuene tett p kroppen. Slipp langsomt tilbake og gjenta velsen.', 3545, 2004162, 1, 'https://exorlive.com/media_3405@50.50.media', 'https://exorlive.com/video/?ex=3405'),
(1513, 211, 3918, 'Kneby m/avlastningsbyle', 'Plassr avlastningsbylen under armene. St med fttene i skulderbreddes avstand. By ned til ca. 90 i knrne, hold ryggen rett og blikket fram. Overkroppen lenes p bylen for avlastning og for  gi ekstra stimulering av musklene i sete og lr. Press opp igjen og gjenta velsen.', 3641, 2004274, 1, 'https://exorlive.com/media_3918@50.50.media', 'https://exorlive.com/video/?ex=3918'),
(1514, 211, 3933, 'Skrstende benpress', 'Plassr benene p fotbrettet i skulderbreddes avstand. Ha ca. 90 i knrne. Stram opp i mage- og korsryggregionen og press opp til benene er nesten strake. Vend tilbake til startstillingen og gjenta velsen.', 3674, 0, 2, 'https://exorlive.com/media_3933@50.50.media', 'https://exorlive.com/video/?ex=3933'),
(1515, 211, 3997, 'Mobilisering av ekstensjon i brystryggen 2', 'Plassr pllen fra benken i hyde med omrdet som skal mobiliseres. Sitt med by i hofte og knr, plassr hendene i nakken og ryggen mot pllen. Trekk inn haken og by overkroppen bakover. Slipp rolig tilbake og gjenta velsen. Srg for at du ikke lfter setet fra benken under velsen.', 3631, 2004333, 1, 'https://exorlive.com/media_3997@50.50.media', 'https://exorlive.com/video/?ex=3997'),
(1516, 211, 3848, 'Skr ryggliggende brystpress m/hantler 2', 'Skrstill benken slik at utgangsstillingen gir ca. 100 fleksjon i skuldrene. Ligg p ryggen med fotslene i benken og armene utstrakt over brystet. Senk armene ned samtidig som brystet presses fram og sluttstillingen markres med albuene ut til siden. Strekk armene og gjenta velsen.', 4026, 2004228, 4, 'https://exorlive.com/media_3848@50.50.media', 'https://exorlive.com/video/?ex=3848'),
(1517, 211, 3975, 'Sittende ankelstrekk m/belastning', 'Sitt med det aktive benet strakt og det hvilende benet byd. Fest stroppen rundt den framre delen av foten og hvil benet mot en plle. Strekk i ankelleddet og press trne vekk fra deg. Slipp rolig tilbake og gjenta velsen.', 3753, 2004319, 2, 'https://exorlive.com/media_3975@50.50.media', 'https://exorlive.com/video/?ex=3975'),
(1518, 211, 3930, 'Kneby m/lateral belastning', 'St med fttene i skulderbreddes avstand og en plankebit under hlene. Fest stroppen rett over det kneet som du nsker  stimulere mest. By ned mot ca 90 i knrne, hold ryggen rett og blikket fram. Press opp igjen og gjenta velsen.', 4055, 2004286, 3, 'https://exorlive.com/media_3930@50.50.media', 'https://exorlive.com/video/?ex=3930'),
(1519, 211, 3885, 'Stende enarms omvendt kryssdrag m/kabel 1', 'St skrstilt med den ene armen krysset foran kroppen og et godt grep om hndtaket. Lft armen ut og opp. Ha en liten by i albuen under hele bevegelsen. Slipp rolig tilbake og gjenta velsen. velsen utfres i horisontal planet.', 3525, 2004263, 2, 'https://exorlive.com/media_3885@50.50.media', 'https://exorlive.com/video/?ex=3885'),
(1520, 211, 3958, 'Sittende avlastet kneekstensjon', 'Fest stroppen over ankelleddet og fiksr knrne mot benken med et belte. Sitt p benken rett foran trekkapparatet med ca 90 by i knrne. Slipp foten rolig fram og opp, slik at kneet strekkes, ved hjelp av vekten fra trekkapparatet. Trekk tilbake og gjenta velsen.', 3727, 0, 1, 'https://exorlive.com/media_3958@50.50.media', 'https://exorlive.com/video/?ex=3958'),
(1521, 211, 3884, 'Stende enarms kryssdrag m/kabel', 'St skrstilt mot trekkapparatet, press brystet fram og hold armen ut til siden. Ha en liten by i albuen. Ved strekk av bryst-muskulaturen presses armen diagonalt fram og ned til den er i hoftehyde. Slipp rolig tilbake og gjenta velsen.', 3523, 2004262, 4, 'https://exorlive.com/media_3884@50.50.media', 'https://exorlive.com/video/?ex=3884'),
(1522, 211, 3961, 'Kneby m/anterior og posterior belastning 1', 'St med fttene i skulderbreddes avstand og en plankebit under hlene. Fest stroppene over leddet (for anterior belastning) og under leddet (for posterior belastning) p det kneet man nsker  stimulere. By ned til ca. 90 i knrne, hold ryggen rett og blikket fram. Press opp igjen og gjenta velsen. God velse for  stimulere knefleksjon.', 3733, 2008564, 1, 'https://exorlive.com/media_3961@50.50.media', 'https://exorlive.com/video/?ex=3961'),
(1523, 211, 3854, 'Stende skulderpress ned', 'St med den ene armen tett inntil kroppen og ha et godt grep om hndtaket. Press skulderen rett ned samtidig som armen holdes strak og inntil kroppen gjennom hele bevegelsen. velsen stimulerer en caudal/vertikal glidning mellom leddsklen og leddhodet.', 3464, 2004234, 2, 'https://exorlive.com/media_3854@50.50.media', 'https://exorlive.com/video/?ex=3854'),
(1524, 211, 3819, 'Sittende enarms trekk bak', 'Sitt med ansiktet mot trekkapparatet. Hold armen strak og hevet over hodet. Hold et godt grep om hndtaket. Trekk armen bakover og ned mot hoften. Slipp rolig tilbake og gjenta velsen.', 3399, 2004204, 3, 'https://exorlive.com/media_3819@50.50.media', 'https://exorlive.com/video/?ex=3819'),
(1525, 211, 3988, 'Sittende armsving ut m/hantler', 'Hold en hantel i hver hnd p strake armer over hodet. Slipp armene rolig ut til siden med hndflatene vendt opp mot taket. Stopp ved ca. 90 i skulderleddet og vend tilbake til utgangsposisjon. Gjenta velsen.', 3613, 2004327, 3, 'https://exorlive.com/media_3988@50.50.media', 'https://exorlive.com/video/?ex=3988'),
(1526, 211, 6237, 'Dobbel sidehev i kabel-apparat 1', 'St med ansiktet mot apparatet og armene langs siden. Hold ryggen rett og blikket framover. Lft armene ut til siden til de er ca horisontale. Senk rolig ned og gjenta.', 6108, 0, 2, 'https://exorlive.com/media_6237@50.50.media', 'https://exorlive.com/video/?ex=6237'),
(1527, 211, 3815, 'Stende enarms trekk inn (45 abd. og 45 fleksj. i skulder)', 'St vendt skrtt mot trekkapparatet, ha armen hevet ca 45 ut til siden og ca 45 framfor deg og hold et godt grep om hndtaket. Trekk armen bakover og inn mot hoften. Slipp rolig tilbake og gjenta velsen.', 3393, 2004201, 2, 'https://exorlive.com/media_3815@50.50.media', 'https://exorlive.com/video/?ex=3815'),
(1528, 211, 3943, 'Stende knelft m/belastning', 'Fest stroppen over kneleddet, st med ryggen til apparatet og sttt deg evt. til en benk/et stativ. I startstillingen er det aktive ben strukket litt bakover. Lft kneet fram og opp, til lret er ca vannrett. Bytt ben.', 3697, 2004298, 3, 'https://exorlive.com/media_3943@50.50.media', 'https://exorlive.com/video/?ex=3943'),
(1529, 211, 3813, 'Mageliggende roing m/vektstang 1', 'Ligg p magen, la armene henge rett ned og hold et grep i ca skulderbreddes avstand. Trekk stangen opp til brystet samtidig som skulderbladene presses sammen. Senk rolig tilbake og gjenta velsen.', 3575, 2004199, 2, 'https://exorlive.com/media_3813@50.50.media', 'https://exorlive.com/video/?ex=3813'),
(1530, 211, 4004, 'Mageliggende armsving bak (60 fleksj. i skulder)', 'Start med ca. 60 fleksjon i skuldrene og la armene henge rett ned. Trekk armene bakover samtidig som skulderbladene presses sammen. Slipp rolig tilbake og gjenta velsen.', 3756, 2004340, 1, 'https://exorlive.com/media_4004@50.50.media', 'https://exorlive.com/video/?ex=4004'),
