(1532, 211, 4005, 'Mageliggende armsving bak 2 (60 fleksj. i skulder)', 'Hold en hantel i hver hnd. Start med ca. 60 fleksjon i skuldrene og la armene henge rett ned. Trekk armene bakover samtidig som skulderbladene presses sammen. Slipp rolig tilbake og gjenta velsen.', 3759, 2004341, 2, 'https://exorlive.com/media_4005@50.50.media', 'https://exorlive.com/video/?ex=4005'),
(1533, 211, 3824, 'Sittende enarms trekk inn (130 abd. i skulder)', 'Sitt med siden mot trekkaparatet. Hold den ene armen hevet ca 130 ut til siden og ha et godt grep om hndtaket. Trekk armen ned og inn mot hoften. Slipp rolig tilbake og gjenta velsen.', 3408, 2004207, 5, 'https://exorlive.com/media_3824@50.50.media', 'https://exorlive.com/video/?ex=3824'),
(1534, 211, 3849, 'Skr ryggliggende brystpress', 'Skrstill benken slik at utgangsstillingen gir ca. 100 fleksjon i skuldrene. Ligg p ryggen med fotslene i benken og hold stangen p strake armer over brystet. Senk stangen ned samtidig som brystet presses fram. Press tilbake og gjenta velsen.', 3454, 2004229, 3, 'https://exorlive.com/media_3849@50.50.media', 'https://exorlive.com/video/?ex=3849'),
(1535, 211, 3880, 'Knestende hndleddsstrekk m/hantel', 'Sitt p knrne med underarmen hvilende p puten. Hold hantelen med et fast grep og la hnden henge ned mot gulvet. Strekk hndleddet og press hnden opp mot taket mens underarmen beholder kontakten med benken. Senk rolig tilbake og gjenta velsen.', 4053, 2004258, 3, 'https://exorlive.com/media_3880@50.50.media', 'https://exorlive.com/video/?ex=3880'),
(1536, 211, 3935, 'Steg fram m/belastning', 'Fest stroppen rundt ankelen og st med ryggen til apparatet. I startstillingen er det aktive ben strukket litt bakover og tyngden er p standbenet. Ta et steg fram og fr tyngden over til det aktive benet. Bytt ben.', 3679, 2004289, 2, 'https://exorlive.com/media_3935@50.50.media', 'https://exorlive.com/video/?ex=3935'),
(1537, 211, 3859, 'Sittende hantelcurl m/supinasjon', 'Sitt med hantlene ned langs siden. By i albuene og press helt opp samtidig som du dreier hantlene utover. Senk rolig tilbake og gjenta velsen.', 3473, 2004239, 2, 'https://exorlive.com/media_3859@50.50.media', 'https://exorlive.com/video/?ex=3859'),
(1538, 211, 3893, 'Ryggliggende armsving ut', 'Ligg p ryggen og hold hantlene p strake armer over brystet. Armene fres ut til siden, med en liten by i albuene, og bevegelsen stoppes nr du kjenner ett godt strekk i brystet. Fr tilbake og gjenta velsen.', 3406, 2004271, 2, 'https://exorlive.com/media_3893@50.50.media', 'https://exorlive.com/video/?ex=3893'),
(1539, 211, 3847, 'Skr ryggliggende armstrekk m/hantler 1', 'Skrstill benken slik at utgangsstillingen gir ca. 100 fleksjon i skuldrene. Ligg p ryggen med fotslene i benken og armene utstrakt over brystet. Senk armene ned samtidig som brystet presses fram og sluttstillingen markres med albuene tett inntil siden av kroppen. Strekk armene og gjenta velsen.', 3450, 2004227, 4, 'https://exorlive.com/media_3847@50.50.media', 'https://exorlive.com/video/?ex=3847'),
