(1541, 211, 3941, 'Firfotstende ettbenshev m/vektmansjett', 'Fest vektmansjettene rundt leggene. St p alle fire, med puten under deg, slik at hoftekanten er inne p puten. Strekk vekselvis benene bakover til de er i forlengelse av resten av kroppen.', 3691, 2004296, 2, 'https://exorlive.com/media_3941@50.50.media', 'https://exorlive.com/video/?ex=3941'),
(1542, 211, 3858, 'Sittende hantelcurl m/nytralt grep', 'Sitt med hantlene ned langs siden og la hndflatene vende inn mot lrene. By i albuene og press helt opp uten  dreie underarmene. Senk rolig tilbake og gjenta velsen.', 3471, 2004238, 2, 'https://exorlive.com/media_3858@50.50.media', 'https://exorlive.com/video/?ex=3858'),
(1543, 211, 3881, 'Knestende hndleddsby m/hantel', 'Sitt p knrne med underarmen hvilende p puten. Hold hantelen med et fast grep og la hnden henge ned mot gulvet. By hndleddet og press hnden opp mot taket mens underarmen beholder kontakten med benken. Senk rolig tilbake og gjenta velsen.', 3517, 2004259, 3, 'https://exorlive.com/media_3881@50.50.media', 'https://exorlive.com/video/?ex=3881'),
(1544, 211, 3883, 'Stende vertikal armstrekk', 'St med ryggen mot apparatet og ha et godt grep om hndtaket. Start velsen med at overarmen er trukket opp og tilbake og albuen byd. Press armen ned mot gulvet og strekk i albuen. Spenn godt opp i mage- og korsryggregionen. Markr sluttstillingen. Slipp rolig tilbake og gjenta velsen.', 4047, 2004261, 3, 'https://exorlive.com/media_3883@50.50.media', 'https://exorlive.com/video/?ex=3883'),
(1545, 211, 3996, 'Mobilisering av lateral fleksjon i brystryggen 1', 'Plassr pllen fra benken under armen i hyde med omrdet som skal mobiliseres. Sitt med rett rygg og la armen henge rett ned. Hold en hantel i motsatt hnd. By overkroppen til siden samtidig som armen beveges ut og opp over hodet. Slipp rolig tilbake og gjenta velsen.', 3629, 2004332, 1, 'https://exorlive.com/media_3996@50.50.media', 'https://exorlive.com/video/?ex=3996');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1546, 211, 3985, 'Sittende nedtrekk bak nakken m/firkantpute', 'Ta et bredt grep, press brystkassen fram og trekk haken inn. Trekk stangen ned til nakken samtidig som skuldrene ogs trekkes ned og sammen. Slipp rolig tilbake og gjenta velsen.', 3605, 2004324, 6, 'https://exorlive.com/media_3985@50.50.media', 'https://exorlive.com/video/?ex=3985'),
(1547, 211, 3820, 'Sittende enarms trekk fram', 'Sitt med ryggen mot trekkapparatet. Hold armen strak og hevet over hodet. Hold et godt grep om hndtaket. Trekk armen framover og ned mot kneet. Slipp rolig tilbake og gjenta velsen.', 3821, 2004205, 4, 'https://exorlive.com/media_3820@50.50.media', 'https://exorlive.com/video/?ex=3820'),
(1548, 211, 3949, 'Sittende hofterotasjon ut', 'Fest stroppen over ankelleddet. Sitt p benken med det hvilende benet trukket inn under deg, og det aktive benet ut til siden. Trekk benet inn slik at det til slutt krysser det hvilende benet. Slipp rolig tilbake og gjenta velsen.', 3709, 2004303, 3, 'https://exorlive.com/media_3949@50.50.media', 'https://exorlive.com/video/?ex=3949'),
(1549, 211, 3929, 'Avlastet kneby m/lateral belastning', 'Plassr avlastningsbylen under armene. St med fttene i skulderbreddes avstand og en plankebit under hlene. Fest stroppen rett over det kneet som du nsker  stimulere mest. By ned mot ca. 90 i knrne, hold ryggen rett og blikket fram. Overkroppen lenes p bylen for avlastning og for  gi ekstra stimulering av musklene i sete og lr. Press opp igjen og gjenta velsen.', 3667, 0, 3, 'https://exorlive.com/media_3929@50.50.media', 'https://exorlive.com/video/?ex=3929'),
(1550, 211, 3981, 'Nakke ekstensjon-fleksjon mobilisering m/maks rotasjon', 'Sitt p en benk og rotr hodet til den ene siden. Trekk haken godt inn, by hodet framover og se ned. Behold rotasjonen, by nakken deretter bakover og se opp. Bytt side. Viktig  rotere hodet frst for  "lse" de nederste segmentene, da fokus for velsen er mobilisering av vre cervikal columna.', 3595, 2004321, 2, 'https://exorlive.com/media_3981@50.50.media', 'https://exorlive.com/video/?ex=3981'),
(1551, 211, 3962, 'Kneby m/anterior og posterior belastning 2', 'St med fttene i skulderbreddes avstand og en plankebit under hlene. Fest stroppene over leddet (for posterior belastning) og under leddet (for anterior belastning) p det kneet man nsker  stimulere. Hold en hantel i hver hnd. By ned til ca. 90 i knrne, hold ryggen rett og blikket fram. Press opp igjen og gjenta velsen. God velse for  stimulere kneekstensjon.', 3735, 2008480, 1, 'https://exorlive.com/media_3962@50.50.media', 'https://exorlive.com/video/?ex=3962'),
(1552, 211, 3814, 'Stende enarms trekk inn (45 abd. i skulder)', 'St med siden til trekkapparatet, ha armen hevet ca 45 ut til siden og hold et godt grep om hndtaket. Trekk armen ned og inn mot hoften. Slipp rolig tilbake og gjenta velsen.', 3577, 2004200, 1, 'https://exorlive.com/media_3814@50.50.media', 'https://exorlive.com/video/?ex=3814'),
(1553, 211, 3993, 'Knestende rygghev 2', 'Ligg med overkroppen p en firkantpute, ha knrne byd og hendene bak nakken. Start med hodet og brystet hengende ned mot gulvet. Trekk haken inn og lft hodet og overkroppen opp i en rolig bevegelse. Viktig  stramme opp i magen og korsryggen for  holde ryggen stabil gjennom hele bevegelsen. Slipp rolig tilbake og gjenta velsen.', 3623, 2004330, 2, 'https://exorlive.com/media_3993@50.50.media', 'https://exorlive.com/video/?ex=3993'),
(1554, 211, 4008, 'Skr ryggliggende brystpress m/hantler 1', 'Ligg p ryggen med strake ben og albuene pekende ut til siden for  oppn innadrotasjon i skuldrene. Press armene rett opp mot taket til de er helt strake. Unng for mye svai i korsryggen. Hold deg innenfor smertegrensen. Slipp rolig tilbake og gjenta velsen.', 3765, 2004344, 4, 'https://exorlive.com/media_4008@50.50.media', 'https://exorlive.com/video/?ex=4008'),
(1555, 211, 4002, 'Skrsittende enarms skuldertrekk', 'Fest stroppen rundt skulderen og sitt med sttte mot brystkassen. Press skulderen bakover og trekk skulderbladet inn mot ryggraden. Forsk  begrense rotasjonen i brystryggen. Slipp rolig tilbake og gjenta velsen.', 3663, 2004339, 1, 'https://exorlive.com/media_4002@50.50.media', 'https://exorlive.com/video/?ex=4002'),
(1556, 211, 3892, 'Kne- og hndstttende roing p pute 3', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk skulder og arm opp langs siden til hantelen er i mageniv. Skulderen holdes utadrotert gjennom hele bevegelsen. Senk tilbake og gjenta velsen.', 3540, 2004270, 3, 'https://exorlive.com/media_3892@50.50.media', 'https://exorlive.com/video/?ex=3892'),
(1557, 211, 3838, 'Sittende innoverrotasjon skulder m/sttte (90 abd. i skulder)', 'Sitt med ryggen mot trekkapparatet og ta et fast grep om hndtaket. Plassr overarmen p en pute og ha 90 vinkel i albuen. Rotr innover i skulderleddet, slik at hndtaket svinges fram og ned, mens overarmen holdes i samme stilling. Slipp rolig tilbake og gjenta velsen.', 3432, 2004219, 4, 'https://exorlive.com/media_3838@50.50.media', 'https://exorlive.com/video/?ex=3838'),
(1558, 211, 3948, 'Sittende hofterotasjon inn', 'Fest stroppen over ankelleddet. Sitt p benken med benet nrmest apparatet hvilende p en firkantpute. I startstillingen skal det aktive benet vre krysset bak det hvilende benet. Trekk benet ut til siden, slipp rolig tilbake og gjenta velsen. Lret skal vre i kontakt med benken gjennom hele bevegelsen.', 3707, 2004302, 3, 'https://exorlive.com/media_3948@50.50.media', 'https://exorlive.com/video/?ex=3948'),
(1559, 211, 3946, 'Mageliggende hofterotasjon ut', 'Fest stroppen over ankelleddet. Ligg p magen med hoften strak og bekkenet fiksrt med et belte. Start med 90 by i kneet og leggen ut til siden. Trekk deretter leggen inn, slik at den krysser motsatt ben. Slipp benet rolig tilbake og gjenta velsen.', 4057, 2008495, 2, 'https://exorlive.com/media_3946@50.50.media', 'https://exorlive.com/video/?ex=3946'),
(1560, 211, 3865, 'Mobilisering av ekstensjon i brystryggen 1', 'Sitt skrtt bakover med fttene hvilende p fotsttten og plasser pllen midt i brystryggen. Krum den vre delen av ryggen og legg haken mot brystet samtidig som armene holdes krysset foran kroppen. Trekk haken inn og press den vre delen av ryggen bakover mot ryggsttten, samtidig som du strekker ryggen. By rolig tilbake.', 3485, 2004244, 1, 'https://exorlive.com/media_3865@50.50.media', 'https://exorlive.com/video/?ex=3865'),
(1561, 211, 3839, 'Sittende utoverrotasjon skulder m/sttte (90 abd. i skulderen)', 'Sitt med ansiktet mot trekkapparatet og ta et fast grep om hndtaket. Plassr overarmen p en pute og ha 90 vinkel i albuen. Rotr utover i skulderleddet, slik at hndtaket svinges opp og bakover, mens overarmen holdes i samme stilling. Senk rolig tilbake og gjenta velsen.', 3434, 2004220, 4, 'https://exorlive.com/media_3839@50.50.media', 'https://exorlive.com/video/?ex=3839'),
(1562, 211, 3891, 'Kne- og hndstttende roing p pute 2', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk armen opp langs siden til hantelen er i mageniv samtidig som skulderen roteres innover. Senk tilbake og gjenta velsen.', 3538, 2004269, 3, 'https://exorlive.com/media_3891@50.50.media', 'https://exorlive.com/video/?ex=3891'),
(1563, 211, 3951, 'Stende hofterotasjon ut', 'Fest stroppen over ankelleddet. St med 90 fleksjon i kneeleddet og sttt kneet mot stolen. Start med leggen ut til siden. Trekk benet inn slik at det til slutt krysser bak standbenet. Slipp rolig tilbake og gjenta velsen. Viktig at bekkenet stabiliseres gjennom hele velsen slik at bevegelsen begrenses til hofteleddet.', 3713, 2004306, 4, 'https://exorlive.com/media_3951@50.50.media', 'https://exorlive.com/video/?ex=3951'),
(1564, 211, 4016, 'Sittende ekstensjon-rotasjons mobilisering m/enarmssving', 'Plassr kilen i hyde med omrdet som skal mobiliseres og fest beltet rundt maven og korsryggen. Sitt med by i hofte og knr, og len ryggen mot kilen. Trekk haken inn og rotr hodet til siden samtidig som armen fres p skr ut og opp over hodet. Slipp rolig tilbake og gjenta velsen. velsen vil vre mest spesifikk for mobilisering av de vre segmentene i brystryggen.', 3593, 2008529, 3, 'https://exorlive.com/media_4016@50.50.media', 'https://exorlive.com/video/?ex=4016'),
(1565, 211, 3828, 'Stende armsving fram', 'St med strak arm bak hoften. Sving armen fram og opp over hodet, slik at den til sist er i forlengelse av kroppen. Senk rolig tilbake og gjenta velsen. Armen holdes strak gjennom hele bevegelsen.', 4049, 2004210, 4, 'https://exorlive.com/media_3828@50.50.media', 'https://exorlive.com/video/?ex=3828'),
(1566, 1029, 6771, 'Avspent fall av underkroppen', 'Ligg p ryggen med fttene i gulvet og hendene ut til siden. Srg for  vende hndflatene opp og hold benene samlet. Kjenn at benene fles "tunge" og avslappede. La de nrmest falle til siden og bruk bukmusklene til  trekke de opp igjen samtidig som du presser korsryggen mot underlaget. Kjenn at du fr en fjrende effekt oppover i ryggen nr du slipper benene fra side til side.', 6730, 2007691, 3, 'https://exorlive.com/media_6771@50.50.media', 'https://exorlive.com/video/?ex=6771'),
(1567, 1029, 6780, 'Spiral dreining', 'St med hoftebreddes avstand mellom fttene. Ha en god strekk i ryggen. La armene henge avslappet ned langs siden. Start en liten rotasjon verst i ryggen. k dreiningen nedover i ryggen mens armene svinger tungt inntil kroppen fra side til side. Kombiner gjerne med fokus p respirasjon og lett knesvikt.', 6752, 2007814, 1, 'https://exorlive.com/media_6780@50.50.media', 'https://exorlive.com/video/?ex=6780'),
(1568, 1029, 9188, 'Foam roller: Brystrygg', 'Ligg p ryggen med rullen plassert i midtre del av ryggen.  Knrne holdes byd i 90 grader og bena brukes til  lage bevegelse slik at rullen gr opp og ned langs ryggstrekkerne. Du kan ogs bye og strekke litt i vre del av rygg for bedre bevegelse. mme punkter jobbes litt ekstra med.', 11727, 2011284, 3, 'https://exorlive.com/media_9188@50.50.media', 'https://exorlive.com/video/?ex=9188'),
(1569, 1029, 7643, 'Ryggliggende sidebevegelse av bena', 'Ligg p ryggen med fttene i gulvet og hendene ut til siden. Vend hndflatene ned og hold benene samlet. La bena falle til siden og bruk bukmusklene til  trekke de opp igjen samtidig som du presser korsryggen mot underlaget.', 8119, 2006873, 2, 'https://exorlive.com/media_7643@50.50.media', 'https://exorlive.com/video/?ex=7643'),
(1570, 1029, 6770, 'Sideliggende rotasjon av overkroppen 2', 'Ligg p siden med den nederste hnden under hodet og den andre armen strak mot gulvet foran deg. Hold det verste benet byd. Drei overkroppen ved at du frer armen opp og bakover s langt du klarer. Hold stillingen ca 30 sekunder og drei rolig tilbake. Forsk  holde underkroppen i ro under velsen.', 6728, 2007653, 3, 'https://exorlive.com/media_6770@50.50.media', 'https://exorlive.com/video/?ex=6770'),
(1571, 1029, 9170, 'Foam roller: Utside lr', 'Ligg p siden, slik at foamrolleren er posisjonert p utsiden av lret, like ved hoften. Sett den verste foten opp fremfor den underste foten og bruk den til  stabilisere kroppen mens du lener deg p strake armer eller albuen. Rull opp og ned langs hele lret.', 11691, 2011170, 3, 'https://exorlive.com/media_9170@50.50.media', 'https://exorlive.com/video/?ex=9170'),
(1572, 1029, 7645, 'Sideliggende rotasjon av overkropp 2', 'Ligg p siden med det underste benet rett og det verste benet byd opp. Hold tak med den underste armen rundt nakken og den verste armen strukket rett ut. Ligg i ro med bena slik at du kun roterer i overkroppen og samtidig flger armen med blikket. Bruk gjerne pusten bevisst slik at du puster inn nr du rotere bakover og ut p veien tilbake igjen.', 8123, 2006950, 2, 'https://exorlive.com/media_7645@50.50.media', 'https://exorlive.com/video/?ex=7645'),
(1573, 1029, 9184, 'Foam roller: Utside sete', 'Sitt p rullen med den siden som skal jobbes med, og legg foten p motsatt kne for  f litt ekstra strekk i setemuskulaturen. Bruk armene som sttte for kroppen. Rull frem og tilbake og fra side til side for  jobbe gjennom muskulaturen.', 11719, 2011167, 2, 'https://exorlive.com/media_9184@50.50.media', 'https://exorlive.com/video/?ex=9184'),
(1574, 1029, 9169, 'Foam roller: Bakside lr', 'Sitt p bakken og la det ene lret hvile p rullen, mens du legger det andre benet over som en vekt. Bruk armene til bevege kroppen opp og ned, slik at du kan rulle opp og ned i lrbenets retning. Start nede ved knehasen og jobb hele veien opp til sitteknuten.', 11689, 2011254, 2, 'https://exorlive.com/media_9169@50.50.media', 'https://exorlive.com/video/?ex=9169'),
(1575, 1029, 9173, 'Foam roller: Fremside lr', 'Ligg p magen med det ene benet ut til siden, og det andre benet plassert p foamrolleren.\nOverkroppen hviler p albuene og underarmene. Legg trykk p foamrolleren ved  senke hoftene mot bakken. Rull opp og ned langs med hele lrets lengde', 11697, 2011236, 3, 'https://exorlive.com/media_9173@50.50.media', 'https://exorlive.com/video/?ex=9173'),
(1576, 1029, 6783, 'Armpendel', 'St med god holdning. Kjenn at armene er tunge. Sving den ene armen rolig fram og tilbake ved at du pendler i skulderleddet. k etterhvert pendelen og ta den verste delen av ryggen med i bevegelsen, slik at du bde svinger armen og dreier overkroppen. F et godt "slipp" i skulderleddet og hold en fin rytme. Svikt gjerne lett knrne mens du pendler. Kombiner evt velsen med fokus p respirasjon.', 6745, 2007710, 1, 'https://exorlive.com/media_6783@50.50.media', 'https://exorlive.com/video/?ex=6783'),
(1577, 1029, 9187, 'Foam roller: Korsrygg', 'Ligg p ryggen med rullen plassert i nedre del av korsryggen. Knrne holdes byd i 90 grader og bena brukes til  lage bevegelse slik at rullen gr opp og ned langs ryggstrekkerne. mme punkter jobbes litt ekstra med.', 11725, 2011179, 1, 'https://exorlive.com/media_9187@50.50.media', 'https://exorlive.com/video/?ex=9187'),
(1578, 1029, 9167, 'Foam roller: Bakside legger', 'Start nede ved achillessenen og rull opp mot knehasen.\nRull i et jevnt tempo. Nr du finner mme punkter kan du holde trykket og gjre sirkelbevegelser med foten, samt bye og strekke i ankelleddet. \nForsk  jobbe bde p innsiden og utsiden av leggmuskulaturen.', 11685, 2011161, 1, 'https://exorlive.com/media_9167@50.50.media', 'https://exorlive.com/video/?ex=9167'),
(1579, 1029, 8646, 'Shoulder dislocation', 'Hold en stokk i hendene med bredt grep foran kroppen. Beveg stokken i en sirkelbevegelse med strake armer over hodet og ned bak p ryggen og frem igjen til utgangsposisjon.', 10753, 2009833, 3, 'https://exorlive.com/media_8646@50.50.media', 'https://exorlive.com/video/?ex=8646'),
(1580, 1029, 8296, 'Fremoverfring med stang', 'St oppreist med cirka skulderbreddes avstand mellom bena. Hold en stang foran kroppen. Fr stangen frem og opp samtidig som du trekker inn pusten. Slipp stangen rolig ned igjen i samme bevegelsesbane og pust ut samtidig.', 9929, 2008128, 2, 'https://exorlive.com/media_8296@50.50.media', 'https://exorlive.com/video/?ex=8296'),
(1581, 1029, 9192, 'Foam roller: situps', 'Ligg p ryggen med rullen plassert i midtre del av ryggen. Knrne holdes byd i 90 grader og armene i kryss over brystkassen. Pust inn p toppen, og pust ut mens du lener deg bakover p rullen. Beveg tilbake til startposisjon.', 11735, 2011230, 2, 'https://exorlive.com/media_9192@50.50.media', 'https://exorlive.com/video/?ex=9192'),
(1582, 1029, 6781, 'Avspenning av skulderbuen 1', 'St med god holdning. Trekk det ene skulderbladet inn mot ryggsylen, og deretter hele skulderbuen bak og litt oppover, samtidig som du dreier hodet til den samme siden. Hold noen f sekunder og slipp rolig ned og ls opp. Gjenta til den andre siden.', 6755, 2007633, 1, 'https://exorlive.com/media_6781@50.50.media', 'https://exorlive.com/video/?ex=6781'),
(1583, 1029, 9213, 'Fotsle m/ ball', 'Legg en ball p bakken og sett den ene foten opp p ballen. Legg et jevnt trykk ned p ballen. Rull frem og tilbake i lengderetning og sideveis for  lse opp spenninger.', 11775, 2011245, 1, 'https://exorlive.com/media_9213@50.50.media', 'https://exorlive.com/video/?ex=9213'),
(1584, 1029, 9175, 'Foam roller: Innside lr', 'Ligg p magen med det ene benet ut til siden p foamrolleren, og det andre benet plassert p bakken. Start oppe ved lysken. Overkroppen hviler p albuene og underarmene. Legg trykk p foamrolleren ved  senke hoftene mot bakken. Rull frem og tilbake langs med hele lrets lengde fra lysken til kneet', 11701, 2011176, 2, 'https://exorlive.com/media_9175@50.50.media', 'https://exorlive.com/video/?ex=9175'),
(1585, 1029, 9171, 'Foam roller: Utside lr m/ begge ben p rullen', 'Ligg p siden, slik at foamrolleren er posisjonert p utsiden av lret, like ved hoften. Legg begge bena p rullen og bruk armene til  stabilisere kroppen og bevege deg. \nRull opp og ned langs hele lret.', 11693, 2011290, 4, 'https://exorlive.com/media_9171@50.50.media', 'https://exorlive.com/video/?ex=9171'),
(1586, 1029, 8347, 'Katten m/bevgelse', 'St i firefotsstende p en matte. Len deg bak p hlene, beveg deretter overkroppen ned mot bakken og fremover samtidig som du svaier litt i korsryggen og trekker pusten inn gjennom nesen. Beveg deg opp i firefotsstende og skyt rygg samtidig som du slipper pusten ut.', 10085, 2008035, 3, 'https://exorlive.com/media_8347@50.50.media', 'https://exorlive.com/video/?ex=8347'),
(1587, 1029, 9190, 'Foam roller: Utside rygg', 'Ligg p siden p rullen med byde ben og nederste arm strak som sttte i gulvet. Start fra nedre del av ribbena og rull hele veien opp til armhulen. Jobb ekstra med de mme punktene, spesielt i regionen oppe ved armhulen', 11731, 2011218, 1, 'https://exorlive.com/media_9190@50.50.media', 'https://exorlive.com/video/?ex=9190'),
(1588, 1029, 9002, 'Sittende rotasjon av overkropp med stokk', 'Sitt p en stol med rak rygg og en stokk bak nakken. Hold stokken med bredt grep. Roter overkroppen rolig fra side til side. Flg stokken med blikket og hold hofter og bekken i ro.', 11384, 2010893, 1, 'https://exorlive.com/media_9002@50.50.media', 'https://exorlive.com/video/?ex=9002'),
(1589, 1029, 7644, 'Sideliggende rotasjon av overkropp 1', 'Ligg p siden med det underste benet rett, det verste benet byd opp og hendene bak nakken. Ligg i ro med bena og roter kun i overkroppen slik at den verste skulderen nesten er i gulvet. Bruk gjerne pusten bevisst slik at du puster inn nr du rotere bakover og ut p veien tilbake igjen.', 8121, 2006911, 2, 'https://exorlive.com/media_7644@50.50.media', 'https://exorlive.com/video/?ex=7644'),
(1590, 1029, 8348, 'Firefotsstende nakkerotasjon', 'St i firefotsstende p en matte. Roter nakken i ett rolig tempo fra side til side.', 10036, 2008084, 2, 'https://exorlive.com/media_8348@50.50.media', 'https://exorlive.com/video/?ex=8348'),
(1591, 1029, 7640, 'Sittende ryggstrekk med utadrotasjon av armer', 'Sitt p stolel med bena i gulvet. Sitt litt sammensunket med drlig holdning i overkroppen. Trekk pusten inn samtidig som du retter deg opp i ryggen og strekker ut armene til siden.', 8113, 2007000, 2, 'https://exorlive.com/media_7640@50.50.media', 'https://exorlive.com/video/?ex=7640'),
(1592, 1029, 8265, 'Sidehev av skulder med stang', 'Hold i en stang/kosteskaft i cirka skulderbreddes avstand. Trekk skulderbladene litt sammen. Skyv armen ut til siden ved hjelp av stangen og kraften fra den nederste armen. Senk rolig tilbake igjen.', 9868, 2008001, 1, 'https://exorlive.com/media_8265@50.50.media', 'https://exorlive.com/video/?ex=8265'),
(1593, 1029, 7968, 'Stende strekk med kosteskaft', 'St oppreist og hold ett kosteskaft el. i cirka skulderbreddes avstand. Lft kosteskaftet frem og opp samtidig som du trekker pusten inn. Nr du har strukket armene helt opp slipper du pusten ut samtidig som du senker armene rolig ned igjen. Vr oppmerksom p  holde strake armer under hele velsen.', 9092, 2007544, 2, 'https://exorlive.com/media_7968@50.50.media', 'https://exorlive.com/video/?ex=7968'),
(1594, 1029, 9172, 'Foam roller: Utside lr m/ benbevegelse', 'Ligg p siden, slik at foamrolleren er posisjonert p utsiden av lret, like ved hoften. Sett den verste foten opp fremfor den underste foten og bruk den til  stabilisere kroppen mens du lener deg p albuen. Rull opp og ned langs hele lret. Nr du finner et mt punkt, holder du trykket og byer og strekker i kneet.', 11695, 2011281, 2, 'https://exorlive.com/media_9172@50.50.media', 'https://exorlive.com/video/?ex=9172'),
(1595, 1029, 7605, 'Liggende oppoverfring av arm', 'Ligg p ryggen med en liten by i knrne. Hold rundt underarmen p den aktive armen. Fr armen oppover ved hjelp av motsatte arm.', 8043, 2006944, 1, 'https://exorlive.com/media_7605@50.50.media', 'https://exorlive.com/video/?ex=7605'),
(1596, 1029, 6769, 'Sideliggende rotasjon av overkroppen 1', 'Ligg p siden med hendene plassert over rene. Hold albuene samlet og det verste benet byd. Drei overkroppen ved at du frer den verste albuen opp og bakover s langt du klarer. Hold stillingen ca 30 sekunder og drei rolig tilbake. Forsk  holde underkroppen i ro under velsen.', 6725, 2007804, 2, 'https://exorlive.com/media_6769@50.50.media', 'https://exorlive.com/video/?ex=6769'),
