(1652, 1029, 8930, 'Bakside legg 6', 'Pasienten ligger p ryggen med strake ben. Terapeut/pleier stiller seg i fotenden av sengen, griper om pasientens forfot med begge hender og beveger foten opp mot ansiktet. Hold stillingen i ca 20-30 sekunder.', 11256, 2010743, 2, 'https://exorlive.com/media_8930@50.50.media', 'https://exorlive.com/video/?ex=8930'),
(1653, 1029, 8941, 'Gjennombeveging: rotasjon skulder', 'Pasienten ligger p ryggen med armen i rett ut til siden. Terapeut/pleier sttter pasientens albue med vre hnd, holder nedre hnd rundt pasientens hndledd og lfter underarmen til loddrett stilling. Underarmen beveges s bakover og ned mot madrassen og deretter fremover og ned mot madrassen.', 11278, 2010754, 2, 'https://exorlive.com/media_8941@50.50.media', 'https://exorlive.com/video/?ex=8941'),
(1654, 1029, 7457, 'Mobilisering vre del  rygg i slynge m/ball 4', 'Sitt p en stor ball ca 50 cm foran opphengspunktet og hvil underarmer og hodet i slyngene. Beveg deg framover og sideveis mens du presser brystet fram/ned og strekker ut brystryggen.', 7736, 2005840, 2, 'https://exorlive.com/media_7457@50.50.media', 'https://exorlive.com/video/?ex=7457'),
(1655, 1029, 9098, 'Nervemobilisering n.medianus', 'Ligg p ryggen med den ene armen strak ut til siden i ca 45 graders vinkel fra kroppen. Ha full strekk i hndleddet og hodet byd mot den siden du skal trene. By s i hndleddet samtidig som du byer hodet til motsatt side.', 11540, 2010862, 2, 'https://exorlive.com/media_9098@50.50.media', 'https://exorlive.com/video/?ex=9098'),
(1656, 1029, 7622, 'Stende fremoverfring av arm med hjelp', 'St oppreist. Sttt med motsatt hnd rundt underarmen. Fr armen opp og frem ved hjelp av motsatt arm.', 8078, 2006953, 1, 'https://exorlive.com/media_7622@50.50.media', 'https://exorlive.com/video/?ex=7622'),
(1657, 1029, 7608, 'Sittende fremoverfring av arm med sttte', 'Sitt p en stol med armen hengende ned til siden. Hold rundt underarmen med motsatt hnd. Fr armen frem og opp mot taket ved hjelp av motsatt arm.', 8049, 2006815, 1, 'https://exorlive.com/media_7608@50.50.media', 'https://exorlive.com/video/?ex=7608'),
(1658, 1029, 9211, 'Foam roller: vre del nakke', 'Legg en rull langs med en syle eller drkarm. Len deg mot rullen slik at den er plassert i nakkevinkelen. Bruk kroppen til  legge et jevnt trykk mot rullen. Rull langs med muskulaturen.', 11771, 2011278, 3, 'https://exorlive.com/media_9211@50.50.media', 'https://exorlive.com/video/?ex=9211'),
(1659, 1029, 8032, 'Indianer med pil og bue', 'Lat som du holder en pil og bue. St i fekterstilling med det ene benet foran det andre. Strekk den fremste armen og spenn opp buen med  bye den bakerste armen, slipp s pilen, Roter overkroppen til motsatt side og gjenta.', 8982, 2007385, 2, 'https://exorlive.com/media_8032@50.50.media', 'https://exorlive.com/video/?ex=8032'),
(1660, 1029, 9189, 'Brystrygg m/ accupoint ball', 'Ligg p ryggen med accupoint ballen plassert i midtre del av ryggen. Knrne holdes byd i 90 grader. Hold armene i kryss over brystkassen. For  f mer bevegelse kan du jobbe fra side til side i rotasjon samt vekselvis strekke ut armene til siden og krysse dem foran brystet. mme punkter jobbes litt ekstra med.', 11729, 2011239, 3, 'https://exorlive.com/media_9189@50.50.media', 'https://exorlive.com/video/?ex=9189'),
(1661, 1029, 9203, 'Hoftebyer m/ accupoint ball og hoftebevegelse', 'Ligg p magen og plasser accupointballen p hykant p fremsiden og innsiden av bekkenkanten. Legg trykk ned p ballen. Rull i sm bevegelser frem og tilbake over ballen. Lft lret forsiktig fra underlaget for  skape mer trykk mot ballen.', 11755, 2011260, 2, 'https://exorlive.com/media_9203@50.50.media', 'https://exorlive.com/video/?ex=9203'),
(1662, 1029, 7455, 'Mobilisering vre del rygg i slynge m/ball 2', 'Sitt p en stor ball ca 60 cm foran opphengspunktet og hvil underarmer og hodet i en bred slynge. Beveg deg framover og sideveis mens du presser brystet fram/ned og strekker ut brystryggen.', 7732, 2005878, 2, 'https://exorlive.com/media_7455@50.50.media', 'https://exorlive.com/video/?ex=7455'),
(1663, 1029, 8647, 'Shoulder dislocation, smalt grep', 'Hold en stokk med et grep litt bredere enn skulderbredde foran kroppen. Fr stokken med strake armer i en sirkelbevegelse opp over hodet og ned bak p ryggen. Beveg p samme mte tilbake til utgangsposisjon.', 10755, 2009771, 3, 'https://exorlive.com/media_8647@50.50.media', 'https://exorlive.com/video/?ex=8647'),
(1664, 1029, 9096, 'Nervemobilisering n.radialis', 'Ligg p ryggen med byde ben med armen strakt ut til siden i ca 45 graders vinkel til kroppen og med hndleddet strukket. Hodet ligger rotert til motsatt side av armen du skal trene. Roter s hodet til motsatt side samtidig som du byer hndleddet.', 11537, 2010860, 2, 'https://exorlive.com/media_9096@50.50.media', 'https://exorlive.com/video/?ex=9096'),
(1665, 1029, 8931, 'Gjennombeveging: innadrotasjon hofte', 'Pasienten ligger p ryggen med strake ben. Terapeut/pleier griper om pasientens ankel og kne og byer opp til ca 90 grader i hofte og kne. Roter s i hoften ved  vri kneet innover og fot og legg utover. Beveg rolig tilbake og gjenta bevegelsen.', 11258, 2010744, 2, 'https://exorlive.com/media_8931@50.50.media', 'https://exorlive.com/video/?ex=8931'),
(1666, 1067, 387, 'Romaskin', 'Juster motstanden med hendelen p din hyre side. Trykk p "on", velg hvilken informasjon du vil se p skjermen og start roingen.', 707, 2004249, 3, 'https://exorlive.com/media_387@50.50.media', 'https://exorlive.com/video/?ex=387');
