(1690, 1067, 8670, 'Hoppende utfall 1', 'Ta et stort skritt frem med det ene benet og ha lett by i kneet som str igjen. Gjr et hopp og bytt plass p fremste og bakerste ben vekselvis samtidig som du svinger begge armer frem og tilbake.', 10801, 2009728, 4, 'https://exorlive.com/media_8670@50.50.media', 'https://exorlive.com/video/?ex=8670'),
