(1692, 1067, 8671, 'Hoppende utfall 2', 'Ta et stort skritt frem og by litt i fremste kne. Bytt plass p fremste og bakerste ben vekselvis ved  hoppe. Beveg ogs armene vekselvis frem og tilbake diagonalt slik at venstre arm flger hyre ben og motsatt.', 10803, 2009803, 4, 'https://exorlive.com/media_8671@50.50.media', 'https://exorlive.com/video/?ex=8671'),
(1693, 1067, 8846, '1 ben singelhopp', 'Start med noen singel hopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Legg vekten p ett ben og finn balansen, for at du skal kunne hoppe p ett ben. \nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11152, 2009778, 2, 'https://exorlive.com/media_8846@50.50.media', 'https://exorlive.com/video/?ex=8846'),
