(1701, 1067, 5397, 'Oppvarming: rotasjonsvelse 1', 'St med rett rygg og ha ca. hoftebreddes avstand mellom fttene. Hold stavene bak hodet slik at de hviler p skuldrene. Spenn lett i mage- og ryggmuskulaturen. Drei overkroppen rolig fra side til side uten  flytte fttene.', 5368, 2008483, 2, 'https://exorlive.com/media_5397@50.50.media', 'https://exorlive.com/video/?ex=5397'),
