(1704, 1067, 8705, 'Stakemaskin/thorax trainer', 'St p stakemaskinen og fest stavene, riktig hyde p stavene har du nr de rekker deg til armhulene. St mest mulig i ro med bena. Ha rett rygg, sett setet litt ut og dra stavene bakover med armene. Fr armene frem igjen, stopp nr de er ca ved skulderhyde. Gjenta.', 10871, 2009775, 3, 'https://exorlive.com/media_8705@50.50.media', 'https://exorlive.com/video/?ex=8705'),
(1705, 1067, 8667, 'Boksing med spark', 'St p en matte med hoftebreddes avstand mellom fttene og hendene i bokseposisjon. Boks ut i luften med annenhver arm. Varier ved  bruke ulike slag og spark innimellom.', 10795, 2009729, 2, 'https://exorlive.com/media_8667@50.50.media', 'https://exorlive.com/video/?ex=8667'),
(1706, 1067, 7268, 'BOSU: Jogge', 'St p toppen av BOSU-en med parallelle ftter. Jogg p stedet. Prv  f inn en gyngebevegelse av kroppen der hlene lfter seg fra BOSU-en mens trne til en hver tid er i kontakt med BOSU-en.', 7356, 2005392, 2, 'https://exorlive.com/media_7268@50.50.media', 'https://exorlive.com/video/?ex=7268'),
(1707, 1067, 853, 'Skyggeboksing', '', 1601, 2004816, 3, 'https://exorlive.com/media_853@50.50.media', 'https://exorlive.com/video/?ex=853'),
(1708, 1067, 5392, 'Stavgang', 'G framover med rett rygg og lave avslappede skuldre. Ha armene forholdsvis tett p kroppen og hold overkroppen lett foroverbyd. Hold et lett grep omkring stavene og sving armene vekselvis fram og tilbake. Stavene settes i bakken p hyde med hlen p motsatt fot, og skal peke skrtt bakover gjennom hele armbevegelsen. Legg trykk p staven inntil hnden er bak kroppens midtlinje. G med lette og lange steg. Finn ditt eget tempo. Ved hjelp af stavene fr du en god rytme i gangen og en bedre holdning.', 5360, 0, 3, 'https://exorlive.com/media_5392@50.50.media', 'https://exorlive.com/video/?ex=5392'),
(1709, 1067, 5398, 'Rotasjonsvelse 2', 'St med rett rygg og ha ca. hoftebreddes avstand mellom fttene. Hold stavene lftet med strake armer over hodet. Spenn lett i mage- og ryggmuskulaturen. Drei overkroppen rolig fra side til side uten  flytte fttene.', 5370, 2008503, 2, 'https://exorlive.com/media_5398@50.50.media', 'https://exorlive.com/video/?ex=5398'),
(1710, 1067, 848, 'G tur', '', 1573, 0, 2, 'https://exorlive.com/media_848@50.50.media', 'https://exorlive.com/video/?ex=848'),
(1711, 1067, 5395, 'Padletak', 'St med lett byde kne og hold stavene tett p kroppen. Ta et bredt grep slik at du holder i hver ende av stavene. Spenn lett i mage- og ryggmuskulaturen. Ta store padletak til hver side, mens du samtidig byer og strekker lett i knrne. Utfr bevegelsen i et moderat tempo og med en god rytme.', 5366, 2008549, 2, 'https://exorlive.com/media_5395@50.50.media', 'https://exorlive.com/video/?ex=5395'),
(1712, 1067, 8855, 'Bokse hopp', 'Start med noen singelhopp for  finne rytmen. Stuss opp og ned ved  bruke ankelleddet aktivt. Bevegelsen gjennomfres ved  splitte fttene frem og tilbake mellom hoppene.\nSkuldrene m vre avslappet i velsen, og det er hndleddene som skaper bevegelse p tauet.', 11170, 2009717, 2, 'https://exorlive.com/media_8855@50.50.media', 'https://exorlive.com/video/?ex=8855'),
