(1714, 1067, 7271, 'BOSU: Saksehopp', 'St p toppen av BOSU-en. Hoppopp og ned ved  flytte annethvert ben fram og tilbake. Kan gjres vanskeligere ved  lfte bena hyere.', 7363, 2005395, 3, 'https://exorlive.com/media_7271@50.50.media', 'https://exorlive.com/video/?ex=7271'),
