(1754, 1002, 5760, 'Armbyninger', 'St oppreist. Ta en dyp innnding og trekk navlen inn mot ryggsylen. Pust ut og la hendene vandre nedover lrene mens du byer framover. Pust inn og merk strekket p baksiden av lrene. Pust ut og senk hoftene til kroppen er strak og du er klar til  utfre en armbyning. Utfr tre armbyninger ved  bye og strekke armene. Hold albuene tett p kroppen. P den siste armbyningen folder du deg sammen ved  fre brystet mot benene og presse hndflater og ftter mot gulvet. Trekk navlen enda lenger inn mot ryggsylen for  f et fullkomment strekk. Forestill deg at kroppens senter trekkes oppover av en fjr. Pust inn mens du lar hendene vandre tilbake mot fttene. Hold benene s strake som mulig underveis. Pust ut og rull tilbake til oppreist stilling.', 5748, 2004600, 4, 'https://exorlive.com/media_5760@50.50.media', 'https://exorlive.com/video/?ex=5760'),
(1755, 1002, 9235, 'Mage m/ ettbens strekk', 'Ligg p ryggen med 90 grader i hofter og knr og armene langs siden. Aktiver magemuskulaturen slik at korsryggen har kontakt med gulvet. Lft overkroppen opp p utpust. P neste utpust strekker du ut den ene foten. Beveg rolig tilbake og gjenta med motsatt fot. Sett bena i gulvet og senk overkroppen ned til utgangsstilling.', 11819, 2011101, 2, 'https://exorlive.com/media_9235@50.50.media', 'https://exorlive.com/video/?ex=9235'),
