(1757, 1002, 9232, 'Rull opp', 'Sitt p huk og ta tak i trne med hendene. Begynn velsen med  strekke ut i knrne, du skal da kjenne en strekk p baksiden av lrene. Pust rolig og rull overkroppen sakte opp virvel for virvel mens du puster ut.', 11813, 2011092, 2, 'https://exorlive.com/media_9232@50.50.media', 'https://exorlive.com/video/?ex=9232'),
(1758, 1002, 5775, 'Benlft - innside lr', 'Ligg p hyre side med venstre fot krysset inn foran det hyre kneet. La hodet hvile p armen mens du sttter deg med den andre armen. Strekk benet godt ut og lft det fra gulvet mens du vender hlen en anelse mot taket. Lft og senk benet uten at det rrer underlaget. Fokusr p lftet. Lft og senk fem til ti ganger. Hold deretter benet i lftet stilling og la det pumpe oppover i ti sm rykk. Gjenta velsen med motsatt ben.', 5767, 2004606, 3, 'https://exorlive.com/media_5775@50.50.media', 'https://exorlive.com/video/?ex=5775'),
(1759, 1002, 5734, 'Ryggsylerotasjon', 'Sitt s strak som mulig med litt mer enn hoftebreddes avstand mellom fttene. Strekk armene ut til siden som om du prver  berre veggene p begge sider. Pust inn og trekk navlen mot ryggsylen. Pust ut og drei mot den ene siden. k strekket ved  holde ryggen strak og presse brystet fram. Forestill deg at all bevegelse foregr fra rett over hoftene og opp. Gjenta velsen til motsatt side.', 5729, 2004588, 5, 'https://exorlive.com/media_5734@50.50.media', 'https://exorlive.com/video/?ex=5734'),
(1760, 1002, 5676, 'Innledende velse: Ett hundre', 'Ligg p ryggen og lft benene slik at du har ca 90 vinkel i kne og hofte. Ta en dyp innnding og pust ut mens du forestiller deg at brystet og magen synker ned i gulvet. Fasthold denne flelsen og lft den verste delen av overkroppen fra underlaget, slik at du kan se mot navlen. Lft samtidig armene, strekk de framover og begynn  pumpe opp og ned, som om du slr p vann. Hold denne stillingen mens du puster langsomt inn og teller til fem og puster ut og teller til fem. Forsk etter hvert  telle til hundre.', 5666, 2004556, 1, 'https://exorlive.com/media_5676@50.50.media', 'https://exorlive.com/video/?ex=5676'),
(1761, 1002, 5708, 'Kryss og tvers', 'Ligg p ryggen med hendene bak hodet, albuene ut til siden og knrne byd. Strekk det ene benet langt ut foran deg og drei overkroppen slik at den motsatte albuen fres mot det byde kneet. Pust inn nr du dreier overkroppen. Hold stillingen mens du puster helt ut og pust inn igjen nr du skifter stilling. Forestill deg at du er forankret til underlaget. Srg for at bevegelsen og kraften utgr fra mage og korsrygg.', 5704, 2004574, 4, 'https://exorlive.com/media_5708@50.50.media', 'https://exorlive.com/video/?ex=5708'),
(1762, 1002, 5707, 'Dobbelt strak benstrekk', 'Ligg p ryggen med hendene bak hodet og albuene ut til siden. Strekk benene opp mot taket. Lft hodet, stram setemuskulaturen og senk benene ned mot gulvet mens du puster inn. Press ryggsylen mot gulvet og hold haken mot brystet. Nr du puster ut igjen hever du benene opp igjen. Merk hvordan bryst og ben presses mot hverandre.', 5703, 2004573, 3, 'https://exorlive.com/media_5707@50.50.media', 'https://exorlive.com/video/?ex=5707'),
