(1767, 1002, 5755, 'Benlft bakover', 'St i armhevings-posisjon med hendene plassrt like under skuldrene. Trekk navlen opp mot ryggsylen og stram muskulaturen i bde ben og overkropp. Flytt kroppsvekten bakover mens du presser hlene mot gulvet. Vipp fram igjen over trne. Gjr dette noen ganger for  varme senene opp. Pust inn og hev det ene benet, som du holder hevet, mens du igjen gjentar vippebevegelsen i ankelen og puster ut. Skift ben hver gang du har foretatt en inn- og utnding.', 5743, 2004596, 5, 'https://exorlive.com/media_5755@50.50.media', 'https://exorlive.com/video/?ex=5755'),
(1768, 1002, 5692, 'Sirkler med ett ben', 'Ligg p ryggen med det ene benet lftet rett opp mot taket. Det andre er i forlengelse av kroppen og srger for stabilitt. Fr benet i en sirkel, frst opp og ut og deretter ned og inn og tilbake til utgangsstillingen. Merk hvordan ryggsylen presses ned i gulvet. Pust inn nr du begynner p sirkelen og ut nr du avslutter den. Etterp frer du benet motsatt vei rundt i sirkelen. Husk ogs  gjenta velsen med det andre benet.', 5685, 2004567, 2, 'https://exorlive.com/media_5692@50.50.media', 'https://exorlive.com/video/?ex=5692'),
(1769, 1002, 5683, 'Innledende velse: Rulle opp', 'Ligg p ryggen med knrne samlet og fotslene i gulvet. Press knrne lett sammen, stram setemuskulaturen, pust inn og rull opp ved at du frer haken mot brystet og lfter virvel for virvel og til sist hele overkroppen framover. Samtidig strekker du benene og puster helt ut. Rull deretter tilbake igjen ved at du strammer setemuskulaturen, byer knrne og utfrer velsen i motsatt rekkeflge.', 5682, 2004561, 1, 'https://exorlive.com/media_5683@50.50.media', 'https://exorlive.com/video/?ex=5683'),
(1770, 1002, 5756, 'Benlft framover', 'Sitt med samlede ben og plassr hndflatene i gulvet. Lft bekkenet opp til kroppen er strak. Stabilisr ved  stramme setemuskulaturen og klemme benene sammen. Trekk navlen inn mot ryggsylen. Pust inn og spark det ene benet s langt opp som du kan uten at du knekker sammen i ryggen. By ankelen og pust ut igjen mens du senker benet tilbake og forestiller deg at energien strmmer ut av hlen. Nr hlen nrmer seg gulvet strekker du ankelen og utfrer bensparket p nytt. Gjenta velsen med motsatt ben.', 5744, 2004597, 5, 'https://exorlive.com/media_5756@50.50.media', 'https://exorlive.com/video/?ex=5756'),
(1771, 1002, 5735, 'Follekniven', 'Ligg p ryggen med armene langs siden og benene opp mot taket. Stram sete og lr muskulaturen og trekk navlen inn mot ryggsylen. Rull videre bakover til du hviler p skuldrenes bakside. Press armene ned i gulvet og skyt hoftene fram og opp og lft benene mot taket. La kroppen hvile p skuldrene, hold fttene p linje med ynene, fr du puster ut og langsomt senker deg ned mot gulvet virvel for virvel.', 5724, 2004589, 5, 'https://exorlive.com/media_5735@50.50.media', 'https://exorlive.com/video/?ex=5735'),
(1772, 1002, 5695, 'Trille som en ball', 'Sitt med byde knr og en hnd omkring hver ankel. Lft fttene og balansr p halebenet. Hold haken mot brystet og albuene ut til siden, slik at du fr flelsen av  vre rund som en ball. La navlen synke dypt ned i ryggsylen og fall bakover. Rull bakover p n innnding og rull framover mens du puster ut. Forsk  rulle hurtig framover til du igjen holder balansen p halebenet. Unng  rulle helt tilbake p nakken.', 5693, 2004568, 2, 'https://exorlive.com/media_5695@50.50.media', 'https://exorlive.com/video/?ex=5695'),
(1773, 1002, 5772, 'Lft opp og ned', 'Ligg p siden. Lft det verste benet til hoftehyde og rotr det litt utover. Pust inn mens du trekker navlen inn mot ryggsylen og lfter benet mot taket. Pust ut mens du senker benet og strekker benet langt ut fra hoften underveis. Hold resten av kroppen helt i ro mens du utfrer velsen.', 5764, 2004603, 2, 'https://exorlive.com/media_5772@50.50.media', 'https://exorlive.com/video/?ex=5772'),
(1774, 1002, 5718, 'Sagen', 'Sitt s strak som mulig med litt mer enn hoftebreddes avstand mellom fttene. Strekk armene ut til siden som om du prver  berre veggene p begge sider. Pust inn og trekk navlen mot ryggsylen. Pust ut og drei mot venstre og fr hodet, brystet og armen mot det venstre benet. Strekk armen framover forbi lilleten mens du gjr utndingen enda dypere. Forestill deg at all bevegelse foregr fra rett over hoftene og opp. Gjenta velsen til motsatt side.', 5712, 2004579, 3, 'https://exorlive.com/media_5718@50.50.media', 'https://exorlive.com/video/?ex=5718'),
(1775, 1002, 5733, 'Skulderbro', 'Ligg p ryggen. Lft bekkenet og plassr hendene like over hoftene og albuene like under. Trekk navlen inn og strekk det ene benet og spark opp mot taket samtidig som du puster inn. Nr benet er p det hyeste punktet, puster du ut og senker det ned mot gulvet. Gjenta velsen med motsatt ben.', 5728, 2004587, 6, 'https://exorlive.com/media_5733@50.50.media', 'https://exorlive.com/video/?ex=5733'),
(1776, 1002, 5710, 'Foroverbyd ryggsylestrekk', 'Sitt med rett rygg og strake ben.Gjr deg s hy som du kan. Strekk armene framfor deg i ca skulderhyde og by anklene som om du presser hlene mot veggen. Fr haken mot brystet og begynn  rulle framover mens du trekker navlen inn mot ryggsylen. Pust ut mens du strekker deg framover og inn igjen nr du vender tilbake til utgangsstillingen. Husk  ha lave skuldre.', 5705, 2004577, 2, 'https://exorlive.com/media_5710@50.50.media', 'https://exorlive.com/video/?ex=5710'),
(1777, 1002, 5678, 'Innledende velse: Enkelt benstrekk', 'Ligg p ryggen med knrne mot brystet. Grip omkring den ene leggen med begge hendene (som vist p tegningen) og strekk det andre benet opp mot taket. Hold albuene ut til siden, lft hodet og pust ut mens du ser hvordan navlen synker ned mot gulvet. Press ryggsylen ned mot gulvet. Pust inn og skift ben og armstilling, mens du fortsatt holder hodet lftet.', 5783, 2004557, 1, 'https://exorlive.com/media_5678@50.50.media', 'https://exorlive.com/video/?ex=5678'),
(1778, 1002, 5720, 'Enkelt benspark', 'Ligg p magen og sttt deg p albuene. Stram setemuskulaturen og knip den verste del av innsiden p lrene sammen. Press albuene og bekkenet ned mot underlaget, slik at du ikke synker sammen. By det ene kneet og utfr et dobbelspark mot rumpa. Gjenta med motsatt ben.', 5713, 2004883, 3, 'https://exorlive.com/media_5720@50.50.media', 'https://exorlive.com/video/?ex=5720'),
(1779, 1002, 5679, 'Innledende velse: Dobbelt benstrekk', 'Ligg p ryggen med knrne mot brystet. Grip omkring begge benene. Hold albuene ut til siden, lft hodet og pust ut mens du ser hvordan navlen synker ned mot gulvet. Pust inn og strekk ben og armer mot taket, mens du presser ryggsylen mot gulvet og holder haken mot brystet. Det skal fles som om du blir trekt i to retninger. Pust ut igjen mens du trekker knrne opp mot brystet og nrmest presser luften ut av lungene.', 5675, 2004558, 1, 'https://exorlive.com/media_5679@50.50.media', 'https://exorlive.com/video/?ex=5679'),
(1780, 1002, 5771, 'Spark fram og tilbake', 'Ligg p siden. Lft det verste benet til hoftehyde og rotr det litt utover. Pust inn mens du trekker navlen inn mot ryggsylen. Sving benet fram og la det pumpe ett par ganger (som to sm spark). Sving tilbake p n utnding og strekk det bakover. Hold resten av kroppen helt i ro mens du utfrer velsen.', 5763, 2004602, 3, 'https://exorlive.com/media_5771@50.50.media', 'https://exorlive.com/video/?ex=5771'),
(1781, 1002, 5699, 'Enkelt benstrekk', 'Sitt med byde knr og hold omkring det ene benet med den innerste hnden p kneet og den ytterste p ankelen. Hold haken mot brystet og albuene ut til siden. Rull bakover p ryggen mens du fortsatt holder omkring det ene benet. Det andre strekker du ut i en vinkel som tillater at korsryggen har kontakt med gulvet. Ta en dyp innnding og merk hvordan navlen synker ned i ryggsylen. Nr du puster ut skifter du ben og armstilling. Utfr bevegelsen glidende og kontrollert.', 5697, 2004569, 2, 'https://exorlive.com/media_5699@50.50.media', 'https://exorlive.com/video/?ex=5699'),
(1782, 1002, 5749, 'Forberedende velse: Luringen 1', 'Ligg p ryggen med armene over hodet og fotslene i gulvet. Klem kne og lr sammen. Hold ryggen flat og trekk navlen inn mot ryggsylen. Strekk armene opp og fram og la hodet og overkroppen flge med. P en innnding ruller du s langt opp at hele ryggen er lftet fra gulvet. Hold denne stillingen mens du teller til tre. Pust ut og rull tilbake og strekk armer og overkropp mot veggen bak deg.', 5739, 2004591, 3, 'https://exorlive.com/media_5749@50.50.media', 'https://exorlive.com/video/?ex=5749'),
(1783, 1002, 5684, 'Innledende velse: Sirkler med ett ben', 'Ligg p ryggen med byde knr og fotslene i gulvet. Strekk det ene benet opp mot taket og rotr det litt utover i hofteleddet. Begynn sirkelen ved  bevege benet inn og oppover og deretter ut og nedover. Merk hvordan ryggsylen presses ned i gulvet. Pust inn nr du begynner p sirkelen og ut nr du avslutter den. Etterp frer du benet motsatt vei rundt i sirkelen. Husk ogs  gjenta velsen med det andre benet.', 5681, 2004562, 1, 'https://exorlive.com/media_5684@50.50.media', 'https://exorlive.com/video/?ex=5684'),
(1784, 1002, 5758, 'Havfruen', 'Sitt p siden med samlede og lett byde kne. Plassr hnden under skulderen mens den andre hviler p leggen. Lft bekkenet s kroppen blir helt strak og utgjr en linje fra isse til fot. Drei ansiktet mot taket og forsk  fre haken mot den verste skulderen. Mens du strekker fingerspissene ned mot fttene puster du ut og senker hoften til du kjenner et strekk langs den siden av kroppen som vender ned mot gulvet. Ta en dyp innnding og fr armen rett overhodet og strekk den s langt vekk fra fttene som mulig. Samtidig lfter du hoftene. N br du merke et strekk langs kroppens overside. Gjenta velsen til motsatt side.', 5746, 2004598, 5, 'https://exorlive.com/media_5758@50.50.media', 'https://exorlive.com/video/?ex=5758'),
(1785, 1002, 5701, 'Enkelt strak benstrekk', 'Ligg p ryggen med knrne mot brystet. Grip omkring begge benene, hold albuene ut til siden og hodet lftet. Strekk det ene benet mot taket og grip omkring ankelen med begge hendene, samtidig med at du strekker det andre benet og lar det sveve et stykke over gulvet. Forestill deg at overkroppen er forankret i gulvet. Pust inn og trekk benet enda lengere mot hodet, pust ut og fr benene hurtig forbi hverandre med en sakselignende bevegelse. velsen skal utfres med sm rytmiske rykk for hvert strekk.', 5696, 2004572, 3, 'https://exorlive.com/media_5701@50.50.media', 'https://exorlive.com/video/?ex=5701'),
(1786, 1002, 5690, 'Rulle opp', 'Ligg p ryggen med armene over hodet og strekk deg s lang du er. Stram setet og innsiden av lrene og trekk trne mot deg. Fr armene opp over hodet og pust inn mens du ruller opp. Lft virvel for virvel og til sist hele overkroppen framover. Strekk deg framover samtidig med at du trekker navlen mot ryggsylen. Rull deretter tilbake igjen ved at du strammer setemuskulaturen, puster ut igjen og utfrer velsen i motsatt rekkeflge.', 5687, 2004565, 2, 'https://exorlive.com/media_5690@50.50.media', 'https://exorlive.com/video/?ex=5690'),
(1787, 1002, 5689, 'Ett hundre', 'Ligg p ryggen og trekk knrne opp mot brystet. Ta en dyp innnding og pust ut mens du forestiller deg at brystet og magen synker ned i gulvet. Fasthold denne flelsen og lft den verste delen av overkroppen fra underlaget, slik at du kan se mot navlen. Strekk samtidig armene ned langs siden og benene opp mot taket. Knip setet og innsiden av lrene sammen. Begynn  pumpe opp og ned, som om du slr p vann. Pust langsomt inn og tell til fem og pust ut og tell til fem. Senk benene til punktet like fr korsryggen slipper gulvet. Hold stillingen og forsk  telle til hundre. Vend tilbake til utgangsstillingen.', 5686, 2004563, 2, 'https://exorlive.com/media_5689@50.50.media', 'https://exorlive.com/video/?ex=5689'),
(1788, 1002, 5677, 'Innledende velse: Trille som en ball', 'Sitt med byde knr og en hnd under hvert lr. Lft fttene og balansr p halebenet. La haken hvile ned mot brystet og hold albuene ut til siden, slik at du fr flelsen av  vre rund som en ball. La navlen synke dypt ned i ryggsylen og fall bakover. Rull bakover p n innnding og rull framover mens du puster ut. Forsk  rulle hurtig framover til du igjen holder balansn p halebenet. Unng  rulle helt tilbake p nakken.', 5670, 2004882, 1, 'https://exorlive.com/media_5677@50.50.media', 'https://exorlive.com/video/?ex=5677'),
(1789, 1002, 5750, 'Forberedende velse: Luringen 2', 'Ligg p ryggen med armene over hodet og fotslene i gulvet. Strekk det ene benet slik at det er i en vinkel p 45 grader. Klem knrne sammen. Hold ryggen flat og trekk navlen inn mot ryggsylen. Strekk armene opp og fram mot foten og la hodet og overkroppen flge med. P en innnding ruller du s langt opp at hele ryggen er lftet fra gulvet. Hold denne stillingen mens du teller til tre. Pust ut og rull tilbake og strekk armer og overkropp mot veggen bak deg. Gjenta med motsatt ben strakt.', 5740, 2004593, 3, 'https://exorlive.com/media_5750@50.50.media', 'https://exorlive.com/video/?ex=5750'),
(1790, 1002, 5753, 'Hoftesirkler', 'Balansr p halebenet mens du sttter deg p strake armer bak kroppen. Pust inn og beveg benene ned og rundt mot venstre, pust ut og fullfr sirkelen mot hgre og opp til utgangsstillingen igjen. Srg for  skyte brystet fram og presse hendene ned i gulvet mens du utfrer velsen.', 5741, 0, 5, 'https://exorlive.com/media_5753@50.50.media', 'https://exorlive.com/video/?ex=5753');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1791, 1002, 5732, 'Syklen', 'Ligg p ryggen, lft benene opp og fortsett lftet ved  skubbe hofter og ben opp mot taket. Plassr hendene mot ryggen rett over hoftene s du str stabilt. Trekk navlen inn mot ryggsylen og stram setemuskulaturen. Senk benene i en slag spagatlignende bevegelse. By det bakerste kneet og trekk hlen inn mot rumpa og kneet framover samtidig som du frer det andre benet tilbake. Fortsett med  sykle i luften noen runder.', 5727, 2004586, 6, 'https://exorlive.com/media_5732@50.50.media', 'https://exorlive.com/video/?ex=5732'),
(1792, 1002, 5751, 'Luringen 1', 'Ligg p ryggen med strake ben mot taket og armene over hodet. Trekk navlen inn, hold korsryggen i gulvet og senk benene til ca 45. Pust inn samtidig som du frer armene mot trne og lfter overkroppen, virvel for virvel, til du balanserer p halenbenet. Pust ut og senk overkroppen tilbake.', 5737, 2004594, 4, 'https://exorlive.com/media_5751@50.50.media', 'https://exorlive.com/video/?ex=5751'),
(1793, 1002, 5776, 'Sidesyklen', 'Ligg p siden med hendene bak hodet. Sving det verste benet bakover og by kneet s du frer hlen mot setet og strekker i hoften. Fr deretter det byde kneet framover og opp mot skulderen og strekk det ut foran deg. Utfr denne sykle lignende bevegelsen noen ganger, fr du vender om og trkker bakover noen ganger (spark fram, by kneet, trekk kneet tilbake og strekk benet). Gjenta velsen med motsatt ben.', 5766, 2004607, 5, 'https://exorlive.com/media_5776@50.50.media', 'https://exorlive.com/video/?ex=5776'),
(1794, 1002, 5731, 'Saksen', 'Ligg p ryggen med strake ben. Lft benene opp og fortsett lftet ved  skubbe hofter og ben opp mot taket. Plassr hendene mot ryggen rett over hoftene s du str stabilt. Trekk navlen inn mot ryggsylen og stram setemuskulaturen. Pust inn og senk det ene benet mens du strekker det andre benet over hodet i en slags spagatlignende bevegelse.', 5726, 2004585, 6, 'https://exorlive.com/media_5731@50.50.media', 'https://exorlive.com/video/?ex=5731'),
(1795, 1002, 5761, 'Gyngehesten', 'Ligg p magen, by knrne og fr hlene mot setet. Strekk armene bakover og grip fatt i anklene. Pust inn og strekk langsomt kroppen oppover idet du hever bryst og kne fra gulvet. Forestill deg at noen lfter deg oppover etter hender og ftter. Gyng framover ved  trekke anklene mot hodet og skyte brystet ned mot gulvet. Pust ut samtidig. Pust inn og gyng tilbake ved  lfte brystet. Hold hele tiden navlen inn mot ryggsylen.', 5782, 0, 6, 'https://exorlive.com/media_5761@50.50.media', 'https://exorlive.com/video/?ex=5761'),
(1796, 1002, 5759, 'Selen', 'Sitt med byde knr og hlene samlet. Spre knrne og fr hendene mellom dem og grip omkring hver ankel. Trekk knrne opp mot brystet og balansr p halebenet. Pust inn og trekk navlen inn mot ryggsylen. Rull bakover og trekk benene med deg. Balansr p baksiden av skuldrene og sl hlene sammen tre ganger, som en sel som slr luffene sammen. Pust ut igjen mens du ruller framover. Trekk i anklene. Balansr p halebenet og sl hlene sammen tre ganger. Gjenta velsen og legg merke til hvordan ryggens muskler masseres.', 5747, 2004599, 2, 'https://exorlive.com/media_5759@50.50.media', 'https://exorlive.com/video/?ex=5759'),
(1797, 1002, 5680, 'Innledende velse: Foroverbyd ryggsylestrekk', 'Sitt med rett rygg og en lett by i knrne. Strekk armene framfor deg i ca skulderhyde og trekk trne imot deg. Fr haken mot brystet og begynn  rulle framover mens du trekker navlen inn mot ryggsylen. Pust ut mens du strekker deg framover og pust inn igjen nr du vender tilbake til utgangsstillingen. Husk  ha lave skuldre.', 5674, 2004560, 1, 'https://exorlive.com/media_5680@50.50.media', 'https://exorlive.com/video/?ex=5680'),
(1798, 1002, 5773, 'Side pass', 'Ligg p siden. Lft det verste benet opp mot taket. By kneet og senk foten ned mot innsiden av lret. La foten gli nedover langs benet inntil benet igjen er strakt. Lft det opp mot taket igjen og gjenta velsen noen ganger. Etterp gjr du velsen omvendt, ved at du frst trekker foten mot lret, s lfter du og strekker det mot taket, og til sist senker det mot gulvet igjen. Hold resten av kroppen helt i ro mens du utfrer velsen.', 5765, 2004604, 3, 'https://exorlive.com/media_5773@50.50.media', 'https://exorlive.com/video/?ex=5773'),
(1799, 1002, 5691, 'Rulle bakover', 'Ligg p ryggen med armene ned langs siden. Start velsen med  stramme setemuskulaturen og pust inn samtidig som du lfter benene og frer de opp over hodet. Rull bakover inntil benene er parallelle med gulvet. Du skal balansre p skuldrene og ikke nakken. Bruk hndflatene til  sttte deg og til  kontrollere bevegelsen. Spre fttene inntil de er ca en hoftebredde fra hverandre og la ryggsylen rulle tilbake virvel for virvel. Nr benene nrmer seg gulvet og korsryggen er i ferd med  miste kontakten med gulvet samler du fttene og gjentar velsen.', 5688, 2004566, 5, 'https://exorlive.com/media_5691@50.50.media', 'https://exorlive.com/video/?ex=5691'),
(1800, 1002, 5709, 'Gyngestol med spredte ben', 'Sitt med byde knr og en hnd omkring hver ankel. Lft fttene og balansr p halebenet. Strekk begge ben mot loftet som om du lager en V. Start gyngebevegelsen med en dyp innnding og merk at navlen synker dypt ned i ryggsylen. Rull bakover p n innnding og rull framover mens du puster ut. Forsk  rulle hurtig framover til du igjen holder balansen p halebenet. Unng  rulle helt tilbake p nakken.', 5702, 2004575, 3, 'https://exorlive.com/media_5709@50.50.media', 'https://exorlive.com/video/?ex=5709'),
(1801, 1002, 5719, 'Svanestup', 'Ligg p magen og plassr hndflatene mot gulvet like under skuldrene. Press benene sammen og la vristen p begge ftter presse ned mot gulvet. Pust inn mens du retter armene ut og lfter overkroppen. Srg for  holde brystet hyt og nakken lang. Pust ut og senk overkroppen ned igjen. Gjr dette 2-3 ganger.\nSiste gang du strekker armene, gir du slipp og lar kroppen falle framover. Armene holdes strake over hodet og benene flger med i bevegelsen. Pust ut og vipp tilbake og lft overkroppen p ny.', 5711, 2004580, 5, 'https://exorlive.com/media_5719@50.50.media', 'https://exorlive.com/video/?ex=5719'),
(1802, 1002, 5757, 'Knestende sidespark', 'St p kne og ln deg over til den ene siden og plassr hnden rett under skulderen. Hold den andre hnden bak hodet med albuen pekende mot taket. Strekk det verste benet ut til siden, mens du srger for  holde balansen. Lft benet opp til ca hoftehyde. Pust inn mens du med et spark svinger benet inn foran deg, uten at du knekker i ryggen. Pust inn og sving benet tilbake og strekk det s langt du klarer uten  vippe i hoften eller skyte magen fram. Gjenta velsen med motsatt ben.', 5745, 0, 5, 'https://exorlive.com/media_5757@50.50.media', 'https://exorlive.com/video/?ex=5757'),
(1803, 1002, 5777, 'Grande Ronde De Jambe', 'Ligg p siden med hendene bak hodet. Lft det verste benet til hoftehyde og rotr det litt utover. Pust inn mens du trekker navlen inn mot ryggsylen og svinger benet framfor deg. Lft benet mot taket og videre bakover mens du fortsetter  rotre det utover. Pust ut og senk benet og fr det fram igjen. Forestill deg at du rrer i en stor gryte. Husk  skape motvekt til benet ved at du skyter den verste hoften i motsatt retning av foten. Gjr velsen i motsatt retning noen ganger fr du gjentar med motsatt ben. Hold resten av kroppen helt i ro mens du utfrer velsen.', 5762, 0, 5, 'https://exorlive.com/media_5777@50.50.media', 'https://exorlive.com/video/?ex=5777'),
(1804, 1002, 5730, 'Nakketrekk', 'Ligg p ryggen med hendene bak hodet. Strekk benene ut og ha ca hoftebreddes avstand mellom fttene. Trekk navlen mot ryggsylen. Pust inn og begynn  rulle opp og fram. Forestill deg at du skreller deg selv av fra underlaget. Pust ut mens du krummer ryggen over lrene. Hold albuene ut til siden og benene fast mot gulvet. Pust inn og rett opp ryggen som om du hadde ryggen mot en vegg. Pust ut igjen og rull tilbake.', 5725, 2004584, 3, 'https://exorlive.com/media_5730@50.50.media', 'https://exorlive.com/video/?ex=5730'),
(1805, 1002, 5752, 'Luringen 3', 'Ligg p ryggen med strake ben mot taket og armene over hodet. Trekk navlen inn, hold korsryggen i gulvet og senk benene til ca 45. Pust inn samtidig som du frer armene mot trne og lfter overkroppen, virvel for virvel,  til du balanserer p halenbenet. Lft armene mot taket og la kroppen langsomt rulle ned p gulvet mens du puster ut. Strekk deg s lang du er uten at ftter eller armer berrer gulvet, fr du p ny folder deg sammen igjen.', 5738, 0, 5, 'https://exorlive.com/media_5752@50.50.media', 'https://exorlive.com/video/?ex=5752'),
(1806, 1047, 8863, 'Sittende rotasjonskast til partner', 'Start sittende med fttene opp fra bakken og ballen ved siden av kroppen.  Kast ballen ved hjelp av en rotasjon til partneren, som sitter ved siden av. Partneren tar imot ballen og kaster tilbake. Tilpass kraften i forhold til partneren.', 11186, 2009809, 2, 'https://exorlive.com/media_8863@50.50.media', 'https://exorlive.com/video/?ex=8863'),
