(1859, 1030, 3932, 'Marklft 2', 'St med fttene i skulderbreddes avstand og en plankebit under hlene. Hold vektstangen med et bredt grep. By ned til ca. 90 i knrne, hold ryggen rett og blikket fram. Press opp igjen og gjenta velsen.', 3673, 2004288, 5, 'https://exorlive.com/media_3932@50.50.media', 'https://exorlive.com/video/?ex=3932'),
(1860, 1030, 7643, 'Ryggliggende sidebevegelse av bena', 'Ligg p ryggen med fttene i gulvet og hendene ut til siden. Vend hndflatene ned og hold benene samlet. La bena falle til siden og bruk bukmusklene til  trekke de opp igjen samtidig som du presser korsryggen mot underlaget.', 8119, 2006873, 2, 'https://exorlive.com/media_7643@50.50.media', 'https://exorlive.com/video/?ex=7643'),
(1861, 1030, 777, 'Ryggligende "flat mage"', 'Ligg p ryggen (hold nytralposisjon av bekken og ryggrad) med fotslene i gulvet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Forsk  holde spenningen mens du puster normalt i 10-15 sek.', 1485, 2007751, 1, 'https://exorlive.com/media_777@50.50.media', 'https://exorlive.com/video/?ex=777'),
(1862, 1030, 572, 'Stende benhev ut m/strikk', 'Fest midten av strikken rundt den ene ankelen, mens du str p hndtakene med det andre benet. Fr det aktive benet ut til siden og opp. Hold kroppen fiksrt under velsen. Bytt ben.', 903, 2004581, 2, 'https://exorlive.com/media_572@50.50.media', 'https://exorlive.com/video/?ex=572'),
(1863, 1030, 558, 'Stende roing m/strikk 2', 'Fest strikken nede i ribbeveggen. St med spredte ben, et hndtak i hver hnd og med ansiktet mot ribbeveggen. Hold armene strak ut fra kroppen og trekk hndtakene skrtt opp og bak. I sluttstilling har du 90 grader i albuene og armene er hevet til skulderhyde.', 875, 2004544, 4, 'https://exorlive.com/media_558@50.50.media', 'https://exorlive.com/video/?ex=558'),
(1864, 1030, 5219, 'Liggende kroppsheving i slynge', 'Ligg p ryggen med strake armer framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Lft overkroppen ved bde  bye i albuene og trekke skulderbladene mot hverandre slik at brystkassen presses fram. Fr rolig tilbake til utgangsstillingen.', 4799, 2004850, 4, 'https://exorlive.com/media_5219@50.50.media', 'https://exorlive.com/video/?ex=5219'),
(1865, 1030, 6559, 'Pil og bue m/strikk', 'Hold strikken p strak arm foran deg (som om det skulle vre en pil og bue). Stram strikken ved at du frer armen bakover samtidig som du dreier lett i overkroppen, til albuen peker rett bakover. Hold stillingen noen sekunder og slipp langsomt tilbake til utgangsstillingen. Gjenta velsen med motsatt arm.', 6523, 2007731, 3, 'https://exorlive.com/media_6559@50.50.media', 'https://exorlive.com/video/?ex=6559'),
(1866, 1030, 818, 'Sideliggende bekkenhev 3', 'Ligg p siden med byde knr og sttte mot den ene albuen. Finn nytralstillingen av ryggen og bekken. Lag "flat mage" og hev bekkenet til kroppen er strak. Hold i 10-15 sek. og hvil tilsvarende. Gjenta mot motsatt side.', 1610, 2004793, 2, 'https://exorlive.com/media_818@50.50.media', 'https://exorlive.com/video/?ex=818'),
(1867, 1030, 785, '"Broen" ettbenslft 2', 'Ligg med et godt grep om det ene lret. Vipp bekkenet bakover. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Lft bekkenet opp fra gulvet helt til du ligger p skulderbladene. Senk og lft langsomt. Gjenta med det andre benet.', 1501, 2007249, 4, 'https://exorlive.com/media_785@50.50.media', 'https://exorlive.com/video/?ex=785'),
(1868, 1030, 555, 'Stende brystpress m/strikk', 'Fest strikken i ca brysthyde. St med ryggen mot ribbeveggen og hold armene ut til siden, i ca brystniv. Ha byde albuer og press armene fram, samtidig som armene strekkes.', 870, 2004541, 1, 'https://exorlive.com/media_555@50.50.media', 'https://exorlive.com/video/?ex=555'),
(1869, 1030, 3323, 'Balansepute: kneby', 'St p balanseputen. By ned til ca. 90 grader i knrne og press opp igjen. Hold ryggen rett og blikket fram. Alternativt kan sittestillingen holdes i noen sekunder fr du presser opp igjen.', 1000576, 2004133, 2, 'https://exorlive.com/media_3323@50.50.media', 'https://exorlive.com/video/?ex=3323'),
(1870, 1030, 7673, 'Liggende rotasjon av overkroppen', 'Ligg p magen med pannen i matten og med byde albuer slik at hendene ligger p hver side av hodet. Lft venstre arm, skulder og hodet opp fra matten og roter til venstre. Returner til startstillingen og gjenta til hyre side.', 8179, 2006937, 3, 'https://exorlive.com/media_7673@50.50.media', 'https://exorlive.com/video/?ex=7673'),
(1871, 1030, 9030, 'Steg opp med knelft', 'G opp p en step/trinn med venstre ben og lft kneet p hyre ben hyt opp. Sett s hyre ben ned p gulvet og deretter venstre. Gjenta velsen, men n med hyre ben frst opp p stepen/trinnet.', 11425, 2010905, 2, 'https://exorlive.com/media_9030@50.50.media', 'https://exorlive.com/video/?ex=9030'),
(1872, 1030, 6641, 'Transversus/Korsett aktivering 2', 'Ligg p ryggen med fttene i gulvet. Plasser hendene p magen, den ene under og den andre over navlen. Aktiver muskelkorsettet ved   trekke den nederste delen av magen 1-2 cm inn mot ryggsylen, uten at den verste hnden beveger seg. Spenn bekkenbunnen samtidig.', 6638, 2008538, 1, 'https://exorlive.com/media_6641@50.50.media', 'https://exorlive.com/video/?ex=6641'),
(1873, 1030, 5021, 'Brystpress m/bredt grep i slynge 2', 'St med trne i gulvet og sttt deg i stroppene med strake armer. Ha en slynge i hver hnd. Skyt rygg. Stabilisr i mage og korsrygg. Senk kroppen ved  fre albuene rett ut til siden samtidig som du byer dem. Press rolig tilbake ved  fre armene sammen foran kroppen igjen.', 4779, 2004846, 4, 'https://exorlive.com/media_5021@50.50.media', 'https://exorlive.com/video/?ex=5021'),
(1874, 1030, 779, '"Broen" m/benspark', 'Plasser fotslene p gulvet og armene ut til siden. Fra den broliggende posisjonen, med "flat mage" og "bekkenvipp bak" utfrer du langsomme benspark. Lrene skal hele tiden vre parallelle.', 1495, 2004769, 4, 'https://exorlive.com/media_779@50.50.media', 'https://exorlive.com/video/?ex=779'),
(1875, 1030, 8307, 'Ettbens setelft p ball m/utoverfring', 'Ligg p ryggen p en matte med armene ned langs siden. Hold begge bena strake. Plasser det ene benet p ballen og hold det andre benet parallelt i luften. Lft setet opp i luften s hele kroppen er strak. Fr det benet som er i luften rolig ut til siden og tilbake igjen. Senk deg s ned p matten.', 9952, 2008027, 5, 'https://exorlive.com/media_8307@50.50.media', 'https://exorlive.com/video/?ex=8307'),
(1876, 1030, 5284, 'Hofte fleksjon i slynge 4', 'St p albuene med en slynge plassert omkring hver ankel. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4924, 2004499, 3, 'https://exorlive.com/media_5284@50.50.media', 'https://exorlive.com/video/?ex=5284'),
(1877, 1030, 7502, 'Sammentrekning av skulderbladene 1', 'St oppreist med armene hengende ned langs siden. Trekk skulderbladene sammen og litt ned.', 7855, 2006996, 1, 'https://exorlive.com/media_7502@50.50.media', 'https://exorlive.com/video/?ex=7502'),
(1878, 1030, 3841, 'Kne- og hndstttende enarms roing 1', 'St med tyngden fordelt p det ene kneet og den ene armen. Hold hantelen i den frie hnden og la armen henge tungt ned. Trekk armen opp langs siden til hantelen er i mageniv. Senk tilbake og gjenta velsen.', 3438, 2004222, 3, 'https://exorlive.com/media_3841@50.50.media', 'https://exorlive.com/video/?ex=3841'),
(1879, 1030, 575, 'Stende benhev bak m/strikk', 'Fest strikken helt nede i ribbeveggen og rundt ankelen. St med ansiktet mot veggen. Hofteleddet er lett byd p det aktive ben. Fr benet bakover og strekk maksimalt i hoften. Bytt ben.', 908, 2004592, 2, 'https://exorlive.com/media_575@50.50.media', 'https://exorlive.com/video/?ex=575'),
(1880, 1030, 528, 'Stende bicepscurl m/strikk 1', 'Fest midten av strikken under fttene og st med et hndtak i hver hnd. Hold albuene i ro og trekk hndtakene opp mot skuldrene. Senk langsomt tilbake.', 817, 2004494, 1, 'https://exorlive.com/media_528@50.50.media', 'https://exorlive.com/video/?ex=528'),
(1881, 1030, 6427, 'Horisontal armsving m/strikk', 'Rett deg opp i overkroppen og ha avslappede skuldre. Hold strikken foran deg i ca skulderhyde og med et skulderbredt grep. Fr armene ut til siden og bakover, og kjenn at skulderbladene mtes. Slipp rolig tilbake og gjenta.', 6413, 2007745, 2, 'https://exorlive.com/media_6427@50.50.media', 'https://exorlive.com/video/?ex=6427'),
(1882, 1030, 3077, 'Ekstensjon, liggende', 'Legg deg ned p magen og plassr hendene under skuldrene. Press overkroppen s langt opp som mulig. Slapp helt av i sete- og ryggmuskulaturen og la tyngden hvile p armene. Ta evt. et dypt ndedrag og hold ytterposisjonen i 1-2 sek. Vend tilbake til utgangsposisjonen og gjenta.', 1000140, 2007811, 6, 'https://exorlive.com/media_3077@50.50.media', 'https://exorlive.com/video/?ex=3077'),
(1883, 1030, 3126, 'Stende skulderrotasjon ut m/strikk 2', 'St med ca. 90 graders vinkel i albuene og la underarmene peke rett framover. Hold overarmene tett p kroppen og albuene i ro, mens du svinger den ene armen ut til siden. Strikken skal vre s slakk at du klarer  utadrotere maksimalt i skulderleddet. Gjenta velsen med den andre armen.', 1000221, 2004015, 1, 'https://exorlive.com/media_3126@50.50.media', 'https://exorlive.com/video/?ex=3126'),
(1884, 1030, 9431, 'Pallof press 1', 'Fest en strikk i ca brysthyde og still deg i stende med siden til strikkfestet. Ta tak i strikken med begge hender og hold strikken inntil kroppen med byde albuer. Skyv armene rett frem til albuene er nesten strake, beveg rolig tilbake til utgangsstilling. Overkroppen holdes rak og i ro under hele velsen, unng rotasjon.', 12217, 2011886, 2, 'https://exorlive.com/media_9431@50.50.media', 'https://exorlive.com/video/?ex=9431'),
(1885, 1030, 800, '"Vandring" p en ball', 'Ligg i push up stilling med bekkenet p ballen. Ha et skulderbredt grep. Finn nytralstillingen av ryggen og bekkenet. Lag "flat mage" og begynn  g p strake armer framover. G tilbake og gjenta.', 1514, 2004910, 3, 'https://exorlive.com/media_800@50.50.media', 'https://exorlive.com/video/?ex=800'),
(1886, 1030, 543, 'Stende skulderhev m/strikk', 'Fest midten av strikken under fttene og st med et hndtak i hver hnd. Lft skuldrene opp mot rene og senk rolig tilbake.', 846, 2004515, 2, 'https://exorlive.com/media_543@50.50.media', 'https://exorlive.com/video/?ex=543'),
(1887, 1030, 710, 'Liggende diagonal armsving og benspark', 'Ligg p ryggen med 90 graders by i hofter og knr og armene hevet over brystet. Aktivr den nederste og dypeste delen av magemuskulaturen, trekk navlen inn mot ryggraden og lag "flat mage". Samtidig senker du den ene armen og det motsatte benet.', 1489, 2004719, 5, 'https://exorlive.com/media_710@50.50.media', 'https://exorlive.com/video/?ex=710'),
(1888, 1030, 8325, 'Kneby m/ stol 2', 'St oppreist foran en stol. Bena skal vre i cirka hoftebreddes avstand. Knr og tr skal peke rett frem og armene holdes strakt foran kropen. Gjr en kneby slik at du akkurat ikke setter deg ned p stolen. Bli stende i den stillingen og gjr sm kneby.', 9987, 2008087, 2, 'https://exorlive.com/media_8325@50.50.media', 'https://exorlive.com/video/?ex=8325'),
(1889, 1030, 8249, 'Thev p benk el. ett trinn 2', 'St p kanten av et trappetrinn eller en benk, slik at hlene er fri. Ha ca. hoftebreddes avstand mellom fttene. Lft hlene og press opp til tstende - denne bevgelsen skal gjres kjapt. Senk rolig tilbake igjen til utgangsstilling og gjenta. velsen kan gjres med eller uten sttte.', 9836, 2008038, 3, 'https://exorlive.com/media_8249@50.50.media', 'https://exorlive.com/video/?ex=8249'),
(1890, 1030, 793, 'Knestende framoverrulle m/ball 2', 'St p knrne og sttt underarmene p ballen. Lag "flat mage", rull framover samtidig som du srger for  holde nytralstilingen og unng  overstrekke i ryggen. Vend tilbake til utgangsstillingen fr belastningen overstiger den styrken du har.', 1523, 2004780, 6, 'https://exorlive.com/media_793@50.50.media', 'https://exorlive.com/video/?ex=793'),
(1891, 1030, 3110, 'Firfotstende posisjon "rygg"', 'St p alle fire. Lft hodet slik at det er i forlengelse av overkroppen. Press den vre del av ryggen opp mot taket slik at du unngr  "henge" i skulderpartiet. Trekk deretter haken inn samtidig som du forsker  gjre nakken lngre. Dette er nakkens nytralstilling. Trekk ogs navlen inn mot ryggraden og lag "flat mage". Hold stillingen mens du puster normalt i 10-30 sek.', 1000224, 2005967, 3, 'https://exorlive.com/media_3110@50.50.media', 'https://exorlive.com/video/?ex=3110'),
(1892, 1030, 553, 'Stende sidehev m/strikk 1', 'Fest midten av strikken under fttene. St med armene ned langs siden og et hndtak i hver hnd. Vend hndflatene inn mot deg. Lft armene ut til siden og opp til de er vannrette.', 866, 2004539, 2, 'https://exorlive.com/media_553@50.50.media', 'https://exorlive.com/video/?ex=553'),
(1893, 1030, 780, '"Firfot" benlft', 'St p alle fire og finn nytralstillingen i ryggen og bekkenet. Lag "flat mage" og lft det ene benet til det er i forlengelse av resten av kroppen. Gjenta med det andre benet.', 1621, 2004770, 2, 'https://exorlive.com/media_780@50.50.media', 'https://exorlive.com/video/?ex=780'),
(1894, 1030, 9255, 'Sideveis gange m/ strikk', 'St p gulvet med ca hoftebredde avstand mellom bena og en strikk rundt anklene. G sideveis, gjerne med fttene noe innadrotert, og hold spenning i strikken hele tiden.', 11859, 2011047, 2, 'https://exorlive.com/media_9255@50.50.media', 'https://exorlive.com/video/?ex=9255'),
(1895, 1030, 552, 'Stende fronthev m/strikk 1', 'Fest midten av strikken under fttene. St med armene ned langs siden og et hndtak i hver hnd. Vend hndflatene bakover. Lft armene fram og opp til de er i ansiktshyde. Senk langsomt tilbake.', 864, 2004538, 2, 'https://exorlive.com/media_552@50.50.media', 'https://exorlive.com/video/?ex=552'),
(1896, 1030, 7466, 'Stabilisering av rygg m/slynge 2', 'St oppreist og hold i slyngene med strake armer. Len deg framover og stabilisr samtidig i korsyggen.', 7754, 2005873, 4, 'https://exorlive.com/media_7466@50.50.media', 'https://exorlive.com/video/?ex=7466'),
(1897, 1030, 573, 'Stende bentrekk inn m/strikk', 'St med siden til ribbeveggen. Fest strikken helt nede i ribbeveggen og rundt ankelen p det aktive benet. I startstillingen er benet frt ut til siden. Trekk benet inn og kryss det framfor standbenet. Bytt ben.', 905, 2004583, 2, 'https://exorlive.com/media_573@50.50.media', 'https://exorlive.com/video/?ex=573'),
(1898, 1030, 577, 'Foroverbyd sidehev m/strikk', 'Fest midten av strikken under fttene og hold rundt hndatkene. St foroverbyd med en by i bde knr og hofter. Lft de strake armene ut til siden og opp. Skulderbladene er trukket godt sammen ved sluttstillingen. Senk langsomt tilbake.', 916, 2004601, 4, 'https://exorlive.com/media_577@50.50.media', 'https://exorlive.com/video/?ex=577'),
(1899, 1030, 7123, 'Enarms sidehev i scapula plan m/strikk', 'St med den ene enden av strikken under foten og den andre i hnden. Hold armen strak og lft den opp inntil den er i skulderhyde. Tommelen skal peke ned i sluttstillingen. Merk at armen ikke skal beveges rett ut til siden, men ca 45 grader foran det - i det skalte scapula planet.', 7096, 2007713, 3, 'https://exorlive.com/media_7123@50.50.media', 'https://exorlive.com/video/?ex=7123'),
(1900, 1030, 546, 'Stende enarms trekk inn m/strikk', 'Fest strikken et stykke oppe i ribbeveggen. St med hndtakene i den ene hnden og med siden mot ribbeveggen. Hold armen strak ut fra kroppen og trekk hndtaket ned og inn mot hoften. Slipp langsomt tilbake.', 852, 2004518, 2, 'https://exorlive.com/media_546@50.50.media', 'https://exorlive.com/video/?ex=546'),
(1901, 1030, 795, '"Broen" p en ball', 'Ligg med den verste delen av ryggen p ballen. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og lft bekkenet opp til vannrett posisjon. Senk langsomt tilbake og gjenta.', 1520, 2004907, 1, 'https://exorlive.com/media_795@50.50.media', 'https://exorlive.com/video/?ex=795'),
(1902, 1030, 8351, 'Eksentrisk ettbens kneby', 'St p gulvet med cirka hoftebreddes avstand mellom bena. Knr og tr peker rett frem. Lft opp det ene benet. Gjr en kneby p ett ben og press opp med begge bena.', 10042, 2007974, 4, 'https://exorlive.com/media_8351@50.50.media', 'https://exorlive.com/video/?ex=8351'),
(1903, 1030, 828, '"Crawl" ben- og armlft m/pute', 'Ligg p magen med sttte under bekkenet f.eks en tykk pute. Lag "bekkenvipp bak" og "flat mage" og lft den ene armen og det motsatte benet opp fra gulvet.', 1625, 2007682, 3, 'https://exorlive.com/media_828@50.50.media', 'https://exorlive.com/video/?ex=828'),
(1904, 1030, 8382, 'Kneby p BOSU opp ned', 'Snu BOSU-en opp ned. Stell deg p BOSU`en med cirka hoftebreddes avstand mellom bena og hoftetak med hendene. Gjr en kneby ned til 90 grader og returner til startstilling.', 10225, 2008548, 5, 'https://exorlive.com/media_8382@50.50.media', 'https://exorlive.com/video/?ex=8382'),
(1905, 1030, 5262, 'Ettbens setelft  i slynge 1', 'Ligg p ryggen med en slynge rundt det ene kneet. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke hoften og kneet p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt i sluttstillingen. Fr rolig tilbake til utgangsstillingen.', 4882, 2004871, 3, 'https://exorlive.com/media_5262@50.50.media', 'https://exorlive.com/video/?ex=5262');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(1906, 1030, 7645, 'Sideliggende rotasjon av overkropp 2', 'Ligg p siden med det underste benet rett og det verste benet byd opp. Hold tak med den underste armen rundt nakken og den verste armen strukket rett ut. Ligg i ro med bena slik at du kun roterer i overkroppen og samtidig flger armen med blikket. Bruk gjerne pusten bevisst slik at du puster inn nr du rotere bakover og ut p veien tilbake igjen.', 8123, 2006950, 2, 'https://exorlive.com/media_7645@50.50.media', 'https://exorlive.com/video/?ex=7645'),
(1907, 1030, 783, 'Kneby stabilitet', 'St oppreist og finn nytralstillingen i ryggen og bekken. Lag "flat mage" og by i knrne til du er i sittestilling. Press opp igjen og gjenta.', 1502, 2004772, 2, 'https://exorlive.com/media_783@50.50.media', 'https://exorlive.com/video/?ex=783'),
(1908, 1030, 805, 'Liggende bekkenvipp', 'Ligg p ryggen med fotslene p gulvet. Hold bekkenet i midtstillingen. Vipp bekkenet fram slik at korsryggen svaier. Deretter vippes bekkenet bakover slik at svaien nederst i ryggen rettes ut. Vend tilbake til midtstillingen og gjenta.', 1508, 2007686, 3, 'https://exorlive.com/media_805@50.50.media', 'https://exorlive.com/video/?ex=805'),
(1909, 1030, 217, '"Broen" ettbenslft p en ball', 'Ligg i "brostillingen", med verste del av ryggen p ballen. Strekk det ene benet slik at det holdes parallelt med gulvet. Finn nytralstillingen i ryggen og bekkenet, lag "flat mage" og senk og lft langsomt p ett ben. Gjenta med det andre benet etterp.', 1654, 2004889, 4, 'https://exorlive.com/media_217@50.50.media', 'https://exorlive.com/video/?ex=217'),
(1910, 1030, 3314, 'Balansepute: utfall fram', 'St med samlede ben i god avstand fra balanseputen. Lft det ene benet og fall framover mot balanseputen. Nr foten treffer balanseputen, bremser du bevegelsen og stopper nr kneet er ca 90 grader og kroppen er i dyp posisjon. Spark ifra og returner til startstillingen.', 1000560, 2004123, 5, 'https://exorlive.com/media_3314@50.50.media', 'https://exorlive.com/video/?ex=3314'),
(1911, 1030, 3307, 'Balansepute: hold balansen', 'St p balanseputen og forsk  holde balansen. Gjr evt. velsen vanskeligere ved  dreie hodet og se i forskjellige retninger elller ved  lukke ynene.', 1000550, 2004115, 1, 'https://exorlive.com/media_3307@50.50.media', 'https://exorlive.com/video/?ex=3307'),
(1912, 1030, 6428, 'Vertikal armsving m/strikk', 'Hold strikken med strake armer over hodet. Trekk armene ned til de peker rett ut til siden. Slipp rolig tilbake og gjenta.', 6414, 2007778, 2, 'https://exorlive.com/media_6428@50.50.media', 'https://exorlive.com/video/?ex=6428'),
(1913, 1030, 5258, 'Setelft i slynge 2', 'Ligg p ryggen med en slynge omkring hver ankel (bruk evt. en stor slynge som begge benene kan ligge i). Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fr rolig tilbake til utgangsstillingen.', 4825, 2004474, 3, 'https://exorlive.com/media_5258@50.50.media', 'https://exorlive.com/video/?ex=5258'),
