(1967, 1019, 7166, 'Hvilestilling - stende', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. St med stdig beinstilling og len deg lett fremover p handlevognen, mot vinduskarmen, p rekkverket e.l. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7148, 0, 1, 'https://exorlive.com/media_7166@50.50.media', 'https://exorlive.com/video/?ex=7166'),
(1968, 1019, 7980, 'Hvilestilling 1', 'Ligg p siden med venstre ben utstrekt p gulvet og hyre ben byd stttet av puter. Roter overkroppen til hyre. Armene skal ligge avslappet ut til siden. Hodet stttes av en pute.', 9114, 2007603, 2, 'https://exorlive.com/media_7980@50.50.media', 'https://exorlive.com/video/?ex=7980'),
(1969, 1019, 7971, 'Rotasjonsbevegelse 2', 'Lft hyre arm skrtt opp og drei venstre arm skrtt ned p samme side av kroppen. Roter til motsatt side og gjenta samme bevegelsen der.', 9098, 2007449, 2, 'https://exorlive.com/media_7971@50.50.media', 'https://exorlive.com/video/?ex=7971'),
(1970, 1019, 7964, 'Blse fjr', 'St i firefotstende p gulvet og legg en fjr foran deg. Hold armene i gulvet mens du lener deg bakover slik at du setter deg ned p leggene. Forsk  blse fjren bortover. Krabb deretter bort til fjren, sett deg bak p leggene og bls fjren videre bortover. Gjenta.', 9084, 2007377, 3, 'https://exorlive.com/media_7964@50.50.media', 'https://exorlive.com/video/?ex=7964'),
(1971, 1019, 7429, 'Basal respirasjon 1', 'Ligg p benken med bekken og ben hevet i forhold til overkroppen. Slapp godt av og pust rolig ned i magen.', 7680, 2005844, 1, 'https://exorlive.com/media_7429@50.50.media', 'https://exorlive.com/video/?ex=7429'),
(1972, 1019, 7173, 'Generelle tips - respirasjon', '- Bruk handlevogn nr du handler og unng  bre tungt.\n- Bruk dusjkrakk nr du dusjer s slipper du  st.\n- Bruk sm hndklr i stedet for ett stort og tungt hndkle.\n- Bruk leppebrems ved aktivitet.\n- Riktig inhalasjonsteknikk er viktig for effekt av medisin.\n- Kvinner som hoster mye kan ha nytte av bekkenbunnstrening.\n- Drikk mye vann.', 7147, 0, 1, 'https://exorlive.com/media_7173@50.50.media', 'https://exorlive.com/video/?ex=7173'),
(1973, 1019, 7985, 'Hvilestilling over en stol', 'Snu en stol opp ned og legg deg over den for drenasje. Legg gjerne ett lite pledd over dersom det er hardt  ligge rett p stolen.', 9120, 2007550, 2, 'https://exorlive.com/media_7985@50.50.media', 'https://exorlive.com/video/?ex=7985'),
(1974, 1019, 6972, 'Anfallsmestring - generelle rd', 'Det er mulig  pvirke anstrengt pust ved:\n - Anfallsmedisin\n - Hvilestillinger\n - Leppebrems\n - God pusteteknikk (tilstrebe  puste med magen)', 7150, 0, 1, 'https://exorlive.com/media_6972@50.50.media', 'https://exorlive.com/video/?ex=6972'),
(1975, 1019, 9164, 'Vektoverfring i knestende 2', 'St p knrne p en matte. Flytt vekten fra side til side.', 11679, 2011458, 1, 'https://exorlive.com/media_9164@50.50.media', 'https://exorlive.com/video/?ex=9164'),
(1976, 1019, 7165, 'Flutter', 'Dette er et eksempel p en enkel instruksjon for bruk av flutter. Lukk munnen rundt munnstykket. Trekk pusten rolig inn gjennom nesen eller munnen. Bls ut i flutteren uten  anstrenge deg for mye. Kinnene skal holdes stramme nr du puster ut. Hold skuldrene avslappet. Gjenta 5 -15 ganger i flere serier.', 7159, 0, 1, 'https://exorlive.com/media_7165@50.50.media', 'https://exorlive.com/video/?ex=7165'),
(1977, 1019, 7172, 'PEP maske', 'Dette er et eksempel p en enkel instruksjon for bruk av PEP masken. Hold masken stdig over nese og munn uten  presse for hardt. Trekk pusten rolig inn gjennom nesen eller munnen. Pust ut i masken uten  anstrenge deg for mye. Hold skuldrene avslappet. Gjenta dette 5-15 ganger i flere serier.', 7158, 0, 1, 'https://exorlive.com/media_7172@50.50.media', 'https://exorlive.com/video/?ex=7172'),
(1978, 1019, 7969, 'Strekk med kosteskaft', 'St p gulvet med armene strukket over hodet. Hold i ett kosteskaft i cirka skulderbreddes avstand. By i albuen og senk kosteskaftet ned mot brystet samtidig som du slipper pusten ut. Trekk pusten inn og lft kosteskaftet opp igjen.', 9094, 2007587, 3, 'https://exorlive.com/media_7969@50.50.media', 'https://exorlive.com/video/?ex=7969'),
(1979, 1019, 7977, 'Blse fjr', 'Sitt p en stol inntil ett bord. Plasser en fjr p bordet. Forsk  blse fjren bortover bordet.', 9110, 2007436, 2, 'https://exorlive.com/media_7977@50.50.media', 'https://exorlive.com/video/?ex=7977'),
(1980, 1019, 7979, 'Hvilestilling med skrpute', 'Ligg p siden p en skr pute. Ligg med hyre ben utstrekt p gulvet og venstre ben byd. Roter overkroppen til venstre. Den underste armen skal ligge ut til siden, hodet stttes av en pute og den verste armen strekkes over hodet. Forsk  slappe godt av og pust kontrollert inn og ut.', 9113, 2007519, 2, 'https://exorlive.com/media_7979@50.50.media', 'https://exorlive.com/video/?ex=7979'),
(1981, 1019, 7162, 'Hvilestilling - sittende p en rullator', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Sett deg p rullatoren og hvil underarmene p hndtakene. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7142, 0, 1, 'https://exorlive.com/media_7162@50.50.media', 'https://exorlive.com/video/?ex=7162'),
(1982, 1019, 7986, 'Mageliggende sove-/pustestilling', 'Ligg p magen. Ligg med byde armer og by hyre ben samtidig som du ligger med hodet rotert til hyre side. Ha gjerne en pute under hode.', 9121, 2007592, 1, 'https://exorlive.com/media_7986@50.50.media', 'https://exorlive.com/video/?ex=7986'),
