(1985, 1019, 7168, 'Hvilestilling- sittende p sengekanten', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Sitt p sengekanten. Len deg lett fremover med rett rygg. Hvil underarmene p et stdig sengebord. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn gjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7149, 0, 1, 'https://exorlive.com/media_7168@50.50.media', 'https://exorlive.com/video/?ex=7168'),
