(2022, 1003, 5262, 'Ettbens setelft  i slynge 1', 'Ligg p ryggen med en slynge rundt det ene kneet. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke hoften og kneet p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt i sluttstillingen. Fr rolig tilbake til utgangsstillingen.', 4882, 2004871, 3, 'https://exorlive.com/media_5262@50.50.media', 'https://exorlive.com/video/?ex=5262'),
(2023, 1003, 8532, 'TRX Medium Row (tung)', 'St p gulvet med hender i TRX, flytt bena mot ankerpunktet slik at du har 45 grader vinkel i forhold til gulvet. Trekk overkroppen opp med albue 45 grader ut fra skulder. velsen gjres tyngre ved  plassere bena nrmere ankerpunktet.', 10510, 2009418, 5, 'https://exorlive.com/media_8532@50.50.media', 'https://exorlive.com/video/?ex=8532'),
(2024, 1003, 5258, 'Setelft i slynge 2', 'Ligg p ryggen med en slynge omkring hver ankel (bruk evt. en stor slynge som begge benene kan ligge i). Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fr rolig tilbake til utgangsstillingen.', 4825, 2004474, 3, 'https://exorlive.com/media_5258@50.50.media', 'https://exorlive.com/video/?ex=5258'),
(2025, 1003, 5260, 'Setelft i slynge 4', 'Ligg p ryggen med en slynge omkring hver ankel. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fra denne stillingen byer og strekker du i hofter og knr samtidig. Fr rolig tilbake til utgangsstillingen.', 4877, 2004477, 5, 'https://exorlive.com/media_5260@50.50.media', 'https://exorlive.com/video/?ex=5260'),
(2026, 1003, 5278, 'Hofte fleksjon i slynge 3', 'St p albuene med en slynge plassert omkring anklene. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4914, 2004492, 3, 'https://exorlive.com/media_5278@50.50.media', 'https://exorlive.com/video/?ex=5278'),
(2027, 1003, 8544, 'TRX T Deltoid Fly', 'St p gulvet med hender i TRX og armene rett ut til siden, som en T. Senk overkroppen mot gulvet og trekk med strake albuer opp til utgangsposisjonen.', 10534, 2009477, 4, 'https://exorlive.com/media_8544@50.50.media', 'https://exorlive.com/video/?ex=8544'),
(2028, 1003, 5227, 'Skulder knestende ekstensjon i slynge 2', 'St p knrne med armene rett framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Len kroppen framover ved  fre armene rett fram slik at de peker over hodet. Press armene ned mot underlaget for  komme tilbake til utgangsstillingen.', 4816, 2004855, 5, 'https://exorlive.com/media_5227@50.50.media', 'https://exorlive.com/video/?ex=5227'),
(2029, 1003, 8492, 'TRX Runner', 'Ligg p ryggen med begge helene festet i TRX. Lft setet opp fra gulvet, trekk annenhvert ben inn mot setet i stempelbevegelse. Hold et jevnt trykk ned i TRX under hele velsen.', 10430, 2009485, 5, 'https://exorlive.com/media_8492@50.50.media', 'https://exorlive.com/video/?ex=8492'),
(2030, 1003, 7465, 'Stabilisering av rygg m/slynge 1', 'St med slyngene plassert midt p underarmene og ha 90 grader i albuer. Len deg framover og stabilisr samtidig i korsyggen.', 7752, 2005864, 3, 'https://exorlive.com/media_7465@50.50.media', 'https://exorlive.com/video/?ex=7465'),
(2031, 1003, 5226, 'Skulder knestende ekstensjon i slynge 1', 'St p knrne mer armene rett framfor kroppen og ha en slynge i hver hnd. Stabilisr i mage og korsrygg. Len kroppen framover ved  fre armene rett fram slik at de peker over hodet. Press armene ned mot underlaget for  komme tilbake til utgangsstillingen.', 4814, 2004854, 4, 'https://exorlive.com/media_5226@50.50.media', 'https://exorlive.com/video/?ex=5226'),
(2032, 1003, 5020, 'Brystpress m/bredt grep i slynge 1', 'St p knrne og sttt deg i stroppene med strake armer. Ha en slynge i hver hnd. Skyt rygg. Stabilisr i mage og korsrygg. Senk kroppen ved  fre albuene rett ut til siden samtidig som du byer dem. Press rolig tilbake ved  fre armene sammen foran kroppen igjen.', 4777, 2004442, 2, 'https://exorlive.com/media_5020@50.50.media', 'https://exorlive.com/video/?ex=5020');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(2033, 1003, 8571, 'TRX Squat Row', 'St p gulvet med skulderbredde mellom ftter, hender i TRX og albue rett under skulder. Senk overkroppen ned mot gulvet ved  rette ut albue. Senk setet mot gulvet, og skyv tilbake til utgangspunktet gjennom helen og trekk overkroppen med albuene 45 grader ut fra skulder, fr du gjentar velsen.', 10588, 2009414, 4, 'https://exorlive.com/media_8571@50.50.media', 'https://exorlive.com/video/?ex=8571'),
(2034, 1003, 8554, 'TRX Roll Out (deep)', 'St p gulvet med hender i TRX, armene fram foran kroppen med en godt framoverlent. Senk kroppen ned mot gulvet mens armene kommer opp over hodet  til ret. Skyv tilbake til utgangspunktet med strake armer og en strak kropp.', 10554, 2009410, 4, 'https://exorlive.com/media_8554@50.50.media', 'https://exorlive.com/video/?ex=8554'),
(2035, 1003, 8488, 'TRX Hamstring Curl', 'Ligg p ryggen med setet i gulvet, begge heler festet i TRX. Trekk helene inn mot setet, press helene ned i TRX med et jevnt trykk og kom tilbake til utgangspunktet. Behold setet i gulvet under hele velsen.', 10422, 2009522, 2, 'https://exorlive.com/media_8488@50.50.media', 'https://exorlive.com/video/?ex=8488'),
(2036, 1003, 8546, 'TRX Y Deltoid Fly', 'St p gulvet med hender i TRX og armene opp som en Y. Senk overkroppen mot gulvet og trekk med strake albuer opp til utgangsposisjonen.', 10538, 2009513, 4, 'https://exorlive.com/media_8546@50.50.media', 'https://exorlive.com/video/?ex=8546'),
(2037, 1003, 8569, 'TRX Power Pull', 'St med en hnd i TRX (singel hand mode). Roter kroppen ned mot gulvet med hnden som er fri. Trekk deg opp ved  bye albue og  rotere gjennom hoften samtidig som du strekker hnden s langt opp p TRX som mulig.', 10584, 2009415, 4, 'https://exorlive.com/media_8569@50.50.media', 'https://exorlive.com/video/?ex=8569'),
(2038, 1003, 5257, 'Setelft i slynge 1', 'Ligg p ryggen med byde knr og med en slynge plassrt omkring hvert kne (evt. en stor slynge som begge beina kan ligge i). Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke ut i hofter og knr samtidig. Fr rolig tilbake til utgangsstillingen.', 4873, 2004473, 2, 'https://exorlive.com/media_5257@50.50.media', 'https://exorlive.com/video/?ex=5257'),
(2039, 1003, 5253, 'Rygg lateral fleksjon i slynge 5', 'Ligg p siden med en slynge rundt legg/ankel. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft bekkenet ved  presse benene nedover mot underlaget. Fr rolig tilbake til utgangsstillingen.', 4866, 2008485, 5, 'https://exorlive.com/media_5253@50.50.media', 'https://exorlive.com/video/?ex=5253'),
(2040, 1003, 8497, 'TRX Plank', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og kne og hender i gulvet. Lft kne av gulvet slik at kroppen blir strak og hold posisjonen.', 10440, 2009432, 4, 'https://exorlive.com/media_8497@50.50.media', 'https://exorlive.com/video/?ex=8497'),
(2041, 1003, 8561, 'TRX Triceps Press (deep)', 'St framoverlent p gulvet med hender i TRX, armene rett fram foran skulder og hndflatene pekende ned. Senk kroppen ned mot gulvet ved  bye i albue, skyv tilbake til utgangspunktet. Albuen skal peke framover under hele velsen.', 10568, 2009382, 4, 'https://exorlive.com/media_8561@50.50.media', 'https://exorlive.com/video/?ex=8561'),
(2042, 1003, 5264, 'Ettbens setelft  i slynge 2', 'Ligg p ryggen med en slynge ved den ene ankelen. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoften p slyngesiden. Lft samtidig det frie benet strakt slik at benene ligger parallelt i sluttstillingen. Fr rolig tilbake til utgangsstillingen.', 4884, 2004480, 4, 'https://exorlive.com/media_5264@50.50.media', 'https://exorlive.com/video/?ex=5264'),
(2043, 1003, 8521, 'TRX Balance Lunge', 'St p gulvet med hender i TRX og samlede ben, albue rett under skulder. Lft det ene benet i balanse, og fr bakerste kne bakover uten  berre gulvet med benet. Rett ut albue og hold overkroppen over bekkenet. Kom opp i balanse mellom hver repetisjon, velsen utfres p et ben av gangen.', 10488, 2009483, 4, 'https://exorlive.com/media_8521@50.50.media', 'https://exorlive.com/video/?ex=8521'),
(2044, 1003, 8516, 'TRX Lunge', 'St p gulvet med hender i TRX og albue rett under skulder. Bena i ofset, det ene foran det andre. Senk kneet og setet mot gulvet, rett ut albue og kom tilbake til utgangspunktet.', 10478, 2009364, 4, 'https://exorlive.com/media_8516@50.50.media', 'https://exorlive.com/video/?ex=8516'),
(2045, 1003, 8548, 'TRX I Deltoid Fly', 'St p gulvet med hender i TRX og armene over hodet som en I. Senk overkroppen mot gulvet og trekk med strake albuer opp til utgangsposisjonen.', 10542, 2009363, 4, 'https://exorlive.com/media_8548@50.50.media', 'https://exorlive.com/video/?ex=8548'),
(2046, 1003, 5259, 'Setelft i slynge 3', 'Ligg p ryggen med en slynge omkring hver ankel. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fra denne stillingen frer du bena s langt du kan ut til siden (spagat) og tilbake. Fr rolig tilbake til utgangsstillingen.', 4876, 2004475, 4, 'https://exorlive.com/media_5259@50.50.media', 'https://exorlive.com/video/?ex=5259'),
(2047, 1003, 8564, 'TRX Superman', 'Sitt p huk med hender i TRX foran skulder. Rett ut kneledd samtidig som du frer armene fram foran kroppen.', 10574, 2009435, 3, 'https://exorlive.com/media_8564@50.50.media', 'https://exorlive.com/video/?ex=8564'),
(2048, 1003, 8514, 'TRX Squat med hopp', 'St p gulvet med skulderbredde mellom ftter, hender i TRX og albue rett under skulder. Senk setet mot gulvet, rett ut albue og skyv gjennom helen og hopp opp.', 10474, 2009343, 4, 'https://exorlive.com/media_8514@50.50.media', 'https://exorlive.com/video/?ex=8514'),
(2049, 1003, 5281, 'Hofte fleksjon i slynge 6', 'St p hendene med strake albuer og med en slynge plassert rundt hver ankel. Skyt rygg og stabilisr i mage og korsrygg. Trekk knrne mot overkroppen samtidig ved  bye i hofter og knr uten  lfte setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4918, 2004496, 4, 'https://exorlive.com/media_5281@50.50.media', 'https://exorlive.com/video/?ex=5281'),
(2050, 1003, 5254, 'Rygg lateral fleksjon i slynge 6', 'Ligg p siden med en slynge plassert omkring leggen. Ha armene i kors over brystet og stabilisr i mage og korsrygg. Lft bekkenet ved  presse det nederste beinet nedover mot underlaget. Lft deretter det verste benet og hold stillingen en stund. Fr rolig tilbake til utgangsstillingen.', 4867, 2004470, 6, 'https://exorlive.com/media_5254@50.50.media', 'https://exorlive.com/video/?ex=5254'),
(2051, 1003, 5251, 'Rygg lateral fleksjon i slynge 3', 'Ligg p siden med en slynge omkring knrne. Ha armene i kors over brystet og stabilisr i mage og korsrygg. Lft bekkenet ved  presse benene nedover mot underlaget. Fr rolig tilbake til utgangsstillingen.', 4863, 2004468, 3, 'https://exorlive.com/media_5251@50.50.media', 'https://exorlive.com/video/?ex=5251'),
(2052, 1003, 8524, 'TRX Front Squat', 'St p gulvet med hender i TRX under armene med hndtakene i armhulen. G tilbake til du har 45 graders vinkel i kroppen i forhold til gulvet. Kom opp p tballene, senk setet mot gulvet og skyv tilbake gjennom forfoten opp til utgangspunktet.', 10494, 2009419, 3, 'https://exorlive.com/media_8524@50.50.media', 'https://exorlive.com/video/?ex=8524'),
(2053, 1003, 5252, 'Rygg lateral fleksjon i slynge 4', 'Ligg p siden med en slynge plassert omkring knrne. Ha armene i kors over brystet og stabilisr i mage og korsrygg. Lft bekkenet ved  presse det nederste beinet nedover mot underlaget. Lft deretter det verste benet og hold stillingen en stund. Fr rolig tilbake til utgangsstillingen.', 4864, 2004469, 4, 'https://exorlive.com/media_5252@50.50.media', 'https://exorlive.com/video/?ex=5252'),
(2054, 1003, 5272, 'Hofte adduksjon i slynge 3', 'Ligg p siden med en slynge plassert omkring leggen p det verste beinet. La hodet hvile p den nederste armen og la den verste ligge stttende over brystet. Stabilisr i mage og korsrygg. Lft hoften ved  presse det verste benet nedover i slyngen. Lft samtidig det nederste benet opp til det andre. Fr rolig tilbake til utgangsstillingen.', 4900, 2004487, 4, 'https://exorlive.com/media_5272@50.50.media', 'https://exorlive.com/video/?ex=5272'),
(2055, 1003, 8570, 'TRX Diagonal Runner', 'Ligge p gulvet med helene i TRX rett under ankerpunktet. Bring kne mot motsatt albue, skyv benet ut igjen og trekk samtidig opp motsatt ben mot albue p den andre siden.', 10586, 2009331, 4, 'https://exorlive.com/media_8570@50.50.media', 'https://exorlive.com/video/?ex=8570'),
(2056, 1003, 8557, 'TRX Overhead Back Extension', 'St p gulvet med hender i TRX, armene strakt over hodet. By hofteleddet og senk setet mot gulvet, trekk opp til utgangspunktet med strake armer og en engasjert kjerne.', 10560, 2009515, 3, 'https://exorlive.com/media_8557@50.50.media', 'https://exorlive.com/video/?ex=8557'),
(2057, 1003, 8567, 'TRX Hip Drop (deep)', 'St p gulvet med siden til ankerpunktet i en skr vinkel.Hender i TRX (fotlenke) over hodet, med albuer til siden og bena i offset. Senk hoften ned mot gulvet og trekk tilbake til utgangspunktet. Hold albuer til siden og hendene plassert midt p hodet under hele velsen.', 10580, 2009532, 3, 'https://exorlive.com/media_8567@50.50.media', 'https://exorlive.com/video/?ex=8567'),
(2058, 1003, 8487, 'TRX Suspended abducted Lunge', 'St med siden til ankerpunktet med benet nrmest ankerpunktet festet i TRX. By benet du str p, senk setet ned, mens benet i TRX fres ut til siden, skyv opp til utgangsposisjon gjennom helen.', 10420, 2009512, 4, 'https://exorlive.com/media_8487@50.50.media', 'https://exorlive.com/video/?ex=8487'),
(2059, 1003, 8522, 'TRX Crossing Balanse Lunge', 'St p gulvet med hender i TRX og samlede ben, albue rett under skulder. Lft det ene benet i balanse, senk setet og fr benet bakover/ bak kroppen til motsatt side uten  berre gulvet. Rett ut albue og hold overkroppen over bekkenet. Kom opp i balanse mellom hver repetisjon, velsen utfres p et ben av gangen.', 10490, 2009457, 4, 'https://exorlive.com/media_8522@50.50.media', 'https://exorlive.com/video/?ex=8522'),
(2060, 1003, 8576, 'TRX Chest Stretch', 'St med hender i TRX vendt fra ankerpunktet med armene rett ut til siden. G et skritt fram og k press p brystet. Hold ca 30 sek', 10598, 2009478, 1, 'https://exorlive.com/media_8576@50.50.media', 'https://exorlive.com/video/?ex=8576'),
(2061, 1003, 8536, 'TRX Chest Press (tempo)', 'St p gulvet med hender i TRX, armene foran kroppen rett ut fra skulder. Plasser bena mot ankerpunktet. Senk overkroppen mot gulvet i rolig tempo til albue har 90 grader, press eksplosivt tilbake til utgangspunktet med en strak kropp.', 10518, 2009367, 4, 'https://exorlive.com/media_8536@50.50.media', 'https://exorlive.com/video/?ex=8536'),
(2062, 1003, 8507, 'TRX Pendulum (hand)', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og hender i gulvet rett under skulder. Hold kroppen i strak linje, start en bevegelse i bena, hvor de pendler fra side til side.', 10460, 2009434, 4, 'https://exorlive.com/media_8507@50.50.media', 'https://exorlive.com/video/?ex=8507'),
(2063, 1003, 5239, 'Skulder sansemotorikk i slynge 1', 'St med den ene armen strak og litt ut fra kroppen. Hold en slynge i hnden. La den andre armen hvile p hoftekammen. Stabilisr i mage og korsrygg. Len deg rolig over til siden ved  sttte deg i slyngen. Stopp bevegelsen nr armen peker rett ut til siden. Fr rolig tilbake til utgangsstillingen.', 4842, 2004866, 3, 'https://exorlive.com/media_5239@50.50.media', 'https://exorlive.com/video/?ex=5239'),
(2064, 1003, 8508, 'TRX Pendulum (elbow)', 'Plasser begge ftter i TRX, med ansiktet fra ankerpunktet og albuer i gulvet. Hold kroppen i strak linje, start en bevegelse i bena, hvor de pendler fra side til side.', 10462, 2009475, 4, 'https://exorlive.com/media_8508@50.50.media', 'https://exorlive.com/video/?ex=8508'),
(2065, 1003, 5275, 'Hofte fleksjon i slynge 2', 'St p albuene med en slynge plassert omkringknrne. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen. For  gjre velsen mer ustabil kan man bruke en slynge omkring hvert kne.', 4908, 2004489, 2, 'https://exorlive.com/media_5275@50.50.media', 'https://exorlive.com/video/?ex=5275'),
(2066, 1003, 8499, 'TRX Side Plank', 'Plasser begge ftter i TRX, med det verste ben foran det andre, med siden til ankerpunktet. Hnden plasserer du rett under skulder. Lft hoften av gulvet slik at kroppen blir strak og hold posisjonen.', 10444, 2009499, 5, 'https://exorlive.com/media_8499@50.50.media', 'https://exorlive.com/video/?ex=8499'),
(2067, 1003, 8573, 'TRX Hip Hinge', 'St p gulvet med hender i TRX med armene i brysthyde og hndflatene pekende nedover. Strekk deg framover, knekk i hoften og strekk et ben bakover. Hold hoftene parallelt med gulvet.', 10592, 2009492, 3, 'https://exorlive.com/media_8573@50.50.media', 'https://exorlive.com/video/?ex=8573'),
(2068, 1003, 8515, 'TRX Squat 1 ben med hopp', 'St p gulvet med en fot, strekk motsatt ben foran deg. Hender i TRX og albue rett under skulder. Senk setet mot gulvet, rett ut albue og skyv opp gjennom helen og hopp.', 10476, 2009443, 5, 'https://exorlive.com/media_8515@50.50.media', 'https://exorlive.com/video/?ex=8515'),
(2069, 1003, 5280, 'Hofte fleksjon i slynge 7', 'St p hendene med strake albuer og med en slynge plassert rundt hver ankel. Skyt rygg og stabilisr i mage og korsrygg. By vekselvis hyre og venstre ben mot overkroppen uten  lfte setet opp mot taket.', 4917, 2004495, 5, 'https://exorlive.com/media_5280@50.50.media', 'https://exorlive.com/video/?ex=5280'),
(2070, 1003, 8572, 'TRX Forward Lunge', 'St p gulvet vendt fra ankerpunktet med hender i TRX, armene strakt ut fra skulder med hndflatene pekende ned. Ta et skritt fram samtidig som du strekker armene over hodet som en Y. Bakerste kne sker ned mot gulvet, skyv gjennom forrerste ben tilbake til utgangspunktet.\nDenne velsen kan gjres med I, Y og T armer.', 10590, 2009484, 3, 'https://exorlive.com/media_8572@50.50.media', 'https://exorlive.com/video/?ex=8572'),
(2071, 1003, 5261, 'Setelft i slynge 5', 'Ligg p ryggen med en slynge omkring hver ankel. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoftene. Fra denne stillingen byer og strekker du annethvert ben i hofter og knr (sykler).', 4879, 2004478, 5, 'https://exorlive.com/media_5261@50.50.media', 'https://exorlive.com/video/?ex=5261'),
(2072, 1003, 5014, 'Skulder abduksjon i slynge 1', 'Ligg p ryggen med en slynge plassert omkring albuen og en slynge i hnden. Fr armen rolig rett ut til siden og tilbake. Du kan evt. fre armen helt opp over hodet for  oppn enda strre bevegelsesutslag.', 4764, 2004436, 1, 'https://exorlive.com/media_5014@50.50.media', 'https://exorlive.com/video/?ex=5014'),
(2073, 1003, 5265, 'Ettbens setelft  i slynge 4', 'Ligg p ryggen med en slynge omkring  den ene ankelen. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoften p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt. Fra denne stillingen frer du det frie benet ut til siden og tilbake - uten  rotere! Fr rolig tilbake til utgangsstillingen.', 4886, 2004481, 6, 'https://exorlive.com/media_5265@50.50.media', 'https://exorlive.com/video/?ex=5265'),
(2074, 1003, 5263, 'Ettbens setelft  i slynge 3', 'Ligg p ryggen med en slynge rundt det ene kneet. Ha armene i kors p brystet og stabilisr i mage og korsrygg. Lft setet fra underlaget ved  strekke i hoften p slyngesiden. Lft samtidig det frie benet og hold det strakt slik at benene ligger parallelt. Fra denne stillingen frer du det frie benet ut til siden og tilbake - uten  rotere! Fr rolig tilbake til utgangsstillingen.', 4885, 2004479, 5, 'https://exorlive.com/media_5263@50.50.media', 'https://exorlive.com/video/?ex=5263'),
(2075, 1003, 8550, 'TRX Low Deltoid Fly', 'St p gulvet med hender i TRX og armene ned til hoften med hndflatene pekende opp. Senk overkroppen mot gulvet og trekk med strake albuer opp til utgangsposisjonen.', 10546, 2009511, 4, 'https://exorlive.com/media_8550@50.50.media', 'https://exorlive.com/video/?ex=8550'),
(2076, 1003, 5270, 'Hofte abduksjon i slynge 1', 'Ligg p ryggen med en slynge plassert omkring kneet og en omkring ankelen. Fr benet ut til siden og tilbake i et rolig tempo.', 4896, 2004485, 1, 'https://exorlive.com/media_5270@50.50.media', 'https://exorlive.com/video/?ex=5270'),
(2077, 1003, 7468, 'Stabilisering av rygg m/slynge 3', 'Utgangsposisjon er knestende armhevingsposisjon med slynger i hendene og strake armer og trne i gulvet. Fr hoften fram og trekk halen inn. Hold posisjonen mens du lfter knrne s vidt over gulvet.', 7757, 2005837, 3, 'https://exorlive.com/media_7468@50.50.media', 'https://exorlive.com/video/?ex=7468'),
(2078, 1003, 4989, 'Nakke lateral fleksjon i slynge', 'Ligg p ryggen med hodet trygt plassrt i en slynge, slik at du fler at du kan slappe skikkelig av i nakkemuskulaturen. Beveg hodet rolig til den ene siden, ved at du frer ret mot skulder. Gjenta til den andre siden.', 4715, 2004832, 1, 'https://exorlive.com/media_4989@50.50.media', 'https://exorlive.com/video/?ex=4989'),
(2079, 1003, 8542, 'TRX Chest Press (smalt grep deep)', 'St p gulvet med hender i TRX og slynger under armen og armer p skr ned mot gulvet. Plasser bena slik at kroppen fr 45 graders vinkel i forhold til gulvet. Senk overkroppen mot gulvet til albue har 90 grader, press tilbake til utgangspunktet med en sterk kjerne.', 10530, 2009330, 5, 'https://exorlive.com/media_8542@50.50.media', 'https://exorlive.com/video/?ex=8542'),
(2080, 1003, 8539, 'TRX Chest Press (smalt grep)', 'St p gulvet med hender i TRX og slynger under armen og armer p skr ned mot gulvet. Senk overkroppen mot gulvet til albue har 90 grader, press tilbake til utgangspunktet med en strak kropp.', 10516, 2009474, 5, 'https://exorlive.com/media_8539@50.50.media', 'https://exorlive.com/video/?ex=8539'),
(2081, 1003, 8575, 'TRX Long Torso Twist', 'St med siden til ankerpunktet, kryss fremre ben foran det andre benet og len deg ut til siden med hoften ned mot gulvet. Senk hodet mellom armene. Hold ca 30 sek', 10596, 2009528, 2, 'https://exorlive.com/media_8575@50.50.media', 'https://exorlive.com/video/?ex=8575'),
(2082, 1003, 8577, 'TRX Lower Back Stretch', 'St med hender i TRX og hoftebredde mellom fttene. len deg tilbake ved  bye i hoften  senke setet mot gulvet. Senk hodet mellom armene og behold rette knr. Hold ca 30 sek', 10600, 2009421, 3, 'https://exorlive.com/media_8577@50.50.media', 'https://exorlive.com/video/?ex=8577'),
(2083, 1003, 8518, 'TRX Step Back Lunge', 'St p gulvet med hender i TRX og samlede ben, albue rett under skulder. Step tilbake med det ene benet rett ut albue. Hold overkroppen over bekkenet og fr kne mot gulvet. Kom tilbake til utgangspunktet, velsen utfres p annet hvert ben.', 10482, 2009482, 4, 'https://exorlive.com/media_8518@50.50.media', 'https://exorlive.com/video/?ex=8518'),
(2084, 1003, 8562, 'TRX Triceps Press (superman)', 'St lett framoverlent p gulvet med hender i TRX, armene armene p skr opp foran kroppen. Senk kroppen ned mot gulvet ved  bye i albue, skyv tilbake til utgangspunktet. Albuen skal peke framover under hele velsen.', 10570, 2009465, 4, 'https://exorlive.com/media_8562@50.50.media', 'https://exorlive.com/video/?ex=8562'),
(2085, 1003, 5279, 'Hofte fleksjon i slynge 5', 'St p hendene med strake albuer og med en slynge plassert omkring anklene. Skyt rygg og stabilisr i mage og korsrygg. By i hofter og knr samtidig som du frer setet opp mot taket. Fr rolig tilbake til utgangsstillingen.', 4916, 2004493, 4, 'https://exorlive.com/media_5279@50.50.media', 'https://exorlive.com/video/?ex=5279'),
(2086, 1003, 8578, 'TRX Lower Back Stretch (with rotation)', 'St med hender i TRX og hoftebredde mellom fttene. len deg tilbake ved  bye i hoften  senke setet mot gulvet. Senk hodet mellom armene, by et kne og roter overkroppen til motsatt side. Hold ca 30 sek og gjenta p andre side.', 10602, 2009429, 3, 'https://exorlive.com/media_8578@50.50.media', 'https://exorlive.com/video/?ex=8578'),
(2087, 1003, 8526, 'TRX Sprinter Start', 'St p gulvet med hender i TRX under armene med hndtakene i armhulen. G tilbake til du har 45 graders vinkel i kroppen i forhold til gulvet. Plasser det ene benet bak i en sprinter posisjon. Kom opp p et ben i balanse, fr benet tilbake til utgangsposisjonen.', 10498, 2009447, 3, 'https://exorlive.com/media_8526@50.50.media', 'https://exorlive.com/video/?ex=8526'),
(2088, 1003, 8517, 'TRX Step Back Lunge', 'St p gulvet med hender i TRX og samlede ben, albue rett under skulder. Step tilbake med det ene benet rett ut albue. Hold overkroppen over bekkenet og fr kne mot gulvet. Kom tilbake til utgangspunktet.velsen utfres p et ben av gangen fr du bytter side.', 10480, 2009461, 4, 'https://exorlive.com/media_8517@50.50.media', 'https://exorlive.com/video/?ex=8517'),
(2089, 1003, 7447, 'Hofte abduksjon i slynge m/balansepute', 'Ligg p siden med skulderen p balanseputen og en slynge omkring leggene. Ha armene i kors over brystet og stabiliser mage og korsrygg. Lft bekkenet ved  presse underste ben mot underlaget. Fr rolig tilbake til utgangsstilling.', 7716, 2005853, 5, 'https://exorlive.com/media_7447@50.50.media', 'https://exorlive.com/video/?ex=7447'),
(2090, 1003, 8525, 'TRX Front squat (hopp)', 'St p gulvet med hender i TRX under armene med hndtakene i armhulen. G tilbake til du har 45 graders vinkel i kroppen i forhold til gulvet. Kom opp p tballene, senk setet mot gulvet og skyv tilbake gjennom forfoten opp i et hopp og gjenta velsen. (pass p  opprettholde vinkelen med et lite hopp tilbake nr du lander)', 10496, 2009433, 3, 'https://exorlive.com/media_8525@50.50.media', 'https://exorlive.com/video/?ex=8525'),
(2091, 1003, 8566, 'TRX Hip Drop', 'St p gulvet med siden til ankerpunktet og hender i TRX (fotlenke) over hodet, albuer til siden og bena i offset. Senk hoften ned mot gulvet og trekk tilbake til utgangspunktet. Hold albuer til siden og hendene plassert midt p hodet under hele velsen.', 10577, 2009448, 4, 'https://exorlive.com/media_8566@50.50.media', 'https://exorlive.com/video/?ex=8566'),
(2092, 1018, 6481, '"Holde igjen" teknikker', '1. Prv  forholde deg rolig.\n2. Konsentrer deg om bekkenbunnen.\n3. Kryss bena.\n4. Stram bekkenbunnen.\n5. Trykk p perineum (skrittet).\n6. Vent 10 - 20 sekunder. G s videre.', 6503, 2005925, 1, 'https://exorlive.com/media_6481@50.50.media', 'https://exorlive.com/video/?ex=6481'),
(2093, 1018, 7174, 'Pusteteknikk', 'v p riktig pusteteknikk nr du sitter eller nr du ligger. Kontroller gjerne ved at du plasserer begge hendene p magen eller den ene hnden p magen og den andre p brystkassen. Ha god sttte i ryggen, lukk ynene og slapp av i skuldrene. Trekk pusten inn gjennom nesen og dypt ned i magen. La magen utvide seg og kjenn at den skyver ut mot hnden. Pust ut gjennom munnen og kjenn at hnden senkes igjen.', 6766, 2007699, 1, 'https://exorlive.com/media_7174@50.50.media', 'https://exorlive.com/video/?ex=7174'),
(2094, 1018, 6488, 'Liggende pustevelse', 'Nr man trener bekkenbunnen er det viktig at man ikke er anspent i pusten og at man ikke bruker muskulatur i sete og lr eller magemuskler i stedet for bekkenbunnsmusklene.\nLigg p ryggen med byde ben og legg hendene nederst p magen. Slapp av, trekk pusten inn og kjenn at magen gr ut. Pust ut og kjenn at magen gr inn igjen. Pust rolig og avslappet.', 6464, 2007674, 1, 'https://exorlive.com/media_6488@50.50.media', 'https://exorlive.com/video/?ex=6488'),
(2095, 1018, 6507, 'Tre stadier for  trene styrke i bekkenbunnen', 'Stadium 1: Start med  trekke sammen s hardt du kan, slipp og slapp av fr du trekker sammen igjen. Stadium 2: Trekk sammen s hardt du kan og forsk  holde sammentrekningen i minst 6-8 sekunder. Stadium 3: Trekk sammen s hardt du kan, hold sammentrekningen i 6-8 sekunder og legg deretter til 3-4 raske sammentrekninger p toppen av holdeperioden. Ettersom du blir sterkere m du ta i stadig hardere for fortsatt  ke styrken.', 6511, 0, 0, 'https://exorlive.com/media_6507@50.50.media', 'https://exorlive.com/video/?ex=6507'),
(2096, 1018, 6508, 'Anatomi bekkenbunnen', 'Bekkenbunnsmusklene ligger innvendig i bekkenet. De danner gulvet i kroppen, skal motst alle kninger i buktrykk som oppstr f.eks under hosting og nysing, og skal holde alle innvollene i underlivet p plass slik at de ikke synker ned.', 6510, 0, 0, 'https://exorlive.com/media_6508@50.50.media', 'https://exorlive.com/video/?ex=6508'),
(2097, 1018, 6587, 'Plassering av skjerm 1', 'Tradisjonelt anbefales 15 - 30 vinkel under yets horisontallinje til et punkt midt p skjermen. Avstand til skjermen vil vre avhengig av brukerens synsevne. Foretrukket synsavstand varierer gjerne mellom 50 cm og 70 cm.', 6586, 0, 0, 'https://exorlive.com/media_6587@50.50.media', 'https://exorlive.com/video/?ex=6587'),
(2098, 1018, 6404, 'Forslag til plassering av utstyr', 'Arbeidstakeren har god plass til underarmene og mulighet til  benytte datamus i forkant av tastatur.', 6378, 0, 0, 'https://exorlive.com/media_6404@50.50.media', 'https://exorlive.com/video/?ex=6404'),
(2099, 1018, 6584, 'Plassering av tastatur', 'Tastaturet skal vre adskilt fra skjermen slik at det kan tilpasses arbeidstakeren og arbeidsoppgavene. Trdlse tastaturer kan vre  foretrekke da de er enkle  plassere. Tastaturet br vre s lavt som mulig for at hndleddet kan vre i tilnrmet hvilestilling ved bruk. Det br vre mulig  endre helningsvinkel p tastaturet slik at hndleddsvinkelen kan varieres. Det skal vre god plass til  hvile hndledd og underarmer p bordplaten. Tastaturet br ligge stdig p bordet og ikke skli, det skal ha en matt overflate, og symbolene skal ha tilstrekkelig kontrast slik at du lett kan lese dem ved en normal sittestilling. Tastaturer som lager sty br unngs.', 6377, 0, 0, 'https://exorlive.com/media_6584@50.50.media', 'https://exorlive.com/video/?ex=6584'),
(2100, 1018, 6405, 'Arbeidsstol', 'Arbeidsstolen skal gi muligheter for varierte og komfortable stillinger og skal kunne tilpasses den enkelte arbeidstaker. Stolens sete og rygg br kunne reguleres uavhengig av hverandre. Innstillingene br kunne lses ved behov. Du br velge en stoltype som gir deg god sttte i korsryggen. Armlener kan gi god avlastning men m ikke vre til hinder slik at stolen ikke kommer tilstrekkelig nr bord/tastatur. Armlenene br ha god bredde, kunne reguleres i hyden og ikke ha glatt overflate.', 6588, 0, 0, 'https://exorlive.com/media_6405@50.50.media', 'https://exorlive.com/video/?ex=6405'),
(2101, 1018, 7629, 'Diagonalgange med krykker', 'G vanlig, men med krykkene som avlaster. Plasser venstre ben og hyre krykke frem samtidig, gjenta deretter med hyre ben og venstre krykke.', 8092, 2006979, 1, 'https://exorlive.com/media_7629@50.50.media', 'https://exorlive.com/video/?ex=7629'),
(2102, 1018, 6403, 'Plassering av skjerm 2', 'Flate skjermer er  foretrekke. De avgir mindre varme, har lavere elektromagnetiske felt, flimrer ikke, gir ofte bedre lesekvalitet, tar mindre plass, er mindre srbare for sjenerede refleks i skjermbildet og er enklere  plassere. Stor skjerm er en fordel for de fleste. Spesielt om man har drlig syn. Det er best om skjermen kan vinkles og roteres. En vinkling av skjermen p 15 - 20 grader bakover gir for mange en bedre arbeidsstilling.', 6377, 0, 0, 'https://exorlive.com/media_6403@50.50.media', 'https://exorlive.com/video/?ex=6403'),
(2103, 1018, 6585, 'Plassering av datamus', 'Det anbefales  prve ut ulike typer datamus. For stor datamus gir oppoverby (ekstensjon) i hndleddet og kan gi statisk muskelbelastning. Trdls mus er  foretrekke, slik at den enkelt kan beveges og flyttes p. Det kan vre bra  variere med  bruke datamusen foran tastaturet. Man br lre seg hutigtaster p tastaturet slik at man kan variere mellom datamus og tastatur da bruk av pekeutstyr kan gi strre statisk muskelbelastning enn bruk av tastatur.', 6377, 0, 0, 'https://exorlive.com/media_6585@50.50.media', 'https://exorlive.com/video/?ex=6585'),
(2104, 1018, 7623, 'Trappegang opp med krykker', 'G helt inntil trappetrinnet. Sett det friske benet opp p neste trappetrinn, krykkene flger det friske benet. Legg vekten frem p det friske benet og bruk det friske benet og armene til  skyve i fra slik at du lfter det opererte benet opp p det neste trinnet.', 8080, 2006992, 2, 'https://exorlive.com/media_7623@50.50.media', 'https://exorlive.com/video/?ex=7623'),
(2105, 1018, 7140, 'Leppebls/ leppebrems', 'Pust ut med halvpne lepper (som om du blser p noe varmt). Leppebrems hjelper til  roe ned pusten og bidrar til  holde luftveiene pne under utpusten. Dette reduserer tendensen til luftveiskompresjon.', 6351, 2007726, 1, 'https://exorlive.com/media_7140@50.50.media', 'https://exorlive.com/video/?ex=7140'),
(2106, 1018, 7624, 'Trappegang ned med krykker', 'Sett krykkene ned p neste trinn. Det skadede benet flger krykkene ned frst, deretter det friske. Legg vekten p krykkene for  avlaste.', 8082, 2006783, 2, 'https://exorlive.com/media_7624@50.50.media', 'https://exorlive.com/video/?ex=7624'),
(2107, 1018, 7628, 'Trepunkts krykkegange 2', 'Sett begge krykkene cirka en skrittlengde frem og fordel vekten over p armene. Sett krykker og det vonde  benet fram, og g igjennom med friskt ben.', 8090, 2006942, 1, 'https://exorlive.com/media_7628@50.50.media', 'https://exorlive.com/video/?ex=7628'),
(2108, 1018, 7171, 'Mini-PEP/system 22', 'Dette er et eksempel p en enkel instruksjon for bruk av mini-PEP. Lukk munnen rundt munnstykket og trekk pusten rolig inn gjennom nesen eller munnen. Bls ut uten  anstrenge deg for mye. Hold skuldrene avslappet. Gjenta dette 5-15 ganger i flere serier.', 7156, 0, 1, 'https://exorlive.com/media_7171@50.50.media', 'https://exorlive.com/video/?ex=7171'),
(2109, 1018, 7161, 'Hvilestilling - sittende p en stol 2', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Len deg forover i stolen og hvil underarmene p lrene. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7141, 2007641, 1, 'https://exorlive.com/media_7161@50.50.media', 'https://exorlive.com/video/?ex=7161'),
(2110, 1018, 7167, 'Hvilestilling - stende i trapp', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. St med stdig beinstilling og len deg p handlevognen, mot vinduskarmen eller p rekkverket e.l. Pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7150, 0, 1, 'https://exorlive.com/media_7167@50.50.media', 'https://exorlive.com/video/?ex=7167'),
(2111, 1018, 6478, 'Bekkenbunn ved lft og sit ups', 'Bruk alltid bekkenbunnsmuskulaturen nr du trener magemusklene eller lfter tungt.', 6472, 2005961, 1, 'https://exorlive.com/media_6478@50.50.media', 'https://exorlive.com/video/?ex=6478'),
(2112, 1018, 7139, 'Sttteknikk', 'Sttteknikk er aktiv utpust. Den er sknsom for luftveiene og brukes for  lsne og flytte p slimet. Sttteknikk m ves inn sammen med fysioterapeut.', 7783, 2007646, 1, 'https://exorlive.com/media_7139@50.50.media', 'https://exorlive.com/video/?ex=7139'),
(2113, 1018, 7137, 'Hosteteknikk', 'Host for  fjerne slimet. Trekk pusten dypt inn og stt raskt ut.', 7783, 2007796, 1, 'https://exorlive.com/media_7137@50.50.media', 'https://exorlive.com/video/?ex=7137'),
(2114, 1018, 7170, 'Hvilestilling - sittende p en stol 1', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Len deg tilbake i stolen med fttene godt plassert p gulvet. Hvil armene p armlenene. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn gjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7160, 2007775, 1, 'https://exorlive.com/media_7170@50.50.media', 'https://exorlive.com/video/?ex=7170'),
(2115, 1018, 7627, 'Trepunkts krykkegange 1', 'Sett begge krykkene cirka en skrittlengde frem og fordel vekten over p armene. Sett det vonde benet mellom krykkene slik at du fr en god sttteflate. Sett deretter det friske benet inntil det vonde.', 8088, 2006902, 1, 'https://exorlive.com/media_7627@50.50.media', 'https://exorlive.com/video/?ex=7627'),
(2116, 1018, 7164, 'Hvilestilling - sittende ved et bord', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Len deg lett forover og hvil underarmene p bordet foran deg. Det kan vre godt  sttte opp med en pute under armene. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn gjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7145, 2007752, 1, 'https://exorlive.com/media_7164@50.50.media', 'https://exorlive.com/video/?ex=7164'),
(2117, 1018, 7169, 'God liggestilling', 'Finn deg en god liggestilling.  ligge med hevet hjertebrett kan vre godt nr du er tungpustet. Legg en pute under knrne og ha god sttte i ryggen, eventuelt en pute under hver arm. I sideleie kan det vre godt  ha en pute mellom knrne, eventuelt en pute for  hvile verste arm.  endre stilling bde liggende, sittende og stende er viktig for pusten og for  f opp slim.', 7153, 0, 1, 'https://exorlive.com/media_7169@50.50.media', 'https://exorlive.com/video/?ex=7169'),
(2118, 1018, 7163, 'Hvilestilling - stende med en prekestol', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Len deg lett forover og hvil underarmene p prekestolen. Plassr en fot foran den andre. Prv  slappe av. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7144, 0, 1, 'https://exorlive.com/media_7163@50.50.media', 'https://exorlive.com/video/?ex=7163'),
(2119, 1018, 7166, 'Hvilestilling - stende', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. St med stdig beinstilling og len deg lett fremover p handlevognen, mot vinduskarmen, p rekkverket e.l. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7148, 0, 1, 'https://exorlive.com/media_7166@50.50.media', 'https://exorlive.com/video/?ex=7166'),
(2120, 1018, 7625, 'Trappegange opp med krykker u/belastning', 'Hold det vonde benet byd og gjerne litt bakover slik at det ikke treffer trappetrinnet nr du er p vei opp. G helt inntil trapptrinnet. Sett krykkene opp p neste trinn, legg vekten p armene samtidig som du hopper opp p neste trinn og setter det friske benet mellom krykkene slik at du fr mest mulig sttteflate.', 8084, 2006823, 1, 'https://exorlive.com/media_7625@50.50.media', 'https://exorlive.com/video/?ex=7625'),
(2121, 1018, 6497, 'Teknikk ved nys, host og latter', '1. Prv  forholde deg rolig.\n2. Konsentrer deg om bekkenbunnen.\n3. Kryss bena.\n4. Stram bekkenbunnen.\n5. Trykk p perineum.\n6. Vent 10 - 20 sekunder. G s videre.', 6468, 2005997, 1, 'https://exorlive.com/media_6497@50.50.media', 'https://exorlive.com/video/?ex=6497'),
(2122, 1018, 7173, 'Generelle tips - respirasjon', '- Bruk handlevogn nr du handler og unng  bre tungt.\n- Bruk dusjkrakk nr du dusjer s slipper du  st.\n- Bruk sm hndklr i stedet for ett stort og tungt hndkle.\n- Bruk leppebrems ved aktivitet.\n- Riktig inhalasjonsteknikk er viktig for effekt av medisin.\n- Kvinner som hoster mye kan ha nytte av bekkenbunnstrening.\n- Drikk mye vann.', 7147, 0, 1, 'https://exorlive.com/media_7173@50.50.media', 'https://exorlive.com/video/?ex=7173'),
(2123, 1018, 6972, 'Anfallsmestring - generelle rd', 'Det er mulig  pvirke anstrengt pust ved:\n - Anfallsmedisin\n - Hvilestillinger\n - Leppebrems\n - God pusteteknikk (tilstrebe  puste med magen)', 7150, 0, 1, 'https://exorlive.com/media_6972@50.50.media', 'https://exorlive.com/video/?ex=6972'),
(2124, 1018, 8951, 'Forflytning: liggende til sittende', 'Ligg p ryggen. Flytt bena ut mot sengekanten med sm bevegelser. Nr bena er p utsiden av sengekanten, senk dem rolig mot gulvet. Bruk s armene til  skyve fra i sengen og kom opp i sittende p sengekanten.', 11298, 2010764, 2, 'https://exorlive.com/media_8951@50.50.media', 'https://exorlive.com/video/?ex=8951'),
(2125, 1018, 7626, 'Trappegange ned med krykker u/belastning', 'Hold det vonde benet byd og gjerne litt fremover slik at det ikke treffer trappetrinnet nr du er p vei ned. Sett krykkene ned p neste trappetrinn og legg deretter vekten over p armene. Hink ned til neste trinn og sett det friske benet mellom krykkene slik at du fr mest mulig sttteflate.', 8086, 2006863, 1, 'https://exorlive.com/media_7626@50.50.media', 'https://exorlive.com/video/?ex=7626'),
(2126, 1018, 8950, 'Forflytning: liggende til sittende 2', 'Ligg p ryggen. By opp i begge bena, legg den ene armen over mot siden du skal snu deg mot og snu deg over p siden. Unng  rotere eller vri p ryggen. La bena g ned p utsiden av sengekanten, skyv fra med verste arm i sengen og kom opp i sittende.', 11296, 2010763, 2, 'https://exorlive.com/media_8950@50.50.media', 'https://exorlive.com/video/?ex=8950'),
(2127, 1018, 7165, 'Flutter', 'Dette er et eksempel p en enkel instruksjon for bruk av flutter. Lukk munnen rundt munnstykket. Trekk pusten rolig inn gjennom nesen eller munnen. Bls ut i flutteren uten  anstrenge deg for mye. Kinnene skal holdes stramme nr du puster ut. Hold skuldrene avslappet. Gjenta 5 -15 ganger i flere serier.', 7159, 0, 1, 'https://exorlive.com/media_7165@50.50.media', 'https://exorlive.com/video/?ex=7165'),
(2128, 1018, 7172, 'PEP maske', 'Dette er et eksempel p en enkel instruksjon for bruk av PEP masken. Hold masken stdig over nese og munn uten  presse for hardt. Trekk pusten rolig inn gjennom nesen eller munnen. Pust ut i masken uten  anstrenge deg for mye. Hold skuldrene avslappet. Gjenta dette 5-15 ganger i flere serier.', 7158, 0, 1, 'https://exorlive.com/media_7172@50.50.media', 'https://exorlive.com/video/?ex=7172'),
(2129, 1018, 9019, 'Forflytning: lenger inn/ut p stol', 'Nr du skal bevege deg lenger inn eller ut p en stol, kan skalt skinkegange benyttes. Len overkroppen over til hyre side slik at du har mest tyngde her. Flytt s bekken og seteparti p venstre side litt bakover. Len deretter overkroppen til venstre side og beveg bekken og sete p hyre side bakover. Gjenta dette vekselvis p annenhver side til du er s langt inne/ute p stolen som nskelig.', 11405, 2010802, 1, 'https://exorlive.com/media_9019@50.50.media', 'https://exorlive.com/video/?ex=9019'),
(2130, 1018, 8952, 'Forflytning: sittende til liggende', 'Sitt p sengekanten. Ta tak i sengekanten  med begge hender og lft begge bena opp i sengen samtidig som du senker overkroppen ned mot madrassen. Snu deg s rundt p ryggen, unng  rotere eller vri ryggen.', 11300, 2010765, 2, 'https://exorlive.com/media_8952@50.50.media', 'https://exorlive.com/video/?ex=8952'),
(2131, 1018, 9020, 'Forflytning: seng til stol', 'Sitt p sengekanten med en stol med armlener plassert med siden mot sengen. Ha en hnd p sengekanten og hnden nrmest stolen p armelenet som er lengst bort. Beveg overkroppen frem, lft setet fra madrassen og drei ftter riktig i forhold til stolen og sett deg rolig og kontrollert ned.', 11407, 2010803, 1, 'https://exorlive.com/media_9020@50.50.media', 'https://exorlive.com/video/?ex=9020'),
(2132, 1018, 8956, 'Forflytning: hyere opp i seng med medhjelper', 'Pasienten ligger p ryggen, byer opp bena og setter fttene i madrassen. Medhjelperen tar tak p undersiden av pasientens knr med nedre arm og under pasientens skulderparti med vre arm, og hjelper til med  flytte pasienten hyere opp i sengen. Pasienten skyver samtidig fra med fttene og lfter setet fra madrassen.', 11308, 2010769, 1, 'https://exorlive.com/media_8956@50.50.media', 'https://exorlive.com/video/?ex=8956'),
(2133, 1018, 7162, 'Hvilestilling - sittende p en rullator', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Sett deg p rullatoren og hvil underarmene p hndtakene. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn igjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7142, 0, 1, 'https://exorlive.com/media_7162@50.50.media', 'https://exorlive.com/video/?ex=7162'),
(2134, 1018, 8954, 'Forflytning: opp i sittende med medhjelper', 'Pasienten ligger p ryggen, byer opp bena og setter fttene p madrassen. Medhjelper tar tak med nedre arm under pasientens knr og vre arm under pasientens skulderparti og hjelper til med  f pasienten opp i sittende. Pasienten deltar s mye som han klarer.', 11304, 2010767, 2, 'https://exorlive.com/media_8954@50.50.media', 'https://exorlive.com/video/?ex=8954'),
(2135, 1018, 7941, 'G med crocodile', 'Sitt p kne, kom opp i knestende, ta hyre fot frem, reis deg til stende og snu deg rundt. Hold deg med begge hender, rett deg opp i ryggen og g fremover.', 8656, 2007380, 1, 'https://exorlive.com/media_7941@50.50.media', 'https://exorlive.com/video/?ex=7941'),
(2136, 1018, 7168, 'Hvilestilling- sittende p sengekanten', 'Ved  avlaste overkroppen vil musklene dine slappe av. Nr du blir tungpustet kan du ved  bruke hvilestillinger lette p pusten og bruke mindre energi. Sitt p sengekanten. Len deg lett fremover med rett rygg. Hvil underarmene p et stdig sengebord. Fttene skal vre godt plassert p gulvet. Sitt avslappet. Senk skuldrene og pust med magen. Pust rolig og dypt inn gjennom munn eller nese. Bls luften ut mellom sammenpressede lepper og stramme kinn (leppepust) eller en pustemotstand som f.eks. mini PEP.', 7149, 0, 1, 'https://exorlive.com/media_7168@50.50.media', 'https://exorlive.com/video/?ex=7168'),
(2137, 1018, 8953, 'Forflytning: ut til sengekant', 'Ligg p ryggen. By bena og plasser det ene eller begge ben et par cm til siden. Lft setet og flytt det til samme side som bena. Flytt overkroppen etter.', 11302, 2010766, 1, 'https://exorlive.com/media_8953@50.50.media', 'https://exorlive.com/video/?ex=8953'),
(2138, 1018, 7955, 'Kle p bukse i liggende', 'Ligg p siden med knrne byd. By det verste benet og tre buksen p. Snu deg rundt p andre siden og gjr det samme. Legg deg s p ryggen med byde knr, lft opp sete og dra buksen p.', 9066, 2007480, 1, 'https://exorlive.com/media_7955@50.50.media', 'https://exorlive.com/video/?ex=7955'),
(2139, 1018, 9099, 'Opp fra gulv', 'Ligg p ryggen p gulvet. Rull deg over p siden. Trekk knrne litt opp mot magen og sttt deg opp p albuen. Skyv deg opp i sittende ved  sette hndflaten i gulvet. Kom deg over p alle fire. Sett det ene benet opp slik at foten str i gulvet og reis deg opp til stende.', 11543, 2010983, 2, 'https://exorlive.com/media_9099@50.50.media', 'https://exorlive.com/video/?ex=9099'),
(2140, 1018, 7940, 'G med crocodile (med terapeut)', 'St i knestende, ta hyre fot frem, reis deg til stende og snu deg rundt. Hold deg med begge hender, rett deg opp i ryggen og g fremover.\nTerapeuten hjelper til dersom barnet har behov i bevegelsesovergangene.', 8653, 2007599, 1, 'https://exorlive.com/media_7940@50.50.media', 'https://exorlive.com/video/?ex=7940'),
(2141, 1018, 9021, 'Forflytning: seng til stol med sklibrett', 'Sitt p sengekanten med en stol i ca 90 graders vinkel mot sengen. Plasser den ene enden av et forflytningsbrett under setehalvdelen som er nrmest stolen. Ta tak i stolen med armen nrmest stolen og dra deg over p stolen mens du glir p forflytningsbrettet.', 11409, 2010804, 1, 'https://exorlive.com/media_9021@50.50.media', 'https://exorlive.com/video/?ex=9021'),
(2142, 1018, 7832, 'Brestillings variant', 'Barnet lftes hyt p skulder, mens man sttter barnet under baken.', 8676, 2007910, 1, 'https://exorlive.com/media_7832@50.50.media', 'https://exorlive.com/video/?ex=7832'),
(2143, 1018, 8039, 'Rullestol forover', 'Sitt oppreist i rullestolen med bena p fotstttene. Ta tak rundt begge hjulene samtidig og dra dem fremover, Gjenta.', 8453, 2007417, 1, 'https://exorlive.com/media_8039@50.50.media', 'https://exorlive.com/video/?ex=8039'),
(2144, 1018, 7833, 'Brestilling i mageleie', 'Hold barnet holdes med en arm under brystet og den andre hnden p magen med underarmen mellom barnets lr.', 8678, 2007956, 1, 'https://exorlive.com/media_7833@50.50.media', 'https://exorlive.com/video/?ex=7833'),
(2145, 1018, 8955, 'Forflytning: hyere opp i seng', 'Ligg p ryggen. By opp i begge ben og lft setet fra madrassen. Skyv deg hyere opp i sengen ved  skyve fra med fttene i madrassen.', 11306, 2010768, 1, 'https://exorlive.com/media_8955@50.50.media', 'https://exorlive.com/video/?ex=8955'),
(2146, 1018, 8043, 'Rullestol bakover', 'Sitt oppreist i rullestolen med bena p fotstttene. Ta tak i begge hjulene samtidig og dra dem bakover.', 8452, 2007625, 1, 'https://exorlive.com/media_8043@50.50.media', 'https://exorlive.com/video/?ex=8043'),
(2147, 1018, 7831, 'Brestilling mage mot mage', 'Holdt barnet med magen til deg og med bena byet og fra hverandre. Den ene armen sttter under barnets bak og den andre armen rundt ryggen.', 8674, 2008164, 1, 'https://exorlive.com/media_7831@50.50.media', 'https://exorlive.com/video/?ex=7831'),
(2148, 1018, 7841, 'Brestillinger', 'Holde barnet sittende i armkroken, hold en hnd p ytterste lret og den andre armen bak skulder og under baken.', 8682, 2008091, 1, 'https://exorlive.com/media_7841@50.50.media', 'https://exorlive.com/video/?ex=7841'),
(2149, 1018, 7942, 'Riktig hyde av krykker', 'Hndtaket br vre p hyde med hndleddet.', 8658, 2007422, 1, 'https://exorlive.com/media_7942@50.50.media', 'https://exorlive.com/video/?ex=7942'),
(2150, 1018, 8976, 'Leiring: ryggliggende', 'Pasienten ligger p ryggen. Plasser en pute under pasientens knr.', 11342, 2010789, 1, 'https://exorlive.com/media_8976@50.50.media', 'https://exorlive.com/video/?ex=8976');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(2151, 1018, 8047, 'Forflytning fra rullestol fremover med hjelp', 'Sett rullestolen og en stol mot hverandre. Fortell barnet hva dere skal gjre. Plasser barnets ftter p gulvet med god sttteflate og be barnet legge hendene p stolen foran seg. Still deg ved siden av barnet og ta tak rundt livet p barnet. Hjelp barnet opp i stende og deretter roter barnet slik at han fr satt seg ned.', 8465, 2007528, 2, 'https://exorlive.com/media_8047@50.50.media', 'https://exorlive.com/video/?ex=8047'),
(2152, 1018, 8050, 'Forflytning fra rullestol til liggende med to personer 2', 'Fortell barnet hva dere skal gjre. Sett p bremsene p rullestolen og be barnet krysse armene over brystet. Den ene personen stiller seg foran barnet og tar tak under barnets lr. Den andre personen stiller seg bak barnet og tar tak under barnets armer. Bruk bena og srg for en god lftestilling. Lft barnet opp og forflytt det til matten.', 8445, 2007435, 1, 'https://exorlive.com/media_8050@50.50.media', 'https://exorlive.com/video/?ex=8050'),
(2153, 1018, 7830, 'Brestillinger', 'Variasjon av brestillinger p hyre og venstre arm. Hold barnet med ryggen til deg med armene samlet foran barnets mage. Barnet fr sttte under lr og overarm.', 8672, 2008115, 1, 'https://exorlive.com/media_7830@50.50.media', 'https://exorlive.com/video/?ex=7830'),
(2154, 1018, 7956, 'Kle p bukse i sittende', 'Sitt inntil en stor pute, stol eller liknende. By opp det ene benet og tre p buksen, gjenta p samme mte med motsatt ben. By knrne opp og snu deg rundt slik at du kommer opp og st p knrne, bruk gjerne armene til  sttte deg p puten. Nr du str p knrne inntil puten trekker du buksen p deg.', 9068, 2007522, 2, 'https://exorlive.com/media_7956@50.50.media', 'https://exorlive.com/video/?ex=7956'),
(2155, 1018, 9945, 'Rengjring av rullestol', 'Det anbefales riktig arbeidshyde.', 13245, 2013347, 2, 'https://exorlive.com/media_9945@50.50.media', 'https://exorlive.com/video/?ex=9945'),
(2156, 1018, 7829, 'Brestilling rygg mot mage 1', 'Hold barnet med armen rundt rygg og mage og hold rundt barnets lr.', 8670, 2008019, 1, 'https://exorlive.com/media_7829@50.50.media', 'https://exorlive.com/video/?ex=7829'),
(2157, 1018, 9101, 'Opp fra gulv 2', 'Ligg p ryggen p gulvet. Rull deg over p siden. Trekk knrne litt opp mot magen og sttt deg opp p albuen. Skyv deg opp i sittende ved  sette hndflaten i gulvet. Kom deg opp over p alle fire. Sett det ene benet opp slik at foten str i gulvet, sttt deg til en stol og reis deg opp.', 11547, 2010944, 2, 'https://exorlive.com/media_9101@50.50.media', 'https://exorlive.com/video/?ex=9101'),
(2158, 1018, 8046, 'Forflytning fra rullestol med hjelp sideveis', 'Sett rullestol og stol med ca 90 graders vinkel mot hverandre. Sett deg ned p kne foran barnet. Fortell barnet hva du skal gjre. Plasser barnets armer over skuldrene dine og ta tak rundt livet p barnet eller under setet. Flytt barnet over fra rullestolen til stolen.', 8460, 2007486, 2, 'https://exorlive.com/media_8046@50.50.media', 'https://exorlive.com/video/?ex=8046'),
(2159, 1018, 8038, 'Trille rullestol', 'Srg for at barnet sitter godt i rullestolen med bena p fotsttten. Bruk hndtak bak p rullestol for  trille barnet.', 8437, 2007374, 1, 'https://exorlive.com/media_8038@50.50.media', 'https://exorlive.com/video/?ex=8038'),
(2160, 1018, 8051, 'Forflytning fra rullestol til stol med to personer', 'Fortell barnet hva dere skal gjre. Sett p bremsene p rullestolen og be barnet krysse armene over brystet. Den ene personen stiller seg foran barnet og tar tak under barnets lr. Den andre personen stiller seg bak barnet  og tar tak under armene. Bruk bena og srg for en god lftestilling. Lft barnet opp og forflytt det til stolen.', 8448, 2007476, 1, 'https://exorlive.com/media_8051@50.50.media', 'https://exorlive.com/video/?ex=8051'),
(2161, 1018, 7848, 'Sideliggnede hvile/sovestilling', 'Hvis barnet m ligge i sideleie, enten for  hvile eller sove skal barnet leires slik at det ikke kan falle over i mageleie. Rull et teppe eller lignende som en plse og legg det fra brystet, mellom bena til bak p ryggen, slik at barnet ligger stdig i stillingen.', 8773, 2008125, 1, 'https://exorlive.com/media_7848@50.50.media', 'https://exorlive.com/video/?ex=7848'),
(2162, 1018, 8041, 'Snu rullestol til venstre - hurtig', 'Sitt oppreist i rullestolen med bena p fotstttene. Dra det venstre hjulet bakover samtidig som du drar det hyre hjulet fremover.', 8455, 2007541, 1, 'https://exorlive.com/media_8041@50.50.media', 'https://exorlive.com/video/?ex=8041'),
(2163, 1018, 7823, 'Barnet legges ned og taes opp fra mageleie', 'Hold barnet med ryggen til med den ene armen over brystet og den andre rundt lret. Legg barnet ned med verste ben noe byet og nr barnet taes opp byes lret mot magen i det det lftes opp.', 8746, 2008032, 1, 'https://exorlive.com/media_7823@50.50.media', 'https://exorlive.com/video/?ex=7823'),
(2164, 1018, 7828, 'Lfte barnet opp over mageleie', 'Barnet ligger p rygg. Snu barnet over p magen og lft det opp.', 8752, 2007972, 1, 'https://exorlive.com/media_7828@50.50.media', 'https://exorlive.com/video/?ex=7828'),
(2165, 1018, 7824, 'Barnet legges ned og taes opp fra mageleie 2', 'Hold barnet med ryggen til med den ene armen over brystet og den andre rundt lret. Legg barnet ned med verste ben noe byet og nr barnet taes opp byes lret mot magen i det det lftes opp. Barnet kan skyve fra med den underste armen.', 8748, 2008081, 1, 'https://exorlive.com/media_7824@50.50.media', 'https://exorlive.com/video/?ex=7824'),
(2166, 1018, 8042, 'Snu rullestol til venstre', 'Sitt oppreist i rullestolen med bena p fotstttene. Hold det venstre hjulet i ro samtidig som du drar det hyre hjulet fremover.', 8457, 2007585, 1, 'https://exorlive.com/media_8042@50.50.media', 'https://exorlive.com/video/?ex=8042'),
(2167, 1018, 7825, 'Barnet taes opp fra mageleie', 'Ta en arm under barnets bryst. Den andre armen skyver barnets ene lr i by fr det lftes opp.', 8750, 2008130, 1, 'https://exorlive.com/media_7825@50.50.media', 'https://exorlive.com/video/?ex=7825'),
(2168, 1018, 8045, 'Hydejustere bord for rullestolbruker', 'Benytt et bord som kan heises eller senkes for  tilpasse det til riktig hyde. Hyden p bordet br vre slik at armene hviler komfortabelt p arbeidsflaten og at barnet har ca. 90 grader i albuen. Trill rullestolen godt under bordet.', 8439, 2007447, 1, 'https://exorlive.com/media_8045@50.50.media', 'https://exorlive.com/video/?ex=8045'),
(2169, 1018, 9947, 'Justering av luftmengden i trykkavlastende sittepute', 'For noen rullestolbrukere er det mulig  stille og justere luftmengden selv. For riktig bruk av enhver sittepute m bruksanvisningen leses nye og evt. opplring gis av fagpersonell.', 13249, 2013464, 2, 'https://exorlive.com/media_9947@50.50.media', 'https://exorlive.com/video/?ex=9947'),
(2170, 1018, 9950, 'Rengjre svinghjulene', 'Plasser rullestolen slik at du nr svinghjulene. Det anbefales  demontere svinghjul jevnlig for  fjerne hr og annet smuss.', 13255, 2013302, 2, 'https://exorlive.com/media_9950@50.50.media', 'https://exorlive.com/video/?ex=9950'),
(2171, 1018, 9948, 'Regulere rygg p egen rullestol', 'Ryggen innstilles av fagpersonell frste gang mens pasienten sitter i rullestolen. Man flger pasientens konturer for mest mulig avslappet sitteposisjon. Deretter kan sm korrekturer foretas. Pasienten kan gjre det selv ved  sitte bak sin egen rullestol og justere velcrobndene.', 13251, 2013395, 2, 'https://exorlive.com/media_9948@50.50.media', 'https://exorlive.com/video/?ex=9948'),
(2172, 1018, 9949, 'Legge sammen egen rullestol', 'Sett p bremser p stolen. Ta av armlener og fotbrett, hvis disse er avtagbare. Dra i hndtaket bak p stolen for  legge ned ryggen. Ta av bremsene og trykk inn i midten av navet for lsne hjulene.', 13253, 2013440, 2, 'https://exorlive.com/media_9949@50.50.media', 'https://exorlive.com/video/?ex=9949'),
(2173, 1018, 9946, 'Vedlikehold av sittepute', 'Sittepute krever ulikt vedlikehold, se bruksansvisningen. Jevnlig sjekk og rengjring er viktig for  unng fuktproblematikk, lukt og trykksr!', 13247, 2013173, 2, 'https://exorlive.com/media_9946@50.50.media', 'https://exorlive.com/video/?ex=9946'),
(2174, 1018, 8048, 'Forflytning fra rullestol til liggende med to personer 1', 'Fortell barnet hva dere skal gjre. Sett p bremsene p rullestolen.Still dere p hver deres side av barnet. Be barnet samle armene og legge dem i fanget. Ta tak under lret og bak ryggen p barnet. Bruk bena og srg for en god arbeidsstilling. Lft barnet opp og forflytt det til matten.', 8441, 2007571, 1, 'https://exorlive.com/media_8048@50.50.media', 'https://exorlive.com/video/?ex=8048'),
(2175, 1032, 7730, 'Katten', 'Utgangsposisjon: St p alle fire med parallelle lr og armene rett ned fra skuldrene. Skulderbladene ned mot ryggen og lang nakke.\nInngang: Pust inn  svai ryggenog se opp. Pust ut  krum ryggen og se mot navlen. Gjenta x5-10.\nFokus: Fokuser p bevegelsen i ryggraden, svai ogs i brystdelen av ryggen.\nUtgang: Kom tilbake i barnet - sitt p hlene og legg panna/hodet i gulvet, armene ligger ned p siden av kroppen. Rull deretter forsiktig opp i sittende.', 8403, 2007202, 2, 'https://exorlive.com/media_7730@50.50.media', 'https://exorlive.com/video/?ex=7730'),
(2176, 1032, 7732, 'Kobra (Bhujangasana)', 'Utgangsposisjon: Ligg p magen med beina sammen, pannen i gulvet, hndflatene ved brystet og albuene inntil kroppen.\nInngang: Pust inn - lft hodet, brystet og verste del av rygg, men la navlen vre i gulvet. Hold stillingen i 5 pust eller mer.\nFokus: Bruk ryggmusklene, skyv skulderbladene ned og brystet fram. Slapp mest mulig av i baken.\nUtgang: Pust ut - kom ned. Gjenta x2.', 8408, 2007213, 3, 'https://exorlive.com/media_7732@50.50.media', 'https://exorlive.com/video/?ex=7732'),
(2177, 1032, 7753, 'Flyvern (eka padasana)', 'Utgangsposisjon: St p gulvet med fttene samlet. \nInngang: Pust inn- lft armene rett opp, hndflatene mot hverandre. Pust ut  St p hyre ben og by langsomt forover fra hofta. Overkropp, hode og armer holdes i en rett linje. Venstre bein fres rett bakover p den samme linja slik at kroppen er som en T. Hold stillingen i 5 pust eller mer.\nFokus: Kjenn god kontakt med stbeinet. Armene strekkes framover slik at kroppen strekkes. Pass p at skuldrene er lave. Strekk ogs ut gjennom bakerste fot.  \nUtgang: Pust inn - kom ut av stillingen. Gjenta til den andre siden.', 8399, 2007201, 5, 'https://exorlive.com/media_7753@50.50.media', 'https://exorlive.com/video/?ex=7753'),
(2178, 1032, 7760, 'Barnets posisjon (Balasana)', 'Utgangsposisjon: Sitt p hlene.\nInngang: Pust ut  kom fram slik at panna/hodet ligger i gulvet. Armene ligger langs siden av kroppen.\nFokus: Baken ligger ned mot hlene. Fokuser p pusten. Slipp spenninger i kroppen, slapp av i nakken.\nUtgang: Pust inn  rull forsiktig opp i sittende. Stillingen kan holdes en stund.', 8433, 2007210, 2, 'https://exorlive.com/media_7760@50.50.media', 'https://exorlive.com/video/?ex=7760'),
(2179, 1032, 7729, 'Palmen, svingende palme', 'Utgangsposisjon: St p gulvet med beina litt fra hverandre. Trne peker framover. Fold hendene og vend de slik at hndflatene vender ned.\nInngang: Pust inn - strekk armene/hndflatene opp mot taket. Hold stillingen i 5 pust eller mer.\nFokus: Kjenn god kontakt mellom underlaget og fotslen. Kjenn strekket i hele kroppen. Skyv skulderbladene ned i ryggen og slapp av i skuldrene. Se rett fram.\nUtgang: Pust ut - kom rolig ut av stillingen. Gjenta stillingen. Nr stillingen holdes, svai kontrollert fra side til side. Behold strekket i kroppen.', 8386, 2007191, 2, 'https://exorlive.com/media_7729@50.50.media', 'https://exorlive.com/video/?ex=7729'),
(2180, 1032, 7754, 'Bten (navasana)', 'Utgangsposisjon: Sitt p gulvet med beina framover, strak overkropp. \nInngang: Pust inn - by knrne og balanser p baken. Pust ut - strekk ut beina og strekk armene framover slik at disse er parallelle med gulvet og hndflatene peker mot hverandre. Hold stillingen i 5 pust eller mer.\nFokus: Behold strekket i overkroppen. Korsryggen skal vre lang og rett, brystkassen er pen og lftet. Armene er strake framover. \nUtgang: Pust ut - kom rolig i sittende igjen. Gjenta evt x2-4.', 8428, 2007206, 5, 'https://exorlive.com/media_7754@50.50.media', 'https://exorlive.com/video/?ex=7754'),
(2181, 1032, 7748, 'Stende framoverby', 'Utgangsposisjon: St p gulvet med hoftebreddes avstand mellom beina. Trne peker framover.\nInngang: Pust ut - ta tak i trne eller anklene. Pust inn - strekk ryggen og pne brystkassa. Pust ut - behold lengden i ryggen og kom fram. Hold stillingen i 5 pust eller mer.\nFokus: Forleng i hele ryggraden. Trekk evt. knesklene oppover og stram lrene dersom beina er strake. Slapp av i nakken.\nUtgang: Pust inn - strekk ryggen og pne brystkassa. Pust ut - by knrne og kom ut av stillingen.', 8394, 2007203, 2, 'https://exorlive.com/media_7748@50.50.media', 'https://exorlive.com/video/?ex=7748'),
(2182, 1032, 7750, 'Krigerstilling 2 (virabradasana 2)', 'Utgangsposisjon: St p gulvet med en beinlengdes avstand (el. mer) mellom fttene. Hyre tr peker 90 grader mot hyre og venstre tr rett fram. Hoftene peker rett fram, parallelt med venstre tr. Armene er 90 grader ut til siden, hndflatene peker ned.\nInngang: Pust ut - by hyre kne 90 grader. Hyre lr skal vre tilnrmet vannrett, kanskje m du ke avstanden mellom beina.  Se over den hyre hnda. Hold stillingen i 5 pust eller mer.\nFokus: Hyre kne er over stort og andre t. Jobb innsiden av lrene fra hverandre. Slapp av i nakken og skuldrene, men ha sterke armer ut til siden. Slipp halebeinet ned mot matta slik at baken ikke stikker ut.\nUtgang: Pust inn - kom opp. Gjenta til den andre siden.', 8396, 2007185, 4, 'https://exorlive.com/media_7750@50.50.media', 'https://exorlive.com/video/?ex=7750'),
(2183, 1032, 7728, 'Stende rotasjon av ryggen (Kati shakrasana)', 'Utgangsposisjon: St p gulvet med fttene litt fra hverandre. Armene slapt ned. Svikt litt i knrne og stabiliser hoftene.\nInngang: Roter ryggen rundt sin egen akse og la armene flge med slik at du slr deg selv p skuldre/overarm. k rotasjonen og tempo gradvis.\nFokus: Kjenn god kontakt mellom underlaget og fotslen. Hoftene peker rett fram hele tiden.\nUtgang: Senk tempo gradvis og kom tilbake til stende. St litt og kjenn p pusten og kroppen.', 8385, 2007186, 2, 'https://exorlive.com/media_7728@50.50.media', 'https://exorlive.com/video/?ex=7728'),
(2184, 1032, 7745, 'Liggende ryggvri/universalstrekk: (Shava Udarakarshanasana)', 'Utgangsposisjon: Ligg p ryggen med beina samlet.\nInngang: Lft bekkenet litt mot hyre s du ligger i en svak bue. Pust inn - by hyre kne opp mot brystet. Pust ut - rull over til siden slik at hyre kne fres mot gulvet p venstre side av kroppen. Pust inn - strekk hyre arm opp mot taket. Pust ut - legg armen diagonalt bakover. \nFokus: Rolig pust, la skulder og kne slippes ned mot under laget. Vr oppmerksom p korsryggen, la den f vre lang, sttt med nederste del av magen. Hold stillingen i 5 pust eller mer.\nUtgang: Pust ut - kom rolig ut. Ligg stille og kjenn p effekten av velsen i noen sekunder. Gjenta s til den andre siden.', 8391, 2007187, 2, 'https://exorlive.com/media_7745@50.50.media', 'https://exorlive.com/video/?ex=7745'),
(2185, 1032, 7738, 'Sittende framoverby', 'Utgangsposisjon: Sitt p gulvet med samlede strake bein. Trne peker opp.  \nInngang: Pust ut - ta tak i trne eller anklene. Pust inn - strekk ryggen og pne opp brystkassa. Pust ut - behold lengden i ryggen og kom fram. Hold stillingen i 5 pust eller mer.\nFokus: Forleng i hele ryggraden. Beina er samlet og trne peker oppover. Trekk evt. knesklene oppover og aktiver lrene dersom beina er strake. Slapp av i nakken.\nUtgang: Pust inn - strekk kroppen framover. Pust ut - kom ut av stillingen.', 8387, 2007211, 2, 'https://exorlive.com/media_7738@50.50.media', 'https://exorlive.com/video/?ex=7738'),
(2186, 1032, 7758, 'Plogen (Halasana)', 'Utgangsposisjon: Skulderstende.\nInngang: Pust ut - senk fttene samlet og kontrollert ned mot (ikke ndvendigvis til) gulvet bak hodet. Evt. by knrne via panne. La overkroppen vre mest mulig loddrett. Om fttene rekker i gulvet, fold hendene bak ryggen. Om fttene er over gulvet, sttt hendene i ryggen for balanse.\nFokus: Lengde i rygg, om hendene er plassert i rygg kan disse brukes til sttte i lengderetning. Om hendene er strukket ut bak ryggen lft i bakside av lr og sittebein, og skyv trne ned mot gulv. Pass p nakken, den skal ikke vre i gulvet. Lirk skulderbladene sammen og/eller dra hendene fra deg. Hold stillingen i 5 pust eller mer.  \nUtgang: Pust ut - rull ut av stillingen.', 8430, 2007194, 6, 'https://exorlive.com/media_7758@50.50.media', 'https://exorlive.com/video/?ex=7758'),
(2187, 1032, 7742, 'Bredvinkel fremoverby (Upavistha konasana)', 'Utgangsposisjon: Sitt med beina samlet og strakt ut framfor deg.\nInngang: Spre beina s de er omtrent 90 grader i forhold til hverandre. Lft evt. bekkenet opp og fram slik at vinkelen kes. Roter lrene utover slik at knrne peker opp mot taket. Strekk ut gjennom hlene. Pust inn  forleng ryggen fra underlaget. Pust ut - by framover fra hoftene, armene plasseres i gulvet foran deg.\nFokus: Sitt med bekken i nytral posisjon (sitteben i underlag) slik at du kan strekke ryggen loddrett ut fra bekkenet. Forleng ryggraden. Hold stillingen i 5 pust eller mer.\nUtgang: Pust inn - kom rolig ut av stillingen.', 8390, 2007204, 3, 'https://exorlive.com/media_7742@50.50.media', 'https://exorlive.com/video/?ex=7742'),
(2188, 1032, 7757, 'Skulderstende (Salamba Sarvangasana)', 'Utgangsposisjon: Ligg p rygg med armene ned langs siden av kroppen. Lirk skulderbladene sammen slik at denne delen av ryggraden er opp fra gulvet (hndflater ned). By knrne opp mot magen. \nInngang: Pust ut - press armene mot gulvet samtidig som du lfter hofter og rygg opp fra gulv. Kjenn at magen er aktiv. Plasser hendene i ryggen. Pust inn - lft knrne opp mot taket og strekk ut beina, slik at kroppen er loddrett fra hoften. Jobb hendene s langt opp i ryggen som nakke og skuldre tillater uten at albuene sklir for mye til siden. Hold stillingen i 20 pust eller mer.\nFokus: Pass p at ikke nakken belastes (evt. bruk teppe under skuldrene). Vekten skal vre fordelt p skuldre, overarmer og albu (skyv ned). La baken vre avspent, strekk opp gjennom innsiden av beina og ut gjennom trne.\nUtgang: Pust ut - kom forsiktig ut av stillingen. By knr mot overkroppen p vei ned eller g rett inn i plogen.', 8384, 2007188, 5, 'https://exorlive.com/media_7757@50.50.media', 'https://exorlive.com/video/?ex=7757'),
(2189, 1032, 7731, 'Halvbro/halv oppoverbue (Urdva Danurasana)', 'Utgansposisjon: Ligg p ryggen.\nInngang: By opp knrne og plasser fttene slik at leggene er loddrette og hele fotslen er i gulvet. Parallelle ftter (det beskytter nederste del av rygg) og armene ned langs siden av kroppen og hndflater ned. Pust inn - lft hoftene og svai i ryggen slik at du blir stende p skuldre og ftter. Etter siste gang, hold rundt knrne og dra de ned mot mage/bryst samtidig som du skyver korsryggen ned i underlaget.\nFokus: Pust rolig. Skyv fra i fttene, og slapp av i baken. Dra skulderbladene sammen, fold hendene bak ryggen og dra hendene ned mot hlene. Hold stillingen i 5 pust eller mer.\nUtgang: Slipp hendene. Pust ut - rull forsiktig ned. Gjenta x2.', 8406, 2007207, 3, 'https://exorlive.com/media_7731@50.50.media', 'https://exorlive.com/video/?ex=7731'),
(2190, 1032, 7755, 'Dobbel vinkelstilling (Dvikonasana)', 'Utgangsposisjon: St oppreist med hoftebreddes avstand mellom fttene. Trne peker rett fram. \nInngang: Pust inn - rull skuldrene bakover og fold hendene bak ryggen. Pust ut - by fram. Pust inn - lft armene opp fra ryggen.\nFokus: P innpust, dra skulderbladene litt bort fra ryggen og slipp p utpust. By litt i knrne om det strammer p baksiden av lrene. Hold stillingen i 10 pust eller mer.\nUtgang: Pust ut - senk armene ned mot ryggen. Pust inn - by knrne litt og kom opp. Pust ut - senk armene ned langs siden. Gjenta eventuelt x2.', 8400, 2007212, 3, 'https://exorlive.com/media_7755@50.50.media', 'https://exorlive.com/video/?ex=7755'),
(2191, 1032, 7746, 'Sittende ryggvri I (Ardha Matsyendrasana)', 'Utgangsposisjon: Sitt med beina strakt ut foran deg. \nInngang: By knrne slik at fttene kommer i gulvet. Fr hyre fot bak venstre legg og litt forbi hoften. Plasser venstre fot p utsiden av hyre kne. Pust ut - vri mot venstre og plasser hyre arm rundt venstre lr. Plasser venstre arm i gulvet bak deg som sttte.\nFokus: Press hyre albue og venstre kne mot hverandre for  komme dypere inn i vridningen. Lave skuldre, slipp hoftene ned og strekk opp gjennom ryggen for hver pust. La blikket flge rotasjonen. Hold stillingen i 5 pust eller mer.\nUtgang: Pust ut - kom ut av vridningen. Gjenta til den andre siden.', 8392, 2007192, 3, 'https://exorlive.com/media_7746@50.50.media', 'https://exorlive.com/video/?ex=7746'),
(2192, 1032, 7736, 'Kamel (Ushtrasana)', 'Utgangsposisjon: St p knrne om mulig med vristene strukket slik at trne peker bakover.\nInngang: Pust ut - len tilbake (bruk styrken i beina slik at ikke korsryggen belastes undig) og plasser hendene p hlene. Lft brystet og slipp hodet tilbake.\nFokus: Pust normalt/rolig. Fokuser p strekk i bryst og styrke i bein s de holder seg loddrette. Hold stillingen i 5 pust eller mer.\nUtgang: Kom ut av stillingen ved  slippe en hnd av gangen, bruk styrken i beina til  komme opp til utgangsstilling. La brystet lede, hodet kommer opp til sist. Gjenta x2.', 8418, 2007200, 4, 'https://exorlive.com/media_7736@50.50.media', 'https://exorlive.com/video/?ex=7736'),
(2193, 1032, 7749, 'Treet', 'Utgangsposisjon: St p gulvet med beina samlet. Trne peker framover.\nInngang: Pust inn - by hyre kne. Sett hyre fotsle p innsiden av venstre kne ankel eller lr. Strekk hendene opp mot taket, eller sett hndflatene mot hverandre foran brystkassa. Blikket er lftet. Hold stillingen i 5 pust eller mer.\nFokus: Skyv fotslen mot kneet/lret, pne opp i hofta. Strakt stbein. Fikser blikket p et punkt foran deg. Jobb med  strekke kroppen opp mot taket.\nUtgang: Pust ut - kom rolig ut av stillingen. Jobb med  strekke kroppen oppover slik at balansen holdes. Gjenta til den andre siden.', 8395, 2007208, 3, 'https://exorlive.com/media_7749@50.50.media', 'https://exorlive.com/video/?ex=7749'),
(2194, 1032, 7751, 'Balanse p ett bein', 'Utgangsposisjon: St p gulvet med samlede bein. Trne peker framover.\nInngang: Pust inn - by venstre kne og ta tak rundt kneet med venstre arm. Ta eventuelt tak rundt venstre stort og strekk foten ut (rett fram). Hold stillingen i 5 pust eller mer.\nFokus: Kjenn god kontakt mellom underlaget og fotslen, strakt stbein. Jobb med  vre rett i overkroppen (pass p at du ikke blir hengende bakover). Om kneet er byd, s trekk kneet inn mot magen. Er beinet strakt, s jobb med  ha parallelle skuldre og rett overkropp). Blikket er lftet og fiksert p et punkt.\nUtgang: Pust ut - kom rolig ut av stillingen. Gjenta til den andre siden.', 8397, 2007190, 3, 'https://exorlive.com/media_7751@50.50.media', 'https://exorlive.com/video/?ex=7751'),
(2195, 1032, 7759, 'Bein opp langs vegg (Viparita Karani)', 'Utgangsposisjon: Ligg p ryggen inn mot en vegg. \nInngang: Baken ligger helt inntil veggen. Beina ligger opp langs veggen. Armene ligger ned langs siden. \nFokus: Kjenn at hele ryggen ligger p gulvet. Fokuser p pusten. Slapp av i hele kroppen.\nUtgang: Pust ut  kom rolig ut av stillingen ved  rulle over til hyre side fr du kommer opp. Stillingen kan holdes en stund.', 8431, 2007199, 2, 'https://exorlive.com/media_7759@50.50.media', 'https://exorlive.com/video/?ex=7759'),
(2196, 1032, 7761, 'Dd stille (Savasana)', 'Utgangsposisjon: Ligg p ryggen med beina litt fra hverandre, armene ned langs siden og ut fra kroppen, hndflaten peker opp.\nFokus: Slipp hele kroppen ned i gulvet. Ligg helt urrlig og kjenn p den naturlige pusten. \nLigg alltid i dd stille i 5-10 minutter som en avslutning, Gjerne lenger.', 8436, 2007215, 1, 'https://exorlive.com/media_7761@50.50.media', 'https://exorlive.com/video/?ex=7761'),
(2197, 1032, 7737, 'Fisken (Matsyasana)', 'Utgangsposisjon: Ligg p ryggen med beina samlet. Plasser hendene under lr med hndflatene ned og albuer inntil kroppen.\nInngang: Pust inn - press albue og underarm ned i underlaget mens du lfter bryst og verste del av ryggen opp. Legg hodet bakover og plasser toppen evt. baksiden av hodet i underlaget.\nFokus: Pass p at nakken ikke belastes, lft i brystet, evt. plasser et sammenlagt teppe under hodet. Hold stillingen i 5 pust eller mer.\nUtgang: Kom forsiktig ut av stillingen ved  senke ryggen ned og rull hodet p plass.', 8420, 2007205, 3, 'https://exorlive.com/media_7737@50.50.media', 'https://exorlive.com/video/?ex=7737'),
(2198, 1032, 7740, 'Foroverby med hofterotasjon utover (Janu sirsasana)', 'Utgangsposisjon: Sitt p gulvet med begge beina framover. Trne peker opp.\nInngang: Pust inn - by venstre kne og roter venstre hofte utover. Plasser venstre fot langs innsiden av hyre lr. Ta tak p utsiden av hyre fot eller ankel med hendene. Pust inn - strekk ryggen og pne brystkassa. Pust ut - behold lengden i ryggen og kom fram. Hold stillingen i 5 pust eller mer.\nFokus: Forleng hele ryggraden, ikke kollaps. Trne p hyre fot peker opp. Slipp i venstre hofte. Trekk evt. hyre kneskl oppover og aktiver lret dersom beinet er strakt. Slapp av i nakken.\nUtgang: Pust inn - strekk ryggen og pne brystkassa. Pust ut - kom ut av stillingen. Gjenta til den andre siden.', 8388, 2007193, 3, 'https://exorlive.com/media_7740@50.50.media', 'https://exorlive.com/video/?ex=7740'),
(2199, 1032, 7743, 'Bundet vinkelstilling (Baddha konasana)', 'Utgangsposisjon: Sitt med beina samlet og strakt ut framfor deg. \nInngang: Pust ut - by knr, samle fttene og plasser dem s nr hoftene som mulig og slipp knrne mot underlaget. Hold rundt samlede ftter eller pne fotslene mens utsiden at fttene er i kontakt med underlaget.\nFokus: Sitt med bekken i nytral posisjon (sitteben i underlag) slik at du kan strekke ryggen loddrett opp fra bekken. Lave skuldre. Hold stillingen i 5 pust eller mer.\nUtgang: Pust inn - fr knrne sammen og strekk ut beina foran deg.', 8424, 2007209, 2, 'https://exorlive.com/media_7743@50.50.media', 'https://exorlive.com/video/?ex=7743'),
(2200, 1032, 7756, 'Skulderstrekk', 'Utgangsposisjon: Sitt p knrne. Bygg eventuelt opp under baken og vristene s du kan sitte komfortabelt med en rett rygg. \nInngang: Pust ut - roter venstre arm innover og fr hnden opp mellom skulderbladene. Pust inn - strekk hyre arm opp. By albuen og ta tak i hyre hnd. \nFokus: Ha lang nakke og rygg. Hyre albue peker mest mulig rett opp. Hold stillingen i 10 pust eller mer. \nUtgang: Pust ut - kom ut av stillingen. Gjenta til den andre siden.', 8401, 2007217, 3, 'https://exorlive.com/media_7756@50.50.media', 'https://exorlive.com/video/?ex=7756'),
(2201, 1032, 7752, 'rnen (garuda asana)', 'Utgangsposisjon: St p gulvet med samlede bein. Trne peker framover.\nInngang: Pust ut - by begge knrne. Pust inn - lft det venstre beinet og vri det rundt den hyre foten slik at trne p venstre fot er p innsiden av den hyre ankelen. Fr den hyre underarmen foran ansiktet og vri den venstre rundt fra innsiden. Hndflatene er mot hverandre. Armer og bein er flettet i hverandre. Blikket er lftet. Hold stillingen i 5 pust eller mer.\nFokus: By s langt som mulig inn i stillingen. Pass p at det byde kneet er over stort og andre t slik at det ikke faller innover.\nUtgang: Pust ut - kom rolig ut av stillingen. Gjenta med armer og bein plassert omvendt.', 8398, 2007196, 6, 'https://exorlive.com/media_7752@50.50.media', 'https://exorlive.com/video/?ex=7752'),
(2202, 1032, 7747, 'Sittende ryggvri II (Marichiasana c)', 'Utgangsposisjon: Sitt med beina rett foran deg. \nInngang: By opp venstre kne og plasser foten rett foran venstre sittebein. Behold hyre bein aktivt ved  strekke ut gjennom venstre hl. Pust ut - roter overkroppen mot venstre og legg hyre overarm p utsiden av venstre lr. Det kan vre en hjelp  skyve venstre lr litt inn mot midten slik at armen kommer godt p utsiden. Plasser venstre arm bak overkroppen for sttte og rett opp venstre kne.\nFokus: P innpust fokus p rett rygg (strekk toppen av hodet opp og slipper hoften ned), p utpust fokus p vridning.  skyve venstre lr og hyre arm mot hverandre, er god hjelp for  komme dypere inn i rotasjonen. Hold stillingen i 5 pust eller mer. \nUtgang: Pust ut - kom ut av rotasjonen. Gjenta til den andre siden.', 8393, 2007197, 4, 'https://exorlive.com/media_7747@50.50.media', 'https://exorlive.com/video/?ex=7747'),
(2203, 1032, 7734, 'Gresshoppen (Shalabasana)', 'Utgangsposisjon: Som halv gresshoppe.\nInngang: Pust inn. Hold pusten - lft begge beina. Bruk ryggmusklene og fraskyvet i hendene.\nFokus: Hold beina samlet og strake. Hold stillingen i 5 pust eller mer.\nUtgang: Pust ut - kom kontrollert ned. Gjenta x2.', 8414, 2007189, 5, 'https://exorlive.com/media_7734@50.50.media', 'https://exorlive.com/video/?ex=7734'),
(2204, 1032, 7733, 'Halv gresshoppe', 'Utgangsposisjon: Ligg p magen med beina sammen og hendene foldet under lrene eller med hndflatene opp mot lrene. Haken i gulvet.\nInngang: Pust inn - behold begge beina strake og lft hyre bein. Begge hoftene skal vre i gulvet. Hold stillingen i 5 pust eller mer.\nUtgang: Pust ut - kom ned. Gjenta med venstre bein.', 8409, 2007218, 3, 'https://exorlive.com/media_7733@50.50.media', 'https://exorlive.com/video/?ex=7733'),
(2205, 1032, 7741, 'Foroverby med hofterotasjon innover', 'Utgangsposisjon: Sitt p gulvet med begge beina framover. Trne peker opp.\nInngang: By venstre kne slik at leggen ligger p utsiden av lret. Lrene er parallelle og hyre tr peker bakover. Sitt p gulvet med hele baken. Pust ut - ta tak rundt hyre ankel eller p utsiden av hyre fot. Pust inn - strekk ryggen og pne brystkassa. Pust ut - behold lengden i ryggen og kom fram. Hold stillingen i 5 pust eller mer.\nFokus: Forleng ryggraden, ikke kollaps i ryggen. Trne p hyre fot peker opp. Trekk evt. hyre kneskl oppover og aktiver lret dersom beinet er strakt. Slapp av i nakken.\nUtgang: Pust inn - strekk ryggen og pne brystkassa. Pust ut - kom forsiktig ut av stillingen. Gjenta til den andre siden.', 8389, 2007198, 3, 'https://exorlive.com/media_7741@50.50.media', 'https://exorlive.com/video/?ex=7741'),
(2206, 1032, 7744, 'Heltens posisjon (Virasana)', 'Utgangsposisjon: Sitt p knrne med hlene p utsiden av lrene. Trne peker litt mot hverandre. \nInngang: P utpust, sitt mellom hlene. \nFokus: Forleng ryggen ved  slippe halebeinet ned og strekk ut gjennom toppen av hodet. Lave skuldre. Hold stillingen i 20 til 30 pust.\nUtgang: Press hendene mot gulvet og lft opp.', 8425, 2007214, 2, 'https://exorlive.com/media_7744@50.50.media', 'https://exorlive.com/video/?ex=7744'),
(2207, 1032, 10115, 'Tre i vinden', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. Ansiktet er vendt fremover under hele velsen. Fr knrne s langt fra hverandre som du klarer. Fold hendene foran kroppen og vend hndflatene ut. \nP innpust: lft armene og hendene rett opp mot taket.\nP utpust: by overkroppen og armene rett over til den ene siden inn i en sideby. P innpust lft deg opp igjen med armene mot taket og p neste utpust by deg ned til den andre siden. Gjr bevegelsene rolig og kontrollert med langsomme dype pust. Gjenta mellom 5 og 15 ganger til hver side fr du senker armene ned igjen foran kroppen p en utpust.', 13720, 2013799, 2, 'https://exorlive.com/media_10115@50.50.media', 'https://exorlive.com/video/?ex=10115'),
(2208, 1032, 10103, 'Lft av motsatt arm og ben', 'St i firstende utgangsstilling med hendene plassert rett under skuldrene (loddrette, strake armer), og knrne plassert rett under hver sin hofte (loddrette lr). Ha lang rett rygg og nakken/hodet i forlengelse av resten av ryggen. Underveis i denne velsen skal magen/ryggen og nakken/hodet vre i ro. Stabiliser magen og ryggen ved  trekke navlen litt inn mot ryggsylen.\nP en rolig innpust med nesen strekker du ut i venstre ben og lfter det opp til vannrett. Samtidig lfter du hyre arm fremover og opp til vannrett. Hold lftet et yeblikk mens du holder pusten inne.\nP utpust senker du benet og armen ned igjen og holder pusten ute et kort yeblikk fr du p neste innpust lfter hyre ben og venstre arm opp. Fortsett med annethvert ben/arm i mellom 5 og 15 repetisjoner.', 13547, 2013895, 3, 'https://exorlive.com/media_10103@50.50.media', 'https://exorlive.com/video/?ex=10103'),
(2209, 1032, 10096, 'Dynamisk ryggradsdreining 2 (Gatyatmak Meru Vakrasana 2)', 'Sitt p baken med godt spredte ben. Plasser hndflatene mot hverandre og fr dem til utsiden av venstre kne. Strekk ut i armene og rett godt opp i ryggen. Kjenn at du har like mye vekt ned i begge setehalvdeler underveis i velsen. La hyre hnd bli vrende ved kneet mens du lfter venstre arm opp og bak deg - p skr oppover. Vri ryggen, nakken og hodet godt rundt mot venstre slik at hele ryggraden fr en fin rotasjon. Pust inn mens du roterer inn i stillingen, og pust ut mens du kommer ut av den igjen. Pust med nesen. Flytt hendene til utsiden av hyre kne, og p neste innpust lfter du hyre arm opp og bak deg og roterer mot hyre. Fortsett 10-15 ganger til hver side.', 13530, 2013820, 2, 'https://exorlive.com/media_10096@50.50.media', 'https://exorlive.com/video/?ex=10096'),
(2210, 1032, 10097, 'Kvernen (Chakki Chalanasana)', 'Sitt p baken med godt spredte ben. Fold hendene, strekk helt ut i armene og hold dem ca 15-20 cm over gulvet under hele velsen. Fr armene utover det ene benet og len deg s langt frem mot (eller forbi) foten som du klarer. Begynn n en sirkelbevegelse med kroppen, armene og hendene frst over mot den andre foten, forbi det andre benet, len deg deretter bakover mens du holder ryggen rett, s over til frste siden igjen. Fortsett  "kverne" rundt i store sirkler ca. 10 ganger den ene veien, og deretter 10 ganger den andre veien. Fri pust med nesen.', 13714, 2013841, 2, 'https://exorlive.com/media_10097@50.50.media', 'https://exorlive.com/video/?ex=10097'),
(2211, 1032, 10091, 'Venepumpa (Janu Naman)', 'Sitt p baken med rett rygg og bena strukket frem foran deg. Fold hendene under det hyre lret og lft dette benet kort opp fra matten og hold det strukket. Strekk ogs i ankelen slik at du frer foten/trne vekk fra deg. Fra denne stillingen byer du n bde i kneet og i ankelen (slik at foten/trne peker oppover) og bruker armene som hjelp til  fre lret godt opp mot overkroppen. Deretter strekker du helt ut igjen og fortsetter  vekselsvis bye og strekke benet i en lett pumpende bevegelse. \nFortsett i ca. 1 minutt fr du avslutter og gjentar med venstre ben.', 13519, 2013766, 2, 'https://exorlive.com/media_10091@50.50.media', 'https://exorlive.com/video/?ex=10091'),
(2212, 1032, 10108, 'Skulderrulling 1 (Skandha Chakra 1)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem med haken litt inn. La armene henge rett ned hele tiden. Begynn  rulle skuldrene bakover ved frst  lfte skuldrene godt opp mot rene, deretter trekke skuldrene godt tilbake, s presse dem godt ned og til slutt skyve dem fremover. Fortsett  rulle skuldrene rundt og rundt i jevne, rolige og grundige sirkler. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Hold hodet og nakken i ro hele tiden.\nGjr velsen i ca 20 sekunder den ene veien frst og s rull skuldrene fremover i 20 sekunder etterp. Fri pust underveis.', 13558, 2013862, 1, 'https://exorlive.com/media_10108@50.50.media', 'https://exorlive.com/video/?ex=10108'),
(2213, 1032, 10099, 'Mor og barn 1', 'Sitt p baken med bena strukket frem. Lft opp hyre ben og by kneet. Ta tak med hyre hnd p utsiden av hyre kne og med venstre hnd p utsiden av hyre ankel. Trekk benet godt inn mot overkroppen, rett deg godt opp i ryggen og trekk skuldrene litt bakover og nedover. Begynn n  "vugge" benet lett fra side til side. Du skal kjenne at det strekker lett p baksiden/utsiden av hyre sete, hofte og lr. Fri pust med nesen. Fortsett i mellom 30 og 60 sekunder fr du legger benet ned igjen og gjr det samme med venstre ben.', 13539, 2013787, 3, 'https://exorlive.com/media_10099@50.50.media', 'https://exorlive.com/video/?ex=10099'),
(2214, 1032, 10094, 'Halv bukstrekkstilling (Supta Vajrasana)', 'Sitt p baken med bena strukket frem. By det ene benet slik at hlen berrer utsiden av hofta, og fotens vrist er ned mot gulvet. Sttt frst med hendene p baksiden av kroppen, deretter senker du deg ned p albuene, og til slutt legger du deg helt ned p ryggen og bakhodet. Knrne skal vre samlet og ned mot gulvet. Plasser hendene foran brystkassen med hndflatene mot hverandre. \nStillingen tyer muskulatur p forsiden av lr, hofte og buken. \nBli liggende i stillingen i mellom 1 og 3 minutter, kom deretter rolig opp og gjenta til den andre siden.', 13525, 2013883, 3, 'https://exorlive.com/media_10094@50.50.media', 'https://exorlive.com/video/?ex=10094'),
(2215, 1032, 10080, 'Ryggliggende lotusfr', 'Ligg p ryggen og plasser fotslene i matten, ganske nrme baken. Ha hoftebreddes avstand mellom fttene og mellom knrne.\nTrinn 1: lft opp venstre ben og plasser utsiden av venstre ankel p forsiden av hyre kne/lr. Venstre kne fres lett vekk fra kroppen.\nTrinn 2: lft hyre fot opp fra matten og fold hendene p baksiden av hyre lr. Ha strake armer og lave skuldre.\nTrinn 3: flytt hendene frem slik at de foldes p forsiden av hyre legg og beina fres enda nrmere overkroppen.\n\nUnderveis i velsen: Slapp av i ansiktet og ha fri, rolig pust med nesen. Ligg i minimum ett minutt fr du kommer rolig ut av stillingen og gjentar deretter til den andre siden.', 13710, 2013808, 3, 'https://exorlive.com/media_10080@50.50.media', 'https://exorlive.com/video/?ex=10080'),
(2216, 1032, 10120, 'Sohans balansevelse', 'Start med  st godt i balanse p begge ben. Lft s opp hyre fot og plasser hyre fot helt opp venstre fot, med forfot opp forfot og hyre hl inn mot forsiden av venstre legg. Plasser n alle fingertuppene mot hverandre foran kroppen, med lillefingertuppene inn mot navlen, og tommelfingertuppene opp p magen i retning brystbenet. Senk skuldrene og tenk at du lfter toppen av hodet n cm hyere opp mot taket. Lukk ynene. St i stillingen i minst 10 sekunder.\nNr du skal ut av stillingen: pne ynene, senk armene ned langs siden av kroppen og plasser hyre fot kontrollert ned i gulvet. Gjenta til den andre siden.', 13588, 2013829, 2, 'https://exorlive.com/media_10120@50.50.media', 'https://exorlive.com/video/?ex=10120'),
(2217, 1032, 10107, 'By og strekk i albuene (Kehuni Naman)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem. Plasser hyre hnds fingertupper opp hyre skulder, og venstre hnds fingertupper opp venstre skulder. Lft albuene rett ut til siden. Ha lave og lett tilbaketrukne skuldre. \nBegynn rolig  strekke ut i albuene og fr hendene rett ut til siden med hndlatene opp. By deretter rolig i albuene og plasser fingrene p skuldrene igjen. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder. Senk deretter armene ned igjen. Fri pust underveis.', 13556, 2013754, 1, 'https://exorlive.com/media_10107@50.50.media', 'https://exorlive.com/video/?ex=10107'),
(2218, 1032, 10105, 'Bying i hndledd (Manibandha Naman)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem. Lft parallelle armer rett frem foran deg til vannrett. Vend hndflatene ned. Ha lave og lett tilbaketrukne skuldre. \nFlytt n all din oppmerksomhet til hendene og hndleddene, og begynn sakte vekselsvis  bye opp og ned i hndleddene - hele tiden med strake hender/fingre. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder fr du senker armene ned igjen. Fri pust med nesen.', 13717, 2013850, 1, 'https://exorlive.com/media_10105@50.50.media', 'https://exorlive.com/video/?ex=10105'),
(2219, 1032, 10111, 'Sideby av nakken (Greeva Sanchalana 1)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem og haken litt inn. \nBy hodet og nakken ned i en sideby, fortsatt med ansiktet fremover, og uten medbevegelse i skuldrene og overkroppen. Tenk "ret i retning skulderen". Unng  presse hodet ned. Hold det lette strekket i noen f sekunder fr du lfter hodet opp til midtstilling igjen og deretter senker hodet til den andre siden. Gjr bevegelsen rolig og uanstrengt flere ganger fra side til side. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder med fri pust.', 13564, 2013775, 1, 'https://exorlive.com/media_10111@50.50.media', 'https://exorlive.com/video/?ex=10111'),
(2220, 1032, 10085, 'Dyrenes hvilestilling (Saithalyasana)', 'Sitt p baken med bena strukket frem. By deretter det ene benet godt bakover slik at hlen kommer s nrme baken som mulig og kneet peker rett ut til siden. Det andre benet byer du inn slik at hlen kommer s nrme skrittet som mulig og kneet peker rett frem. Orienter overkroppen rett frem mot det fremre kneet og plasser hendene p kneet med strake armer. Rett deg litt ekstra opp i ryggen.\nP en rolig innpust: lft armene rett opp mot taket.\nP en rolig utpust: senk overkroppen ned og legg deg opp det fremre lret/kneet. Legg hendene og underarmene i matten p en slik mte at du fr sttte og balanse i stillingen. Stillingen tyer muskulatur i baken og p utsiden av hoftene/lrene, og kan kan holdes i alt fra 1 til 5 minutter.\nUt av stillingen: pust rolig inn mens du lfter overkroppen opp og strekker armene mot taket. Pust ut nr du senker armene ned p kneet. Gjenta til den andre siden.', 13712, 2013871, 2, 'https://exorlive.com/media_10085@50.50.media', 'https://exorlive.com/video/?ex=10085'),
(2221, 1032, 10098, 'Roing (Nauka Sanchalanasana)', 'Sitt p baken med strake, parallelle ben. Ha ogs strake, parallelle armer og lett knyttede hender. Len overkroppen fremover og fr hendene s godt frem mot (eller forbi) fttene som mulig. Strekk deretter armene hyt opp mot taket mens du retter overkroppen opp til sittende. Strekk deg godt opp. Len deg bakover s langt du klarer med rett rygg (men ikke legg deg helt ned), mens de strake armene fres ned foran kroppen igjen. Rett overkroppen opp igjen fr du p ny lener deg fremover mot/forbi fttene. Fortsett denne store "ro"-bevegelsen ca. 10 ganger den ene veien, og gjr den deretter 10 ganger den andre veien. Pust inn hver gang du strekker armene opp mot taket, og pust ut hver gang hendene fres mot fttene. Pust med nesen.', 13715, 2013796, 2, 'https://exorlive.com/media_10098@50.50.media', 'https://exorlive.com/video/?ex=10098'),
(2222, 1032, 10110, 'Skulderrulling 3 (Skandha Chakra 3)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem med haken litt inn. Plasser fingertuppene opp hver sin skulder og la dem vre p skuldrene under hele velsen.\nFr albuene sammen foran kroppen. Hold albuene samlet mens du lfter dem opp foran ansiktet. Etterhvert slipper du albuene litt fra hverandre s de kan lftes s hyt som mulig mot taket. S frer du albuene og skuldrene godt bakover og trekker skulderbladene sammen p baksiden. Senk deretter albuene ned langs siden og la dem etterhvert mtes foran kroppen s langt nede som mulig. Fortsett med  lfte albuene opp og gjenta flere runder. Gjr bevegelsen rolig og grundig. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Hold hodet og nakken i ro hele tiden.\nGjr velsen i ca 20 sekunder den ene veien frst og s  i 20 sekunder den andre veien etterp. Pust inn hver gang albuene lftes opp mot taket og pust ut nr albuene senkes ned igjen. Pust med nesen.', 13562, 2013892, 1, 'https://exorlive.com/media_10110@50.50.media', 'https://exorlive.com/video/?ex=10110'),
(2223, 1032, 10087, 'Krokodillen (Makarasana)', 'Ligg p magen med armene strukket frem. Lft opp vre del av ryggen, nakken og hodet og plasser albuene i matten litt foran skuldrene. Legg hodet i hendene slik at haken/kjevebena hviler ned i hndflatene, og fingrene er vendt opp mot kinnene. Ansiktet vender rett frem. Lukk ynene, ha fri pust med nesen og la deg synke litt inn i stillingen - brystkassen fr synke litt fremover og nedover. Vr i stillingen i 1 til 3 minutter. Ligg et kort yeblikk p magen etterp.', 13511, 2013817, 1, 'https://exorlive.com/media_10087@50.50.media', 'https://exorlive.com/video/?ex=10087'),
(2224, 1032, 10081, 'Lav bt (Naukasana)', 'Ligg p ryggen med armene ned langs siden. Lft hodet ca. 10 cm opp, lft armene ca. 10 cm opp og lft bena s hyt opp at du kan stabilisere korsryggen ned mot underlaget, men heller ikke hyere. Trekk navlen lett inn i retning ryggsylen. Ha en lett by i knrne ved behov.\nLigg i denne stillingen i alt fra 10-30 sekunder avhengig av hva du klarer. Viktig: hold god kontakt med mage/korsrygg og kjenn at korsryggen er i kontakt med matten hele tiden. Fri pust med nesen.', 13497, 2013838, 3, 'https://exorlive.com/media_10081@50.50.media', 'https://exorlive.com/video/?ex=10081'),
(2225, 1032, 10079, 'Rugge (Jhulana Lurhakanasana 3)', 'Ligg p ryggen. By opp begge ben og hold n hnd p forsiden av hvert kne. Behold knr og lr lett samlet underveis i velsen. Begynn n en sirkelbevegelse av bena hvor knrne frst fres til den ene siden, deretter trekkes inn mot kroppen, fres over til den andre siden, og s skyves fra kroppen - rundt og rundt i sirkler. Korsryggen fr en god massasje. Gjenta 5-10 sirkler den ene veien, og deretter 5-10 sirkler den andre veien. Kan gjres enten rolig eller mer dynamisk. Fri pust.', 13492, 2013763, 2, 'https://exorlive.com/media_10079@50.50.media', 'https://exorlive.com/video/?ex=10079');
INSERT INTO `exercise_list` (`id`, `type_id`, `exercise_id`, `title`, `description`, `image_id`, `video_id`, `level`, `image_path`, `video_path`) VALUES
(2226, 1032, 10102, 'Tigeren (Vyaghrasana)', 'St i firstende utgangsstilling med hendene plassert rett under skuldrene (loddrette, strake armer), og knrne plassert rett under hver sin hofte (loddrette lr). Ha lang rett rygg og nakken/hodet i forlengelse av resten av ryggen.\nP en jevnt og rolig innpust: strekk ut i venstre ben og lft benet s hyt opp bak deg som mulig. Samtidig svaier du lett i ryggen og lfter hodet slik at du ser oppover.\nP en jevn og rolig utpust: krum ryggen, senk hodet ned og senk venstre ben - og fr venstre kne og pannen s nrme hverandre som mulig uten  sette foten ned i matten. P neste innpust svaier du igjen ryggen, lfter hodet og strekker ut igjen i venstre ben. Fortsett velsen mellom 5 og 10 ganger med venstre ben fr du gjentar velsen med hyre ben.', 13716, 2013859, 3, 'https://exorlive.com/media_10102@50.50.media', 'https://exorlive.com/video/?ex=10102'),
(2227, 1032, 10077, 'Vugge (Jhulana Lurhakanasana 1)', 'Ligg p ryggen. By opp begge ben og ta tak p forsiden av knrne eller leggene. Vugg hele kroppen fra side til side s ryggen og bakhodet fr en lett massasje. velsen kan gjres rolig eller raskt, og med enten sm, fine bevegelser, eller strre mer dynamiske bevegelser. Fri pust.', 13708, 2013784, 2, 'https://exorlive.com/media_10077@50.50.media', 'https://exorlive.com/video/?ex=10077'),
(2228, 1032, 10106, 'Rotasjon i hndledd (Manibandha Chakra)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem. Lft parallelle armer rett frem foran deg til vannrett. Ha lett knyttede hender. Ha lave og lett tilbaketrukne skuldre. \nFlytt n all din oppmerksomhet til hendene og hndleddene dine, og begynn rolig  rotere hendene rundt og rundt fra hndleddene. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 15 til 20 sekunder den ene veien fr du skifter retning. Senk deretter armene ned igjen. Fri pust med nesen.', 13554, 2013880, 1, 'https://exorlive.com/media_10106@50.50.media', 'https://exorlive.com/video/?ex=10106'),
(2229, 1032, 10101, 'Fjellstilling (Parvatasana)', 'St i firstende utgangsstilling med hendene plassert rett under skuldrene (loddrette, strake armer), og knrne plassert rett under hver sin hofte (loddrette lr). Ha lang rett rygg og nakken/hodet i forlengelse av resten av ryggen.\nSett n trne i matten, lft knrne opp fra matten og strekk s godt ut i knrne som mulig. Lft baken opp mot taket og tilstreb samtidig  f hlene s nr gulvet som mulig. Skyv deg godt inn i stillingen ved hjelp av hendene og st med lang, rett rygg - tenk gjerne at du skal ha en lett svai i korsryggen. Hodet er fortsatt i en naturlig forlengelse av resten av ryggen. \nHa rolige dype pust med nesen mens du str i stillingen i mellom 20 og 60 sekunder, fr du kommer rolig ned igjen p alle fire.', 13542, 2013805, 3, 'https://exorlive.com/media_10101@50.50.media', 'https://exorlive.com/video/?ex=10101'),
(2230, 1032, 10078, 'Rulle (Jhulana Lurhakanasana 2)', 'Ligg p ryggen. By opp i begge ben og ta tak p forsiden av knrne eller leggene. Trekk bena godt inn mot overkroppen, lft opp hodet, gjr ryggen rund og begynn  rulle frem og tilbake p matten. Du kan variere mellom  gjre velsen rolig og forsiktig kun p ryggen, eller mer dynamisk hvor du ruller bakover p nakken og bakhodet og fremover slik at du fr fotslene ned i matten. Fri pust.', 13709, 2013901, 3, 'https://exorlive.com/media_10078@50.50.media', 'https://exorlive.com/video/?ex=10078'),
(2231, 1032, 10123, 'Palmen (Tadasana)', 'Start med  st godt oppreist og i balanse, med hoftebreddes avstand mellom fttene og med armene lst ned langs siden av kroppen.\nFold hendene foran kroppen og vend hndflatene ut. P en dyp innpust lfter du armene rett opp mot taket og lfter deg hyt opp p t. Se rett frem. Hold pusten s lenge du kan mens du hele tiden strekker deg s hyt opp du kan. Trenger du  trippe litt frem og tilbake for  holde balansen er det ok; det viktigste er strekket oppover. Nr du m puste ut senker du deg rolig ned p hele foten og senker armene ned langs siden p en rolig utpust. velsen kan gjres n eller flere ganger.', 13594, 2013826, 2, 'https://exorlive.com/media_10123@50.50.media', 'https://exorlive.com/video/?ex=10123'),
(2232, 1032, 10112, 'Rotasjon av nakken (Greeva Sanchalana 2)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. \nRotr nakken og hodet godt over til den ene siden og se s langt bak deg som mulig. Hold ytterstrekket et kort yeblikk fr du frer hodet frem igjen og deretter roterer over til den andre siden. Fortsett fra side til side uten  lfte eller senke haken underveis. Pass p  ikke bevege skuldrene eller overkroppen. Gjr bevegelsen rolig og uanstrengt. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder med fri pust.', 13566, 2013751, 1, 'https://exorlive.com/media_10112@50.50.media', 'https://exorlive.com/video/?ex=10112'),
(2233, 1032, 10118, 'Pumpa (Vayu Nishkasana)', 'Sitt p huk med litt avstand mellom fttene, og med knrne godt ut til siden. Plasser alle fingrene bortsett fra tomlene inn under foten fra innsiden, med hndflaten vendt oppover. \nP en rolig innpust: bruk armene til  skyve knrne godt ut til hver sin side. Trekk skuldrene tilbake og forsk  svaie i ryggen. Lft hodet og se oppover.\nP en rolig utpust: strekk ut i bena, lft baken opp mot taket, slipp overkroppen, nakken og hodet ned.\nP neste innpust: sitt ned med baken, skyv knrne ut til siden, svai i ryggen osv.\nFortsett  veksle mellom de to ytterstillingene med rolige bevegelser ca. 10 ganger. Pust jevnt, rolig og forholdsvis dypt med nesen underveis.', 13722, 2013847, 4, 'https://exorlive.com/media_10118@50.50.media', 'https://exorlive.com/video/?ex=10118'),
(2234, 1032, 10084, 'Dd stille i mageliggende (Advasana)', 'Ligg p magen. Ha litt avstand mellom fttene. Strekk ut i fttene slik at vristene er ned mot matten. Ligg med armene strukket fremover, men ikke lenger frem enn at du ligger uanstrengt med skuldrene. Hodet kan du la hvile p det ene kinnet. Lukk ynene og fall til ro.\nDette er en avspenningsstilling som du kan ligge i i alt fra 3 til 10 minutter, og er en fin stilling for  avslutte et yogaprogram.', 13504, 2013772, 1, 'https://exorlive.com/media_10084@50.50.media', 'https://exorlive.com/video/?ex=10084'),
(2235, 1032, 10083, 'Skulderstilling med ett ben opp', 'Ligg p ryggen med armene ned langs siden. Sett fotslene i matten ganske nrme baken slik at leggene str loddrett. Ha hoftebreddes avstand mellom fttene og mellom knrne. Lft baken s hyt opp fra matten at det gr en rett linje fra skuldrene, gjennom hoftene og til knrne. Stabiliser stillingen ved  stramme magen, ryggen og baken. Strekk ut i ett ben og lft benet rett opp mot taket. Pass p  ikke synke ned med baken, og hold begge hoftene like hye.\nSt i stillingen i 5-20 sekunder fr du setter foten rolig ned og gjentar med det andre benet. Fri pust.', 13711, 2013868, 4, 'https://exorlive.com/media_10083@50.50.media', 'https://exorlive.com/video/?ex=10083'),
(2236, 1032, 10076, 'Indre massasje (Supta Pawanmuktasana)', 'Ligg p ryggen.\nP en rolig innpust: by opp hyre ben og ta tak p forsiden av hyre kne eller legg. Press hyre lr lett ned mot magen/overkroppen samtidig som du holder pusten inne et kort yeblikk. \nP en rolig utpust: lft hodet s hyt opp mot hyre kne som mulig. Hold n pusten ute mens du legger deg helt ned p ryggen igjen. P neste innpust lfter du opp venstre ben og gjentar mnsteret med venstre ben. Til slutt gjentar du med begge ben. Dette (hyre ben, venstre ben, begge ben) tilsvarer n runde - gjr gjerne 5-10 runder.\nPust med nesen. Ligg et yeblikk i ro helt til slutt.\nvelsen stimulerer fordyelsen/tarmsystemet og de indre organer.', 13707, 2013793, 2, 'https://exorlive.com/media_10076@50.50.media', 'https://exorlive.com/video/?ex=10076'),
(2237, 1032, 10116, 'Klovnen (variasjon av Salamba Sirshasana)', 'Sitt p leggene og fttene med samlede knr. Plasser hndflatene i matten rett foran og rett p utsiden av knrne. Plasser toppen av hodet i matten 10-15 cm foran hendene. Pass p at albuene er godt inn mot kroppen og at underarmene er loddrette. Sett trne i matten og lft baken godt opp. Strekk ut i knrne. G litt nrmere kroppen med trne fr du plasserer det ene kneet opp p samme sides overarm eller albue, og deretter det andre kneet opp p den sides overarm eller albue. Lft fttene opp fra matten. Ikke "synk" ned i stillingen, men kjenn at du kan st "oppreist" med en sterk og solid nakke og hals. Hold oppmerksomheten p toppen av hodet.\nBli kun stende i stillingen i ca. 1 minutt i begynnelsen, etterhvert kan du gradvis utvide tiden til opptil 5 minutter. Ha fri pust underveis og lukk gjerne ynene.\nFor best effekt: gjr alltid Palmen (Tadasana) umiddelbart etter Klovnen.', 13721, 2013889, 6, 'https://exorlive.com/media_10116@50.50.media', 'https://exorlive.com/video/?ex=10116'),
(2238, 1032, 10095, 'Dynamisk ryggradsdreining 1 (Gatyatmak Meru Vakrasana 1)', 'Sitt p baken med strake, parallelle ben. Plasser hndflatene mot hverandre og fr dem til utsiden av venstre kne. Strekk ut i armene og rett godt opp i ryggen. Kjenn at du har like mye vekt ned i begge setehalvdeler underveis i velsen. La hyre hnd bli vrende ved kneet mens du lfter venstre arm opp og bak deg - p skr oppover. Vri ryggen, nakken og hodet godt rundt mot venstre slik at hele ryggraden fr en fin rotasjon. Pust inn mens du roterer inn i stillingen, og pust ut mens du kommer ut av den igjen. Pust med nesen. Flytt hendene til utsiden av hyre kne, og p neste innpust lfter du hyre arm opp og bak deg og roterer mot hyre. Fortsett 10-15 ganger til hver side.', 13713, 2013814, 2, 'https://exorlive.com/media_10095@50.50.media', 'https://exorlive.com/video/?ex=10095'),
(2239, 1032, 10125, 'Trekantstilling (Trikonasana)', 'St med godt spredte ben. Ha parallelle ftter eller la fttene peke litt ut til hver sin side.\nP en rolig innpust: lft armene rett ut til siden og vend hndflatene frem. La det g en rett linje fra hnd til hnd.\nP en rolig utpust: by overkroppen frem med rett rygg, og roter ryggen mot venstre. Plasser hyre hnd p utsiden av venstre legg eller ankel med hndflaten ut. Venstre arm strekkes rett opp mot taket, eller fres enda lenger bakover dersom det er mulig. Trekk den verste skulderen godt bakover og skyv den nederste skulderen godt fremover for  forsterke rotasjonen. Vri hodet mot venstre og se opp mot taket. St i ytterstillingen et yeblikk mens du holder pusten ute. Kom rolig helt opp igjen til utgangsstillingen p innpust, hold pusten inne et yeblikk og g deretter ned til den andre siden p neste utpust. Fortsett fra side til side minst 6 ganger til hver side.', 13599, 2013835, 3, 'https://exorlive.com/media_10125@50.50.media', 'https://exorlive.com/video/?ex=10125'),
(2240, 1032, 10126, 'Sivet', 'St med lett spredte ben; litt mer enn hoftebreddes avstand mellom fttene.\nPlasser hyre hnd p hyre side av kroppen s hyt opp mot armhulen som mulig, og venstre hnd opp mot venstre armhule. Samle fingrene og la dem peke nedover. Senk skuldrene.\nP en rolig utpust: stryk venstre hnd ned langs venstre side av kroppen til armen er helt strukket ut. Da byer du overkroppen, nakken og hodet inn i en sideby slik at venstre hnd kommer enda litt lenger ned. Pass p at du ikke byer deg fremover, men til siden. P en rolig innpust retter du overkroppen opp igjen og stryker venstre hnd helt opp til oppunder armhulen igjen, fr du p neste utpust stryker hyre hnd ned langs hyre side og byer overkroppen mot hyre. Fortsett  "svaie" kroppen fra side til side minst 6 ganger til hver side. Avslutt velsen ved  senke begge armene ned langs siden p utpust.', 13724, 2013760, 2, 'https://exorlive.com/media_10126@50.50.media', 'https://exorlive.com/video/?ex=10126'),
(2241, 1032, 10082, 'Skulderstilling med ett ben frem', 'Ligg p ryggen med armene ned langs siden. Sett fotslene i matten ganske nrme baken slik at leggene str loddrett. Ha hoftebreddes avstand mellom fttene og mellom knrne. Lft baken s hyt opp fra matten at det gr en rett linje fra skuldrene, gjennom hoftene og til knrne. Stabiliser stillingen ved  stramme litt i magen, ryggen og baken. Strekk s ut i ett ben slik at leggen og foten peker p skr oppover og lrene er helt parallelle. Pass p  ikke synke ned med baken, og hold begge hoftene like hye.\nSt i stillingen i 5-20 sekunder fr du setter foten rolig ned og gjentar med det andre benet. Fri pust.', 13499, 2013856, 4, 'https://exorlive.com/media_10082@50.50.media', 'https://exorlive.com/video/?ex=10082'),
(2242, 1032, 10122, 'Lperen', 'Start med  st godt i balanse p begge ben. Plasser hyre hnd p utsiden eller baksiden av hyre hofte/lr.\nP en rolig innpust: lft venstre arm rett opp mot taket.\nP en rolig utpust: len overkroppen og venstre arm ned til vannrett og lft samtidig hyre ben opp bak deg til vannrett. St p venstre ben med venstre kne enten helt strukket, eller med en liten by. Strekk deg lang fra tspissene p hyre fot til fingertuppene p venstre hnd. Senk hyre hofte s hoftene blir like hye. Bli stende i denne stillingen i minst 10 sekunder med fri pust.\nUt av stillingen: p innpust retter du overkroppen helt opp, lfter venstre arm mot taket og senker hyre ben ned. P utpust senker du armen ned langs siden av kroppen. Gjenta velsen til den andre siden.', 13592, 2013781, 3, 'https://exorlive.com/media_10122@50.50.media', 'https://exorlive.com/video/?ex=10122'),
(2243, 1032, 10092, 'Sommerfuglen (Poorna Titali Asana)', 'Sitt p baken med bena strukket frem. By bena og fr fotslene mot hverandre og la knrne komme godt ut til hver sin side. Trekk fttene s nrme kroppen som mulig og fold hendene rundt forfttene. Sitt med strake armer, lave og lett tilbaketrukne skuldre og rett deg godt opp i ryggen. Begynn  vippe knrne raskt, lett og uanstrengt opp og ned. Du skal ikke bruke mye krefter, men forske  vre s avspent som mulig i hoftene.\nFortsett i ca. 1 minutt og strekk deretter ut i bena igjen.', 13521, 2013877, 2, 'https://exorlive.com/media_10092@50.50.media', 'https://exorlive.com/video/?ex=10092'),
(2244, 1032, 10114, 'Hoderulling (Greeva Sanchalana 4)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. \nBy hodet frem s du fr haken mot brystkassen. Herfra starter du en rullebevegelse av hodet hvor du frst legger hodet til den ene siden med ansiktet frem og ret mot skulderen, deretter lfter du haken s hyt og rett opp mot taket som mulig fr du senker hodet ned til den andre siden med ret mot skulder, og til slutt ruller ned og frem igjen med haken mot brystkassen. Fortsett hoderulle i et jevnt, lett tempo - ikke for fort og ikke for langsomt. Etter ca. 30 sekunder stopper du og gjentar 30 sekunder den andre veien. Pass p  ikke bevege skuldrene eller overkroppen. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Fri pust underveis. Sitt i ro et yeblikk etterp.', 13719, 2013802, 1, 'https://exorlive.com/media_10114@50.50.media', 'https://exorlive.com/video/?ex=10114'),
(2245, 1032, 10109, 'Skulderrulling 2 (Skandha Chakra 2)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem med haken litt inn. Plasser fingertuppene opp hver sin skulder og lft albuene rett ut til siden. Hold skuldrene ned fra rene og lett trukket tilbake. Begynn n  tegne sm sirkler i luften ut til siden med albuene. La bevegelsen vre lett og uanstrengt. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent. Hold hodet og nakken i ro hele tiden.\nGjr velsen i ca 20 sekunder den ene veien frst og s  i 20 sekunder den andre veien etterp. Fri pust underveis.', 13562, 2013898, 1, 'https://exorlive.com/media_10109@50.50.media', 'https://exorlive.com/video/?ex=10109'),
(2246, 1032, 10121, 'Flyet', 'Start med  st godt i balanse p begge ben.\nP en rolig innpust: lft armene rett ut til siden og vend hndflatene frem.\nP en rolig utpust: len overkroppen, med armene, ned til vannrett og lft samtidig hyre ben opp bak deg til vannrett. St p venstre ben med  venstre kne enten helt strukket, eller med en liten by. Strekk deg lang fra tspissene p hyre fot til toppen av hodet. Senk hyre hofte s hoftene blir like hye. Bli stende i denne stillingen i minst 10 sekunder med fri pust.\nUt av stillingen: p innpust retter du overkroppen opp og senker hyre ben ned. P utpust senker du armene ned langs siden av kroppen. Gjenta velsen til den andre siden.', 13590, 2013823, 3, 'https://exorlive.com/media_10121@50.50.media', 'https://exorlive.com/video/?ex=10121'),
(2247, 1032, 10100, 'Mor og barn 2', 'Sitt p baken med bena strukket frem. Lft opp hyre ben og by kneet. Plasser ytterkanten av hyre fot inn i vinkelen til venstre albue, legg hyrearmen rundt hyre lr og legg, og fold hendene p forsiden av leggen slik at hele hyre ben blir "lst" fast av armene. Trekk benet godt inn mot overkroppen, rett deg godt opp i ryggen og trekk skuldrene litt bakover og nedover. Begynn n  "vugge" benet lett fra side til side. Du skal kjenne at det strekker lett p baksiden/utsiden av hyre sete, hofte og lr. Fri pust med nesen. Fortsett i mellom 30 og 60 sekunder fr du legger benet ned igjen og gjr det samme med venstre ben.', 13540, 2013844, 3, 'https://exorlive.com/media_10100@50.50.media', 'https://exorlive.com/video/?ex=10100'),
(2248, 1032, 10113, 'By og strekk av nakken (Greeva Sanchalana 3)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg, nakke og hode. \nBy hodet fremover og fr haken s nr brystkassen som mulig. Hold ytterstrekket et kort yeblikk fr du lfter hodet opp til utgangsstillingen og videre opp slik at haken lftes s hyt opp mot taket som mulig. Hold dette strekket litt fr du senker hodet ned mot brystkassen igjen. Pass p  ikke bevege skuldrene eller overkroppen. Gjr bevegelsen rolig og uanstrengt. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder med fri pust.', 13718, 2013769, 1, 'https://exorlive.com/media_10113@50.50.media', 'https://exorlive.com/video/?ex=10113'),
(2249, 1032, 10119, 'Hugging (Kashtha Takshanasana)', 'Sitt p huk med litt avstand mellom fttene, og med knrne godt ut til siden. Ha strake armer og foldede hender som svidt berrer gulvet foran deg. La overkroppen, nakken og hodet vre lett byd forover.\nP en rask innpust: lft armene raskt og s hyt du kan, svai i ryggen og se oppover. Forestill deg at du hogger ved oppover. Senk armene rolig ned p en rolig utpust, fr du igjen "hogger" oppover p en rask innpust. Gjenta 10 til 15 ganger.', 13586, 2013865, 3, 'https://exorlive.com/media_10119@50.50.media', 'https://exorlive.com/video/?ex=10119'),
(2250, 1032, 10086, 'Flyndra (Matsya Kridasana)', 'Ligg frst p magen med armene strukket frem. Legg deg deretter delvis over p hyre side, samtidig som du legger flate hender opp hverandre, og hviler hyre kinn opp hendene. By godt opp i venstre ben slik at venstre kne berrer venstre albue. Venstre fotsle skal berre forsiden av hyre kne. Lukk ynene, ha fri pust med nesen og fall til ro i stillingen. Du kan ligge i stillingen i mellom 1 og 5 minutter fr du kommer rolig ut av den og gjentar til den andre siden.', 13509, 2013790, 1, 'https://exorlive.com/media_10086@50.50.media', 'https://exorlive.com/video/?ex=10086'),
(2251, 1032, 10124, 'Rett vinkel stilling (Samakonasana)', 'Start med  st godt oppreist og i balanse, med hoftebreddes avstand mellom fttene og med armene lst ned langs siden av kroppen.\nP en rolig innpust: lft parallelle armer rett opp mot taket, men la hndleddene vre helt passive slik at hendene henger slapt fremover.\nP en rolig utpust: senk overkroppen ned mot vannrett med rett rygg. Ikke g lenger ned enn at du kan ha rett rygg hele tiden, og armene i en forlengelse av den rette ryggen. Hendene er fortsatt slappe. Bli stende i stillingen med fri pust i minst 10 sekunder.\nKom ut av stillingen ved  rette overkroppen opp og lfte armene mot taket p en innpust, og senk armene ned langs siden p en utpust. Gjr velsen minst 3 ganger.', 13723, 2013886, 2, 'https://exorlive.com/media_10124@50.50.media', 'https://exorlive.com/video/?ex=10124'),
(2252, 1032, 10104, 'Knytte og sprike med fingrene (Mushtika Bandhana)', 'Sitt p leggene og fttene, med trne vendt mot hverandre og hlene litt ut til siden. Sitt med lang, rett rygg og med ansiktet vendt rett frem. Lft parallelle armer rett frem foran deg til vannrett. Ha lave og lett tilbaketrukne skuldre. \nFlytt n all din oppmerksomhet til hendene og fingrene dine, og begynn sakte vekselsvis  knytte og  strekke/sprike med fingrene. Nr du knytter kan du annenhver gang ha tomlene p utsiden av hnda, og annehver gang ha tomlene inni hnda. Vr helt tilstede i bevegelsen samtidig som du holder ansiktet avspent.\nGjr velsen i ca 30 sekunder fr du senker armene ned igjen. Fri pust med nesen.', 13549, 2013811, 1, 'https://exorlive.com/media_10104@50.50.media', 'https://exorlive.com/video/?ex=10104'),
(2253, 1032, 10089, 'By og strekk i ankler (Goolf Naman)', 'Sitt p baken med bena strukket frem, og sttt med hendene i matten litt bak kroppen. Flytt all din oppmerksomhet til fttene og anklene, og begynn vekselsvis  strekke og bye anklene fremover og bakover s mye du klarer. Rolige bevegelser.\nVr nye p at du ikke rrer p, eller spenner undvendig i andre kroppsdeler. Ha rolig, fri pust. Hold p i ca. 1 minutt.', 13515, 2013832, 1, 'https://exorlive.com/media_10089@50.50.media', 'https://exorlive.com/video/?ex=10089'),
(2254, 1032, 10117, 'Hilsen til naturen (Namaskarasana)', 'Sitt p huk med litt avstand mellom fttene, og med knrne godt ut til siden. Plasser albuene eller overarmene p innsiden av knrne og sett hndflatene mot hverandre foran brystkassen (hilsestilling).\nP en rolig utpust: strekk helt ut i armene slik at fingertuppene berrer matten/gulvet. La knrne komme litt nrmere hverandre og senk hodet ned. Rund ryggen.\nP en rolig innpust: by albuene s hendene kommer opp til brystkassen igjen. Bruk albuene til  skyve knrne godt fra hverandre. Trekk skuldrene tilbake og forsk  svaie i ryggen. Lft hodet og se opp.\nFortsett  veksle mellom de to ytterstillingene med rolige bevegelser ca. 10 ganger. Pust jevnt, rolig og forholdsvis dypt med nesen underveis.', 13581, 2013757, 3, 'https://exorlive.com/media_10117@50.50.media', 'https://exorlive.com/video/?ex=10117'),
(2255, 1032, 10093, 'Halv sommerfugl (Ardha Titali Asana)', 'Sitt p baken med bena strukket frem. By opp hyre ben og legg utsiden av hyre ankel opp p forsiden av venstre lr og slipp hyre kne ned i retning gulvet. Du plasserer hyrefoten p venstre lr enten i nrheten av kneet (lettest), midt p lret, eller helt opp mot lysken (vanskeligst). Rett godt opp i ryggen. Bruk n n finger til  dytte kneet litt ned og la kneet f "sprette" opp igjen. Gjenta dette flere ganger i et ganske raskt og lett tempo. Hele benet skal vre avspent underveis. \nGjr velsen i ca. 1 minutt fr du gjr det samme med venstre ben.', 13523, 2013853, 2, 'https://exorlive.com/media_10093@50.50.media', 'https://exorlive.com/video/?ex=10093'),
(2256, 1032, 10090, 'Rotasjon i ankler (Goolf Chakra)', 'Sitt p baken med bena strukket frem, og sttt med hendene i matten litt bak kroppen. Ha litt avstand mellom fttene. Flytt all din oppmerksomhet til fttene og anklene, og begynn  rotere anklene rundt og rundt i grundige, rolige sirkler. Etter ca 30 sekunder skifter du retning og roterer den andre veien.\nSe om du kan la lrene vre mest mulig i ro, og spenn av i ansiktet og kjevene. Ha rolig, fri pust. Hold p i ca. 1 minutt.', 13517, 2013778, 1, 'https://exorlive.com/media_10090@50.50.media', 'https://exorlive.com/video/?ex=10090'),
(2257, 1032, 10088, 'By og sprik med tr (Padanguli Naman)', 'Sitt p baken med bena strukket frem, og sttt med hendene i matten litt bak kroppen. Flytt all din oppmerksomhet til trne, og begynn vekselsvis  bye/krumme og strekke/sprike med alle trne. Rolige bevegelser.\nVr nye p at du ikke rrer p, eller spenner andre kroppsdeler. Legg srlig merke til at ansiktet skal vre avspent. Det er kun trne som skal rre p seg. Ha rolig, fri pust. Hold p i ca. 1 minutt.', 13513, 2013874, 1, 'https://exorlive.com/media_10088@50.50.media', 'https://exorlive.com/video/?ex=10088');
